INSERT INTO `blog` (`id`, `title`, `author`, `visibility`, `body`, `image_1`, `created_by`, `time_created`, `date_created`, `hash_id`, `about`, `thumbnail`, `notification_status`, `rcount`, `category_id`) VALUES
(10, '5 cancer causing foods in your diet you did not know', 'Kwasy Danyels', 'show', '<p>Cancer treatments can make it hard to do the things youve always done as a human being so take note of these list of foods.</p><p>People who adopt the right health and wellness habits can reduce their risk of ever getting cancer by over fifty percent. That\'s a pretty staggering statistic.</p><p>Cancer is often the disease that kills centenarians, and cancer has a strong genetic component. Desisting from these foods and getting enough exercise can put you at less risk of cancer.</p><p>1. As much as people understandably love sugar, sugar is something that literally feeds cancer cells. Diabetes mediation can be used in order to fight cancer cells, which should illustrate the danger of refined sugars in the fight against cancer.</p><p>2. Red Meat</p><p>People can still eat red meat sometimes. However, even eating small amounts of red meat every day is a huge problem from the perspective of cancer development. Factory farmed red meat is particularly bad, since disease outbreaks among cows are controlled through carcinogenic chemicals. You want to avoid this at all costs.</p><p>3. Microwave Popcorn</p><p>You can expect to find more than kernels in microwave popcorn. There is PFOA (perfluorooctanoic acid). This has been known to cause cancer in living tissue. Likewise, the corn is mostly GMO.</p><p>4. Canned Foods</p><p>Many of the cans on the market today are lined with BPA. This is an item that has been known to change brain cells. Studies have shown this to be true in rats.</p><p>5. Soda Pop</p><p>Soda contains refined sugar, which is known to spike your insulin levels quickly and is a genetically modified product. Cancers must have a sweet tooth because refined sugars and fructose found in sodas directly feed cancer cells.</p>', 'uploads/3058100download.jpg', 'admin8291345862', '23:35:14', '2018-04-29', 'article20427230592', 0, '', 0, 387, NULL),
(11, '5 signs that you\'re stuck in a loveless marriage', 'Ntianu Obiora', 'show', '<p><strong>All marriages go through ups and downs but if you recognise these signs, your problems might be more serious than you thought.</strong></p><p>&nbsp;</p><h4>1. You don\'t have anything to say to each other</h4><p>When something comes up in life, whether that\'s a work event or any accomplishment and your partner isn\'t the first person you\'re sharing it with, or&nbsp;one of the first, it means that you prefer to get your needs mets outside the relationship.</p><p>Not having any meaningful conversations aside from rudimentary conversations about chores and things that need to get done is a warning sign that your relationship is not in a good place</p><p><strong>2. The void between you keeps growing wider and wider</strong></p><p>One way to distinguish between a run-of-the-mill marital rut and a loveless marriage is to ask yourself how long the situation has been this way, and whether it\'s been steadily worsening.</p><p>Most couples go through rough times, but if the difficulties last more than two years, with no sign of relief, you probably should seek professional help. And sooner is always better to avoid passing the point of no return.</p><p><strong>3. You dream about a life without your spouse</strong></p><p>If you often imagine a happy future without your partner, that\'s a major sign that things aren\'t right.</p><p>This is a part of the emotional detachment process, during which you may try to convince yourself that you don\'t care anymore so that the eventual separation feels less painful.</p><p>Detaching psychologically by fantasising about having an affair or making plans for the future that don\'t include your partner can all be signs that you\'ve fallen out of love.</p><p><strong>4. You\'re not be listened to (or listening)</strong></p><p>When you sit down to talk with your spouse about what\'s working and what isn\'t, do you hear silence? Or does it feel like nothing changes, no matter how vocal you are about your feelings? That\'s a problem!</p><p>The most powerful tool we have for resolving our conflicts is listening and understanding one another.</p><p>When we invite our partners to share what we\'ve done to let them down, and when we truly listen and understand their feelings, decades of hurt and anger can easily fade away. Make a point of listening for the underlying emotions and messages in your partner\'s words.</p><p><strong>5. You\'re about to have an emotional affair</strong></p><p>If you\'re not happy with your husband, you might be falling into an&nbsp;emotional affair, making another male the priority in your life. And thanks to today\'s technology, it\'s easier than ever to get caught up. Technology has allowed people who might never risk having any kind of affair&nbsp;to flirt online.</p><p>This creates a situation of \'temptation,\' and not everything that takes place online stays online. If your relationship is already on the rocks, giving yourself to someone else, even if it\'s only online will only make things worse.</p><p>&nbsp;</p><p>Source: http://www.pulse.ng</p>', 'uploads/2672765-signs-that-you-are-stuck-in-a-loveless-marriage.jpg', 'admin8291345862', '00:11:38', '2018-04-30', 'article9832811951', 0, '', 0, 568, NULL),
(14, '10 foods you\'ve been pronouncing wrong all your life', 'Omotolani OdumadePrinteMail', 'hide', '<p>&nbsp;</p><p>Even the smartest diners can\'t get all these words right.</p><p>&nbsp;</p><p>10 foods you\'ve been pronouncing wrong all your life (DigtoKnow)</p><p>There are food items that we can\'t really pronounce well and it\'s not because we are not trying but sometimes it\'s not in our language.</p><p>Even the smartest diners can\'t get all these words right.</p><p>&nbsp;</p><p>1. Beignet</p><p>How you should say it: Benn-yay (TipHero)</p><p>How you should say it: Benn-yay</p><p>&nbsp;</p><p>Beignet is the French term for a pastry made from deep-fried dough pastry.</p><p>&nbsp;</p><p>2. Cognac</p><p>How you should say it: Kohn-yack (Cognac 1719)</p><p>How you should say it: Kohn-yack</p><p>Cognac is a variety of brandy named after the town of Cognac, France. It is produced in the surrounding wine-growing region in the departments of Charente and Charente-Maritime.</p><p>&nbsp;</p><p>3. Quinoa</p><p>How you should say it: Keen-wah (BBC Good Food)</p><p>How you should say it: Keen-wah</p><p>Quinoa is one of the world\'s most popular health foods. Not only is it gluten-free, it is also high in protein and one of the few plant foods that contain all nine essential amino acids.</p><p>&nbsp;</p><p>4. Almond</p><p>Portion Sizes 1 Almondsplay</p><p>How you should say it: Ah-mund (Google)</p><p>How you should say it: Ah-mund</p><p>Loaded with minerals, they are also among the healthiest of tree nuts.</p><p>&nbsp;</p><p>5. Raspberry</p><p>How you should say it: Raz-ber-ee</p><p>Raspberries are a delicious fruit with many health benefits. They range in colour from the popular red and black varieties to purple, yellow, or golden.</p><p>&nbsp;</p><p>6. Onion</p><p>How you should say it: Ah-nion</p><p>The onion is found in every home but its curative powers goes beyond the kitchen.</p><p>&nbsp;</p><p>7. Herb</p><p>How you should say it: Erb</p><p>Herbs are plants with savoury or aromatic properties that are used for flavouring food, in medicine, or as fragrances.</p><p>&nbsp;</p><p>8. Buffet</p><p>How you should say it: Boo-fay</p><p>A buffet is a system of serving meals in which food is placed in a public area where the diners generally serve themselves.</p><p>&nbsp;</p><p>9. Pasta</p><p>How you should say it: Pah-stuh</p><p>Pasta is a staple food of traditional Italian cuisine, with the first reference dating to 1154 in Sicily.</p><p>&nbsp;</p><p>10. Jalapeno</p><p>How you should say it: Hah-lah-peh-nyoh</p><p>The jalapeo is a medium-sized chilli pepper pod used especially in Mexican cooking.</p><p>&nbsp;</p><p>Source: http://www.pulse.ng</p>', 'uploads/9948441pasta.jpg', 'admin8291345862', '01:04:04', '2018-05-01', 'article279017090970', 0, '', 0, 14, NULL),
(15, '5 things you can only buy in Nigeria', 'Omotolani Odumade', 'show', '<p><strong>&nbsp;These things can be the perfect thing to give loved ones as a souvenir.&nbsp;</strong></p><p><strong>1. Aso Oke</strong></p><p>Aso Okeplay</p><p>This specially made cloth is expensive and worn on special occasions like weddings, funeral and chieftaincy installation ceremonies (Deal Dey)</p><p>Aso Oke is a hand-woven material made by the Yorubas. This exquisite fabric is made by weavers from the northernmost part of Yoruba land, who are referred to as ara-oke.</p><p>This specially made cloth is expensive and worn on special occasions like weddings, funeral and chieftaincy installation ceremonies.</p><p>This would make a perfect gift for a loved one back home.</p><p><strong>2. Adire</strong></p><p>The three basic resist techniques used to dye the cloth are Oniko, Alabere and Eleko (Naij)</p><p>Adire is a type of dyed cloth produced by the Yoruba women of southwestern Nigeria, particularly those from Abeokuta. The three basic resist techniques used to dye the cloth are Oniko, Alabere and Eleko.</p><p><strong>3. Udu</strong></p><p>It produces a bass sound that changes in pitch depending on how the hand above the jug is positioned (Research Gate)</p><p>A water jug that could pass as a musical instrument, the Udu is made from baked clay by women from the southeast of Nigeria. To turn this into a musical instrument an extra hole is added to the jug. It produces a bass sound that changes in pitch depending on how the hand above the jug is positioned.</p><p><strong>4. Wara</strong></p><p>Made in Kwara state hence the name \"wara\", you can also call it a local Tofu (Kitchen Butterfly)</p><p>Wara is traditionally made by adding a coagulant called bomubomu in the Yoruba language, to fresh boiling cow\'s milk to curdle it. Made in Kwara state hence the name \"wara\", you can also call it a local Tofu.</p><p>Source: www.pulse.ng</p>', 'uploads/2977259aso-oke.jpg', 'admin8291345862', '01:15:23', '2018-05-01', 'article05475634437', 0, '', 0, 382, NULL),
(16, 'The secret burden of mental illness in Hong Kong', 'By Marian Liu, CNN', 'show', '<p>Hong Kong (CNN)He just wanted help, but it proved much harder to find in Hong Kong than at home.</p><p>In one of the <a href=\"https://www.gov.hk/en/about/abouthk/factsheets/docs/population.pdf\">most densely populated areas</a> in the world -- with<strong> </strong>many people working long hours, <a href=\"https://www.sciencedirect.com/science/article/pii/S0160412017315179\">severe air pollution</a>, skyrocketing home costs, strict schools and a fragile political climate -- at least one in six<strong> </strong>Hong Kong residents have a common mental disorder, such as <a href=\"https://www.ncbi.nlm.nih.gov/pubmed/25660760\">anxiety, depression and psychotic disorders</a>, according to two studies cited by Sherry Kit Wa Chan, clinical assistant professor in the Department of Psychiatry at the University of Hong Kong.</p><p>Despite the numbers, Laurence Grant discovered that the amount of resources available to those in need of mental health support was not enough.</p><p>In October, his girlfriend, Olivia Parker, found him dead in their Laos hotel from a<strong> </strong>mix of alcohol, sleeping pills, antidepressants and antipsychotic medicine.</p><p>\"In Hong Kong, there didn\'t seem to be an obvious place he could go to for help,\" Parker said, adding that there was no implication that his death was intentional.</p><p>The depression hit like \"black waves,\" starting when Grant was a teenager in the UK, she said. \"He couldn\'t see anything else. He couldn\'t get out of it. He just felt like everything good was gone from this world.\"</p><p>The two were together for 4 years. They met in Scotland in 2012, three weeks before Grant left for Afghanistan, serving in the British army as a lieutenant and captain. When he came back to London in May 2013, they started dating again. She was drawn to \"everything about him.\"</p><p>\"You could not ever be bored around him,\" Parker said. \"He would just sweep everyone up in whatever he cared about. He could talk about anything with anyone. He was always the most happy when other people were happy.\"</p><p>These waves became worse when Grant came back from Afghanistan. It was a tough transition from a high-risk environment to an office setting. He worked as a bid manager at the global accountancy firm KPMG,<strong> </strong>where people were stressed about things that had nothing to do with life and death.</p><p>Grant and Parker decided on a fresh start and moved to Hong Kong in January 2017. They wanted to embark on a new adventure and maybe \"leave some of what he was feeling behind,\" Parker said.</p><p>But it \"wasn\'t really a great tactic,\" she said.</p><h3>\'Black waves\' from the pressure</h3><p>Life in Hong Kong can be stark, with a culture of success and quick fixes. It\'s stressful for those working high-pressure jobs like Grant, who became a manager in cross-border client contracting for Deloitte.</p><p>\"He was constantly quite anxious about what he was doing there,\" said Parker, 30. He had a \"tightness in his chest that wouldn\'t go away\" with the \"pressure to do the job really well.\"</p><p>Not only does Hong Kong clock in with the most work hours per week globally -- more than 50, according to a <a href=\"https://www.static-ubs.com/microsites/prices-earnings/shared/_jcr_content/par/actionbutton.1062824217.file/bGluay9wYXRoPS9jb250ZW50L2RhbS91YnMvbWljcm9zaXRlcy9wcmljaW5nZWFybmluZ3MvdWJzLXByaWNlc2FuZGVhcm5pbmdzLTIwMTUtZW4ucGRm/ubs-pricesandearnings-2015-en.pdf\">study by UBS</a> -- a reported 60% of residents experience stress and anxiety related to their jobs.</p><p>Half of the respondents to a 2014 study by the <a href=\"http://www.mhahk.org.hk/chi/index.htm\">Mental Health Association in Hong Kong</a> felt that they had poor mental health.</p><p>\"We believe that it\'s a combination of the culture, the enormous pressure that people place on themselves to succeed and do well in a highly competitive, high-achieving system, the working hours and the fact that we live in a very cramped, urban environment,\" said Hannah Reidy, who runs the new mental health charity initiative <a href=\"http://www.mind.org.hk/\">Mind HK</a>. \"These problems start young, too: Children are feeling incredibly anxious, low and sometimes suicidal due to the pressure that they feel under to achieve what is expected of them.\"</p><figure class=\"image\"><img src=\"https://cdn.cnn.com/cnnnext/dam/assets/180423123311-mental-health-hk-2-exlarge-169.jpg\" alt=\"Actress and comedian Cheuk Wan Chi is open about her suicide attempt.\"></figure><p>Actress and comedian Cheuk Wan Chi is open about her suicide attempt.</p><p>As a result, people become very fragile, said Hong Kong actress and comedian <a href=\"https://www.cheukwanchi.co/\">Cheuk Wan Chi</a>, who attempted suicide after her mother\'s death from cancer. \"That is the norm of today,\" she said.</p><p>As a former radio personality, DJ and show host, the 39-year-old \"doesn\'t mind\" being open about her 2006 attempt, describing suicide as not only a personal issue but a social issue. After she opened up about her story, Cheuk said, she received lots of messages from people about their own struggles.</p><p>\"I feel like they were waiting for a chance to talk about it,\" said Cheuk, who is planning an October Hong Kong comedy show and whose 2015 Hong Kong \"Two Night Stand\" show is on Netflix. \"I try to correspond especially to those who are stuck right now. ... I always feel glad that people open up to me, meantime I feel heavy because this is a problematic scenario.\"</p><p>More than half of suicides around the world are in Southeast Asia and Western Pacific regions, <a href=\"http://apps.who.int/iris/bitstream/handle/10665/43929/9789241596893_eng.pdf?sequence=1\">according to the World Health Organization</a>. And although the number of suicides is highest in Japan or South Korea, it is one of the <a href=\"http://www.edb.gov.hk/attachment/tc/teacher/student-guidance-discipline-services/lecture-notes/lecture-notes-201516/20160422_seminar_2.pdf\">leading causes of death</a> in Hong Kong: about <a href=\"https://csrp.hku.hk/wp-content/uploads/2017/09/2017WSPD_slide.pdf.pdf\">900 per year in the past decade</a>. Hong Kong\'s suicide rate is sixth in Asia, behind South Korea, Kazakhstan, Sri Lanka, Japan and Taiwan, <a href=\"https://web.archive.org/web/20120122021659/http://www.who.int/mental_health/prevention/suicide_rates/en/\">according to WHO.</a></p><p>This figure includes students who take their lives due to academic pressures, but the silent majority are men and seniors who don\'t speak up. The suicide rate of people over 65 is about 40 times more than of those under 15, according to the <a href=\"https://csrp.hku.hk/statistics/\">Hong Kong Jockey Club Centre for Suicide Research and Prevention</a>. And the suicide rate for men is about <a href=\"https://csrp.hku.hk/statistics/\">twice as much</a> as for women</p><p>Men are less willing to talk due to pride, while seniors worry that after retirement, they have no value and are more of a burden to their families, said Clarence Tsang, chief executive of <a href=\"http://help4suicide.com.hk/\">Samaritan Befrienders Hong Kong</a>, which provides counseling services to people with suicidal tendencies and behavior. The agency was the first of its kind in Asia.</p><h3>Under-reported in Asia</h3><p>Though one in eight may be the statistic for depression and anxiety in Hong Kong, Reidy said the number is \"probably an under-representation, as stigma and shame prevents many people from reporting (problems with) mental health.\"</p><p>Only a quarter of people experiencing a mental health problem reach out for professional help in Hong Kong, said Reidy, who has worked in the field for over a decade.</p><p>Even so, the<a href=\"http://www.hpdo.gov.hk/doc/e_mhr_full_report.pdf\"> demand for psychiatric services</a> has been increasing about 18% in Hong Kong, from 187,000 in 2011 to over 220,000 in 2016. And the caseload for child and adolescent psychiatric teams has increased by more than half in five years: from 18,900 in 2011 to 28,800 in 2016.</p><p>But health care services aren\'t in a position to meet the growing demand.</p><figure class=\"image\"><img src=\"https://cdn.cnn.com/cnnnext/dam/assets/180423151045-mental-health-hk-3-exlarge-169.jpg\" alt=\"Hannah Reidy is CEO of the new charity Mind HK.\"></figure><p>Hannah Reidy is CEO of the new charity Mind HK.</p><p>\"Resources here are really low,\" Reidy said. \"To add to this problem, the resources that we do have (small nongovernmental organizations and services, as well as larger organizations) are struggling to connect with the population that needs them. This is partly due to the public\'s lack of awareness and partly stigma.\"</p><p>To adequately treat those affected by mental health disorders, the <a href=\"http://gamapserver.who.int/gho/interactive_charts/mental_health/psychiatrists_nurses/atlas.html\">WHO</a> recommends a ratio of 10 psychiatrists per 100,000 people. The ratio in <a href=\"http://www.hkcpsych.org.hk/index.php?lang=en\">Hong Kong</a> is about 4.9 psychiatrists per 100,000 people; the UK, where Grant was from, has a ratio of 14.6.</p><p>\"There are under half the number of psychiatrists recommended by the World Health Organization for our population size,\" Reidy said.</p><p>As a result, the level of care is affected. This was the case for Yan, who was only comfortable giving her first name, after a court ordered that she get counseling for early psychosis in 2016. She said that \"powers\" were controlling her, making her do things like talk to herself.</p><p>In cases of early psychosis, early intervention can cut the risk of suicide by half, according to a recent<a href=\"https://jamanetwork.com/journals/jamapsychiatry/article-abstract/2676847\"> study in the Journal of the American Medical Association</a>.</p><p>Without the court order, said Yan, a 39-year-old engineer, she would never have realized that she needed counseling. The lack of doctors in the system was also challenging, she said, because her case managers constantly change, and thus she ends up using most of her consultation time explaining her own diagnosis to the doctor.</p><p>Another challenge to treatment is the cost. When someone does find a doctor, it\'s expensive.</p><h3>Sticker shock</h3><p>In the UK, Grant saw a therapist for free under his work\'s health care and the National Health Service, but in Hong Kong, it was more than HK $3,000 (almost US<strong> </strong>$400) per hour, Parker said.</p><p>The cost was not sustainable, even though he had a well-paying job, she said, so he started to self-medicate, buying sleeping pills at local pharmacies and drinking.</p><figure class=\"image\"><img src=\"https://cdn.cnn.com/cnnnext/dam/assets/180411174751-reading-tablet-in-bed-stock-medium-plus-169.jpg\" alt=\"Night owls have 10% higher mortality risk, study says\"></figure><p><a href=\"https://edition.cnn.com/2018/04/12/health/night-owl-mortality-risk-study/index.html\">Night owls have 10% higher mortality risk, study says</a></p><p>There is not the same \"safety net\" in Hong Kong as other places, said Hong Kong clinical psychologist Klaris Leung, who leads many wellness programs for professionals.</p><p>Leung said that most Hong Kong insurance plans don\'t cover sessions -- a marked difference from her time at her clinic in New York\'s Chinatown district, where many patients had immigrated from Hong Kong and their treatment was<strong> </strong>covered by insurance.</p><p>Andrew Welling faced the same problem. His health care covered therapy in his home country of Australia but not in Hong Kong, where he moved at the end of 2012.</p><p>\"It was a ridiculous experience. I could tell the psychologist had no experience with depression,\" said Welling, 34, who paid HK$2,500 (about US $320) per session. \"It\'s really quite hard to find someone to find that I can talk to. It\'s also expensive, and there\'s a stigma attached to it.\"</p><p>He admits that he could have easily gone the way of Grant, adding that despite all the challenges, as with any injury, one must see a doctor and get help.</p><figure class=\"image\"><img src=\"https://cdn.cnn.com/cnnnext/dam/assets/180423152317-mental-health-hk-4-exlarge-169.jpg\" alt=\"Andrew Welling (left) and a friend at last year&amp;#39;s Blue Tie Ball.\"></figure><p>Andrew Welling (left) and a friend at last year\'s Blue Tie Ball.</p><p>\"When we have injuries in our ankles and knees, it\'s all we talk about, but at no point do we talk about health above the neck,\" Welling said. \"We don\'t walk around with a broken leg without seeing a doctor, so why should mental health be any different?\"</p><p>After losing local rugby friends to suicide, Welling created the <a href=\"https://www.facebook.com/HKbluetieball/\">Blue Tie Ball</a>, a charity night to raise money for mental health groups. Last year, it raised HK $650,000, and this year, it plans to raise HK $1 million.</p><h3>Saving face</h3><p>Depression has a stigma all over the world but is particularly strong in Chinese culture.</p><p>\"They think that it\'s something to be ashamed of,\" said Chan, who has practiced psychiatry in Hong Kong for eight years. \"Chinese culture is more collective, so the whole family will feel the shame as well, indicating there is something wrong with the person and something wrong with the family.\"</p><p>Unfortunately, this view has not changed much over that time, said Chan. She conducted a <a href=\"https://www.ncbi.nlm.nih.gov/pubmed/27909775\">survey across Hong Kong</a> in 2009 and 2014 and found that there was \"no change of public stigma within the Hong Kong Chinese population.\"</p><h3>Moving forward</h3><p>Before Grant died, he was working on a charity called Help Me, because it was \"all he could think when he was feeling at his worst,\" Parker said.</p><p>She is collaborating with Mind HK<strong> </strong>to create a chatbot for those looking for mental health help. She also hopes to make Grant\'s dream of free therapy a reality.</p><p>Parker believes<strong> </strong>that<strong> </strong>the conversation around mental health is gaining momentum in Hong Kong. In November, the first <a href=\"http://www.hkmentalhealthconference.com/\">Hong Kong Mental Health Conference</a> gathered 400 attendees and over 100 speakers to launch <a href=\"http://www.mind.org.hk/\">Mind HK</a>, which provides online information and training. Mind HK is set to launch the Mind Media Awards this November to promote mental health in the media.</p><figure class=\"image\"><img src=\"https://cdn.cnn.com/cnnnext/dam/assets/180423154529-mental-health-hk-5-exlarge-169.jpg\" alt=\"Hong Kong Chief Executive Carrie Lam speaking at the first Hong Kong Mental Health Conference last year.\"></figure><p>Hong Kong Chief Executive Carrie Lam speaking at the first Hong Kong Mental Health Conference last year.</p><p>Last year, the government also launched an <a href=\"http://www.hpdo.gov.hk/doc/e_mhr_full_report.pdf\">in-depth study</a> of the mental health situation. Itstressed how mental health is a \"major public health concern in Hong Kong.\"</p><p>The report outlined several government programs to improve resources for those in need, such as <a href=\"https://www.joyfulathk.hk/en/index.asp\">Joyful@HK</a>, a three-year educational campaign working with schools and workplaces to increase public engagement and knowledge around mental health.</p><p>In March, the government launched the <a href=\"https://www.vhis.gov.hk/en/home/index.html\">Voluntary Health Insurance Scheme</a>, which extends health coverage to psychiatric treatments.<strong> </strong>It is working on increasing services and psychiatrists, to improve the patient-to-case manager ratio from 47-to-1 to 40-to-1.</p><p>\"The review underlined the government\'s commitment to promoting the mental well being of the population while safeguarding the interest of those with mental illness,\" said Fong Ngai, the deputy secretary for Hong Kong\'s Food and Health Bureau.</p><p>Samaritan Befrienders has a chat line available for those reticent to talk in person. And the <a href=\"https://csrp.hku.hk/\">Hong Kong Jockey Club Centre for Suicide Research and Prevention</a> has worked with social media companies to reach youth, such as a <a href=\"https://youtu.be/8tnfiKX1sc8\">YouTube video</a> about suicide in Hong Kong.</p><p>The center found that <a href=\"https://www.google.com/url?sa=t&amp;rct=j&amp;q=&amp;esrc=s&amp;source=web&amp;cd=2&amp;cad=rja&amp;uact=8&amp;ved=0ahUKEwi-7cjahNLaAhVBheAKHcpmBTUQFgguMAE&amp;url=http%3A%2F%2Fwww.mdpi.com%2F1660-4601%2F12%2F9%2F11506%2Fpdf&amp;usg=AOvVaw0FhKcdlSgwMeqIvBUkArMv\">many youth post </a>about planning suicides on social media, so \"now we can cleverly use it as a platform to engage them,\" Director Paul Yip said.</p><p>Many of these services are surfacing after Grant\'s death, but Parker hopes that her openness about his story will help things change, because she knows that \"he would have stood up and told the world how he felt if it made it better.\"</p>', 'uploads/1993531180423115729-mental-health-hk-1-exlarge-169.jpg', 'admin2023731819', '12:09:36', '2018-05-01', 'articlet87504082he68', 0, '', 0, 405, NULL),
(17, 'Drones to the rescue!', 'Mary-Ann Russon (Technology of Business)', 'show', '<p>Drones may be best known for taking impressive aerial videos and inspecting buildings, infrastructure and crops, but they also promise to improve mobile and internet connectivity for emergency services and consumers.</p><p>Poor mobile signal in rural areas is frustrating, but it can also be life-threatening in emergency situations. Slow emergency response times mean higher mortality rates.</p><p>Mobile signals are usually sent via base stations, attached to buildings or special masts. These are tough to put up in a hurry - so why not attach a base station to a drone?</p><p>For the last two years, the Finnish tech firm Nokia and British mobile operator EE have been flying small quadcopter drones mounted with portable mobile base stations in Scotland.</p><p>The idea is that in an emergency, a drone could hover over a disaster area to provide instant 4G mobile network coverage with a 50km (31 mile) radius.</p><p>But drones can\'t fly for very long before the battery runs out - 30 minutes is a typical maximum.</p><p>So US telecoms giant AT&amp;T is developing a large, helicopter-like drone known as the \"Flying COW\", short for \"Cell on Wings\". It is tethered to the ground by a cable that gives it power.</p><figure class=\"image\"><img src=\"https://ichef-1.bbci.co.uk/news/624/cpsprodpb/13C97/production/_101074018_att_cell_on_wings_pr_19.jpg\" alt=\"AT&amp;T\'s Cell on Wings drone\"></figure><p>Image copyrightAT&amp;TImage captionAT&amp;T\'s \"Flying Cow\" drone can stay airborne all day and night</p><p>This enables the drone stay in the air 24-hours-a-day at a maximum height of 168m (550ft).</p><p>AT&amp;T says it used Flying COW to provide emergency 4G coverage to Puerto Rico <a href=\"http://www.bbc.co.uk/news/world-us-canada-41377185\"><strong>in the aftermath of Hurricane Maria</strong></a> in November. Each drone was able to cover an area measuring 36 sq km.</p><p>Nokia wants to take things a step further, and turn police vans and fire engines into command and control centres to help emergency responders make crucial decisions much faster than they do today.</p><ul><li><a href=\"http://www.bbc.com/news/uk-wales-43893160\"><strong>Drones trialled to help with sea rescues</strong></a></li></ul><p>The idea is for fire engines to have their own personal 4G network with a 50km radius.</p><p>From the command centre, fire fighters would launch drones and use their cameras to survey the scene. The same concept is being used for search and rescue, with artificial intelligence linking the drones together into a \"swarm\", so only one pilot is needed to direct a whole group of drones.</p><figure class=\"image\"><img src=\"https://ichef-1.bbci.co.uk/news/624/cpsprodpb/1C63/production/_101076270_firefighter-drone.jpg\" alt=\"A firefighter flying a drone\"></figure><p>Image copyrightGETTY IMAGESImage captionA Firefighter from a UK Fire and Rescue Service pilots a drone</p><p>Nokia is testing out the technology with Vodafone and firefighters in Dusseldorf, Germany.</p><p>\"You don\'t need to send firemen into the hostile environment, you will have full situational awareness immediately,\" says Thorsten Robrecht, Nokia\'s vice president of advanced mobile networks solutions.</p><p>\"What we see from the police is that this is much quicker and lower cost than a helicopter, which they still mostly use today.\"</p><p>British start-up Unmanned Life has developed software to send out multiple autonomous drones at the same time to gather information during a crisis, such as when a building is on fire.</p><p>One drone hovers in the air providing 4G coverage, while another flies around the building providing live video. A third equipped with heat sensors creates a heat map of the building, while a fourth uses sonar to map structural damage.</p><figure class=\"image\"><img src=\"https://ichef.bbci.co.uk/news/624/cpsprodpb/11587/production/_101074017_drones-nc.png\" alt=\"Graphic showing how drones could work in co-operation at a fire scene\"></figure><p>Unmanned Life is in talks to provide its system to BT and Verizon, who currently hold government contracts for emergency communication networks in the UK and US.</p><p>Swarms of co-operating drones, each with different tasks, help address the flight-time issue because single-function drones can be lighter.</p><p>And they can be lighter still if many of their computational and sensing functions - navigation for example - are undertaken by computers on the ground \"talking\" to the drones wirelessly.</p><p>The lighter the drone, the more it can carry.</p><p>In February, Ericsson tested this concept with BT and Verizon in London to show that a drone could autonomously carry 5kg of medical supplies from one location to another, without human intervention.</p><figure class=\"image\"><img src=\"https://ichef.bbci.co.uk/news/624/cpsprodpb/1780B/production/_101076269_dronedemo-74.jpg\" alt=\"A woman watches on a tablet as a man loads first aid supplies onto a drone at a trial in central London\"></figure><p>Image copyrightDAVID TETT / ERICSSONImage captionA woman watches on a tablet as a man loads a drone with first aid supplies</p><p>The trial demonstrated that next-generation superfast 5G networks would be powerful enough to transfer data streams between the drone and the ground, as well as ensuring that the connection to the drone never dropped.</p><p>\"I think drones together with 5G networks and the IoT [internet of things] offer tremendous opportunities,\" says Phil Bonner of Ericsson.</p><p>\"We need to keep the drone very simple and cheap.\"</p><p>But drones for deliveries and emergency services will only be viable if they can be flown autonomously without crashing into buildings, trees, pylons, or each other.</p><p>So many tech and telecoms companies are racing to build air traffic control systems for them.</p><ul><li><a href=\"http://www.bbc.com/news/technology-43629965\"><strong>Blood delivery drone applies for US trial</strong></a></li><li><a href=\"http://www.bbc.com/news/technology-43302583\"><strong>UK drone deliveries get tracking system</strong></a></li></ul><p>\"Nokia has a system run on the 4G network that can connect all the drones and knows where they are,\" says Mr Robrecht.</p><p>\"And we have a commercial aircraft 4G network covering the entire airspace in Europe in order to connect all the aircraft flying around.</p><p>\"We\'re trying to work out how to connect the two networks.\"</p><p>Once this problem is solved, communications drones won\'t just be for the emergency services. They could help civilians in all sorts of ways too, such as at sports events.</p><figure class=\"image\"><img src=\"https://ichef-1.bbci.co.uk/news/624/cpsprodpb/DFB3/production/_101076275_hi046236294.jpg\" alt=\"New England Patriots players at the 2018 Super Bowl\"></figure><p>Image copyrightAFP/GETTY IMAGESImage captionDrones helped fans watching the 2018 Super Bowl enjoy better mobile connectivity</p><p>\"One of the challenges we see is when people are using their devices in stadiums during the Super Bowl,\" says Art Pregler, AT&amp;T\'s unmanned aircraft systems programme director.</p><p>\"If there\'s a really good football play, they\'re all taking video or looking for an instant replay. That creates a lot of demand on the network.</p><p>\"But we could have drones in the air augmenting our existing capacity, and that will improve their experience at the event.\"</p><p>Technology firm Ericsson thinks that in future we could even pay to have a drone launched if we need internet coverage on-demand in an area with bad signal - great for music festivals.</p>', 'uploads/6044742_101056802_dronedemo-18.jpg', 'admin2023731819', '12:32:50', '2018-05-01', 'article0e5o722s759d5r5n', 0, '', 0, 517, NULL),
(19, 'How To Become Indispensable At Work This Year', 'GWEN MORAN', 'show', '<p>Virtually every office has one: that employee who is the go-to contact and seems to know everything and everyone. The office cant run without her. No one wants to think about what would happen if he ever left.</p><p>Being such a critical part of the team has a number of benefits, including a measure of job security. But those indispensable team members dont get just that way through arbitrary means. If you want to join their ranks, here are seven ways to get there.</p><h2>CHANNEL ELITE ATHLETES</h2><p>Elite athletes are constantly trying to improve their performance. They fine-tune the details that allow them to compete at the highest leveland that practice holds some valuable lessons for people who are trying to become exceptional at their jobs, says Porter Braswell, cofounder and CEO of <a href=\"https://www.jopwell.com/\">Jopwell</a>, a technology platform that helps black, Latino, and Native American students and professionals unlock opportunities for career advancement.</p><p>What I mean by that is not the ability to run fast, jump high, and all the other physical attributes that come with being an athlete. But more of the tactical, being a good teammate, communicating well, knowing how to work hard, being disciplined, being able to multitaskall the things that come with that athletic mind-set. Competing: Thats the mind-set one has to be in before I believe they can perform well, Braswell says.</p><h2>DO YOUR OWN REVIEW</h2><p>You may get regular feedback and a performance review from your supervisor, but its also important to do your own regular review to ensure youre on track with your own goals and expectations, says Carolyn Birsky, founder of <a href=\"https://www.compassmaven.com/\">Compass Maven,</a> a Cambridge, Massachusetts, coaching firm. Keep track of your accomplishments, training, feedback, projects, and overall numbers related to your job. We often think well remember all of these things, but its easy to forget pieces here and there, she says.</p><p>Then, periodically <a href=\"https://www.fastcompany.com/3029117/how-to-make-self-appraisals-less-painful\">and honestly</a> review your progress, set new goals, and look at what its going to take to get to your next milestone, she says. These self-checks can help you ensure youre keeping on track with your own career development and shore up areas that may need improvement. This practice will also keep you ready for the next time youre up for a promotion.</p><p>One of the mistakes employees often make is forgetting to hold those all together in some sort of file. That can be some of your best leverage to put your case forward and say, This is why I think should be promoted. This is what makes me really good at what I do,\' she says.</p><h2>TRACK YOUR METRICS</h2><p>As you set your new goals, look at the metrics that are going to matter and include them as part of your plan, Birsky says. Whether its bumping up a sales quota or improving efficiency or cost controls in your business unit by a certain margin, be sure to look for positive measures to which you can contribute and how you can be <a href=\"https://www.fastcompany.com/3068537/the-one-page-cheat-sheet-to-your-most-productive-90-days-ever\">most productive in contributing to them</a>. Companies value employees who are focused on finding ways to raise the performance bar.</p><h2>DO AN ALIGNMENT CHECK</h2><p>Its also a good idea to ensure that the areas youre prioritizing in your career and development are consistent with what the company values, says <a href=\"https://wishingwellcoach.com/\">licensed therapist and career coach Jessica Sweet</a>. You may have a sense of whats important to the company, but its essential to actually be clear that your efforts are moving initiatives forward that the company cares about, she says.</p><p>I would be looking at what the companys goals are for 2018, and be looking at how my skills and experience align with those goals, and how I can set myself up on any projects that are going on, to add the most value to those upcoming projects, she says.</p><h2>SPEAK UP</h2><p>When employees are afraid to show that theyre imperfect or they dont know something, it gets in the way of their performance, Birsky says. Learning how to effectively communicate with your boss and team, including asking questions and ensuring that you fully understand assignment instructions and ask questions when you dont is essential to ensuring youre performing in the best possible way for your company.</p><p>Beyond that, <a href=\"https://www.fastcompany.com/3067743/how-to-create-your-own-opportunities-at-work\">ask for opportunities to get better</a>. Be vocal to your boss about the fact that you are open to learning. Ask for opportunities to collaborate with another team, or be vocal about your ideas, or you might see a training [you need to get better]. Make your case for it, she says.</p><h2>ACT LIKE YOU OWN THE PLACE</h2><p>Ownership is essential to being invaluable, says Andy Chan, founder of Seattle-based career coaching center <a href=\"http://prime-opt.com/\">Prime Opt</a>. Take ownership of your workwhether its a project assignment or even a simple spreadsheet. <a href=\"https://www.fastcompany.com/3030817/how-to-think-like-an-entrepreneur-even-when-youre-not-one\">Think about it in terms of the bigger picture of the company</a> and what its goals are. When you take full responsibility and apply strategic thinking to your work, youre immediately supporting your supervisor and team in a new and more valuable way. Every time, when it comes to you learning new skills, it actually opens up a conversation for you to ask for a raise or a promotion, he says. So, think about what you can take ownership of in your work environment, and treat your work as if you own the company and are acting in its best interest.</p><h2>MAKE YOUR BOSS LOOK GREAT</h2><p>One of the most important things you can do to <a href=\"https://www.fastcompany.com/3067748/four-easy-ways-to-reboot-your-relationship-with-your-boss-this-year\">be indispensable to your boss</a> is to help them excel, Braswell says. People value those who help them do their jobs better.</p><p>Really get in the mind-set of the person youre working for or alongside and really figure out, What are they trying to achieve?\' he says. Through having an understanding of what theyre trying to achieve and having the context, you can then say to them, What can I be doing to help you achieve that goal?\' Once you know where you fit in and exactly the metrics on which you should be focused, you can rank or prioritize your efforts on those tasks and initiatives, he says.</p>', 'uploads/1448289new.jpg', 'admin2023731819', '19:34:43', '2018-05-10', '28cr32ihalet0w6o4072', 0, '', 0, 412, NULL),
(20, '25 Things About Life I Wish I Had Known 10 Years Ago', 'DARIUS FOROUX', 'show', '<p>Socrates, considered as one of the founders of Western philosophy, was once named the wisest man on earth by the Oracle of Delphi. When Socrates heard that the oracle had made such a comment, he believed that the statement was wrong.</p><blockquote><p>Socrates said: I know one thing: that I know nothing.</p></blockquote><p>How can the smartest man on earth know nothing? I heard this paradoxical wisdom for the first time from my school teacher when I was 14 or 15. It made such an impact on me that I used Socratess quote as my learning strategy.</p><p>I know nothing to me, means that you might be an educated person, but still, you know nothing. You can learn from everything and everyone.</p><p>One thing that I like better than learning from my mistakes is to learn from other peoples mistakes. Over the years, Ive been blessed to have great mentors, teachers, family, friends, that taught me about life.</p><p>What you will find below is a list of the most important things I learned from other people and <a href=\"http://dariusforoux.com/100-great-books-to-read-in-a-lifetime/\">books</a>. Some of the lessons took me a long time to learnbut if I had to learn these things all by myself, it would take me a lot longer.</p><p>We might learn things quickly, but we often forget things at the same rateand sometimes we need to remind ourselves of the things weve learned.</p><p>Here are 25 of those reminders that others taught me.</p><ol><li><strong>Struggle Is Good</strong> Never say I cant take it anymore. Say Bring it on!</li><li><strong>Dont Complain </strong>Complaining is the biggest waste of time there is. Either do something about it, and if you cant, shut up about it.</li><li><strong>Spend Time With People You Love</strong>Thats your family and best friends. If you dont have a family, create one. Most people in life are only visitors. Family is for life.</li><li><strong>Dont Start A Relationship If Youre Not In Love</strong> Ive done this more than once. You kind of like someone and think: We might as well give it a shot. Not a good idea. Youre either in love, or you are not. Dont fool yourself. Its not fair to you and the other person.</li><li><strong>Exercise Daily</strong> I didnt get this until recently. A healthy body is where you have to start everything in life. If you cant build a healthy and strong body, what CAN you build in life?</li><li><strong>Keep A Journal</strong> No, keeping a journal is not for children. It helps you to become a better thinker and writer. I dont want to be a writer you might think. Well, how many emails and texts do you send a day? Everybody is a writer.</li><li><strong>Be Grateful</strong> Say thank you to everyone and everything. Thank you for this beautiful day. Thank you for your email. Thank you for being there for me.</li><li><strong>Dont Care About What People Think</strong> We all die in the end, do you really think it matters what people think of you?</li><li><strong>Take More Risks</strong> Dont be such a wimp.</li><li><strong>Pick An Industry, Not A Job</strong> If you want to become good at something, you need to spend years and years doing that. You cant do that if you hop from industry to industry. Pick an industry you love and start at the bottom. You will find the perfect role for you eventually.</li><li><strong>Lead The Way</strong> When you find yourself in a situation where everyone looks at each other, its time for you to lead. Youre a leader when you decide to become one. Theres no initiation or a title. Just a decision.</li><li><strong>Money Is Not The Most Important Thing</strong> You have to train yourself not to care about money and focus on providing value instead. Also, dont become too dependent on the stuff you own  otherwise, the stuff will own you.</li><li><strong>Be Nice</strong> I dont mean you should be a pushover. You can be someone that doesnt take shit and be nice about it. Just dont insult people, think youre better than them, or act like an idiot.</li><li><strong>Learn Every Day</strong> Youve got to train your brain to stay alert. You dont have to read a book a day to learn every day. Learn from your mistakes. Learn from the people around you  be open to what they can teach you.</li><li><strong>Rest Before You Are Tired </strong>Even if you love your job, and every day seems like a holiday, you need to take time to rest. Youre a human and not an android, never forget that.</li><li><strong>Dont Judge</strong> Just because people make different choices than you, they are not stupid. Also, you dont know everything about people, so dont judge them  help them.</li><li><strong>Think About Others</strong> Just be mindful, thats all. We all have families, bills to pay, and our own issues. Dont always make everything about yourself.</li><li><strong>Give Without Expecting Something In Return</strong> Dont keep score. You will become a bitter person if you do that. Give solely for the joy of giving. If you get something in return, great, if you dont, great.</li><li><strong>Theres No End Game</strong> We, as a species, just <i>are</i>. Dont try to figure it all out. Enjoy your journey.</li><li><strong>Enjoy Small Things</strong> I like clichs because they are true. Especially this one. You know why? Everyone says they know it, but no one lives up to it. They just chase big things.</li><li><strong>Dont Take Yourself So Serious</strong> Yeah, yeah, youre an individual, and people have to take you seriously, I get it. But at the end of the day, were all a bunch of ants trying to chase the same things. Lighten up.</li><li><strong>Dont Blame People</strong> Whats the point? Do you want to punish them? You dont do that to people. Also dont blame yourself  youre only human.</li><li><strong>Create Something</strong> Not to leave a legacy, you wont be here to see it anyway, but to be of use. Make music, write a book, build a table, anything. Youll feel good about yourself, plus you give something back to people to use or enjoy.</li><li><strong>Never Look Back Too Long</strong> Reflecting on the past is only good for one thing: Learning.</li><li><strong>Take Action</strong> Dont just sit there, do something. Without action, there is no outcome.</li></ol><p>You might know a lot. But like Socrates, you and I know nothing at all. So we have to keep learning.</p>', 'uploads/698210325-things-about-life[1].jpg', 'admin2023731819', '14:21:35', '2018-05-11', '76cli205505r67eta95', 0, '', 1, 620, NULL);
