(40, 'A king, if he forgets who he is, will live like a common man.', 'GRACE OLA', 'show', '<p>Adesewa walked as fast as her legs could carry her to the palace. She knew the news would get to Adedibu one way or the other and she didn&rsquo;t want him to hear from any stranger. It was already the talk of the town&rsquo;s jesters. His wife, the&nbsp;<em>Olori</em>&nbsp;had been caught in bed with Rotimi, the&nbsp;<em>Balogun</em>&nbsp;and her ex-lover. It was true the king had taken the proverbial meal from the pauper&rsquo;s mouth even though he had an overflowing storehouse of food by asking the hand of Kikelomo in marriage when everyone in town knew Rotimi and her had been together since their childhood days.</p>\r\n\r\n<p>Adedibu was known as one who did whatsoever he pleased caring less about what others thought but Adesewa knew that Kikelomo was the only thing he had ever wanted that felt out of his grasp and that he was not as inhumane as the villagers thought him to be. Rotimi had stood no chance with Kikelomo when Adedibu asked her hand in marriage because he was the&nbsp;<em>Kabiyesi</em>&nbsp;and no one dared question his choice, not even the Balogun.</p>\r\n\r\n<p>But now, the shaky promise of peace that the villagers had held on to when Rotimi had not challenged Adedibu about taking Kikelomo from him was shattered. All hell was let loose. The sound of wailing she heard from the palace had her hurrying her steps. The noise seemed to be coming from the Queen mother&rsquo;s hut and she just knew that she was too late. The news had already gotten to the palace.</p>\r\n\r\n<p>As she got closer to the King&rsquo;s hut, she passed by people with solemn faces. Ahead of her,&nbsp;<em>Otun</em>,&nbsp;<em>Osi</em>&nbsp;and&nbsp;<em>Iyalode</em>&nbsp;took burdened steps towards the hut, shaking their heads in grief. She slowed down for them to go on in before she followed. On entering the hut, she fell on her knees to pay homage to Adedibu even though he had his back to them all.</p>\r\n\r\n<p>&ldquo;<em>Kabiyeeeesi o!</em>&rdquo; she greeted. &ldquo;My elders, I greet you.&rdquo;</p>\r\n\r\n<p>&ldquo;My daughter, you may rise.&rdquo;&nbsp;<em>Otun</em>&nbsp;said to her, not raising his head.</p>\r\n\r\n<p>She stood up on shaky feet and wondered how long the silence would wear on before someone broke it. She didn&rsquo;t wonder for long.</p>\r\n\r\n<p>&ldquo;<em>Eeeeeeeeeeeewo o!!!!!!!!!!!!!!!!</em>&rdquo; The high-pitch tone and cowries beating against bare flesh announced the arrival of&nbsp;<em>Yeye&nbsp;</em>Mofe, the High Priestess. &ldquo;<em>Kabiyesi o!</em>&rdquo; she greeted the King even though he paid her no heed. She spoke fast all the time and it made one wonder what it was that always made her pressed for time. It was unheard of for the Yeye to have a family so the only duty she had was to the village.</p>\r\n\r\n<p><em>&lsquo;Yio bale yio bale ni labalaba fi wo gbo lo.</em></p>\r\n\r\n<p><em>Kaka kiku ma je sese, a fi sawada ni&rsquo;</em></p>\r\n\r\n<p><em>Yeye&nbsp;</em>Mofe&rsquo;s loud chanting filled the hut and Adedibu finally turned towards them, his eyes bloodshot and swollen. She knew he had been crying and it irked her that there was nothing she could do to ease her brother&rsquo;s pain.</p>\r\n\r\n<p>&ldquo;A king, if he forgets who he is, will live like a common man.&rdquo;&nbsp;<em>Yeye</em>&nbsp;Mofe continued, chewing her mouth and looking round the room, wide-eyed. When she opened her mouth next, Adesewa knew that the High Priestess had a message to relay. Taking slow, calculated steps towards the&nbsp;<em>Kabiyesi</em>, she drew shapes in the sand and chanted. All eyes were on her as she moved and&nbsp;<em>Otun</em>,&nbsp;<em>Osi</em>&nbsp;and&nbsp;<em>Iyalode</em>shared fearful glances when they realized what she was drawing. There was no escaping doom now. War was inevitable.</p>\r\n\r\n<p>Vocabulary:<em>&nbsp;*Olori-&nbsp;</em>Queen<em>, Balogun-&nbsp;</em>Army General<em>, Kabiyesi-&nbsp;</em>Unquestionable One/King<em>, Eeeeeeeeeeeewo o!-&nbsp;</em>Abomination!<em>, Yeye-&nbsp;</em>Mother<em>&nbsp;&lsquo;Yio bale yio bale ni labalaba fi wo gbo lo. Kaka kiku ma je sese, a fi sawada ni&rsquo;-&nbsp;</em>Incantations<em>, Otun, Osi and Iyalode-&nbsp;</em>Yoruba elders (Otun and Osi are men, Iyalode is the women&rsquo;s leader)*</p>\r\n\r\n<p>Source: <a href=\"http://www.graceola.wordpress.com\" target=\"_blank\">www.graceola.wordpress.com</a></p>', 'uploads/5531166king1.jpg', 'j90819542aBn72ii', '23:06:07', '2018-05-21', 'q7rl9d1ua57957aoilcte81', 0, '', 0, 128, NULL),
(41, 'OPEN LETTER TO EKITI PEOPLE: THE SELECTION EDUCATION AND THE FUTURE OF EKITI DEVELOPMENT  PART II', 'Folorunso Obayemi T. Obasuyi', 'hide', '<p><strong><em>Folorunso Obayemi T. Obasuyi</em></strong></p>\r\n\r\n<p><strong><em>Dear Ekiti Sons and Daughters,</em></strong></p>\r\n\r\n<p><strong>Introduction</strong></p>\r\n\r\n<p>This is the second part of the open letter to Ekiti People on the Selection education and the future of Ekiti Development. You may wish to read the Part I of this open letter <a href=\"https://boardspeck.com/article?post=open-letter-to-ekiti-people-the-selection-education-and-the-future-of-ekiti-development-ndash-part-i&amp;id=rc2ta8ei68noe5599lp17\" target=\"_blank\"><strong>HERE</strong></a>. &nbsp;In part I, we discussed the deficiencies of governance and major selection principles during electioneering. In this Part II, we address the cogent and specific areas that the electorates should focus while selecting a candidate for governorship seat of Ekiti State.</p>\r\n\r\n<p><strong>Section B. Further Principles of Selection</strong></p>\r\n\r\n<p>I was inspired to write this Part II because of a shock I received from an undergraduate Malay Student at my University She said:</p>\r\n\r\n<p>&ldquo;Ekiti State has the highest Professors in Nigeria but too poor,&rdquo; I asked her a question &ldquo;where did you get the information?&rdquo;. She replied, &ldquo;I got it online&rdquo;. Sound as a shock, right? What she believed was that education is the bedrock for any developing countries to catch up.</p>\r\n\r\n<p>In so doing, what should Ekiti People need to do and know to select the right candidate during the electioneering process? This section discusses the specific areas where the electorate should be patient to read. This is because the section B would educate the people of the concrete promises that they should look for in Ekiti of our dream.</p>\r\n\r\n<p>Let us systematically identify our needs for the transformation of Ekiti development and Ekiti people&rsquo;s welfare. All hangs on restructuring and the readiness for change.</p>\r\n\r\n<ul>\r\n	<li><strong>Political Programme and People&rsquo;s Need &ndash; </strong>Political party programme is always deficient that accommodate fragmentation, bias and sometimes contrary to the NEEDS of the people. The programmes are drawn to bribe electorate&rsquo;s conscience. We don&rsquo;t need political party programme.</li>\r\n</ul>\r\n\r\n<p><strong>Suggestion</strong><em> - People of Ekiti State should be conscious of selecting an aspirant who will be ready to allow Ekiti people to define their <strong>NEEDS</strong>. Relying on political party programmes is a <strong>SHITHOLE</strong>. </em><strong>Ok?</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Efficient Policy &ndash; </strong>We don&rsquo;t need N500.00, N1000.00, N5000.00 and or more to bribe your conscience to which you become unhappy after the election. If you collect the money, you signed and accepted your death-economic warrant. The monies shared by politicians are poverty money that electorates take for four years. If you take N500.00, N1000.00, N5000.00, try to spend it judiciously because you may not receive similar consignment before the end of the four years. My people, we need an effective policy that will teach and direct the people to where they could get money every day. Don&rsquo;t allow the politician to give you money. Instead, tell them to have effective policy to enhance people capability of how to get their own money and they will be satisfied.</li>\r\n</ul>\r\n\r\n<p><strong>Suggestion - </strong><em>In consequence of the above, the electorates should exercise caution in collecting money from any of the aspirants. Instead, demand for an effective policy that will upturn poverty. </em><strong>Ok?</strong></p>\r\n\r\n<ul>\r\n	<li><strong>State Conference/Summit</strong> &ndash; The incoming government should agree to organise State Conference/Summit immediately after the swearing-in ceremony to design the way forward on the real and services sectors such as Agric, industry, manufacturing, SME, electricity, tourism, services and education. The summit should identify and collate the State <strong>NEEDS</strong> (People and government NEEDS). The outcome of the Conference/Summit shall be a template for running the State than <strong>GOVERNOR PRESUMED NEEDS</strong> or <strong>POLITICAL PARTY ASSUMED NEEDS</strong> for the people.</li>\r\n</ul>\r\n\r\n<p><strong>Suggestion - </strong><em>In the spirit of development, the electorates are cautioned against a poor selection of a candidate and cast their vote for somebody who will not be interested in organising a <strong>CONFERENCE/SUMMIT</strong> as a template for Governor and the State operationalisation of development activities. It will be somehow and somewhat suicidal. Vote for a candidate that would be ready to declare state of emergency on the Ekiti State industrial sector. </em><strong>Ok?</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Governance Inclusiveness</strong><strong> -</strong> The inclusiveness includes people&rsquo;s participation in the running of the society. I suggest that any aspirant whose interest is to govern the State by <strong>self-ideas and Godfatherism</strong> should be avoided. Godfatherism does not allow for sustainable development to take place neither a self-idea (which is controlled by emotions) cannot put food on the electorate&rsquo; tables.</li>\r\n</ul>\r\n\r\n<p><strong>Suggestion </strong><em>- Therefor</em>e, <em>the guide is to vote for a candidate who is interested in <strong>INCLUSIVENESS</strong> instead of exclusiveness. If the voters make a selection mistake of <strong>EXCLUSIVENESS</strong>, without mincing words, they will pay the prize for the error committed for four solid years. </em><strong>Ok?</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Research and Development (R&amp;D)</strong> - The Incoming Governor should demonstrate the readiness to respect and use R&amp;D as an economic tool to upgrade the State economic development. The Incoming Governor should use experts in EKSU, College of Education and Health Technology in ensuring R&amp;D in the State. That is where the <strong>SEERS and PROPHETS of DEVELOPMENT</strong> reside. This aspect is most crucial to monitor the State development in Education, Science, Social, Business and Arts/Humanities, instead of politician&rsquo;s ideologies that are always demonstrating biasness and frustrating. A deviation or attempt to reduce these experts to non-functioning in prophesying, seeing and proclaiming several development warnings would be a <strong>CURSE</strong> for the State economic development.</li>\r\n</ul>\r\n\r\n<p><strong>Suggestion </strong><em>- The electorate should be most conscious of selecting an aspirant/candidate wisely such that the person should be interested in R&amp;D. </em><strong>OK?</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Interest in Development instead of Political Affiliation</strong>. The State incoming Governor should have 100% <strong>INTEREST</strong> in the State development instead of personal thinking and philosophy of the Governor regarding the State development. The Governor &lsquo;own-thought&rsquo; regarding State development is always biased than the collective thought of development.</li>\r\n</ul>\r\n\r\n<p><strong>Suggestion </strong><em>- This</em><em> principle is a caution for the electorates to select an aspirant who will avoid handling governance by self-imposition but vote in a candidate who will employ collective thinking. Otherwise, be expecting that the incoming Governor with self-thinking episode would lead people to more of poverty and poor development in the State. </em><strong>Ok?</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Restructuring of Small and Medium Enterprises (SME) &ndash;</strong> Re-organisation or restructuring of the State SME to promote investment should top government and the human need to reduce unemployment. The incoming government should consciously allow for the re-organisation or restructuring of the State SME. In developed countries, the SME is largest employer of labour. Currently, I observe that the State SME is outrightly disorganised. The SMEs are not properly organised compare with Malaysia SMEs.</li>\r\n</ul>\r\n\r\n<p><strong>Suggestion - </strong><em>T</em><em>he voters (Ekiti people) should select an aspirant with the heart full of consciousness and readiness to restructure the State SME that is already in a state of a comma. </em><strong>Ok?</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Social and Life Security</strong> &ndash; The incoming governor should demonstrate his readiness to create a secure environment for sustainable development such that the investors are attracted to invest in the State economy. The higher the number of investors, the better the State economic development. Also, the more the State absorbs insecurity, the worse the State economy. Please, ensure that the aspirants you intend to vote for have the intention to secure the State regarding property, social and life.</li>\r\n</ul>\r\n\r\n<p><strong>Suggestion - </strong><em>In a wise saying, it is preferable to argue that a poor selection among the parties aspirants would cause the electorates and their families four-year economic and psychological stress; poverty and insecurity. So, rationally select and vote for the candidate who will be interested in your welfare, the welfare of your family and the inclusiveness of the society in ensuring social order</em><strong>. Ok</strong><em>?</em></p>\r\n\r\n<ul>\r\n	<li><strong>Government Team</strong> &ndash; The incoming Governor should demonstrate the readiness to select government team wisely. Learn from Malaysia. The government team include Commissioners, Directors, Special Advisers and others. The government portfolio should be expert focused rather than political party focused. Over time, the mistake in this aspect has ever been a <strong>CURSE</strong> for the development of the State and Nigeria economy. For example, a former Governor of Ekiti appointed a medical Doctor to manage Ministry of Education and Technology. You could recall that the Commissioner used the <strong>Medical SURGICAL BLADE</strong> to tear apart the State education.</li>\r\n</ul>\r\n\r\n<p><strong>Suggestion - </strong>Without mincing words, I suggest that potential voters<em> should select wisely among the aspirants who will not look at &ldquo;oju aye&rdquo; (eye service) but look at collective goal to choose his team. If you see any aspirant who has promised everyone before the election without consideration to expert, such a candidate is your and family enemy in governance. </em><strong>Ok?</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Governorship Position and Administration -</strong> The Incoming Governor should know that he is the most Senior Staff or Chief Administrator of the State Administration, like a Vice-Chancellor of a University that receive a salary. Yes, Governor appointed the Vice Chancellor but the <strong>ELECTORATES</strong> <strong>APPOINTED</strong> the Governor by the signature of their votes. The incoming Governor should demonstrate in practical terms that the electorates stand as the Boss because the number of votes cast would give the incoming Governor the appointment as a Governor of the State (like a job seeker). The fact remains that people elected/appointed the Governor to serve them with a salary reward from the individual share of the State income (per capita income). As such, Governor is expected to serve as an efficient intermediary between the State economy and external economies instead of being a BOSS over the BOSS (electorates). Otherwise, the State development becomes a curse that would invite more poverty and insecurity to and for the people.</li>\r\n</ul>\r\n\r\n<p><strong>Suggestion - </strong><em>So,</em> <em>the electorates should select a tested and efficient &ldquo;<strong>Leader&rdquo;</strong> instead of a <strong>&ldquo;Boss&rdquo;.</strong> A Boss is an authoritarian person where a Leader is an inspired individual and purely democratic (Read Daskal, 2014). If you select a &ldquo;Boss&rdquo; rather than a &ldquo;Leader&rdquo; to be the next Governor of Ekiti State, <strong>the electorate should expect that they will live in a tyrannical society/community for four solid years, if not more, to pay for their ineptitude </strong>regarding a <strong>BOSS</strong> aspirant selected. </em><strong>Ok?</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Ekiti State Development Plan</strong> &ndash; Passionately and critically, I observe that there is no development plan in the State. If there is, it is not followed, pushed aside or it is outdated/obsolete. The world is changing in economics, science, social, information, technology and arts every day. The incoming State Governor should, as a matter of priority and urgency, take to the House of Assembly to pass into the law of Ekiti State to draw a Five-Year Development Plan (ESFYDP) that will capture all sectors. The plan would be a template to monitor sustainable development goals (SDG) that will improve Ekiti State development and his people. In my opinion, sometimes, what the government is calling development is not the actual development expected. They are window-dressing development with no impact on the people.</li>\r\n</ul>\r\n\r\n<p><strong>Suggestion - </strong><em>So, I suggest with all<strong> </strong>sincerity that the electorate should select a political candidate, without biasness, who will be ready to draw an economic and sustainable development plan for action, as reference a template for the incoming Governor and any government coming-up in the State. The development plan would always provide direction regarding knowledge of what had been done and what remains for action. If the electorate selected an aspirant whose interest deviates from Ekiti State Development Plan (ESDP), remember that your vote is assumed to be a signature of your wisdom or ineptitude which would dictate your family success or economic failure (poverty) for four solid years or more. If governorship candidate selection is carefully done, the ESDP shall become a State economic and development manual, and a necessity to review in every 5-year interval. It is now for an electorate to demonstrate absolute wisdom to ask a direct question from the Governorship candidate: <strong>W</strong><strong>ILL YOU AS INCOMING GOVERNOR BE READY TO DRAW A DEVELOPMENT PLAN REGARDING EKITI STATE ECONOMY AND ITS DEVELOPMENT? </strong></em><strong>Ok</strong><em>?</em></p>\r\n\r\n<ul>\r\n	<li><strong>Data as a Development Weapon</strong> - The Incoming Governor should have the characteristic of, if not available, establishing Ekiti State Department of Economics and Statistics. Why? A country or State that lack accurate statistical data on economic and social issues, and make such data available to the expected users (people and researchers) would not miraculously transform the economy. Like parents monitor the children through data provided by teachers (examination report), people, researchers, economists and socialists do. Through data, development is monitored and achieved because data offer history or trend of events. The Department in question should be independent of the Ministry of Finance, which should be headed by a Director (Economists and Statistician are preferable). The government should make the Department publish State development bi-annually/quarterly in print (Name suggestion -The State Economic Bulletin or Ekiti State Economic Monitor, like Malaysia economic Monitor) and social media such as radio and television.</li>\r\n</ul>\r\n\r\n<p><strong>Suggestion &nbsp;- </strong><em>Hence, I suggest that the electorates should be wise enough to select a virtuous person who will make transparency a watchword. &nbsp;However, suppose voters make a mistake in the political party candidate&rsquo;s selection regarding data issue that defines transparency and monitoring the State economy, (i.e. keeping the record of what was done, how it was done and what remains to be done). Be reminded that the electorates are subjecting themselves and families to abject poverty because there will be no efficiency of governance regarding the distribution of the available State economic resources. Resources would be share at Governor&rsquo;s discretion at the expense of people&rsquo;s welfare. </em><strong>Ok?</strong></p>\r\n\r\n<ul>\r\n	<li>&nbsp;<strong>Efficient Communication -</strong> Readiness of the incoming Governor to develop listening ears on the matter of development is a paramount concept in the development paradigm. Communication exists when the receiver understands the content of the message of the sender. Communication breaks down when there is a misconception of the idea of the message. The misconception could lead to chaos or a state of anarchy<strong><em>. </em></strong>I want to state clearly that in a KNOWLEDGE ECONOMY, information is one of the core variables.</li>\r\n</ul>\r\n\r\n<p><strong>Suggestion - </strong><em>As<strong> </strong>such, the electorates should be courageous to select someone who has human feelings in passing right information to the people because we are social beings whose behaviour changes either for good or bad. Be honest, wise and careful of your selection to have someone who will have a listening ear rather than a deaf ear to people&rsquo;s yearnings. Effective communication between the incoming Governor and the Ekiti People should be the watchword to the electorates in selecting the right person for Governorship. Otherwise, wait for four solid years of poverty and agony, maybe you will become wise later. Elect a candidate that is approachable and invites suggestions from the public. In other words, <strong>Public opinion</strong> <strong>should count</strong>. &nbsp;</em><strong>Ok?</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Corruption Control and Strategy</strong> - Corruption is as old as man, particularly reference to when the evil angel called Satan, corruptively stole the everlasting life given to man. While I am not advocating for corruption, since the first corruption was performed in Eden, corruption has been a behaviour that occurs and reoccurs in all countries of the world. It is only the quantity and management that create the difference. For example, making pronunciation that the State or our country is corrupt is deadlier than the corruption itself because it will negatively impact more on the economy than expected. So, it is a necessary condition to ask the prospective incoming Governor, I mean all the aspirants irrespective of the political party affiliation, to tell the people the strategy of blocking the loopholes of corruptive tendencies in governance. Fighting the past corruption is good, but the approach may look worse. It is now to ask any of the aspirants the following questions. (1) What are the corruption parameters in governance, economic, social and politics? (2) How will you assure the electorates that you will not be a corrupt Governor if elected? (3) If found having the intention (still planning) of corruption (or found corrupted) during your tenure, what should Ekiti people do to minimise the propensity for corruption? Give us your word. (4) If any of your team is found corrupt, what will you do in the interest of Ekiti People and development?<em> </em>If answers are not straightforward, then be wise, patient and careful of such candidate in your selection exercise. Whatever the response, have it in writing to keep a record.</li>\r\n</ul>\r\n\r\n<p><strong>Suggestion - </strong><em>So, I suggest that the electorates should avoid selecting an aspirant that has a corruptive tendency (in other words, traces of being a thieve), merely that he is a member of your party. Please note that when such individual buys his way from your negligence of having right person as a Governor, you and your family will pay for the proceeds of his corruption in four years or more. <strong>Ok?</strong></em></p>\r\n\r\n<ul>\r\n	<li><strong>&nbsp;Wages Problem &ndash; </strong>No doubt, the economic recession has caused a lot to the workers of the State through non-payment of salary. In distribution process, the State economy depends mainly on salary to which distribution goes to the market. Get a clear understanding of the intention of the aspirant(s) of how salary issue would be resolved. The fact that the incoming Governor should know now is the 5 &ndash; 7 months arrears of salary. What Ekiti people would revolt against is telling the people what they know and experience. Instead, the electorates should ask the political party candidates to tell the electorates what and how the arrears of workers emoluments are to be paid. Otherwise, your vote would count for your persistent poverty.</li>\r\n</ul>\r\n\r\n<p><strong>Suggestion &ndash; </strong><em>When an aspirant is using the current weaknesses (such as salary arrears) of the current government to campaign to be a Governor, tell him that we are not <strong>MUNMUN</strong> who does not know right from wrong. The facts about current and previous governments are kept in the Political Bank of Lying. Instead, the electorates need to be sure that the political party candidate of their interest answer the question of HOW? and not WHAT? In other words, HOW? provides convincing and detailed answers than WHAT? to which WHAT? is a bundle of lies in a political arena. </em><strong>Ok?<em> </em></strong></p>\r\n\r\n<p><strong>Conclusion</strong></p>\r\n\r\n<p>In this open letter (Part I&amp;II), we have discussed the weaknesses of the government and stated <em>selection principles</em> as a guide to Ekiti polity. The selection principles are guides to select from the myriads of aspirants and to prepare the winning aspirant for works ahead. So, we propose to Ekiti Sons and Daughters as follows:</p>\r\n\r\n<ul>\r\n	<li>Though it is not easily said and done, do not choose an aspirant base on prejudice or be political and ethnicity bias. If all things being equal, avoid selecting a Governorship candidate merely because he is a member of your party, ethnic group, family and local government even when you have the absolute knowledge that he has little or no capacity to run the affairs of the State.</li>\r\n	<li>Select a virtuous candidate that has a passion for development, who understand the evolution of development and development stages. The person should be a <strong>LEADER</strong> and not a <strong>BOSS</strong>. As a <strong>LEADER</strong>, he should be versatile as a <strong>READER. </strong>A <strong>Reade</strong>r can be a good <strong>Leader </strong>because he acquires more knowledge and wisdom in reading but a <strong>Leader </strong>cannot necessarily be a <strong>Reader </strong>because he has characteristics of a<strong> BOSS.</strong></li>\r\n</ul>\r\n\r\n<p>Base on these conclusions, we argue that a unique thought of the electorates&rsquo; welfare, their families standard of living, the community and economic development of Ekiti State are the inherent value chains in the Selection Education Guide (SEG) provided in this open letter.</p>\r\n\r\n<p><strong>Admonition </strong>- Dear Ekiti Sons and Daughters, you are the electorates that should bear in mind the limitation of the selection principles as highlighted in Kolawole (2018). He said &ldquo;<em>in every election, politicians play on our intelligence and ride on our emotions. When they get power, they become something else&rdquo;</em>. To minimise the limitation, ponder over the selection principle stated in this open letter. Educate your children who are eligible (18 and above) to vote during the election so as to shine their eyes and open their brain for development reasoning. Consciously and constructively reason with your relatives and friends as well as social groups regarding these selection principles during the electioneering process of Ekiti State with an extension to Nigeria politics.</p>\r\n\r\n<p>Many are in the race, but only one person would receive the prize. The truth is that a person among the candidates would emerge as the Governor of Ekiti State. Only God Knows. In advance, I congratulate the unknown and yet decided candidate who will assume the <strong>HOT, DEMANDING and COMPETITIVE SEAT</strong> of Ekiti State. My prayer is for the electorate to make the balanced judgement of the aspirants to get the desired result of development. In so doing, the incoming Governor should not forget to avoid <strong><em>misplacement of priority in governance</em></strong>. He should allow Ekiti people to identify their <strong>NEEDS</strong> from numerous <strong>WANTS</strong> through State Conference/Summit. Make research and development (R&amp;D) a robust governance instrument to reshape and rebuild the dilapidated economy of the State, a fraction of the Nigeria economy. Be sure that you declare state of emmergency on the <strong>REAL SECTOR</strong> of Ekiti State to stimulate employment.</p>\r\n\r\n<p>Whatever the choice of the electorates, I have resolved to constructively provide developmental ideas, innovations and creativity (Sternberg, 2012) to whoever comes to the corridor of power in Ekiti, to proffer solutions to numerous problems of Ekiti people and the State Economy (e.g. youth unemployment). In summary, my concern is the happiness of Ekiti people and the State economic development.</p>\r\n\r\n<p>Further debate shall focus on where we were coming from, where we are now and how to pursue the global SDG 2030 programme in the State. Collectively, we shall discuss what has been done, how it was done but got a failure response, what we should do and shouldn&rsquo;t be done.</p>\r\n\r\n<p>Thanks for your patience for the &ldquo;So long a Letter&rdquo;, as in Mariama B&acirc;&#39;s first novel book written in the form of a letter.</p>\r\n\r\n<p>Folorunso Obasuyi T. Obasuyi</p>\r\n\r\n<p><em>Department</em><em> of Development Studies,</em></p>\r\n\r\n<p><em>University of Malaya, Malaysia.</em></p>\r\n\r\n<p><a href=\"mailto:Obasfot2017@gmail.com\">Obasfot2017@gmail.com</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>Department of Economics </em></p>\r\n\r\n<p><em>College</em><em> of Education,</em></p>\r\n\r\n<p><em>Ikere - Ekiti</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>References</strong></p>\r\n\r\n<p>Connor, B. (2013).<strong> </strong>The Difference Between a Boss and a Leader. Business2Comunity<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"https://www.business2community.com/leadership/difference-boss-leader-0715675\">https://www.business2community.com/leadership/difference-boss-leader-0715675</a></p>\r\n\r\n<p><strong>&nbsp;</strong>Daskal, L. (2014). Here is the difference between a boss and a leader. Business &nbsp;&nbsp;&nbsp; Insider.<strong><em> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em></strong><a href=\"http://www.businessinsider.com/heres-the-difference-between-a-%09boss-and-a-leader-%092014-9/?IR=T\">http://www.businessinsider.com/heres-the-difference-between-a-&nbsp;&nbsp;&nbsp;&nbsp; boss-and-a-leader-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2014-9/?IR=T</a></p>\r\n\r\n<p>Kolawole S (2018) Open Letter to The President: Shall We Tell the President?</p>\r\n\r\n<p>Sternberg, R. J., &amp; Lubart, T. I. (1991). An investment theory of creativity and its development. <em>Human development, 34</em>(1), 1-31.</p>\r\n\r\n<p>DESA, U. (2009). Creating an Inclusive Society: Practical Strategies to Promote Social Integration: UN.</p>\r\n\r\n<p>Independent (February 1, 2018). Economic Growth Not Linked To Electricity &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Supply -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Fashola. <a href=\"https://independent.ng/economic-growth-not-linked-%09electricity-supply-%09fashola/\">https://independent.ng/economic-growth-not-linked-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; electricity-supply-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; fashola/</a></p>\r\n\r\n<p>Kehinde, O. (2018). &ldquo;15 things Obasanjo said in his letter to Buhari&rdquo;. Daily Trust &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"https://www.dailytrust.com.ng/15-things-obasanjo-said-in-his-letter-to-buhari.html\">https://www.dailytrust.com.ng/15-things-obasanjo-said-in-his-letter-to-buhari.html</a></p>\r\n\r\n<p>&nbsp;</p>', 'uploads/2313691Group_1.png', '5s730nFluoo12r0o978', '11:32:52', '2018-05-23', 'iocrpl8n98t7e5ea53318', 0, '', 1, 21, NULL);
INSERT INTO `blog` (`id`, `title`, `author`, `visibility`, `body`, `image_1`, `created_by`, `time_created`, `date_created`, `hash_id`, `about`, `thumbnail`, `notification_status`, `rcount`, `category_id`) VALUES
(42, 'OPEN LETTER TO EKITI PEOPLE: THE SELECTION EDUCATION AND THE FUTURE OF EKITI DEVELOPMENT  PART II', 'Folorunso Obayemi T. Obasuyi', 'show', '<p><em><strong>Dear Ekiti Sons and Daughters,</strong></em></p>\r\n\r\n<p><strong>Introduction</strong></p>\r\n\r\n<p>This is the second part of the open letter to Ekiti People on the Selection education and the future of Ekiti Development. You may wish to read the Part I of this open letter <a href=\"https://boardspeck.com/article?post=open-letter-to-ekiti-people-the-selection-education-and-the-future-of-ekiti-development-ndash-part-i&amp;id=rc2ta8ei68noe5599lp17\" target=\"_blank\">here</a>. In part I, we discussed the deficiencies of governance and major selection principles during electioneering. In this Part II, we address the cogent and specific areas that the electorates should focus while selecting a candidate for governorship seat of Ekiti State.</p>\r\n\r\n<p><strong>Section B. Further Principles of Selection</strong></p>\r\n\r\n<p>I was inspired to write this Part II because of a shock I received from an undergraduate Malay Student at my University She said:</p>\r\n\r\n<p>&ldquo;Ekiti State has the highest Professors in Nigeria but too poor,&rdquo; I asked her a question &ldquo;where did you get the information?&rdquo;. She replied, &ldquo;I got it online&rdquo;. Sound as a shock, right? What she believed was that education is the bedrock for any developing countries to catch up.</p>\r\n\r\n<p>In so doing, what should Ekiti People need to do and know to select the right candidate during the electioneering process? This section discusses the specific areas where the electorate should be patient to read. This is because the section B would educate the people of the concrete promises that they should look for in Ekiti of our dream.</p>\r\n\r\n<p>Let us systematically identify our needs for the transformation of Ekiti development and Ekiti people&rsquo;s welfare. All hangs on restructuring and the readiness for change.</p>\r\n\r\n<p><em>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em><strong>Political Programme and People&rsquo;s Need &ndash; </strong>Political party programme is always deficient that accommodate fragmentation, bias and sometimes contrary to the NEEDS of the people. The programmes are drawn to bribe electorate&rsquo;s conscience. We don&rsquo;t need political party programme.</p>\r\n\r\n<p><strong>Suggestion</strong><em> - People of Ekiti State should be conscious of selecting an aspirant who will be ready to allow Ekiti people to define their <strong>NEEDS</strong>. Relying on political party programmes is a <strong>SHITHOLE</strong>. </em><strong>Ok?</strong></p>\r\n\r\n<p><em>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em><strong>Efficient Policy &ndash; </strong>We don&rsquo;t need N500.00, N1000.00, N5000.00 and or more to bribe your conscience to which you become unhappy after the election. If you collect the money, you signed and accepted your death-economic warrant. The monies shared by politicians are poverty money that electorates take for four years. If you take N500.00, N1000.00, N5000.00, try to spend it judiciously because you may not receive similar consignment before the end of the four years. My people, we need an effective policy that will teach and direct the people to where they could get money every day. Don&rsquo;t allow the politician to give you money. Instead, tell them to have effective policy to enhance people capability of how to get their own money and they will be satisfied.</p>\r\n\r\n<p><strong>Suggestion - </strong><em>In consequence of the above, the electorates should exercise caution in collecting money from any of the aspirants. Instead, demand for an effective policy that will upturn poverty. </em><strong>Ok?</strong></p>\r\n\r\n<p><em>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em><strong>State Conference/Summit</strong> &ndash; The incoming government should agree to organise State Conference/Summit immediately after the swearing-in ceremony to design the way forward on the real and services sectors such as Agric, industry, manufacturing, SME, electricity, tourism, services and education. The summit should identify and collate the State NEEDS (People and government NEEDS). The outcome of the Conference/Summit shall be a template for running the State than GOVERNOR PRESUMED NEEDS or POLITICAL PARTY ASSUMED NEEDS for the people.</p>\r\n\r\n<p><strong>Suggestion - </strong><em>In the spirit of development, the electorates are cautioned against a poor selection of a candidate and cast their vote for somebody who will not be interested in organising a CONFERENCE/SUMMIT as a template for Governor and the State operationalisation of development activities. It will be somehow and somewhat suicidal. </em><strong>Ok?</strong></p>\r\n\r\n<p><em>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em><strong>Governance Inclusiveness -</strong> The inclusiveness includes people&rsquo;s participation in the running of the society. I suggest that any aspirant whose interest is to govern the State by <strong>self-ideas and Godfatherism</strong> should be avoided. Godfatherism does not allow for sustainable development to take place neither a self-idea (which is controlled by emotions) cannot put food on the electorate&rsquo; tables.</p>\r\n\r\n<p><strong>Suggestion </strong><em>- Therefor</em>e, <em>the guide is to vote for a candidate who is interested in <strong>INCLUSIVENESS</strong> instead of exclusiveness. If the voters make a selection mistake of <strong>EXCLUSIVENESS</strong>, without mincing words, they will pay the prize for the error committed for four solid years. </em><strong>Ok?</strong></p>\r\n\r\n<p><em>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em><strong>Research and Development (R&amp;D)</strong> - The Incoming Governor should demonstrate the readiness to respect and use R&amp;D as an economic tool to upgrade the State economic development. The Incoming Governor should use experts in EKSU, College of Education and Health Technology in ensuring R&amp;D in the State. That is where the <strong>SEERS and PROPHETS of DEVELOPMENT</strong> reside. This aspect is most crucial to monitor the State development in Education, Science, Social, Business and Arts/Humanities, instead of politician&rsquo;s ideologies that are always demonstrating biasness and frustrating. A deviation or attempt to reduce these experts to non-functioning in prophesying, seeing and proclaiming several development warnings would be a <strong>CURSE</strong> for the State economic development.</p>\r\n\r\n<p><strong>Suggestion </strong><em>- The electorate should be most conscious of selecting an aspirant/candidate wisely such that the person should be interested in R&amp;D. </em><strong>OK?</strong></p>\r\n\r\n<p><em>6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em><strong>Interest in Development instead of Political Affiliation</strong>. The State incoming Governor should have 100% <strong>INTEREST</strong> in the State development instead of personal thinking and philosophy of the Governor regarding the State development. The Governor &lsquo;own-thought&rsquo; regarding State development is always biased than the collective thought of development.</p>\r\n\r\n<p><strong>Suggestion </strong><em>- This principle is a caution for the electorates to select an aspirant who will avoid handling governance by self-imposition but vote in a candidate who will employ collective thinking. Otherwise, be expecting that the incoming Governor with self-thinking episode would lead people to more of poverty and poor development in the State. </em><strong>Ok?</strong></p>\r\n\r\n<p><strong>7.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Restructuring of Small and Medium Enterprises (SME) &ndash;</strong> Re-organisation or restructuring of the State SME to promote investment should top government and the human need to reduce unemployment. The incoming government should consciously allow for the re-organisation or restructuring of the State SME. In developed countries, the SME is largest employer of labour. Currently, I observe that the State SME is outrightly disorganised. The SMEs are not properly organised compare with Malaysia SMEs.</p>\r\n\r\n<p><strong>Suggestion - </strong><em>The voters (Ekiti people) should select an aspirant with the heart full of consciousness and readiness to restructure the State SME that is already in a state of a comma. </em><strong>Ok?</strong></p>\r\n\r\n<p><em>8.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em><strong>Social and Life Security</strong> &ndash; The incoming governor should demonstrate his readiness to create a secure environment for sustainable development such that the investors are attracted to invest in the State economy. The higher the number of investors, the better the State economic development. Also, the more the State absorbs insecurity, the worse the State economy. Please, ensure that the aspirants you intend to vote for have the intention to secure the State regarding property, social and life.</p>\r\n\r\n<p><strong>Suggestion - </strong><em>In a wise saying, it is preferable to argue that a poor selection among the parties aspirants would cause the electorates and their families four-year economic and psychological stress; poverty and insecurity. So, rationally select and vote for the candidate who will be interested in your welfare, the welfare of your family and the inclusiveness of the society in ensuring social order</em><strong>. Ok</strong><em>?</em></p>\r\n\r\n<p><em>9.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em><strong>Government Team</strong> &ndash; The incoming Governor should demonstrate the readiness to select government team wisely. Learn from Malaysia. The government team include Commissioners, Directors, Special Advisers and others. The government portfolio should be expert focused rather than political party focused. Over time, the mistake in this aspect has ever been a <strong>CURSE</strong> for the development of the State and Nigeria economy. For example, a former Governor of Ekiti appointed a medical Doctor to manage Ministry of Education and Technology. You could recall that the Commissioner used the <strong>Medical SURGICAL BLADE</strong> to tear apart the State education.</p>\r\n\r\n<p><strong>Suggestion - </strong>Without missing words, I suggest that potential voters<em> should select wisely among the aspirants who will not look at &ldquo;oju aye&rdquo; (eye service) but look at collective goal to choose his team. If you see any aspirant who has promised everyone before the election without consideration to expert is your and family enemy in governance. </em><strong>Ok?</strong></p>\r\n\r\n<p><em>10.&nbsp; </em><strong>Governorship Position and Administration -</strong> The Incoming Governor should know that he is the most Senior Staff or Chief Administrator of the State Administration, like a Vice-Chancellor of a University that receive a salary. Yes, Governor appointed the Vice Chancellor but the <strong>ELECTORATES</strong> <strong>APPOINTED</strong> the Governor by the signature of their votes. The incoming Governor should demonstrate in practical terms that the electorates stand as the Boss because the number of votes cast would give the incoming Governor the appointment as a Governor of the State (like a job seeker). The fact remains that people elected/appointed the Governor to serve them with a salary reward from the individual share of the State income (per capita income). As such, Governor is expected to serve as an efficient intermediary between the State economy and external economies instead of being a BOSS over the BOSS (electorates). Otherwise, the State development becomes a curse that would invite more poverty and insecurity to and for the people.</p>\r\n\r\n<p><strong>Suggestion - </strong><em>So,</em> <em>the electorates should select a tested and efficient &ldquo;Leader&rdquo; instead of a &ldquo;Boss&rdquo;. A boss is an authoritarian where a leader is an inspired individual and purely democratic (Read Daskal, 2014). If you select a &ldquo;Boss&rdquo; rather than a &ldquo;Leader&rdquo; to be the next Governor, <strong>the electorate should expect that they will live in a tyrannical society/community for four solid years, if not more, to pay for their ineptitude </strong>regarding a <strong>BOSS</strong> aspirant selected. </em><strong>Ok?</strong></p>\r\n\r\n<p><em>11.&nbsp; </em><strong>Ekiti State Development Plan</strong> &ndash; Passionately, I observe that there is no development plan in the State. If there is, it is not followed, pushed aside or it is outdated/obsolete. The world is changing in economics, science, social, information, technology every day. The incoming State Governor should, as a matter of priority and urgency, take to the House of Assembly to pass into the law of Ekiti State to draw a Five-Year Development Plan (ESFYDP) that will capture all sectors. The plan would be a template to monitor sustainable development goals (SDG) that will improve Ekiti State development and his people. In my opinion, sometimes, what the government is calling development is not the actual development expected. They are window-dressing development.</p>\r\n\r\n<p><strong>Suggestion - </strong><em>So, I suggest with all<strong> </strong>sincerity that the electorate should select a political candidate, without biasness, who will be ready to draw an economic and sustainable development plan for action as a template for the incoming Governor and any government coming-up in the State. The development plan would always provide direction regarding knowledge of what had been done and what remains for action. If the electorate selected an aspirant whose interest deviates from Ekiti State Development Plan (ESDP), remember that your vote is assumed to be a signature of your wisdom or ineptitude which would dictate your family success or economic failure (poverty) for four solid years or more. If candidate selection is carefully done, the ESDP shall become a State economic and development manual, and a necessity to review in every 5-year interval. It is now for an electorate to demonstrate absolute wisdom to ask a direct question from the Governorship candidate: <strong>WILL YOU AS INCOMING GOVERNOR DRAW A DEVELOPMENT PLAN REGARDING EKITI STATE ECONOMY AND ITS DEVELOPMENT? </strong></em><strong>Ok</strong><em>?</em></p>\r\n\r\n<p><em>12.&nbsp; </em><strong>Data as a Development Weapon</strong> - The Incoming Governor should have the characteristic of, if not available, establishing Ekiti State Department of Economics and Statistics. Why? A country or State that lack accurate statistical data on economic and social issues, and make such data available to the expected users (people and researchers) would not miraculously transform the economy. Like parents monitor the children through data provided by teachers (examination report), economists and socialists do. Through data, development is monitored and achieved because data offer history or trend. The Department in question should be independent of the Ministry of Finance, which should be headed by a Director (Economists and Statistician are preferable). The government should make the Department publish State development bi-annually/quarterly in print (Name suggestion -The State Economic Bulletin or Ekiti State Economic Monitor, like Malaysia economic Monitor) and social media such as radio and television.</p>\r\n\r\n<p><strong>Suggestion - </strong><em>Hence, I suggest that the electorates should be wise enough to select a virtuous person who will make transparency a watchword. However, suppose voters make a mistake in the political party candidate&rsquo;s selection regarding data issue that defines transparency and monitoring the State economy, (i.e. keeping the record of what was done, how it was done and what remains to be done). Be reminded that the electorates are subjecting themselves and families to abject poverty because there will be no efficiency of governance regarding the distribution of the available State economic resources. Resources would be share at Governor&rsquo;s discretion. </em><strong>Ok?</strong></p>\r\n\r\n<p><em>13. &nbsp;</em><strong>Efficient Communication -</strong> Readiness of the incoming Governor to develop listening hears on the matter of development is a paramount concept in the development paradigm. Communication exists when the receiver understands the content of the message of the sender. Communication breaks down when there is a misconception of the idea of the message. The misconception could lead to chaos or a state of anarchy<em><strong>. </strong></em>I want to state clearly that in a KNOWLEDGE ECONOMY, information is one of the core variables.</p>\r\n\r\n<p><strong>Suggestion - </strong><em>As<strong> </strong>such, the electorates should be courageous to select someone who has human feelings in passing right information to the people because we are social beings whose behaviour changes either for good or bad. Be honest, wise and careful of your selection to have someone who will have a listening ear rather than a deaf ear to people&rsquo;s yearnings. Effective communication between the incoming Governor and the Ekiti People should be the watchword to the electorates in selecting the right person for Governorship. Otherwise, wait for four solid years of poverty and agony, maybe you will become wise later. </em><strong>Ok?</strong></p>\r\n\r\n<p><em>14.&nbsp; </em><strong>Corruption Control and Strategy</strong> - Corruption as old as man, particularly when an evil angel corruptively stole the everlasting life given to man. While I am not advocating for corruption, since the first corruption was performed, corruption has been a behaviour that occurs and reoccurs in all countries of the world. It is only the quantity and management that create the difference. Making pronunciation that the State is corrupt is deadlier than the corruption itself because it will negatively impact more on the economy than expected. Ask the incoming Governor, I mean all the aspirants irrespective of the party, to tell the people the strategy of blocking the loopholes of corruptive tendencies in governance. Fighting the past corruption is good, but the approach may look worse. It is now to ask any of the aspirants the following questions. (1) What are the corruption parameters in governance, economic, social and politics? (2) How will you assure the electorates that you will not be a corrupt Governor if elected? (3) If found having the intention (still planning) of corruption (or found corrupted) during your tenure, what should Ekiti people do to minimise the propensity for corruption? Give us your word. (4) If any of your team is found corrupt, what will you do in the interest of Ekiti People and development?<em> </em>If answers are not straightforward, then be wise, patient and careful of such candidate in your selection exercise. Whatever the response, have it in writing to keep a record.</p>\r\n\r\n<p><strong>Suggestion - </strong><em>So, I suggest that the electorates should avoid selecting an aspirant that has a corruptive tendency (in other words, a thieve), merely that he is a member of your party. When he buys his way from your negligence of having right person as a Governor, you and your family will pay for the proceeds of his corruption in four years or more. <strong>Ok?</strong></em></p>\r\n\r\n<p><em>15. &nbsp;</em><strong>Wages Problem &ndash; </strong>No doubt, the economic recession has caused a lot to the workers of the State through non-payment of salary. In distribution process, the State economy depends mainly on salary to which distribution goes to the market. Get a clear understanding of the intention of the aspirant(s) of how salary issue would be resolved. The fact that the incoming Governor should know now is the 5 &ndash; 7 months arrears of salary. What Ekiti people would revolt against is telling the people what they know and experience. Instead, the electorates should ask the political party candidates to tell the electorates what and how the arrears of workers emoluments are to be paid. Otherwise, your vote would count for your persistent poverty.</p>\r\n\r\n<p><strong>Suggestion &ndash; </strong><em>When an aspirant is using the current weaknesses (such as salary arrears) of the current government to campaign to be a Governor, tell him that we are not <strong>MUNMUN</strong> who does not know right from wrong. The facts about current and previous governments are kept in the Political Bank of Lying. Instead, the electorates need to be sure that the political party candidate of their interest answer the question of HOW? and not WHAT? In other words, HOW? provides convincing and detailed answers than WHAT? to which WHAT? is a bundle of lies in a political arena. </em><strong>Ok?</strong></p>\r\n\r\n<p><strong>Conclusion</strong></p>\r\n\r\n<p>In this open letter (Part I&amp;II), we have discussed the weaknesses of the government and stated <em>selection principles</em> as a guide to Ekiti polity. The selection principles are guides to select from the myriads of aspirants and to prepare the winning aspirant for works ahead. So, we propose to Ekiti Sons and Daughters as follows:</p>\r\n\r\n<p>(1)&nbsp;&nbsp; Though it is not easily said and done, do not choose an aspirant base on prejudice or be political and ethnicity bias. If all things being equal, avoid selecting a Governorship candidate merely because he is a member of your party, ethnic group, family and local government even when you have the absolute knowledge that he has little or no capacity to run the affairs of the State.</p>\r\n\r\n<p>(2)&nbsp;&nbsp; Select a virtuous candidate that has a passion for development, who understand the evolution of development and development stages. The person should be a <strong>LEADER</strong> and not a <strong>BOSS</strong>. As a <strong>LEADER</strong>, he should be versatile as a <strong>READER. </strong>A <strong>Reade</strong>r can be a good <strong>Leader </strong>because he acquires more knowledge and wisdom in reading but a <strong>Leader </strong>cannot necessarily be a <strong>Reader </strong>because he has characteristics of a<strong> BOSS.</strong></p>\r\n\r\n<p>Base on these conclusions, we argue that a unique thought of the electorates&rsquo; welfare, their families standard of living, the community and economic development of Ekiti State are the inherent value chains in the Selection Education Guide (SEG) provided in this open letter.</p>\r\n\r\n<p><strong>Admonition </strong>- Dear Ekiti Sons and Daughters, you are the electorates that should bear in mind the limitation of the selection principles as highlighted in Kolawole (2018). He said &ldquo;<em>in every election, politicians play on our intelligence and ride on our emotions. When they get power, they become something else&rdquo;</em>. To minimise the limitation, ponder over the selection principle stated in this open letter. Educate your children who are eligible (18 and above) to vote during the election so as to shine their eyes and open their brain for development reasoning. Consciously and constructively reason with your relatives and friends as well as social groups regarding these selection principles during the electioneering process of Ekiti State with an extension to Nigeria politics.</p>\r\n\r\n<p>Many are in the race, but only one person would receive the prize. The truth is that a person among the candidates would emerge as the Governor of Ekiti State. Only God Knows. In advance, I congratulate the unknown and yet decided candidate who will assume the number one office of Ekiti State. My prayer is for the electorate to make the balanced judgement of the aspirants to get the desired result of development. In so doing, the incoming Governor should not forget to avoid misplacement of priority in governance. He should allow Ekiti people to identify their <strong>NEEDS</strong> from <strong>WANTS</strong> through State Conference/Summit. Make research and development (R&amp;D) a robust governance instrument to reshape and rebuild the dilapidated economy of the State/Nigeria.</p>\r\n\r\n<p>Whatever the choice of the electorates, I have resolved to constructively provide developmental ideas, innovations and creativity (Sternberg, 2012) to whoever comes to the corridor of power in Ekiti, to proffer solutions to numerous problems of Ekiti people and the State Economy (e.g. youth unemployment). In summary, my concern is the happiness of Ekiti people and the State economic development.</p>\r\n\r\n<p>Further debate shall be on where we were from, where we are now and how to pursue the global SDG 2030 programme in the State. Collectively, we shall discuss what has been done, how it was done but got a failure response, what we should do and shouldn&rsquo;t be done.</p>\r\n\r\n<p>Thanks for your patience for the &ldquo;So long a Letter&rdquo;, as in Mariama B&acirc;&#39;s first novel book written in the form of a letter.</p>\r\n\r\n<p>Folorunso Obasuyi T. Obasuyi</p>\r\n\r\n<p><em>Department of Development Studies,</em></p>\r\n\r\n<p><em>University of Malaya, Malaysia.</em></p>\r\n\r\n<p><a href=\"mailto:Obasfot2017@gmail.com\">Obasfot2017@gmail.com</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>Department of Economics</em></p>\r\n\r\n<p><em>College of Education,</em></p>\r\n\r\n<p><em>Ikere - Ekiti</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>References</strong></p>\r\n\r\n<p>Connor, B. (2013).<strong> </strong>The Difference Between a Boss and a Leader. Business2Comunity &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"https://www.business2community.com/leadership/difference-boss-leader-0715675\">https://www.business2community.com/leadership/difference-boss-leader-0715675</a></p>\r\n\r\n<p>Daskal, L. (2014). Here is the difference between a boss and a leader. Business &nbsp;&nbsp;&nbsp; Insider.<em><strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></em><a href=\"http://www.businessinsider.com/heres-the-difference-between-a-%09boss-and-a-leader-%092014-9/?IR=T\">http://www.businessinsider.com/heres-the-difference-between-a-&nbsp;&nbsp;&nbsp;&nbsp; boss-and-a-leader-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2014-9/?IR=T</a></p>\r\n\r\n<p>Kolawole S (2018) Open Letter to The President: Shall We Tell the President?</p>\r\n\r\n<p>Sternberg, R. J., &amp; Lubart, T. I. (1991). An investment theory of creativity and its development. <em>Human development, 34</em>(1), 1-31.</p>\r\n\r\n<p>DESA, U. (2009). Creating an Inclusive Society: Practical Strategies to Promote Social Integration: UN.</p>\r\n\r\n<p>Independent (February 1, 2018). Economic Growth Not Linked To Electricity &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Supply -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Fashola. <a href=\"https://independent.ng/economic-growth-not-linked-%09electricity-supply-%09fashola/\">https://independent.ng/economic-growth-not-linked-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; electricity-supply-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; fashola/</a></p>\r\n\r\n<p>Kehinde, O. (2018). &ldquo;15 things Obasanjo said in his letter to Buhari&rdquo;. Daily Trust &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"https://www.dailytrust.com.ng/15-things-obasanjo-said-in-his-letter-to-buhari.html\">https://www.dailytrust.com.ng/15-things-obasanjo-said-in-his-letter-to-buhari.html</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'uploads/819658Group_1.png', 'e238t723ts7106', '04:28:24', '2018-05-24', 'n48al38p9co458rtee68i', 0, 'thumb/2796246thumb1535195458.jpg', 1, 427, NULL),
(50, 'LIVE YOUR LIFE (I)', 'Emmanuel Ojelade', 'show', '<p>LIVE YOUR LIFE (I)</p>\r\n\r\n<p>While growing up, we get &nbsp;to hear lots of feedback on our decisions, on purchases, payment methods, dress sense, school choice, lifestyle and so on, some we take seriously and others not really.</p>\r\n\r\n<p>But then,</p>\r\n\r\n<p>How about you yourself, how often do you double check the things you&#39;re told to and not to do?</p>\r\n\r\n<p>We&#39;ve all heard stories of adults complaining after working hard and not getting good returns (financially) come back to their parents saying;</p>\r\n\r\n<p>&ldquo;Dad, you do realize you&#39;re the cause of all these, because you didn&#39;t allow me study what I wanted to and forced me to study what you wanted.&rdquo;</p>\r\n\r\n<p>To be more realistic here, I&#39;ve heard on these stories more than 10 times, of students complaining their parents do not allow them study/become what they want to, prolly because of a legacy that has been laid down (generational).</p>\r\n\r\n<p>They (the parents) go like;</p>\r\n\r\n<p>&ldquo;Son/Daughter, I am your Father/Mother and you shall do what I say. (kudos to Nigerian parents though, that&#39;s when they&#39;ll start with the eulogies which will bend you against your will)</p>\r\n\r\n<p>As you know, I, Tapa Seriki, I&#39;m a well known doctor, owning lots of hospitals in the nation and beyond and if you don&#39;t become a doctor, who will take my place?So, you want to study law and tarnish the image that led you to becoming this great man/woman?No my dear, you cannot study law, you have no say in this.You just have to become a doctor&rdquo; (this occurs mostly to children from a family of 3 (a single child and parents)</p>\r\n\r\n<p>but they do not think or care less about the passion of the child, about the gift and divine knowledge of the child but decide to enforce their will on such a child.</p>\r\n\r\n<p>There is a reason why Evg. Ebenezer Obey said in his song &ldquo;If you notice a child likes to play(with) the guitar, let him, he might be the next commander (himself)&rdquo;</p>\r\n\r\n<p>which seems to mean that parents should try to encourage the children do what they love or what they are interested in(if it is moral), more than what they ourselves want us to.</p>\r\n\r\n<p>Now, the question is left to you to answer!</p>\r\n\r\n<p>So many people have been forced to agree to the fact that since they are the sole survivors of their family, they are the only ones who can continue to build the family&#39;s lineage and thereby create a mindset for themselves that they are the ones who can keep it going but then, to do that, they (most) end up neglecting themselves (their true potentials, their real talent, their true call), just because they think it is better to keep the family&#39;s lineage in order.</p>\r\n\r\n<blockquote>\r\n<p>parents should try to encourage the children do what they love or what they are interested in(if it is moral), more than what they ourselves want us to.</p>\r\n</blockquote>\r\n\r\n<p>So many have lost it in life because of this simple factor, they want to do their parent&#39;s wish and when some discover that they cannot, they get frustrated some even go to the extent of hurting themselves or doing worse things.</p>\r\n\r\n<p>You can imagine someone who might have been a great physicist, had great compassion/flair for studying scientific tools, making outstanding world-building thesis and so much more, might have been a great asset to the country and the world in all, but being forced to study Law because Dad&#39;s a lawyer and Mum is as well.</p>\r\n\r\n<p>She had to study law and was forced to become one,this unfortunately caused her to lose her flair for scientific matters, but layer on she ends up discovering that her life isn&#39;t for Law but Science (Physics)!</p>\r\n\r\n<p>You can imagine how she&#39;ll feel, so many people live with this everyday of their lives, the fact that they lost it due to the talks they allow into them, through people, circumstances and others situations.</p>\r\n\r\n<p>Now, back to you!</p>\r\n\r\n<p>Has this occurred to you before?Have you had something you really want to do?Have you had a flair for architecture, drawing, tailoring, shoe making and so much more?</p>\r\n\r\n<p>Were you stopped just because they think these things are irrelevant?</p>\r\n\r\n<p>What did you do?</p>\r\n\r\n<p>Did you too agree after being cajoled for a while?I always tell people who come to me with this;</p>\r\n\r\n<p>&ldquo;YOUR PARENTS ARE NOT GOING TO LIVE YOUR LIFE, THEY&#39;LL LIVE THEIRS AND DIE, THEN YOU&#39;LL BE LEFT WITH YOURSELF!ARE YOU PLANNING TO LIVE FOR THEM TILL THEN?IT MIGHT BE TOO LATE&rdquo;</p>\r\n\r\n<p>It&#39;s quite simple to break from these</p>\r\n\r\n<p>1. Let your parents know your reason for wanting to do that which you&#39;ve chosen and not what they want.</p>\r\n\r\n<p>2. It&#39;s your life, politely tell them&nbsp;that! (I said politely ooo, if you do it wrongly and get slapped, I wouldn&#39;t be held responsible)</p>\r\n\r\n<p>3. Make a deal with your success (The hardest part)</p>\r\n\r\n<p>P.S: This is not in any way to meant disrespect to the parents, they just do these things to make their children have what they (parents) think is best for them (the children), but to implore them to enable their kids get the best of themselves while they still can.</p>\r\n\r\n<p>From a friend that loves you,</p>\r\n\r\n<p>&copy;Emmiasky Ojex</p>', 'uploads/420731431381173_180266472625140_1106973712546004992_n.jpg', '36au8m1elEn53m8538', '13:54:51', '2018-06-26', 'e982ca1tleir6l63v7i16', 0, 'thumb/207475thumb1535127550.jpg', 0, 453, NULL),
(52, 'HELLO DEAR FRIEND', 'Emmanuel Ojelade', 'show', '<p>Hi, it&rsquo;s your friend</p>\r\n\r\n<p>Yeah, your longtime friend</p>\r\n\r\n<p>The one whom you thought our relationship has come to an end</p>\r\n\r\n<p>Just because we are now on planet earth&#39;s different end</p>\r\n\r\n<p>I just wanted you to know that I still care</p>\r\n\r\n<p>and thought it&rsquo;d be nice of me to start another relationship trend</p>\r\n\r\n<p>with you, my longtime friend</p>\r\n\r\n<p>surely, you&rsquo;ll have made numerous others but, trust me, we are not them</p>\r\n\r\n<p>Since you decided not to call</p>\r\n\r\n<p>I realized we&rsquo;re both so busy that our time for old friends is none</p>\r\n\r\n<p>But not us, we&rsquo;ve got a special bond</p>\r\n\r\n<p>So I decided to, with this message, make a call</p>\r\n\r\n<p>I miss you and those times</p>\r\n\r\n<p>Surely, we can&rsquo;t reverse it yet it&rsquo;s fine</p>\r\n\r\n<p>At least I can still hold your hands and my cheek will form a smile</p>\r\n\r\n<p>Or are we already too old for that?</p>\r\n\r\n<p>Hello friend</p>\r\n\r\n<p>We&rsquo;ve been through so much</p>\r\n\r\n<p>Life&rsquo;s hurdles and many more</p>\r\n\r\n<p>Here, we don&rsquo;t know whether we&rsquo;ll live so long</p>\r\n\r\n<p>To meet at that time we envisage in the future</p>\r\n\r\n<p>So while we still can, let&rsquo;s catch have some fun</p>\r\n\r\n<p>Life is a journey and not a race</p>\r\n\r\n<p>We all emanated from a starting phase</p>\r\n\r\n<p>And will end up going to different places</p>\r\n\r\n<p>The point is, live well in the moment</p>\r\n\r\n<p>and quit chasing that which isn&rsquo;t really needed,</p>\r\n\r\n<p>make friends and let&rsquo;s live fully till our ends.</p>\r\n\r\n<p>From a friend that cares</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&copy;Emmiasky Ojex</p>', 'uploads/2878109dear_friend.jpg', '36au8m1elEn53m8538', '13:04:24', '2018-07-04', '716alorei8tlle172c6h47', 1, 'thumb/679807thumb1535127536.jpg', 0, 529, NULL),
(56, 'The Untold Story', 'ADEMIJU SOLOMON', 'show', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp; It was the night of your 21st birthday celebration and you had stayed up all night for 12:00a.m to beep on your phone to see his birthday wish for another year in the history of your life but this year was different, he didn&#39;t message or call you like previous years and you had thought maybe he is only playing the heart games with you as he has always does but it was different this time, you were getting scared that he will never be the first person to wish you happy birthday again and it was true after all, he left without saying a word.</p>\r\n\r\n<p><br />\r\n&nbsp;&nbsp; You met victor during your 100level days in the university, as a young matriculant, you were energetic and full of life. You had gone to a friend&#39;s birthday bash when you burp into this cute and charming guy who never showed interest in blaming you for mistakenly pouring your drink on his expensive clothe while you were busy chatting your ass out with a friend at the bar man stand. You wet his clothe and he never said a word or showed any form of anger or embarrassment but instead he smiled back at you patting your back that every thing is okay and you couldn&#39;t get your eyes off him throughout the party.</p>\r\n\r\n<p>Days went by and weeks followed, you kept checking up all guys on campus to see if anyone of them looks like your crush but you never saw him again not until when you saw his pics on Instagram with a bunch of friends cruising at the beach. You were so engrossed with his Instagram post and you two soon became good friends on social media before sealing your friendship with a first date at one of the nicest restaurant in lekki. He was every Lady&#39;s dream as he is fulfilled in all his life endeavors and you had thought you are the only thing left to make his life complete.</p>\r\n\r\n<p><br />\r\n&nbsp; He never stopped lavishing you with expensive gifts and dinners. He was so nice and real but he never told you the story of how ended up being the only surviving child of his wealthy parents.</p>\r\n\r\n<p>Your love story was the perfect love story every lucky girl would always dream of, the forehead kiss, the passionate and deep conversations and the loving make up sex were experiences you couldn&#39;t wave away without taking a glance back. He had promised to make your 21st birthday celebration the best you had ever celebrated and you believed him because he was a man of his words. He planned everything to your taste and expectations but it was suppose to be a surprise even after having a little disagreement with him two days before the big day he never relent on his promise to put a flawless smile on your face on your big day.</p>\r\n\r\n<p>You called his number the following day after waiting to no avail of his loving text message on your birthday with the aim of ranting at him for putting your conflict before your relationship and not wishing you a happy birthday on your new journey to another year only to be told that he died the night before of vaso occlusive crisis resulting from his sickle cell status. He never told you the story behind his health status and left without giving you the perfect birthday gift he promised.</p>\r\n\r\n<p>It was the night of your 21st birthday celebration and you had stayed up all night for 12:00a.m to beep on your phone to see his birthday wish for another year in the history of your life but this year was different, he didn&#39;t message or call you like previous years and you had thought maybe he is only playing the heart games with you as he has always does but it was different this time, you were getting scared that he will never be the first person to wish you happy birthday again and it was true after all, he left without saying a word ****************** You met victor during your 100level days in the university, as a young matriculant, you were energetic and full of life. You had gone to a friend&#39;s birthday bash when you burp into this cute and charming guy who never showed interest in blaming you for mistakenly pouring your drink on his expensive clothe while you were busy chatting your ass out with a friend at the bar man stand. You wet his clothe and he never said a word or showed any form of anger or embarrassment but instead he smiled back at you patting your back that every thing is okay and you couldn&#39;t get your eyes off him throughout the party. Days went by and weeks followed, you kept checking up all guys on campus to see if anyone of them looks like your crush but you never saw him again not until when you saw his pics on Instagram with a bunch of friends cruising at the beach. You were so engrossed with his Instagram post and you two soon became good friends on social media before sealing your friendship with a first date at one of the nicest restaurant in lekki. He was every Lady&#39;s dream as he is fulfilled in all his life endeavors and you had thought you are the only thing left to make his life complete. He never stopped lavishing you with expensive gifts and dinners. He was so nice and real but he never told you the story of how ended up being the only surviving child of his wealthy parents. Your love story was the perfect love story every lucky girl would always dream of, the forehead kiss, the passionate and deep conversations and the loving make up sex were experiences you couldn&#39;t wave away without taking a glance back. He had promised to make your 21st birthday celebration the best you had ever celebrated and you believed him because he was a man of his words. He planned everything to your taste and expectations but it was suppose to be a surprise even after having a little disagreement with him two days before the big day he never relent on his promise to put a flawless smile on your face on your big day. You called his number the following day after waiting to no avail of his loving text message on your birthday with the aim of ranting at him for putting your conflict before your relationship and not wishing you a happy birthday on your new journey to another year only to be told that he died the night before of vaso occlusive crisis resulting from his sickle cell status. He never told you the story behind his health status and left without giving you the perfect birthday gift he promised.</p>', 'uploads/9633523IMG-20180730-WA0016.jpg', 'oo651n61l7m725so1', '20:38:15', '2018-08-01', 'r8l44cite21te011ah28', 1, 'thumb/3480941thumb1535126965.jpg', 0, 513, NULL),
(57, 'SOUNDS OF SILENCE (No To Rape)', 'Emmiasky Ojex', 'show', '<p>SOUNDS OF SILENCE</p><p>NOT RAPE</p><p>&nbsp;</p><p>So she turned your request down</p><p>And your talk was \"You shall see\"</p><p>thus a plot was laid, by you and your accomplice to do the devil\'s bid, rape the innocent lady who is supposedly arrogant for not replying you when you beckoned on her \"heyz, fine girl\"</p><p>She was like, \"what the?\"</p><p>You proceeded to draw her by the waist, and \"Slaam\" on your face landed a slap by the petite you wanted to befriend for her massive waist and great chest.</p><p>Okay, let\'s say she disgraced you for being so ill-mannered and calling a campus girl in such tosh manner, and proceeded to slap you, Oga Scorpion (gbogbo Uniben) for trying to sexually harass her.</p><p>&nbsp;</p><p>The next thing to do was RAPE her to TEACH HER THE LESSON OF HER LIFE</p><p>&nbsp;</p><p>The plan was carried out after lectures; you, who is in school not to learn but to cause ruckus had assembled guys to go bundle her; like sticks from her dorm and into the bush, where the deed to show her who\'s boss is to be carried out</p><p>After several threats from her to report you to the police station and have you and your gang arrested, a little-two slap maimed her and you; Master of Ceremony opened your zip and went in with the subconscious lady.</p><p>Twenty minutes of agony for my dear sister, that would get stuck in her head forever</p><p>\"Please, please, please\", you loved to hear those words from your taunted prey</p><p>\"Next time, you will never slap a scorpion and not expect it to sting you, this is my sting\",was what your reply sounded like and you and the guys all laughed hysterically, proud to be instigators of misfortune for \'gbogbo biz girls\'</p><p>&nbsp;</p><p>Next? you barked!</p><p>&nbsp;</p><p>Thus the gang gathered together to all take a share of the NATIONAL CAKE, a fresh product of Uniben whose life would never remain the same from that day onward.</p><p>Take your turn and enjoy what Baba left for us to enjoy, bro</p><p>Don\'t be a coward, you may never enjoy such fresh product anymore in your life, they whined as they took rounds on my dear sister.</p><p>&nbsp;</p><p>A day of pain, who to tell?</p><p>&nbsp;</p><p>Off to the police station, two weeks after recuperating in the hospital, she goes to make enquiries on the RAPE CASE her friends had gone to file earlier</p><p>&nbsp;</p><p>What were you putting on that fateful day?</p><p>Was it a miniskirt?</p><p>Was it a designer clothing?</p><p>Were you on crop tops?</p><p>Who are your witnesses to this?</p><p>Were you able to recognize the guys?</p><p>Did you offend them prior to that date?&nbsp;</p><p>all these and more were the questions postulated by the officer who obviously had taken no turn as regards your report.</p><p>&nbsp;</p><p>Is this life?</p><p>Is this fair?</p><p>Such question grow wings in her head and she is forced to talk!</p><p>&nbsp;</p><p>For days, she cannot eat, talk nor learn</p><p>&nbsp;</p><p>It takes more than just the sex!</p><p>&nbsp;</p><p>It\'s emotion, it\'s trauma, it\'s a man-made curse, it\'s a physical ghost that torments her every time,</p><p>She has to be shy, she has to be withdrawn from guys, she has to hate menFor she was hurt by one of them, a scorpion that stung her.</p><p>She will forever bear that in her mind and will never let go.</p><p>&nbsp;</p><p>From a friend that cares,</p><p>-The boy</p><p>&nbsp;</p><p>NO TO RAPE CULTURE</p>', 'uploads/3168935No_to_rape.jpeg', '36au8m1elEn53m8538', '11:25:09', '2018-08-08', '82n0ao7r9tudc1344l7ises', 1, 'thumb/4977375thumb1535126952.jpg', 0, 676, NULL),
(58, 'Why did she lie?', 'ADEMIJU SOLOMON', 'show', 'Imagine what we want in life is a brighter future and not depression.\r\nThese were his thought before dozing off after being injected with\r\nanother round of tranquillizing medication.  He has been locked up in\r\na God knows where mental rehabilitation centre for like four to five\r\nweeks now and he still couldn\'t think straight why that should be the\r\nnext point of action in his life. He looked depressed and opposite of\r\nwhat he was in his former life.  He wished he had never met that\r\npsycho Vivian girl. She ought to be the one tied to the hospital bed\r\nand not him. He knew nobody would hear him out but he won\'t stop\r\ncausing destiny for selling him out to a cheap liar like the girl that\r\nsent him to a rehab.  He hadn\'t recover from the effect of the\r\nmedication he was given before dozing off when the bell rang for\r\nmorning prayer and he mustn\'t miss the sermon if That\'s the only thing\r\nthat can change him and give him another opportunity to lead a better\r\nlife. He likes the Reverend father that preaches at the morning mass,\r\nhe is not a black man like him and this is why he loves his sermon\r\nfrom heaven come to earth.  He takes life so easy and talks about\r\nheaven like he has been there before. He knew his late father will be\r\nangry with him for believing a white man fairy tale but it\'s better\r\nthan that of those black holyghost fire men in his village.\r\n\r\nShe lied about every thing to him except her unending love for him.\r\nHe was too young to know the true meaning of love when he met Vivian.\r\nThey both started as secondary school friends before they grew to live\r\nwithout eachother. He loved her so much that he couldn\'t even hide his\r\nemotional feeling for her from the little cat in his father\'s house.\r\nEvery body knew he was in love even his old grandmother who wasn\'t\r\nborn in the 21st century will always fabricate stories of how he met\r\nhis grandfather and that\'s the part that pisses him off about falling\r\nin love, every body always has a story to tell about their love life.\r\nHe had grew to love Vivian like his own blood and flesh even when he\r\nknew he could win the heart of other ambitious and pretty girls on\r\ncampus during his days at the university,  he had stayed with her\r\npatiently and tolerated her melodrama most of the times believing all\r\ngirls were born with various forms of hidden temper in them.\r\n\r\nAfter eight years of their ruff and tumble relationship, he decided to\r\ntie the knot with her and be the lucky man in her life.  They had\r\ngotten married in a grand style and their wedding was the talk of the\r\ntown for some months.  He was already working with one of this fast\r\nrising telecommunications company that had just arrived the country\r\nand the pay was good for a young bachelor turned family man. He\r\ncouldn\'t afford to lose his job but he needs to be there for his newly\r\nwedded wife as well.  He was promoted at work within a short time and\r\nhe too began to keep late at night in the office.  Most times he\r\nhardly even eat anything because he was always busy.  He had set up a\r\nmini deport shop for his wife and stocked it with various imported\r\ngoods but That\'s not enough to keep a home his instinct would always\r\ntell him but he couldn\'t leave what he loves doing for who he loves.\r\n\r\nHe had gotten home several times and met his wife drunk but he\r\nbelieves it\'s one of those things rich people do when their money is\r\nmore than their problem.  He is rich and well fulfilled, so what makes\r\na man if not waelth and fame. He had always tried to avoid\r\nconfrontation from his wife concerning their marriage but he could\r\nescape this last one which led him to the asylum....', 'uploads/8302281IMG-20180805-WA0014.jpg', 'oo651n61l7m725so1', '06:21:58', '2018-08-11', '699ia249w8ch5eytr5l3', 1, 'thumb/5509597thumb1535126127.jpg', 0, 379, NULL);
INSERT INTO `blog` (`id`, `title`, `author`, `visibility`, `body`, `image_1`, `created_by`, `time_created`, `date_created`, `hash_id`, `about`, `thumbnail`, `notification_status`, `rcount`, `category_id`) VALUES
(60, 'Midnight language', 'Nueta\'s lens', 'show', '<p>&nbsp;</p><p>&nbsp;</p><p>I laid down in pretend sleep just to watch her silhouette tell me stories</p><p>&nbsp;I felt frustrated to be gracious but I\'m too tough to whisper</p><p>&nbsp;On this day, my blue sun has kissed my yellow moon and I\'m down in the mouth&nbsp;</p><p>I am the weakest myth alive, I\'ve absolutely nothing to fight for&nbsp;</p><p>My life isn\'t mine to live anymore so I become unoriginal&nbsp;</p><p>Open your portal, let me connect, only the right current I promise&nbsp;</p><p>All of these, that small voice in my heart, something else becomes my mind&nbsp;</p><p>Stay away!! all I have is an anthology to offer</p><p>&nbsp;</p><p>&nbsp;</p>', 'uploads/9090945IMG_20180813_191011_150.JPG', 'a0e6t2s228-4nu933', '10:47:37', '2018-08-13', 'r4ca4gi9i3d23ltht051enim4', 1, 'thumb/1106216thumb1535125686.jpg', 1, 480, NULL),
(61, 'WHY AM I AFRAID?', 'Isiaq Kamaldeen', 'show', '<p>That is the question, people are afraid for different reasons best know to them but in this manuscript we are to lay emphasis on general reasons</p><p><strong>WHY AM I AFRAID?</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; My brethren we do not need to be afraid, the people we face everyday are not impeccable none of them are infallible.</p><p>Imagine we cannot even face people of our clan where we are to speak our mother tongue WHY? This is disheartening.</p><p>Public speaking is what all students in the world should prepared for [extemporaneous], we are to be the leader of tomorrow</p><p>Sometimes we are to be a talkative to gain courage, we should relate with people in another tribe to learn more, Being afraid is what led our predecessor to slavery, frightening does any good.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; According to one of my articulate lecturer. Mr. POPOOLA he said and I quote in an unjust society silent is a crime we can never free from bondage if we are drown in the sea of despair.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In my own field risk taking is one of our attribute, if we are free from English government and we are not free from fear, we are still in personal bondage. However, Do not be colonized by Fear</p><p>the greatest fear is fear itself</p>', 'uploads/3425852Why-Am-I-So-Afraid_screen.jpg', '481q21454i8ais9', '08:35:04', '2018-08-17', '83ah4le9t60cryw7i474', 1, 'thumb/5337879thumb1535125579.jpg', 0, 411, NULL),
(62, 'SILENCE', 'Isiaq Kamaldeen', 'show', '<p>Important of silence</p><p>Be silent in the heat of anger</p><p>Be silent when you do not have all the fact</p><p>Be silent if your words will offend the weaker person</p><p>Be silent when you are tempted to joke with sin</p><p>Be silent if you will be ashamed of your words later</p><p>Be silent if your word will convey the wrong impression</p><p>Be silent if your word will damage someone else reputation</p><p>Be silent if you have already said it more than one time</p><p>Be silent when you are tempted to flatter a wicked person</p><p>Whoever guards his mouth and tongue keeps his soul from troubles.</p><p>Talk when your words are beautiful than silence.</p>', 'uploads/5714539silence_title_image-624x351.jpg', '481q21454i8ais9', '10:48:37', '2018-08-17', 'lsc4e4c4i34ee3rnia6lt000', 1, 'thumb/1357001thumb1535125562.jpg', 0, 396, NULL),
(63, 'I Am A Woman, Something Not Everyone Knows How To Love', 'Tebohroger', 'show', '<p>A response to For women who are difficult to love by Warsan Shire</p><p>i am terrifying and strange and beautiful, something not everyone knows how to love</p><p>i am a woman, something not everyone knows how to love</p><p>i am a woman i am someones someone but no, no i am so much more, more than someones someone i am someone im someone independent of all the other someones</p><p>i am a woman ive tried to close my mouth more for another someone tried to be softer less volatile less awake but no, my mouth is meant to bite to talk over those who talk over me and my awakeness is permanent not to be drugged by someone elses needs</p><p>i am a woman i am a slut, a whore, a cunt no me importa i dont mind to be someones play thing in bed i have the power to choose to my shades i like to but no, the play isnt play after being called a bitch, a twat, a wench, en serio after serving as ones punching bag in real life i cannot enjoy being a fake one in another</p><p>i am a woman i am someones punching bag but no, i am so much more than that i am a girlfriend no, no i was a girlfriend i am no more, independent of that someone</p><p>i am a woman i am someones victim but no, i was someones victim, fue i owed him, he said he blocked the door i couldnt find my shoe my damn shoe he asked in the morning that i wouldnt say anything</p><p>he moved on me he just started kissing me it was like a magnet he didnt even wait he was a star, a very dim one so he thought he could do anything maybe it was because this was his locker room talk his football locker room talk and, it was because he is a rapist</p><p>i am a woman i am someone i am now forever awake.</p>', 'uploads/3399160IMG_20180817_155146_774.JPG', 'j90819542aBn72ii', '14:56:01', '2018-08-17', 'aeti036c34i4r3l704', 2, 'thumb/3576202thumb1535125551.jpg', 0, 600, NULL),
(64, 'SHADOWED', 'EVELYN GABRIELLA', 'show', '<blockquote>\r\n<p>People can go&nbsp; a long way just to dim your light because it shines brighter than theirs. Just look away.</p>\r\n</blockquote>\r\n\r\n<p>Your light is a blessing. Appreciate that which you have, don&#39;t compare yourself to others. What if someone else&#39;s light is bright but won&#39;t last long because it uses more power than it is capable of?</p>\r\n\r\n<p>What if yours will last a lifetime because it is dimmer and shines according to it own timeline and pace?</p>\r\n\r\n<p>Some do not have a light at all to start off with.</p>\r\n\r\n<p>Here you are, appreciating what you have, huhn?</p>\r\n\r\n<p>Take a break!</p>\r\n\r\n<p>This light you so crave won&#39;t shine until the time is right. So whatever time you have, live it out.</p>\r\n\r\n<p>Live it as if its the only one you&#39;ve got.</p>\r\n\r\n<p>Cherish the little things of life. Make yourself happy.</p>\r\n\r\n<p>I tell you your happiness doesn&#39;t depend on anyone, be it a man, a woman, a boyfriend or girlfriend, or even your parent or children.</p>\r\n\r\n<p>Happiness comes from within. You can&#39;t give what you don&#39;t have. Be happy, and you will see your light shine bright Nd shine through.</p>\r\n\r\n<p>At the end, you will be contented because the light will finally reach your corner and you will no longer be <strong>SHADOWED</strong></p>', 'uploads/7161664IMG_20180806_155111.jpg', 'oe02k21a41l3580', '09:32:20', '2018-08-19', '6sdea4t9e4w2i5da8r2oc9h7l', 1, 'thumb/6595058thumb1535125540.jpg', 1, 540, NULL),
(77, 'BECOMING EIGHTEEN', 'Emmiasky Ojex', 'show', '<p>Now I can go to jail</p><p>Have for myself, a bad name</p><p>If I take the wrong steps</p><p>And follow evil men</p><p>&nbsp;</p><p>One that I would carry with me for the rest of life, in shame</p><p>One that would follow me till I join my brothers in Hades</p><p>I fear for I will soon be leaving the teens</p><p>But no worries, for I am still a kid to Him</p><p>&nbsp;</p><p>Now I can serve life imprisonment</p><p>For murdering a soul whether I did or did not, since I was there</p><p>Now I am a man</p><p>What will I grow up as?</p><p>&nbsp;</p><p>A bad or a good one?</p><p>I do not know and can not say what I want</p><p>For the world is all wrong</p><p>And what they see as good is actually not</p><p>&nbsp;</p><blockquote><p>Now I am a man</p><p>What will I grow up as?</p></blockquote><p>&nbsp;</p><p>I am becoming eighteen</p><p>I will no longer be known as a teen</p><p>But an adult</p><p>Who would learn from people and life, all sorts</p><p>&nbsp;</p><p>Welcome to the world, son</p><p>Say this to me for</p><p>all I did in the past was learn</p><p>Now weve gotta put what we learnt to fend for ourselves</p><p>&nbsp;</p><p>In this market of life,</p><p>Weve gotta struggle to not get behind</p><p>Lifes gonna move on whether we like it or not</p><p>Whether or not we want it to be solved.</p><p>&nbsp;</p><p>Now I know no thing,</p><p>Yet, I plan to and will learn every thing</p><p>All I wish to happen, I will do them</p><p>And not like them, complain rather than make wishes real.</p><p>&nbsp;</p><p>I am and will always be ME,</p><p>May He help me.Amen.</p><p>&nbsp;</p><p>Emmiasky Ojex</p>', 'uploads/3919604IMG_2611.JPG', '36au8m1elEn53m8538', '12:54:03', '2018-08-23', 'erble7ncct452go7a6i3i30m4', 1, 'thumb/764691thumb1535117394.jpg', 1, 371, NULL),
(78, 'Is Education Actually a Right In Nigeria', 'Peter Oyebanji', 'show', '<p>The debate whether education is a right or a privilege is dying with much speed to say the least, you hardly see anyone come out to yarn about how education is a privilege as against the popular belief that it is a right. How did it start at first? Because it&#39;s even factual, as there is a provided article for it in the United Nations Universal Declaration of Human Rights. Article 26 of the declaration states:<br />\r\n(1) Everyone has the right to education. Education shall be free, at least in the elementary and fundamental stages. Elementary education shall be compulsory. Technical and professional education shall be made generally available and higher education shall be equally accessible to all on the basis of merit.<br />\r\n(2) Education shall be directed to the full development of the human personality and to the strengthening of respect for human rights and fundamental freedoms. It shall promote understanding, tolerance and friendship among all nations, racial or religious groups, and shall further the activities of the United Nations for the maintenance of peace.<br />\r\n(3) Parents have a prior right to choose the kind of education that shall be given to their children.&nbsp;<br />\r\nThis is clear enough. This is how it should be, but is this how it is?&nbsp;<br />\r\nFine, it&#39;s actually true that most countries do not meet this standards. In fact, only about six (6) countries in the world run free education in the tertiary level. United States of America is among the top five countries in the world that charge the highest fees in public colleges, only in elementary stage is public education free in USA. Considering the economy system and statistics that have shown how some Americans find it difficult to bag a degree due to high costs, you can conclude that education is not affordable there. If education isn&#39;t affordable, is it still a right? Well, may be to some extent but at least they are not far from the human rights declaration.&nbsp;<br />\r\nWhat other countries know about the situation of education in Nigeria is what they see, what they see is statistics. The statistics are terrible enough but ask an average Nigerian that has passed through or is in the system, you will wow at the level of rottenness in the country&#39;s education system. If the statistics are terrible, what will an indepth analysis look like? Sigh.&nbsp;<br />\r\nWe currently have the largest number of out-of-school youths. We have the 7th largest population in the world of more than one hundred and ninety (190) million people, United States is the third with a population of more than three hundred and twenty five (325) million people. United States has over 2000 colleges while we don&#39;t have up to 500 tertiary institutions. The thing here is the govt doesn&#39;t see this as a paramount issue as just 7 percent was allocated to the education sector in ths year&#39;s budget. Other countries are working towards making education in all stages affordable and meeting the UNESCO standard, Nigeria is working towards making the privilege one-sided. With the recent trend about increase in school fees of public universities, we can start picturing a scene where the poor won&#39;t be able to attend public universities in the country.&nbsp;<br />\r\nAn average Nigerian is being forced to think he is privileged&nbsp; to be a secondary school graduate. To pass examination is even a privilege, for example: to pass WAEC (West Africa Examination Council), you have to have a parent who can afford to pay for private schools&#39; centres&nbsp; where examination malpractice is staggering. The unexplainable rate of failures in public schools is untackled, which makes some students abandon their dreams after much tries. The fee to register for the examinations in private schools is more than the country&#39;s minimum wage. Is that close to being a right?&nbsp;<br />\r\nThey&#39;ve been investigative reports about the ingrained corruption in universities, the most recent one i have read is how the management of Obafemi Awolowo University, a foremost school in the country mismanaged the needs assessment fund provided by govt. Things like this don&#39;t get attended to by the govt. To pass examinations nowadays does not depend on how intelligent or prepared you are, you have to be privileged to have lecturers who want to have sex with you to pass an exam you didn&#39;t fail in the first place.&nbsp;<br />\r\nWe are a developing country. I don&#39;t expect the same number of tertiary institutions as it is in the United States neither do I expect zero tuition fee in our institutions just like Germany. We have the resources to achieve these standards, a kindly reminder that students in our public institutions once enjoyed free meals.&nbsp;<br />\r\nThe main reason for this article is to make known that the state of education in Nigeria is far worst than what the statistics show and our energy should be channeled into fixing the education sector instead of jumping a lot of hurdles to talking about free tertiary education. There are lots of problems listed in this article, a country that has these problems should be aiming to fix its education sector not allocating seven (7) percent of its budget to the department.&nbsp;<br />\r\nAs much as all Nigerians want education to be free in all stages, it should be done systematically. Realistically, we can&#39;t achieve that with our current system. It takes a lot of changes from the the top to the bottom. Germany personal income tax is almost up to fifty (50) percent, tho Germany&#39;s minimum wage is not fifty (50) dollars. Over half of Nigerians don&#39;t even pay income tax, what does that portray?&nbsp;<br />\r\nPutting into consideration how the management of universities that should know better treat students, you will think we should still be debating if freedom of speech is actually a right or a privilege.&nbsp;<br />\r\nPeter Oyebanji is a campus journalist at Obafemi Awolowo University and can be reached through Gmail: adewuyipeter50@gmail.com&nbsp; &nbsp; Twitter: @anderpeter2&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'uploads/706449WhatsApp_Image_2018-08-22_at_7.30.08_PM.jpeg', '8e1t86er265564P', '13:08:34', '2018-08-23', '7acr25li27146i25set', 1, 'thumb/8819818thumb1535117389.jpg', 0, 425, NULL),
(79, 'PASSION', 'EVELYN GABRIELLA', 'show', '<p>When people talk about passion, what comes to mind is pleasure and satisfaction. It is true but passion is more than that.</p>\r\n\r\n<p>The dictionary meaning of pleasure means: strong, great, powerful emotion, especially romantic love or hate.</p>\r\n\r\n<p>Another meaning states: fervour, determination e.t.c</p>\r\n\r\n<p>But I will be concentrating on the second meaning.</p>\r\n\r\n<p>I am writing this article so that people won&#39;t get confused and later on regret in their future.</p>\r\n\r\n<p>When we were young, it was instilled into us that the best legacy a parent can give to their child is education. It is indeed true. And today, I will be allowing you a sneak peak into a young girls life.</p>\r\n\r\n<p>There&#39;s this young girl named Nina. She is the only female child in a family of four. She has always sought her parents approval in everything she does especially that of her mother.</p>\r\n\r\n<p>At a very young age, she developed the art of making people&#39;s hair. She has always looked forward to the day she will perfect her craft and proceed in this craft.</p>\r\n\r\n<p>She has always dreamt of been successful but never for once has this dream consist of anything related to education. She has always found herself in a shop making people&#39;s hair and through that became a successful woman.</p>\r\n\r\n<p>Her family is made up of elites. Her mum is a lectural, the first born of the family has two degrees, the second two certificates and the the third, a certificate and a programmer.</p>\r\n\r\n<p>Her mother has always been proud of her brothers. And she didnt want to make her mother furious and disappointed so kept her dream yo herself. The determination not to disappoint her mother pushed her forward in her education always aiming to be the best.</p>\r\n\r\n<p>Indeed, she was. She passed WAESSC without a single blotch. She passed excellently that she didn&#39;t even bother to check her NECO result.</p>\r\n\r\n<p>She waited two years before she got an admission into the university and as usual, the determination not to disappoint her mother still pushed her forward in her education.</p>\r\n\r\n<p>But on getting to the university, everything changed.</p>\r\n\r\n<p>This is not because she joined a bad gang or because she name wayward. No. She wasn&#39;t any of those things. Infact, she was an introvert. She doesn&#39;t have friends, doesn&#39;t party, doesn&#39;t drink. She stays in her room reading both academic books and novels.</p>\r\n\r\n<p>But there&#39;s a little difference.</p>\r\n\r\n<p>The fire is no more there. She reads and read but when the result comes out, its nothing to write home about. The determination not to disappoint her mum is still there, but its not urging her forward in her education like before.</p>\r\n\r\n<p>All that comes to her mind now is the very same dream she buried inside of her.</p>\r\n\r\n<p>In her third year in the university, she could bear it anymore and the fact that she doesn&#39;t like the course she was given one bit complicated matters.</p>\r\n\r\n<p>Upon seeing her results, she wasn&#39;t sure she would make it into 400l but as usual, she keeps a positive mind but the difference there now is she regrets.</p>\r\n\r\n<p>She regrets not telling her mum what she wanted to become.</p>\r\n\r\n<p>She regrets pursuing even when she knows her passion doesn&#39;t lie in what is was doing.</p>\r\n\r\n<p>Most people in the world her like Nina. They pursue their parents dream for them but forget about their own dream for their life.</p>\r\n\r\n<p>They&#39;ve forgotten that their parents are only playing their role. They allow family members to steer them what they never wanted.</p>\r\n\r\n<p>They live peoples dream while theirs lies forgotten in their mind. Some are not even like Nina who couldn&#39;t cope. Some made it, graduating in flying colours but never happy nor were they satisfied.</p>\r\n\r\n<p>I am sure if Nina developed the courage to tell her mother, she would have understood. Even though she might av been angry but I was sure, she would have gotten over it with time. But now, Nina stays in her crying because she doesn&#39;t have the heart to show her mum her results.</p>\r\n\r\n<p>Don&#39;t be like Nina. Chase your dreams. Anchor your own future. Receive guidance from your parents and family but never let them coerce you into living their dreams.</p>\r\n\r\n<p>Some will tell you they want 1st class honors from you because they couldn&#39;t get it. Some will want you to study a course because it was their dream course but they couldn&#39;t stugy it while some demands these things because they want you to be successful but they&#39;ve forgotten you&#39;re the only one responsible for your future</p>\r\n\r\n<blockquote>\r\n<p>TAKE CHARGE TODAY. BE THE CAPTAIN OF YOUR OWN SHIP. INDULGE IN WHAT YOU HAVE PASSION IN. SO THAT YOU WONT REGRET IN THE FUTURE. BUT AMONG ALL, INVOLVE GOD.</p>\r\n</blockquote>', 'uploads/4307300IMG_20180825_120332_965.JPG', 'oe02k21a41l3580', '06:22:49', '2018-08-25', 's526n1trso6a9pa30ieil5c2', 1, 'thumb/2818832thumb1535195399.jpg', 1, 439, NULL),
(80, 'ACCIDENT', 'OLUWAGBEMIGA AYOMIDE MOSES', 'show', '<h2>REASONS WHY MOST VICTIMS OF ACCIDENTS SUSTAIN FATAL INJURY</h2><p>&nbsp; &nbsp; At the mere thought of accident, its almost certain that an injury will be sustained.. Most fatal accidents are caused by the victims themselves but the perspective of the masses in accident is that drivers are always at fault. &nbsp; &nbsp;Myself have also been stocked by this ill thought that drivers are always at fault for any accident but my personal sentiment saved me as I looked and observed the happenings in our environment.. I got to know that most victims of accident have been unconsciously caught by sleep before the accident, not all become unconscious after the incident.In a case where a passenger sleeps off as soon as he or she board a vehicle,you can imagine how a totally relaxed person can struggle for survival..Of course everyone doesn\'t sleep when traveling as we have those who are scared of the unknown and those who are anxious to get to their destination, these are the conscious ones but most of them don\'t strife to survive first during an accident, they mostly put their treasures and other valuables first, \'oh what foolishness \'.I don\'t know how many years its gonna take humans to understand that \"it is only when you have life in you that you have the right to own a property\" &nbsp; For instance,I saw a man sleeping on an opened carrier of a truck,this man might be tired or maybe he could just feel like taking a nap buh definitely shouldn\'t be &nbsp;on a moving truck which has its carrier loaded with tons of cements and blocks, if any accident should occur, this man is liable to sustain a fatal injury or worst still,death. As he is not conscious of his environment at the moment. &nbsp; Another incident we all know about is the incident at the Lagos-Ibadan express way(  NIGERIA) &nbsp;, in a country where we don\'t have a seperated lane for tankers and other trailers to move, alertness and smartness is required. A tank filled with petrol tripped and fell, turning upside down, instead of deliberating on how to survive, they were trying to reverse in order to bring their cars to safety on an already trafficked road.At the long run, the tank leaked and the lane is on fire...The first step they should have taken(which is running far away from the scene) became their last step but its too late as they were all burnt beyond recognition. Now to the questions: &nbsp;How many instances do I need to give? &nbsp; How many signs and warnings do I have to make? &nbsp;For how long will we pass all blames on the government for not construction good and tarred roads? &nbsp; How many times are we going to pay dearly for our foolishness? &nbsp; Its high time we woke up from this mess!! &nbsp;Wake up! &nbsp;Nigeria, just because he is called the driver does not give you the right to let your guard down, you can as well direct and control the driver as long as you know the basics of driving.. Don\'t leave it all to him, he\'s not an Island of knowledge neither is he the Mr perfect that has never and will never exist. &nbsp; &nbsp;Be watchful &nbsp; Be careful &nbsp; Be conscious &nbsp;Together we can make our society a safe place to be. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>', 'uploads/153588715276361car-accident-attorney-car-insurance.jpg', '1535797321gigeml4381o7a448bawu68', '15:37:14', '2018-09-01', '15358162348ancad74e3cir2ie6t8t148lc', 1, 'thumb/8191734thumb1535911294.jpg', 0, 370, NULL),
(81, 'Sustaining Quality Education in West Africa', 'O\'timilehin Adejumobi Alabi', 'show', '<p>The fate of quality education in West Africa is bleak. It is like a tarantula stuck above flowing water yet being breezed by the gusts of winds. But the scientific breakthrough of Europe and the golden words of Nelson Mandela that: &ldquo;Education is the most powerful weapon which you can use to change the world,&rdquo; gives us hope today. Little wonder we are convoked today to salvage education from the jaws of modern entertainment; the jaws of politicking in education by the government, and the jaws of the skyrocketing level of poverty amongst endless. &nbsp;And that is also why we are gathered to probe into the challenge facing education of the 21st century in West Africa and to proffer solutions to it in several ways.</p>\r\n\r\n<p>Firstly, there is alarming need for us as instructors to stop bringing up students who are crammers and subject-questions answerers. But we should bring up students to become problem solvers and critical thinkers. And this requires us to bridge up the subjects we teach with life realities. It also requires us to often make references to live and recent instances, and not obsolete and long forgotten or inapplicable examples.</p>\r\n\r\n<p>Secondly, the essence of ensuring our education is globalised is germane because it will enable our students fit into any universal city. And this is achievable when we break away from the shackles of defining ourselves by our limitations but focusing on our possibilities, and building on our strength and potentials. Yes, this can be attainable when we update and expose ourselves first as instructors and then, make our classes and classrooms a global one.</p>\r\n\r\n<p>Thirdly, it is high time we stopped thinking and reasoning for our students when we teach and access them. Hence, we must place our students at a spot where they can relearn by themselves whatever we have taught them. They must be able to relate what we have taught with their own experiences and present them to us in their own words from their own understanding. By so doing, we will be surprised at how their creativity will give birth to innovations.</p>\r\n\r\n<p>Furthermore, we can mend the future situation of failed leadership in West Africa and its environ when we catch our students young and initiate them into the clan of academic and social responsibilities. Yes, we can build them to take charge of the class sometimes and assign them with roles within the school. More so, we can enhance team spirit in them alongside orientating them on the essence of good moral values.</p>\r\n\r\n<p>Finally, it bores down to us to see it as a priority to enable a platform of communication and collaboration for our students. We must create rooms for clear expression of thoughts and opinions by doing more of interactive learning and less of talking alone for them to learn. In other words, we can assign our students with tasks that only collaboration can solve. And thus, our students&rsquo; default mind-set about tasks will be that, together everyone can achieve more. Over and beyond, if we could be honest and would adopt and implement these points with sincerity in our various institutions, we would successfully tackle the challenges our education now and in the future. Besides, we too3 will also become testifiers of the American author, Leo Buscaglia, who said, &ldquo;Change is the end result of good learning.&rdquo; Thank you.</p>', 'uploads/15358824027604263images.jpg', '7NEO0I762M15TI661HLI', '10:00:03', '2018-09-02', '1535882403iugnii66545er2c4s2as3talnt', 1, 'thumb/15358824021027322images.jpg', 1, 512, NULL),
(87, 'NATURE', 'OLUWAGBEMIGA AYOMIDE MOSES', 'show', '<p>Ordinarily, nature is ascertain as naturalistic things around us but the term &quot;nature&quot; goes way beyond this popular thoughts.</p>\r\n\r\n<p>According to the English dictionary, nature can be ascertain to be the innate characteristics &nbsp;of a thing or what something will tend by its own constitution, to be or do, distinct from what might be expected or intended. &nbsp;Nature can also be described as the&nbsp;summary&nbsp;of&nbsp;everything&nbsp;that has to do with&nbsp;biological,&nbsp;chemical and &nbsp;physical&nbsp;states and&nbsp;events in the physical&nbsp;universe.</p>\r\n\r\n<p>Something relevant and similar in these definitions is that nature is a terminology that happens base on necessity and natural life events. &nbsp;</p>\r\n\r\n<p>It has come to my understanding that whatever happens in life is controlled and wheeled by nature. People find this very easy to believe but difficult to understand. &nbsp; Whenever the cause of nature comes around,we all tend to believe its nature but never understood why it happened. Although,nobody can understand the will of nature but i&#39;ll like us to remember the law of &quot;karma&quot;which is also the law of nature which states that &quot;what goes around comes around&quot;</p>\r\n\r\n<p>Even after when we already know the result and outcome of somethings we do, we still rush all blames on nature when its actually our doing.&nbsp;</p>\r\n\r\n<p>Of course,nature cause happens accidentally but we should always be careful on how to control it instead of cursing and lamenting. It is nature,</p>\r\n\r\n<p>Who can hold it?&nbsp;</p>\r\n\r\n<p>Who can jail it? &nbsp;</p>\r\n\r\n<p>&nbsp;Who can blame it?</p>\r\n\r\n<p>We all are part of this phenomenon, nature can be harsh, wicked, kind, brutal, merciful e.t.c.</p>\r\n\r\n<p>&nbsp;It works in whatever way that pleases but whichever one it gives will always be acceptable by the naturals(living things) &nbsp; &nbsp;In conclusion, the cause is just and natural, so I urge people to always learn how to control the happenings after the cause of nature has taken place rather than cursing it.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'uploads/15359943152436089IMG_20180903_173917_132.jpg', '1535797321gigeml4381o7a448bawu68', '17:05:16', '2018-09-03', '15359943161t84l2a080crtuer4a9ien', 1, 'thumb/15359943155019645IMG_20180903_173917_132.jpg', 1, 498, NULL),
(103, 'I am Shameless', 'Banji Mayowa', 'show', '<p>I\'m a shameless one.</p><p>Are you rather shameful?</p><p>Living in the pain of running around this thorn,&nbsp;</p><p>Despite the lots of the table.</p><p>Right is in the embracement of wrong,</p><p>And wrong is at the lawful company of the right.</p><p>The dumb becomes smart when he turns,</p><p>Turning against the path of the wise.</p><p>Everywhere, a deep pocket with a shallow apex.</p><p>Blunt heads bashing around in joy,</p><p>Talking the line in it\'s best amazing part;</p><p>\"If you no get money, Hide your face\".</p><p>To show my face among this caucus of mess,</p><p>The best that can work for me is \"shameless\".</p><p>&nbsp;</p><p>&nbsp;</p>', 'uploads/15362511814210642cheeky_immodest_shameless_nonchalant-512.png', 'j90819542aBn72i', '16:04:10', '2018-09-06', '15362498509m6iil9c52t696r0ea3', 1, 'thumb/5870627thumb1536252628.jpg', 1, 598, NULL),
(104, 'The Words of the Foolish', 'Banji Mayowa', 'show', '<p>The Words of the foolish are empty,</p>\r\n\r\n<p>Yet, it enjoins judgment.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Oh! The fool speaks!</p>\r\n\r\n<p>Ha! These words are Empty!</p>\r\n\r\n<p>Alas, they attract your comment. Don&#39;t they?</p>\r\n\r\n<p>Hence, not as empty.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Oh! The fool squeaks!</p>\r\n\r\n<p>Ha! We laughed to scorn!</p>\r\n\r\n<p>Sounds like you had some fun. Didn&#39;t You?</p>\r\n\r\n<p>Hence, an entertainment.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Oh! The fool blurts!</p>\r\n\r\n<p>Ha! Just like the old fool!</p>\r\n\r\n<p>You&#39;ve just remembered an old friend. Haven&#39;t You?</p>\r\n\r\n<p>Hence, so inspiring.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The words of the foolish sometimes carry great wisdom,</p>\r\n\r\n<p>Sadly, only the wise can deduce them.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<blockquote>\r\n<p>Listen to Everyone. Either they always have something to say or you seldom have something to decode</p>\r\n</blockquote>', 'uploads/15363318178468607fool.jpg', 'j90819542aBn72i', '14:50:18', '2018-09-07', '153633181849rtai576ece39t93lh0', 1, 'thumb/15363318179579149fool.jpg', 1, 565, NULL),
(105, 'In Love with My Chains', 'Banji Mayowa', 'show', '<p>I\'m in love,</p><p>But with my chains.</p><p>I saw it all coming for me.</p><p>Saw it in my powered box.</p><p>I hear it from the sound of&nbsp;tweet birds.</p><p>I read it on the book of the faceless faces.</p><p>&nbsp;</p><p>Shame! I can\'t let go.</p><p>Let go of my leaking Umbrella.</p><p>Yet, I wont loose grip.</p><p>The grip of my blunt Broom incapable of cleaning.</p><p>&nbsp;</p><p>But, I landed here.</p><p>Now I know my slave masters,&nbsp;</p><p>But I want to become the Head of Slaves someday.&nbsp;</p><p>How do I learn, if I run?</p><p>&nbsp;</p><p>I can break my chains,</p><p>But I won\'t leave,</p><p>Lest the slave feeders pass me by,</p><p>How do I get my share?</p><p>&nbsp;</p><p>\"I for love my country,</p><p>But who he help?\".</p><p>I\'m in chains but I won\'t leave,</p><p>Until I despise them.</p><p>Until I stand for integrity.</p><p>Until I find the love of my life that\'s long gone,</p><p>The Love for My Country.</p><blockquote><p>Nigeria shall be great again, when we choose the right Leader without individual sentiment, prejudice and selfishness.</p></blockquote><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 'uploads/15508271556431650IMG_20190222_100750.jpg', 'j90819542aBn72i', '10:29:54', '2018-09-09', '15364889941lire3293cna1it8796', 1, 'uploads/15508271558239361IMG_20190222_100750.jpg', 1, 898, NULL),
(106, 'DAGGER IN MY HEART (SOUNDS OF SILENCE)', 'Emmiasky Ojex', 'show', '<p>DAGGER IN MY HEART (Sounds of silence)&nbsp;</p>\r\n\r\n<p>Memories of that day rest in the bosom of my heart like a dagger</p>\r\n\r\n<p>I had gone into your room to help wash,&nbsp;</p>\r\n\r\n<p>Your little niece who knows nothing of the double-edged sword ones of the man I&#39;ve been with since 6&nbsp;</p>\r\n\r\n<p>You came at me and started making advances</p>\r\n\r\n<p>The little breast I had have you delight&nbsp;</p>\r\n\r\n<p>You toyed with it like a baby does with its toy despite my not wanting to play, as you tagged it&nbsp;</p>\r\n\r\n<p>You called me to get closer</p>\r\n\r\n<p>Your mother cannot know of this, I promise, you said&nbsp;</p>\r\n\r\n<p>&quot;But, uncle what do you want to do?&quot;, I&#39;d reply&nbsp;</p>\r\n\r\n<p>Just want to show you something and you slung out your newly bought mobile phone, Nokia X3, the latest as of then&nbsp;</p>\r\n\r\n<p>Brother, who is this for?&nbsp;</p>\r\n\r\n<p>Mummy Junior? No, you said&nbsp;</p>\r\n\r\n<p>But Junior cannot use a phone yet, his hands are too minute to hold this type of phone You smiled and said.&nbsp;</p>\r\n\r\n<p>You, my dear, I bought it just for you and no one else</p>\r\n\r\n<p>Then, I was fooled by the feeling of having a personal mobile phone, finally, I would be able to call Papa, whom I have eaten my heart out for in the village and a little bit of pride amidst my fellow mates in school who do not own one yet&nbsp;</p>\r\n\r\n<p>What a gullible me, little did I know that I was walking directly into the fisher&#39;s net with the bait it let out in my mouth&nbsp;</p>\r\n\r\n<p>Thank you brother, I will use it very well, may God bless you and continue to provide for you, I&#39;d say&nbsp;</p>\r\n\r\n<p>Amen, my dear, Amen, you know, I want to go shopping tomorrow, maybe I will buy new clothes for you&nbsp;</p>\r\n\r\n<p>and that was how it started, your hands went deep in me and I screamed, Uncle Matthew, stop, it&#39;s painful</p>\r\n\r\n<p>What is wrong with you Becca?&nbsp;</p>\r\n\r\n<p>Don&#39;t you want the phone?&nbsp;</p>\r\n\r\n<p>I will give it to you and even buy you other fine materials</p>\r\n\r\n<p>But, Uncle, why is your hand in my private part?</p>\r\n\r\n<p>Our teacher says we should not allow anyone to touch our thing But, am I anyone?&nbsp;</p>\r\n\r\n<p>I am your Uncle, the one given birth to after your mother, could I hurt you? You went deeper in and I let out the tears that had been welling up in my eyes,&nbsp;</p>\r\n\r\n<p>No, Uncle, I can not do this and &#39;gbam&#39;, you grabbed me as I made way to run out of the room and threw me on the bed,&nbsp;</p>\r\n\r\n<p>I knew hell was getting lose as you loosen the belt on your trousers&nbsp;</p>\r\n\r\n<p>Uncle, please, I beg you in the name of God,&nbsp;</p>\r\n\r\n<p>I am just a small 13-year-old girl&nbsp;</p>\r\n\r\n<p>Em, the phone, please take it, I don&#39;t want it anymore,&nbsp;</p>\r\n\r\n<p>Just please let me go and continue my washing the clothes outside before Aunty comes back.&nbsp;</p>\r\n\r\n<p>&quot;Aargh aargh, Uncle NO please No,&nbsp;</p>\r\n\r\n<p>I made a final attempt to escape your grasp but slam, on my face landed a slap from your rigid hand&nbsp;</p>\r\n\r\n<p>I knew it was here, you were naked and forcefully tore the dress Aunty bought for me.&nbsp;</p>\r\n\r\n<p>&quot;Now let&#39;s just go slow and steady, I won&#39;t hurt you, dear&quot;, your hands in me and I said, &quot;Daddy Ransom, please aargh, it&#39;s painful, I swear it is.&nbsp;</p>\r\n\r\n<p>Let me go, please&quot;;&nbsp;</p>\r\n\r\n<p>But you didn&#39;t and inserted your penis in me,&nbsp;</p>\r\n\r\n<p>Aargh, It took a great touch out of my little genitals to understand what was occurring&nbsp;</p>\r\n\r\n<p>A few in and outs, watched me releasing all the tears in my eyes&nbsp;</p>\r\n\r\n<p>Uncle please, I&#39;d continually pleaded for you to release me from your monstrous hold and let me go, but these all fell on deaf ears&nbsp;</p>\r\n\r\n<p>***Ten minutes out***&nbsp;</p>\r\n\r\n<p>Woah, you&#39;re sweet Becca, you complimented my forced performance with you on the bed and out of the room, you left.</p>\r\n\r\n<p>My eyes gave out more than it ever had that day&nbsp;</p>\r\n\r\n<p>To talk was an issue, even when Aunty flogged me for not responding to her inquiry of&nbsp;</p>\r\n\r\n<p>WHY ARE YOU CRYING VANESSA?&nbsp;</p>\r\n\r\n<p>DID ANYONE FLOG YOU?&nbsp;</p>\r\n\r\n<p>DID YOU INJURE YOURSELF?&nbsp;</p>\r\n\r\n<p>What am I to do?</p>\r\n\r\n<p>How am I to say it?</p>\r\n\r\n<p>That your husband, Daddy Junior forced himself on me, your Elder brother&#39;s daughter!&nbsp;</p>\r\n\r\n<p>My nights were hell, all my clothes turn stained with RED</p>\r\n\r\n<p>Too many agonizing screams at night, my face, heart, and genitals bled</p>\r\n\r\n<p>And there was nothing to do &#39;bout it!&nbsp;</p>\r\n\r\n<p>&quot;If your sister hears anything of what happened yesterday, I will personally kill you, your threats were not just words to me, I took them seriously as it gets to me and I held on to them firmly.</p>\r\n\r\n<p>&quot; Of course, I didn&#39;t want to die, so I had to shut my mouth in my SILENT SOUNDS.&nbsp;</p>\r\n\r\n<p>Days after days, I still hear myself screaming that night&nbsp;</p>\r\n\r\n<p>That huge incision into me&nbsp;</p>\r\n\r\n<p>My agonizing scream and what effect it took on me.&nbsp;</p>\r\n\r\n<p>Many days, I couldn&#39;t even walk properly and I could tell no one about it.</p>\r\n\r\n<p>You left a dagger in me&nbsp;</p>\r\n\r\n<p>A ghost borne by you is left to taunt my soul day and night.&nbsp;</p>\r\n\r\n<p>I&#39;ll always remember, even when you die&nbsp;</p>\r\n\r\n<p>I&#39;ll always carry my memories, it can not be forgotten, only let go.&nbsp;</p>\r\n\r\n<p>Do not leave a dagger in one&#39;s heart, it&#39;s dangerous.&nbsp;</p>', 'uploads/15365731244501681A_dagger.jpg', '36au8m1elEn53m8538', '09:52:04', '2018-09-10', '1536573124rc6l41gr25aate55i77g9ed', 1, 'thumb/15365731242242467A_dagger.jpg', 1, 463, NULL),
(107, 'IT WILL BE WELL; IF YOU WANT IT TO BE', 'Emmiasky Ojex', 'show', '<p>ALL WILL BE WELL; IF YOU WANT IT</p>\r\n\r\n<p>It obvious enough that all is not well with you&nbsp;</p>\r\n\r\n<p>You owe money, you need to pay up and your creditor had visited you during the weekend to make inquiries on the measly amount of money you lent from him last Tuesday when you had nothing on you to feed.</p>\r\n\r\n<p>It&rsquo;s pretty obvious that the world {or in a better context, YOUR NEIGHBORS} all saw the clamor that occurred when the rent-collector discovered you have been owing house rent for the past 3 months&nbsp;</p>\r\n\r\n<p>[<a href=\"https://m.facebook.com/hashtag/whatamessyscenehecaused?refid=18&amp;ref=bookmarks&amp;__tn__=%2As-R\">#WhatAMessySceneHeCaused</a>]</p>\r\n\r\n<p>Well, they all saw, I did too <strong>[*smiles*</strong>]</p>\r\n\r\n<p>We know that you are trying really hard to make ends meet, to be able to keep up with the responsibilities besieging you currently as you are the head of the family {without a choice}; your junior ones as well need to attend college, at least get to complete Secondary Schooling [it might increase their odds to get a sales rep, office assistant job in one of the local{or not} shops in the neighborhood, perhaps proceed to further their studies in any University; and ease you as well of some financial burden] but, why is not seeming to work out?&nbsp;</p>\r\n\r\n<p>--perhaps a student, who has almost given up on her/his dreams because of low-grades you recorded in the last examinations, know that IT WILL BE WELL if you want it.</p>\r\n\r\n<p>You&rsquo;ve tried all you can, sought for assistance from those you knew &amp; do not as well as those who know you and who don&rsquo;t.</p>\r\n\r\n<p>You&rsquo;ve tried, really all you could to get things running, even if just to make it work for just a milli-second and now FRUSTRATION SETS IN, DEPRESSION CREEPS INTO YOUR SOUL and this duo do as much damage as could be done to a person.</p>\r\n\r\n<p>Wait, just a quick one,&nbsp;</p>\r\n\r\n<blockquote>\r\n<p>&ldquo;How long have you been holding on that you want to back out now?</p>\r\n</blockquote>\r\n\r\n<p>&ldquo;How long have you been holding on? To the pain, to the shame, insults, derision, to you being disgraced by peers for having nothing to party with etc.?&rdquo;&nbsp;</p>\r\n\r\n<p>Yeah, I know; you&rsquo;ve been holding on since were born, despite all these, however;you still are standing tall,</p>\r\n\r\n<p>Why worry about what you do not have yet when you have enough already to keep you from remembering you have nothing?</p>\r\n\r\n<p>You currently have all you need, A SANE MIND AND THE WILL TO ACHIEVE MORE.</p>\r\n\r\n<p>I dare you now, MAKE IT WELL</p>\r\n\r\n<p>I hope this inspires someone to push away those negative thoughts in your head, they are not needed,&nbsp;</p>\r\n\r\n<p>YOU STILL CAN DO IT.</p>\r\n\r\n<p>And I hope you do.</p>\r\n\r\n<p>From your friend that cares,&nbsp;</p>\r\n\r\n<p>&copy;Emmiasky Ojex</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Let&#39;s get social</p>\r\n\r\n<p>Facebook: <a href=\"facebook.com/emmiasky\">facebook.com/emmiasky</a></p>\r\n\r\n<p>Instagram: <a href=\"instagram.com/emmiaskyojex\">instagram.com/emmiaskyojex</a></p>\r\n\r\n<p>Twitter: twitter.com/emmiasky_ojex</p>', 'uploads/153658741061958211.jpg', '36au8m1elEn53m8538', '13:50:10', '2018-09-10', '1536587410tirc39e197i7428tal', 1, 'thumb/1536587410907411.jpg', 1, 421, NULL),
(108, 'A GOOD FUTURE', 'OLUWAGBEMIGA AYOMIDE MOSES', 'show', '<h3>Future, ordinary as it may seem, has a greater impact in human growth and progress. Literally, it means &quot;the&nbsp;time&nbsp;ahead; those&nbsp;moments&nbsp;yet&nbsp;to be&nbsp;experienced&quot; or can be simply described as something that will happen in moments yet to come. &nbsp; &nbsp;Future has become the greatest fear of man from the onset as it is set to determine the best moment of their existence on earth.</h3>\r\n\r\n<h3>Basically, it also has the power to change a man&#39;s story entirely from what it was or what it should be. There is also another of its kind which is &quot;THE PRESENT &quot;. Historically, no man has been able to get to the future without the present but what you do in the present does not determine &nbsp;the future. The present can always be controlled but the future will never bypass the law of nature which says &quot;whatever a man soweth, he shall reap&quot;. &nbsp;Man is not always scared of the present because its ways can still be curbed but the future is fixed and the outcome is everlasting. &nbsp;Apparently, life has been bed of roses for few people who had the luck from birth till death but for most, its not the same. The joy of the present is good and nice but the joy of the future is more blissful if properly planned. Of course, a proper planning is required to gain a proper future. So, man has always succeeded in planning in order to be successful in the future. There are so many people in the world who can&#39;t boast of their present but have strong believe in the future. &nbsp; &nbsp; &nbsp;However, nobody can have a future without first having a present situation but the future is more important than the present because its the best part of our life and existence on earth. A good future is guaranteed and secured to those who work diligently for it. &nbsp;It is clear that every right thinking average human being will prefer a good future to a bad one.&nbsp;</h3>\r\n\r\n<h3>Even if a man is to be addressed, he&#39;ll be addressed as a man with future, nobody can ever address one as a man with present. &nbsp;</h3>\r\n\r\n<h3>In conclusion,a good future is best acquired with a good present but most times, man joke with the present and tend to become serious with the future afterwards where by the future can also be identified as the late days of ones life. &nbsp;</h3>', 'uploads/15369540237249715IMG_20180914_203013_245.jpg', '1535797321gigeml4381o7a448bawu68', '19:40:23', '2018-09-14', '15369540233418i3ac2e9lar68t3', 1, 'thumb/15369540237739758IMG_20180914_203013_245.jpg', 1, 421, NULL);
