(109, 'How to Win This Blog in the Contest of Articles For Free.', 'Boardspeck', 'hide', '<p>Boardspeck features Contest of Articles, which would allow Writers to post their Articles and contest, while the winner of the article wins A Personal Blog Programmed by MCKODEV&nbsp;</p>\r\n\r\n<p><strong>ADDED FEATURES:&nbsp;</strong></p>\r\n\r\n<ul>\r\n	<li>Newsletters&nbsp;</li>\r\n	<li>Free 1 Year .com.ng domain and hosting.&nbsp;</li>\r\n	<li>Free SEO&nbsp;</li>\r\n	<li>Free Social Media Optimization.</li>\r\n</ul>\r\n\r\n<h3>HOW TO PARTICIPATE.</h3>\r\n\r\n<p><strong>Existing Boardspeck Users</strong></p>\r\n\r\n<p>1. If you have never posted an article on Boardspeck. Post your first article through <a href=\"https://boardspeck.com/addArticle\">https://boardspeck.com/addArticle</a></p>\r\n\r\n<p>2. Visit&nbsp;<a href=\"https://boardspeck.com/joinContest\" target=\"_blank\">https://boardspeck.com/joinContest</a></p>\r\n\r\n<p>3. Read through and Click Join Contest.&nbsp;</p>\r\n\r\n<p>4. Add your Contest Article.</p>\r\n\r\n<p>And you would be able to monitor your progress on the dashboards</p>\r\n\r\n<p>NOTE: You can upload any of your previous &nbsp;articles for the contest. You would be able to make changes to your content till 23rd September 2018.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>For New Registrants.</strong></p>\r\n\r\n<p>1. To register, visit<a href=\" https://boardspeck.com/registration \"> https://boardspeck.com/registration</a></p>\r\n\r\n<p>2. Post your first article from <a href=\"https://boardspeck.com/addArticle\">https://boardspeck.com/addArticle</a> to be eligible for contest</p>\r\n\r\n<p>3. Visit <a href=\"https://boardspeck.com/joinContest\">https://boardspeck.com/joinContest</a> to enter the contest.</p>\r\n\r\n<p>NOTE: You can upload the same article for your contest. You would be able to make changes to your content till 23rd September 2018.</p>\r\n\r\n<h3>About the Contest</h3>\r\n\r\n<ul>\r\n	<li>The contest is fully automated and participants would be able to monitor progress from the Contest Dashboard</li>\r\n	<li>Participants would need to upload an article (Not more than 750 Words)</li>\r\n	<li>Social Media Shares(Facebook and Twitter) would help boost your point</li>\r\n	<li>The quality of your content would be rated by our judges and used to determine your overall point.</li>\r\n</ul>\r\n\r\n<p>Contest Procedures</p>\r\n\r\n<p><strong>Content Submission( On or Before Sunday 23rd Sept, 2018 ): </strong>Every participant after entering the contest would be required to submit their article for contest. This article can be uploaded or editted before content review commence</p>\r\n\r\n<p><strong>Content Review:(Monday 24th Sept, 2018 - Friday 28th Sept, 2018)</strong> Every content would be rated and reviewed by our guest judges. From the Rating of 1 - 5.</p>\r\n\r\n<p>The result of this rating would be visible to individual contestants and not to the General Public. No contestant would be able to edit article during this period. This rating can affect total points at Final Calculation.</p>\r\n\r\n<p><strong>Contest Engagement(Saturday 29th Sept, 2018 - Monday 1st Oct, 2018):</strong>Articles are to be shared by readers who find them interesting, to any social media of choice in(Facebook and Twitter). The number of unaltered shares your article gets would give you more chance of winning.</p>\r\n\r\n<p>If You have any issue with registration or contest entry click <a href=\"https://wa.me/2349055062879?text=Hello%20Boardspeck!%20I%20have%20some%20inquiry%20to%20make.\">HERE</a> to chat with us on WhatsApp or send us a message from <a href=\"https://boardspeck.com/contact\">HERE</a></p>\r\n\r\n<p>.</p>', 'uploads/15371855758156453winnerBig.png', 'j90819542aBn72i', '11:59:36', '2018-09-17', '153718557612l8wart833o39hc49ie', 2, 'thumb/15371855753451971winnerBig.png', 1, 190, NULL),
(110, 'THE STORY IN MY HEAD', 'Emmiasky Ojex', 'show', '<p>THE STORY IN MY HEAD(Sounds Of Silence)</p><p>Would I have had it any better in life?</p><p>Why would it be me?</p><p>Why would he hurt me?</p><p>He is my Father</p><p>&nbsp;</p><p>Why would he get closer to me?</p><p>Why would he unbutton me and tell me not to shout?</p><p>and why did I not?</p><p>Why did I not tell Mom?</p><p>&nbsp;</p><p>That her husband, my father is not the man he was once</p><p>Now, he craves for me, his product,</p><p>That he didn\'t do it just once</p><p>but more times that I have even lost count</p><p>&nbsp;</p><p>I am hurt but can only speak to myself</p><p>For one word out, is hell</p><p>I am fearful not to speak, for he said</p><p>DO NOT DARE SAY ANYTHING, or you are gone {dead}</p><p>&nbsp;</p><p>Mom, I am sorry but I each time you inquire,</p><p>\"Are you feeling fine, Glory?\"</p><p>I can only say \"Yes Ma,\" a deceiving story;</p><p>I can only smile at you</p><p>&nbsp;</p><p>For the man in front</p><p>Is not a man</p><p>but a beast&nbsp;</p><p>who feastson his own kids.</p><p>&nbsp;</p><p>I fear for my own death to not come at this young age</p><p>Perhaps, I can tell only myself this tale</p><p>Till when he is of old</p><p>and the story can then be told.</p><p>&nbsp;</p><p>(c)Emmiasky Ojex</p><p>&nbsp;</p><p>P.S: Kindly join us in stopping rape, child and adult sexual assaults by liking our Sounds Of Silence page via <a href=\"https:/facebook.com/stoptheSOS\">https:/facebook.com/stoptheSOS</a></p>', 'uploads/15371899636695302sos.jpg', '36au8m1elEn53m8538', '13:12:44', '2018-09-17', '1537189964e419c0re5t5ah9586tli', 1, 'thumb/15371899635361197sos.jpg', 1, 441, NULL),
(111, 'ARE YOU STILL ENTHRALLING', 'Emmiasky Ojex', 'show', '<p>It\'s pretty simple, you either face it or suffer from it.</p><p>No need to mince words this time around,&nbsp;</p><p>Problems will always be created, and they should always be solved,&nbsp;</p><p>but if we deter from making steps towards solving them, who directly will suffer the consequences?</p><p>I think you figured that out right?</p><p>We will suffer from it.</p><p>&nbsp;</p><p>So why do we rather complain about the things hurting us, making life unbearable for us, these same things were caused by us (maybe our predecessors) when we could provide solutions to them?</p><p>It that not foolishness?</p><p>I am bold enough to tell you today that if you are reading this and are suffering from anything whatsoever, within your grasp and would rather complain than make a change towards getting out from the chains your poor paradigm trapped you in,</p><p><a href=\"https://www.facebook.com/emmiasky\">Emmiask</a><a href=\"https://www.facebook.com/hashtag/emmiasky?source=feed_text&amp;__xts__%5B0%5D=68.ARCWSQvcZBB_bEda8YtB20Ta8ViFuiJNUS81lJlflalZu1_2_uW_aaDEH8GGS6Mu2st7DGbWwbh1CnUOpiawGmCMBhG8xhf2xW2tsCZTULSs1Ti-rONBD2PlFHdkaCQOd34ySVq3kia5OQFKEhVDosNMq4Ui4QooLBw_O0zhY3SGbDkKbGzoXg&amp;__tn__=%2ANK-R\">y</a> says \"YOU ARE FOOLISH\" and \"ARE WASTING YOURSELF\"</p><p>You can*break rules*make new ones*change the game*lead the game</p><p>&nbsp;</p><p>From your friend that cares,</p><p>Emmiasky Ojex</p>', 'uploads/1537282135578175Life_quote.png', '36au8m1elEn53m8538', '14:48:55', '2018-09-18', '1537282135r2a9r601ei782c9te0al', 1, 'thumb/15372821357094973Life_quote.png', 1, 554, NULL),
(112, 'Sequence', 'Olawumi Faidat odunayo', 'show', '<p>Love with pain<br />\r\nHurt with love<br />\r\nSmile with stress<br />\r\nThat&#39;s the sequence<br />\r\nDo we not know?<br />\r\nThe smooth roads<br />\r\nWith invisible bumps<br />\r\nLife&#39;s deceit&nbsp;<br />\r\nWe crash into them<br />\r\nSurprised and unprepared<br />\r\nThe impact is felt<br />\r\nToo much<br />\r\nWe fall and we&#39;re broken<br />\r\nUnable to pick ourselves up<br />\r\nThe pieces begin to float away<br />\r\nAnd when we&#39;re finally picked up<br />\r\nWe&#39;re incomplete.<br />\r\nLet them know<br />\r\nThere&#39;s a sequence.</p>\r\n\r\n<p>&copy; Faiidat</p>', 'uploads/15372926707004856IMG-20180918-WA0003.jpg', '1535272791lai0827814m5u8o6w', '17:44:30', '2018-09-18', '1537292670l5eqc5resc12auneti52e0620', 1, 'thumb/15372926708341452IMG-20180918-WA0003.jpg', 1, 489, NULL),
(113, 'Picture Perfect?', 'Strainj Junior', 'show', '<p>The world as we know it is not always what we dream of it. It is scary and insane but in the simplest forms, it is strange. Then in it, we find things stranger beyond imaginations.</p>\r\n\r\n<p>Are you worried that this is not going anywhere serious? Don&rsquo;t be, it is going somewhere but not serious.</p>\r\n\r\n<p>Why does everything have to be serious? Just so we can be called perfect or diligent? Or could it be the craze or desire to fall into one of the many exhausting categories our society has created without our inputs?</p>\r\n\r\n<p>What do you do? I know that is easy to answer but what do you say, convincingly, when you are asked why do you what you claim to do? If you are a writer, why did you start out in the first place? Is it to impress your readers or to express your thoughts and beliefs? To help build a nation that we all deserve or to deceive and cause division?</p>\r\n\r\n<p>Why do you do it? To rip others off or to build a legacy that you can be remembered for? To denigrate others? Does it make sense yet? I bet no</p>\r\n\r\n<p>Let me tell you, all those boxes you are trying to check so that everyone in your area can give you some accolades, will fade off and you would be disappointed at the things you didn&rsquo;t do.</p>\r\n\r\n<p>You will regret the trips you didn&rsquo;t take and the trips you didn&rsquo;t make. When all the chips are down, you will wish that you&rsquo;d met more people, shared your time with more people and laughed more.</p>\r\n\r\n<p>The times you spend worrying about catching up about the changes around you could be spent easing up. Easing up will not only guaranty long life, it will also give you the chance to free up and network; meet people and build relationships that would work.</p>\r\n\r\n<p>It doesn&rsquo;t have to be <strong>picture perfect</strong>, just embrace the strange things of life and<em> fly without wings</em>.</p>\r\n\r\n<p>&nbsp;</p>', 'uploads/15373642758639051strange.jpg', '15365172264o54i132572m3y', '13:37:55', '2018-09-19', '1537364275ul1c8t9r5pe5r6e2ta2i6c3i', 1, 'thumb/1537364275748875strange.jpg', 1, 434, NULL),
(114, 'TO THE MASS', 'Emmiasky Ojex', 'show', '<p>THE CRITIQUE</p><p>&nbsp;</p><p>Your father complained till he died or is he still alive?</p><p>As well, you mother, followed the ride&nbsp;</p><p>Government is corrupt, \"they make things and life hard\"</p><p>The funny part now is that you, the offspring of two mediocre are following along the same path</p><p>&nbsp;</p><p>You say to yourself on your dirty bed</p><p>\"What can a young me, without resources do that will overthrow what has been set by the top men</p><p>What can a chick do that will lay back that which was made by the mother hen\"</p><p>We shall do wonders, miracles and magic, that\'s what you heard the last time you were to elect.</p><p>&nbsp;</p><p>You\'re still seeking the CHANGE your father\'s fathers sought during at youth</p><p>Of what use are you?&nbsp;</p><p>If you as well, are not ready to make do with</p><p>The little you have around you</p><p>&nbsp;</p><p>You hear, \"MAKE A DIFFERENCE\" everyday</p><p>Yet, your comfort zone is where you\'d rather stay</p><p>Shayo galore, you feed on bottles like it\'s your miniature secon</p><p>&nbsp;Arise Oh Compatriot, your country beckons</p><p>&nbsp;</p><p>You\'re just like every other one of your stupid friends</p><p>Blame those with power, the ones in government&nbsp;</p><p>Don\'t look at yourself, it\'s a crime&nbsp;</p><p>Yet you forget when your palms were itching as you secretly collected bribe</p><p>&nbsp;</p><p>You are now 26,</p><p>&nbsp;Are you still in wonder or dreamland, Alice?&nbsp;</p><p>Are you yet to understand?&nbsp;</p><p>That the eyes of those up there are narrowly open and widely blind?</p><p>&nbsp;</p><p>Are you still seeking answers to the questions that would never be resolved?</p><p>&nbsp;Or are you ready to take what needs to be done as your personal cross?&nbsp;</p><p>If like your fathers did, you still pretend like all is well&nbsp;</p><p>And do not take actions when they are needed,&nbsp;</p><p>I am sorry for you; you never will live well.</p><p>&nbsp;</p><p>You see your mates on socials&nbsp;</p><p>They are falling in love&nbsp;</p><p>Are you people joking?&nbsp;</p><p>Do your words even have meaning</p><p>&nbsp;</p><p>Just like your predecessors I just cry oer the fact that you would as well&nbsp;</p><p>will become Another wasted experiment of God&nbsp;</p><p>In the 7 point something billion.</p><p>&nbsp;</p><p><a href=\"http://facebook.com/emmiasky\">Emmiasky Ojex</a></p>', 'uploads/15374525164200515the_critique.jpeg', '36au8m1elEn53m8538', '14:08:36', '2018-09-20', '1537452516rt1oca686872l831iet', 2, 'thumb/15374525165031224the_critique.jpeg', 1, 479, NULL),
(115, 'DO NOT FEAR TO TAKE THAT LEAP', 'Emmiasky Ojex', 'show', '<p>#MotivateMeMonday &nbsp;</p><p>Are you currently in a dilemma as to whether or not to leave that job you currently are doing that is not paying what you deserve or work for? &nbsp;</p><p>Are you in a bind as to whether or not you should stop doing that particular thing youve been doing for so long that you lost count of how long youve been standing in that stagnant position?&nbsp;</p><p>&nbsp;</p><p>Youre in a bind; thinking of what to do and what not to do? &nbsp; &nbsp;</p><p>&nbsp;</p><p>We all get depressed sometimes, as to whether or not to do it, looking at the fact that the risk we are taking might just be too much for us? &nbsp; &nbsp;</p><p>&nbsp;</p><p>What if we fail at it? &nbsp;</p><p>What if it isnt successful? &nbsp;</p><p>What if the world chastise us? &nbsp;</p><p>What if we lie down flat from failing so bad? &nbsp; &nbsp;</p><p>&nbsp;</p><p>All these thoughts and more come to our head roaring and most of the times, the people fail at recognizing the fact that NO RISK, NO REWARD, is the conspicuous truth; &nbsp; &nbsp;</p><p>&nbsp;</p><p>\"There is absolutely nothing worthwhile that doesnt require extra effort or risk in it\" &nbsp;&nbsp;</p><p>&nbsp;</p><p>There is no excellence without perseverance and consistency; all those who have shaped our world into the good and evil we see now all did that extra thing others {in whatever time they were} would rather not,&nbsp;</p><p>They researched more while others just flipped thought the research material, the known inventors today spent more of their times dwelling on that particular dream they had in mind. &nbsp; &nbsp;</p><p>&nbsp;</p><p>You as well have to take that LEAP, if you ever wish to get to that next level, &nbsp;You have to prepare yourself to just a few more encumbrances on your road to success. &nbsp; &nbsp;</p><p>I therefore, tell you today, DO NOT BE AFRAID TO TAKE THAT LEAP you find in front of you. &nbsp;For if you do not, there will be no difference between you and that other person. &nbsp; &nbsp;Today, I dare you TAKE THAT LEAP, AND JUMP THAT BARRICADE in your front. &nbsp; &nbsp;</p><p>&nbsp;</p><p>P.S: We all have to take different strides in life, do not ever think you are taking the right leap by imitating what your friend. &nbsp; &nbsp; &nbsp;</p><p>&nbsp;</p><p>From a friend that cares, &nbsp;</p><p>&nbsp;Emmiasky Ojex &nbsp;</p>', 'uploads/15377944902300302MOTIVATE-YOURSELF-AND-STAY-MOTIVATED.jpg', '36au8m1elEn53m8538', '13:08:10', '2018-09-24', '1537794490i4rd6o1cl1930460tea', 1, 'thumb/15377944909174422MOTIVATE-YOURSELF-AND-STAY-MOTIVATED.jpg', 1, 566, NULL),
(116, 'Contest Of Articles (Social Media Engagement)', 'Boardspeck', 'hide', '<p>Content Review Concludes Today 28th September, 2018</p><p>Contestants that joined contest but never uploaded their Articles before 24th September, 2018 would not be part of the social media contest.</p><p>Boardspeck Social Media Engagement starts tomorrow 29th September, 2018.</p><p>Every one of the 4 Eligible Contestants would see their contents at <a href=\"https://boardspeck.com/contest \">https://boardspeck.com/contest</a> and would be able to share the contents to general public.</p><p>Please take note of the following as you bear in mind that the just concluded content review does not finally determine the winner of contest. &nbsp;&nbsp;</p><p>1. The Social Media Engagement is the Final Stage of the Contest.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>2. The Social Media Engagement is a great determinant of the winner of this contest.</p><p>3. The Higher a content\'s social media shares to Facebook and Twitter, one or both, the more chance the Contestant gets towards winning.</p><p>4. Contestants who Cheat with multiple shares by a single user would disqualified as our application can detect multiple shares by single individual.</p><p>4. Contestants would be able to monitor progress on the Dashboard at <a href=\"https://boardspeck.com/joinContest \">https://boardspeck.com/joinContest</a></p><p>5. Contestants can inform people to share their content.</p><p>6. The winner of the contest is automatically decided by our system.</p><p>7. No Contestant can monitor other contestants progress or score until after the winner has been declare. Meanwhile only the final score would be displayed. Hence everyone\'s content rating is confidential and visible only to the particular person.</p><p>8. Social Media Engagement will run from 12AM 29th September, 2018 to 11:59pm 1st October, 2018 (Nigerian Time).</p><p>8. The winner of the contest will be contacted by Mckodev for the customization and delivery of the Blog.</p><p>For more info. Please Contact us via https://boardspeck.com/contact &nbsp;or @boardspeck on Facebook, Twitter and Instagram.</p><p>&nbsp;</p>', 'uploads/15381559073669048Untitled.png', 'e238t723ts7106', '17:30:04', '2018-09-28', '153815580499retoi6n1t08sl20c3ta3ce', 2, 'uploads/15381559076650732Untitled.png', 1, 112, NULL),
(117, 'Embrace the Beauty', 'Oyediran Babajide', 'hide', '<p>The problems are so numerous that we ignore the beauty.</p><p>This phrase was inspired by the different situations in Nigeria. &nbsp;It is now obvious, how what we see, hear everyday is the challenge our dear nation is passing through. &nbsp;The government/masses have mastered the act of passing blames and analysing the problems, thereby ignoring the beauty. &nbsp;The problems has form a fog in our faces, depriving us of seeing the beauty as a nation despite the difficulty and challenges facing us as a nation.</p><p>Let us embrace the beauty!!! in the mist of the challenges, how can we not see the peace in the nation? &nbsp;How can we not see how God made our weather perfect? How can we not see the way God kept away natural disasters from us? &nbsp;How can we not see how God has blessed the youth in our nation? The numerous natural resources are also included.</p><p>Believe it or not this nation will be great again. . . &nbsp;We will celebrate again, we will love again.</p><p>We are Nigeria, we are tough, we are resilient and we won\\\'t give up. &nbsp;Happy Independence Day in advance from all of us @dicecouture. &nbsp;Celebrate Nigeria.</p><p>Photography - @skibsphotography Muse- @garogowal/mr_zzamani Styled by @dicecouture &nbsp;@instablog9ja @tundeednut @alibabagcfr @hustlersquare @feladurotoye @mr.jollof_</p><p>#independence #nigeria@58 #problems #embrace #embracethebeauty #brand #madeinnigeria #dice #dicenation</p>', 'uploads/15383428176597719FB_IMG_1538342436730.jpg', 'j90819542aBn72i1', '21:15:54', '2018-09-30', '1538342154i9a218ai1e39grnt21i6elcr', 2, 'uploads/15383428175370898FB_IMG_1538342436730.jpg', 1, 184, NULL),
(118, 'WE ARE STILL UP', 'Emmiasky Ojex', 'hide', '<p>&nbsp;</p>', 'uploads/15385722552556347we_are_still_up.jpg', '36au8m1elEn53m8538', '13:10:55', '2018-10-03', '1538572255e272tew90109al1r6ci', 1, 'thumb/15385722552455817we_are_still_up.jpg', 0, NULL, NULL),
(119, 'IMAGINE', 'Emmiasky Ojex', 'show', '<p>Imagine a world for no and everyone&nbsp;</p><p>Where we all are here to be as one and to save the world&nbsp;</p><p>Where we have no differences at heart despite the differences at hand and our nations can all relate with one happy and unified mind&nbsp;</p><p>&nbsp;</p><p>Imagine a place like home that is not your or my own</p><p>Where we could shelter as many people it could condone&nbsp;</p><p>a home with fights and get back togethers</p><p>Where nothing is left in our hearts to keep that might lead to someones death at night&nbsp;</p><p>&nbsp;</p><p>Imagine a dreamland, not this wander-land we think is a wonderland</p><p>Where the only thing we seek is profit over feelings</p><p>Money over family and corruption over redemption</p><p>But such a land that is rich in the manna we have in our hands and give out to those who lack and never had&nbsp;</p><p>&nbsp;</p><p>Imagine a world where the world knows and does right</p><p>And we could all end these meaningless fights</p><p>That has taken so many lives</p><p>Till we were so lost fighting that we forgot to take care of our dying brothers while they were alive&nbsp;</p><p>&nbsp;</p><p>Imagine a world where we could <strong>reach to the next persons soul</strong></p><p>Let him or her know</p><p>I am here and all will be well</p><p>And we are not so selfish that we always want to neglect them&nbsp;</p><p>&nbsp;</p><p>Imagine and keep doing so</p><p>Let us plant in the hearts of our neighbors what wed all like to sow</p><p>For what is worth doing is better done well</p><p>And we can all have for each and every one of us, a living watered-well</p><p>&nbsp;</p><p>I know that you may think this is unachievable</p><p>But what is not achievable is what we cannot imagine</p><p>For the power for us to become one is locked in</p><p>And we just all need to tap in, knock on the door and see what beauty every one of us has within.</p><p>&nbsp;</p><p>You are not<strong> black and I am not white</strong></p><p>We didnt come here to be, by colors recognized</p><p>We came here to show that we can care</p><p>And that is why we all are here.</p><p>&nbsp;</p><p>From a friend that cares,</p><p>The boy</p><p><a href=\"hhp://facebook.com/Emmiasky\">Emmiasky Ojex</a></p>', 'uploads/15385758469545819Imagine.jpeg', '36au8m1elEn53m8538', '14:10:47', '2018-10-03', '15385758478tiae2m8n4rlia10i36c4eg8', 1, 'thumb/15385758465215660Imagine.jpeg', 1, 602, NULL),
(120, 'Sweet Architect', 'Emmiasky Ojex', 'show', '<p>Sweet architect!&nbsp;</p><p>I hope you are listening to the clamors in my head</p><p>I hope you see the pain I feel in my chest</p><p>I hope you see that I really am trying my best</p><p>&nbsp;</p><p>Sweet architect!&nbsp;</p><p>I hope youre seeing the tears my eyes harbor&nbsp;</p><p>I hope you realize that my heart sobs</p><p>&nbsp;I hope you see me in my origin as someone with naught</p><p>&nbsp;</p><p>Sweet architect!&nbsp;</p><p>I hope you see my soul is a mess</p><p>&nbsp;I hope you see me try again and fall back on earth</p><p>I hope you see my laid back at night trying to reach the heavens for help</p><p>&nbsp;</p><p>Sweet architect!</p><p>I hope you see me wishing I could change</p><p>Become a better person in this age</p><p>I hope you see that I have been damaged</p><p>&nbsp;</p><p>Sweet architect!</p><p>I hope you see the need I need</p><p>I hope you see as I fall on my knees&nbsp;</p><p>That I need a whole new knead</p><p>&nbsp;</p><p>Sweet architect!&nbsp;</p><p>I hope you know that I know that youre the only one who can</p><p>&nbsp;Help me with all of earths troubling time&nbsp;</p><p>And let me live the life I deserve</p><p>&nbsp;</p><p>Sweet architect!</p><p>&nbsp;This is not my cry to you but a plea&nbsp;</p><p>Like a poor child to a rich King&nbsp;</p><p>I reach out to you for a meal!</p><p>&nbsp;</p><p>Sweet architect!&nbsp;</p><p>We both know these chains are not mine&nbsp;</p><p>But I got them while I was trying to make it in life</p><p>Please help me break loose and survive</p><p>&nbsp;</p><p>Sweet architect!&nbsp;</p><p>I know that you are all where&nbsp;</p><p>At days when you are needed&nbsp;</p><p>Youre always near</p><p>&nbsp;</p><p>Sweet architect!&nbsp;</p><p>I now plead with you to come; save me and my mates&nbsp;</p><p>From this trouble we have to eat on our dining plates&nbsp;</p><p>And move us from where we are to our original place!</p><p>&nbsp;</p><p>From a friend that cares,&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 'uploads/15396093822556640sweet_architect.jpg', '36au8m1elEn53m8538', '13:10:47', '2018-10-15', '15396090475ce8tl271at5ee396w2sri', 2, 'uploads/15396093826105063sweet_architect.jpg', 1, 658, NULL),
(121, 'WHEN IT IS TIME', 'Olawale Joseph Faluyi', 'show', '<p>Our days are numbered in our unknown creator hand Ecclesiastes Chapter 3 says \"To everything there is a season and a time to every purpose under the heaven\"</p><p>We have two major times on earth&nbsp;</p><p>-Time of suffering and&nbsp;</p><p>-time for jubilation</p><p>&nbsp;</p><p>We can\'t stop our time but we can use it for something either good or evil&nbsp;</p><p>&nbsp;</p><p>When it is time for suffering to go and jubilation to be welcomed suffering will doubled is belts to torment ones life</p><p>&nbsp;</p><p>But anyone that can endure and determine the yet unseen jubilation days ahead will surely get to it\'s time</p><p>&nbsp;</p><p>When it is time; we need to believe that our time will never pass us away if we are patience for our time&nbsp;</p><p>&nbsp;</p><p>T : Today and Tomorrow&nbsp;</p><p>I : Issues&nbsp;</p><p>M: May&nbsp;</p><p>E: Educates</p><p>&nbsp;</p><blockquote><p>He is the architect of you <i>but</i> designer of the time.</p></blockquote><p>&nbsp;</p><p>When your time comes to succeed it will educate others coming after you,</p><p>Don\'t forget you don\'t have any story or experience to tell except you wait for your time.</p><p>&nbsp;</p><p>Say no to crooked ways not to wait till when the time comes&nbsp;</p><p>Say never to any fast and evil advice&nbsp;</p><p><strong>Don\'t follow multitude to deceive the time</strong></p><p>&nbsp;</p><p>When it is time all things work together for them that can endure When it is time you have a story to tell the world Aim high and be patience for the time.</p><p>&nbsp;</p><p>He is the architect of you <i>but</i> designer of the time.</p>', 'uploads/15396154956825376time.jpg', '36au8m1elEn53m8538', '14:58:17', '2018-10-15', '15396154971ie550c4rae9lht55n7w9', 2, 'thumb/15396154953544649time.jpg', 1, 553, NULL),
(122, 'DECIDE TO DECIDE', 'King Lekhan', 'show', '<p><i>You handle ideas by making some kind of a decision.&nbsp;</i></p><p>&nbsp;</p><p>Winning starts with beginning;</p><p>&nbsp;And to begin, you must do something <strong>NOW</strong>.&nbsp;</p><p>&nbsp;</p><p>What do you do when you have a good idea?&nbsp;</p><p><i>Just observe how different people respond to idea</i>:&nbsp;</p><p>&nbsp;</p><ol><li><strong>1. </strong>INSECURE PEOPLE<strong> HIBERNATE:</strong></li><li>They run away from good ideas.&nbsp;</li><li>They\'re afraid they might fail or that they might have to spend too much effort.&nbsp;</li><li>&nbsp;</li><li>2. LAZY PEOPLE <strong>LUXURIATE</strong>:&nbsp;</li><li>They don\'t pay much attention to ideas.&nbsp;</li><li>They want to enjoy the pleasures of life.&nbsp;</li><li>They will get serious later on, probably when they are old.&nbsp;</li><li>&nbsp;</li><li>3. WOUNDED PEOPLE <strong>COMMISERATE:</strong></li><li>They say&nbsp;</li><li><i>\"Oh, it\'s a good idea, but i can\'t do it. I\'ve tried it so often\"</i>.</li><li>Or&nbsp;</li><li><i>\"I\'ve tried to get along with my wife, but we still argue</i>.<i>\"</i>&nbsp;</li><li>Don\'t commiserate.&nbsp;</li><li>&nbsp;</li><li>4. FOOLISH PEOPLE <strong>PROCRASTINATE:</strong>&nbsp;</li><li>They put off acting on their ideas.&nbsp;</li><li>\"Later on, when I\'m ready, I\'ll do something about it, \" they say. \"I\'m not ready yet. \"&nbsp;</li><li>&nbsp;</li><li>Let me give you a sentence that could change your life: <i>Don\'t wait until you are ready to make a big decision, or you\'ll never accomplish half of what you could</i>.&nbsp;</li><li>&nbsp;</li><li>5. WISE PEOPLE <strong>DEDICATE</strong> :</li><li>&nbsp;They are the <strong>do-it-now</strong> people.&nbsp;</li><li>No grass grows under their feet.&nbsp;</li><li>That\'s why they don\'t waste one of the most precious things in the world, <strong>a good idea</strong>.</li><li>They don\'t waste a good moment or a good opportunity.</li></ol><p>Which will you be?</p><p>&nbsp;</p><p>Decide NOW!</p><p>It\'s up to you.</p>', 'uploads/15403842972407690confused.jpg', '36au8m1elEn53m8538', '10:42:00', '2018-10-16', '1539686520491de14a226dt99ircleiec', 2, 'uploads/15403842972144380confused.jpg', 1, 540, NULL),
(124, 'WEYTIN WE GAIN', 'Emmiasky Ojex', 'show', '<p>If you are a Nigerian and a skin-tight one as that, you should already know where this is headed towards;&nbsp;</p><p>Victor <i>ADs </i><strong>WEYTIN WE GAIN</strong> which has received so much appreciation from most people as one song that reflects on their lives and mentality.</p><p>&nbsp;</p><p>Weytin We Gain is simply talking about the day-to-day hustling, bustling, ado and go-throughs of the normal person in life, the problems we face as people and how this has made <strong>MONEY</strong>, though a necessity become a prominent need of people in the world.</p><p>&nbsp;</p><p>Like Victor said</p><p>If we nor make money weytin we gain</p><p>if we nor buy the Benz weytin we gain</p><p>&nbsp;</p><p>This is where the problem lies there in,</p><p>WEYTIN WE GAIN, IF WE NOR GET MONEY?</p><p>(What do we <strong>gain </strong>if we have no money or if we are poor?)</p><p>&nbsp;</p><p>Many people right now are frustrated by the fact that all they are trying to make things work out for them; have the cash at hand and in bank; something they wish would come as fast as can be but since money is not as the speed of data for many of us,</p><p>It operates on a <strong>1G</strong> wired signal, maybe an Ethernet connection with a 2G China Phone</p><p>&nbsp;</p><p>But!&nbsp;</p><p>We see the immoral ones, scamming people online, gaining money and flaunting it right in our faces, you see these individuals bearing daunting names (nick) and they make good use of their wealth to taunt us, we always hear them buying the latest Porsche cars, wearing a futile chain worth millions and in the end, flashing it all on the worlds most educating and corrupting platform, the social media and bloggers too wey nor dey carry last, making it front page news.&nbsp;</p><p>&nbsp;</p><p>So many lives have gone down the rail because they all are looking for this FAST MONEY, and when it ends up not being fast or not as fast as they want it to, they tend to, like a chemical reaction, catalyze their progress (financially) through the illicit, you see them searching for the Gz (Original Gangsters) and trying to get through to the riches they dream of through scamming innocent people, becoming stinkingly rich through constant recurrence of this new WAY TO BECOME A MILLIONAIRE, but what are we to do? <i>(The fact that they claim to be recovering what was once theirs is another stupid talk which would be accessed some other day)</i></p><p>&nbsp;</p><p>The society accepts these kids and we even ennoble them with praises for being a REAL SON OF THE LAND, have you not heard?&nbsp;</p><p><i>(One of them got crowned recently, make I nor talk before I get beaten up!)</i></p><p>&nbsp;</p><p>Its pretty obvious that everyone in the world currently is searching and wanting to make money, that dough to flex and chop life nah, but since it doesnt happen when we wish it should, we get frustrated and are majorly depressed for a long while, now Victor ADs Weytin We Gain, though might be inspiring; reprimands failure and struggle,</p><p>the fact that you have no money means YOU HAVE NOTHING TO GAIN IN LIFE?</p><p>Or the fact that all the days youve been hustling HAVE BEEN A WASTE OF YOUR TIME?&nbsp;</p><p>&nbsp;</p><p>Lets view from this angle, the normal youths of nowadays are all seeking money</p><p>(more excessively than those of old because they too want to feel amidst the top guys, go to club and do all sorts of immoral stuffs with their cash)</p><p>Even AD pin-pointed this out by calling a car, surely its a luxurious Benz he alluded to.</p><p>&nbsp;</p><p>As a normal hustler with no intent of doing any illicit or immoral act to gain , perhaps a patterned worker in a bank, or perhaps a cleaner for a Concierge Service rendering organization, listening to the very song, after thirty seconds, the chorus was hit</p><p>IF WE NOR MAKE MONEY, WEYTIN WE GAIN (My brother, weytin we gain) If we nor buy the Benz, weytin we gain ooo(trust you know what it says next)</p><p>&nbsp;</p><p>Despite the fact that the first solo was trying to appeal to The Maker for help, the chorus is a mind-changing tool entirely and the only reason you see people making references to this song in discussions is either because they wish to get involved in something malicious in order to GAIN THE MONEY Victor was subconsciously not referring to, but what they choose to interpret it as.&nbsp;</p><p>&nbsp;</p><blockquote><p><i>If the only thing that we say guarantees a successful life is money, then we will surely do something cunning to get to it, since it doesnt come as we wish </i>-Emmiasky Ojex</p></blockquote><p>&nbsp;</p><p>What the above quote implies is that due to the fact that the circumstances involved in getting money legally are too knackering (tiring) and most youths in this generation nowadays do not wish to take part in the opersose tasks involved in doing business legally and making money through it, it pretty obvious what they resort to doing to gain the money they wish but do not want to work for.</p><p>&nbsp;</p><p><strong>Human Trafficking </strong>generates <strong>millions, </strong>so does<strong> Kidnapping, Drug Trafficking, Cyber Crimes (</strong><i><strong>we actually celebrate these guys</strong></i><strong>)</strong>:per transaction for that matter ooo, meanwhile at hand, the nation is still struggling to fix a minimum wage higher than N20,000 and then, a song telling us that our LIVES ARE WORTHLESS WITHOUT THE MONEY IN IT is released and we see the mass grooving to this Please what do the leaders expect the youths to do?</p><p>&nbsp;</p><p>We are forced by what we listen to; to join these people who are already having SUFFICIENT FUNDS #ifyouknowyouknow</p><p>(is it not stupidly irking to know that so many, if not most of our songs are now focusing on money, money and money) Like in ABLE GOD, youths were told to <strong>lo ra lappy, ko le connect, ki wo na le collect.</strong></p><p>(meaning to ignite Youths to go get Laptops, to connect with these people so they too can collect!)</p><p>&nbsp;</p><p>Illegal is the new legal and our leaders do not dissuade it so they subconsciously encourage illegality Emmiasky Ojex</p><p>&nbsp;</p><p>If all we chase after now, is money and not the real things we need to, now these real things are not what can be bought with the former but are the true things people need in life to fully be happy with who and what they are no matter the financial situation they may be in.</p><p>Such things are not usually materialistic, things like <strong>Hope, Education (doesnt imply schooling), Vision, Faith, Love</strong> and so on are the necessary things we as human being should chase and not allow some paper material with worth kill the true meaning of joy in us.</p><p>&nbsp;</p><p>After all said and seen,</p><p>We all need to know something very vital:</p><p>&nbsp;</p><blockquote><p><i>All you need to become that person you dream of is already with you, your life and your mind.</i> Emmiasky Ojex</p></blockquote><p>Notice no money in it right? Thats simply because it need not be!&nbsp;</p><p>&nbsp;</p><blockquote><p><i>We gain a lot without money and as a fact; we gain more without money and less with it.</i></p><p>Emmiasky Ojex</p></blockquote><blockquote><p><i>Whatever the mind of a man can concieve and it beleive, it can achieve.</i></p><p>Napoleon Hill</p></blockquote><blockquote><p><i>See and have faith, work towards it, money will end up following you.</i></p><p>Emmiasky Ojex</p></blockquote><p>&nbsp;</p><p>&nbsp;</p><p>It would be quite natural for so many to disagree with this article, but if you do and think you have solid points, leave it below. Ill be more than happy to continue this.</p><p>&nbsp;</p><p>This link contains what MOST YOUTHS WANT TO GAIN!</p><p>Enjoy</p><p><a href=\"https://www.youtube.com/watch?v=xblrJW4gttg\">https://www.youtube.com/watch?v=xblrJW4gttg</a></p>', 'uploads/15403840493573323backlit-beach-clouds-289998.jpg', '36au8m1elEn53m8538', '13:34:29', '2018-10-23', '1540301669tai55e9r2065yw4eic1lt5n', 2, 'uploads/15403840499734723backlit-beach-clouds-289998.jpg', 1, 509, NULL),
(126, 'THE UNBROKEN SPIRIT', 'Solomon Ademiju', 'show', '<p>&nbsp;</p><p>&nbsp; Some days back I had a problem with my former phone and I was left alone to thrive on the journey where I had no access to Internet, to the outside world and even to my close pals because most of my contacts were saved on the phone that got spoilt but one thing that kept me connected to the world was the access to radio stations. Listening to different stories and even motivational tips keeps me growing and also enhancing my knowledge of how people don\'t care about you unless they see you around and they want something from you. I spent most of my quality time listening to different news and entertaining gist but I was battered because I couldn\'t have access to pictorial evidence of most of the stories I was hearing and it really made me go crazy.</p><p>&nbsp;</p><p>After much consultation from those that could help me add up money to get a new phone and nothing positive came out of the long wait . I checked the total amount of money in my account and I knew deep down in me that it ain\'t enough to get a good andriod phone which could meet my spec but I just got a spirit telling me to go out there and price a phone and see if I can still get a phone to manage for the main time and lo and behold I followed my heart.</p><p>&nbsp;</p><p>It was a sunny Tuesday afternoon, I summoned the courage and I went to a phone outlet not too far from where I was working with an amount that I know ain\'t enough to get a good phone. I priced different kind of phone that met my spec but the fund ain\'t enough to get one but I was surprised when a lady at the shop outlet kept persuading me to point to the phone of my choice that she would make sure I get a phone before leaving the phone outlet that day and God had his way that very day, she and another lady added money up and balanced up the money for the phone and I became the owner of a phone which actually met my spec. I learnt a lesson that no matter what you think about your incapability of doing something ,God will always surprise you if he ain\'t done with you yet.</p><p>&nbsp;</p><p>I got home that same Tuesday evening with just #150 richer than the rest of the world. I charged my new phone and I on my data and update myself with what\'s happening around me and check out some messages on my WhatsApp and it\'s obvious that some people missed me in my absence while some don\'t even know I was offline for some times but at the end of it all I got to know that someone needs me to put smile on his/her face and I went on with my usual habit of cracking jokes in my Alma matas group chat and the group became lively again.</p><p>&nbsp;</p><p>Later that night I got a call from a street friend of mine who needed me to help him sell an iTunes card and here I am again with a little change in my account the following morning and then I remembered the saying \"you can wake up to be a wealthy man\".</p><p>&nbsp;</p><p>If I hadn\'t summed up the courage to walk into that phone outlet even when I add an insufficient fund with me to get that phone , I wouldn\'t have access to the little change I got from the sales of the iTunes card and I wouldn\'t be able to crack up the ribs of my old school mates who had been silent on the group chat for days . Never doubt your spirit and never think someone doesn\'t need you, If God wasn\'t through with you, he wouldn\'t wake you up no more.</p><p>Happy Sunday and stay blessed .</p><p><br>Ademiju Solomon</p>', 'uploads/15407212777768392IMG_20181024_173252_174.jpg', 'oo651n61l7m725so1', '10:07:58', '2018-10-28', '1540721278ce1l9tr2h0110e22ai3t', 1, 'thumb/15407212781585478IMG_20181024_173252_174.jpg', 1, 666, NULL),
(127, 'DO YOU?', 'Emmiasky Ojex', 'show', '<p>Do you see us when we cry?<br>When we try to hide our faces in the sand?<br>have you ever thought it through,</p><p>That these people might be hurt too<br><br>Do we seem like we do not have pain receptors in us?<br>Nay, we are born out of bone and blood</p><p>We also feel the same pain you do<br>Only that the would sees us as weak and your strong when we show it<br><br>Do we seem like goats<br>We do not need to be told</p><p>You are a man, be one<br>Will you tell these words to my boy when I am gone?<br>&nbsp;</p><blockquote><p>Please look into my eyes and tell me</p><p>Its okay to be a hurt boy.</p></blockquote><p><br>Of course, I am a boy!<br>Is that a curse?<br>Can I not feel hurt as well?<br>Or will you only notice my tears when I drown in the well<br><br>Please look into my eyes and tell me</p><p>Its okay to be a hurt boy.</p><p>&nbsp;</p><p>From a friend that cares,</p><p>Emmiasky Ojex</p>', 'uploads/15411636299670157do_you.jpg', '36au8m1elEn53m8538', '13:00:30', '2018-11-02', '15411636303c7ei17ao90rt9299ld', 1, 'thumb/15411636307657899do_you.jpg', 1, 563, NULL),
(128, 'You\'re A Limit To Manhood', 'Oluwaseun Ejire', 'show', '<p>You are a limit to manhood&nbsp;</p><p>A limit to living creature,&nbsp;</p><p>You have built a mansion of thoughts in the heart of man;&nbsp;</p><p>I am your MATHEMATICIAN</p><p><strong>I am your GRADER&nbsp;</strong></p><p>I am your VIEW&nbsp;</p><p>I am your ACCOUNTING OFFICER&nbsp;</p><p>This is because you\'re AGE&nbsp;</p><p>This age will never come back _ so fall in love, if u can\'t, have a new crush everyday. Dream, imagine, go crazy, dance madly, click crazy poses, talk constantly, laugh loudly, speak abusing words, sing favorite songs, shout, take chances, break the rules, make your own philosophy, smile and make others smile,&nbsp;</p><p>Live this AGE, because things are going to be difficult and difficult tomorrow.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ej_oluwaseun&nbsp;</p><p>&nbsp;</p>', 'uploads/15412541701652764afac374cdaaa16e-a-nw-p.jpg', '15409061695snaoeu694w89l7304u', '14:09:31', '2018-11-03', '1541254171cr2le6129ieau9r3oy9t74', 1, 'thumb/15412541704721813afac374cdaaa16e-a-nw-p.jpg', 1, 204, NULL),
(129, 'BLAME IT ON THE MONEY', 'Emmiasky Ojex', 'show', '<p>Look at our daughters<br>They now show no ill in laying with men old as their fathers<br>Look at our sons<br>Nothing is holding them back from scamming the green people with their bad brain and laptops</p><p>&nbsp;</p><p>Look at our mothers, fathers, the young men and alike; women,<br>They now have no time for their own children,<br>Everyone is too busy searching for just one thing,<br>And that is known as MONEY!</p><p>&nbsp;</p><p>Why will a lady lay with a dog?<br>Or whyll she prefer to be known in the environ as a hog?<br>Is it not just for one thing?<br>They choose to sell their body?</p><p>&nbsp;</p><p>Why will a schooler choose to become a drop-out with no good passion?<br>But hes trying to boycott hardships and hardwork<br>Hell just join the bad gang<br>And will receive money off stealing from the innocent man</p><p>&nbsp;</p><blockquote><p>Blame it on the money,<br>What is ours is now owning us</p></blockquote><p>&nbsp;</p><p>Hell swerve off money from the fleeceable parents<br>And to all their good, hell put an end<br>Hes not retarded<br>He just wants the wealth; in anyway it comes and at whatsoever cost, he cares less!</p><p>&nbsp;</p><p>Blame it on the money,<br>What is ours is now owning us,<br>And we still show no remorse,<br>As even today, some of your sons and daughters are still singing this MONEY SONG!</p><p>&nbsp;</p><p><a href=\"bit.ly/emmiasky\">Emmiasky Ojex</a></p>', 'uploads/15415112566779294money.jpg', '36au8m1elEn53m8538', '13:34:16', '2018-11-06', '1541511256rb22lm83alaic70te287e8', 2, 'thumb/15415112567235263money.jpg', 1, 583, NULL),
(130, 'SHARE PEACE  SPREAD LOVE ', 'Oluwaseun Ejire', 'show', '<p>I know the value of what I have in my heart and i refuse to let the world stop me from it. But, when things start being taken for granted, when you no longer appreciate my sincerity,&nbsp;<br>I won\'t SWITCH,<br>I won\'t get ANGRY, and<br>I won\'t be SPITEFUL,&nbsp;<br>End of life what really matter is,&nbsp;<br>What we BUILT not what we BOUGHT,&nbsp;<br>What we SHARED not what we GOT,&nbsp;<br>Our CHARACTER not our COMPETENCE,&nbsp;<br>We were all human until;&nbsp;<br>WEALTH classified us&nbsp;<br>POLITICS divided us<br>RELIGION separated us, and&nbsp;<br>RACE disconnected us,&nbsp;<br>Let\'s live a life that matters&nbsp;<br>Life of love to cater&nbsp;<br>Let\'s send to every length and breath,&nbsp;<br>Let\'s show love while we\'re still alive,<br>Not in death _ all for love&nbsp;<br>SHARE PEACE  SPREAD LOVE </p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ej_oluwaseun</p>', 'uploads/1541980143922535485754a7d2888d86-a-nw-p.jpg', '15409061695snaoeu694w89l7304u', '23:49:03', '2018-11-11', '1541980143etr5el69ra7519i1ha9sc', 1, 'thumb/1541980143462307885754a7d2888d86-a-nw-p.jpg', 1, 763, NULL),
(131, 'WHY SHOULD I NOT?', 'Emmiasky Ojex', 'show', '<p>Why should I hold it in?<br>Is my heart an inn?<br>Why should I not say when I have been hurt?<br>Will you only learn the evil your shunning made me do when I become a member of the dreaded cults?</p><p>&nbsp;</p><p>Why can I not cry too?<br>Why does my pains have to be kept mute?<br>Will you only see the pain in my perforated heart after I go home<br>Beyond this phase, transcendence into the metaphysical zone?</p><p>&nbsp;</p><p>I am human,<br>Born of skin and bone<br>Not made of rocks and stones<br>I have a right to be sad.</p><p>&nbsp;</p><p>So why will you tell me to hide my face,<br>Beneath the dwellings of the bed sheet<br>And under the railing of my own skin<br>Why, I still wonder why?</p><p>&nbsp;</p><p>If you can tell me your pain<br>Maybe I can ease you by telling you the shame coming out to tell the world what boys suffer brings to my name.</p><p>From your friend that cares,<br>&nbsp;</p><p>Emmiasky Ojex</p>', 'uploads/15420215313963358norbert-toth-1096345-unsplash.jpg', '36au8m1elEn53m8538', '11:18:52', '2018-11-12', '1542021532aw3118h99ety99cr1i3l', 1, 'thumb/15420215312625730norbert-toth-1096345-unsplash.jpg', 1, 735, NULL),
(132, 'REMEMBER US THIS WAY', 'Emmiasky Ojex', 'show', '<p>REMEMBER US THIS WAY</p><p>I look back on the memories weve had sometimes ago<br>When life was free for every one of us, both young and old<br>When hiding in dilapidated buildings wasnt a survival technique<br>And death was from nature, not a man-made epidemic</p><p>When our young ones were free to go to school, grow up and become men wholl rule<br>And the dead sons of our land werent having their cadavers along the road-path<br>When our daughters were whole to be married<br>And not hampered like now as they have to be carried</p><p>Ill look back on the time happiness was never far from our sides<br>And joy wasnt gotten from seeing our enemies die<br>Ill look back on the building up front<br>With so many moments had therein, good and bad, all that we hold fond</p><p>Ill remember that fahir was in us too<br>But now, as soon as the day brings itself new<br>Ill see that the brother Ive had my whole life is gone<br>To his end of time at the mercy of a snipers shot</p><p>Ill go to the death-counter, and see another suns been decimated<br>And another light has just been put off<br>All for what?<br>The land,<br>Power,<br>Money,<br>Or religion?</p><p>Another 12-Yearld has just been laid to rest<br>With his mother wailings as the day before yesterday, he laid on her chest,<br>Promised her I will grow up, become a feared militant and put the wars to an end<br>But, he has just been pushed off of earth</p><p>We had holidays<br>Now only morning days<br>Yet as the dust fills our faces<br>Well hold on to our faith</p><p>For someday, we shall all together, say<br>It was all yesterday<br>So for this, Ill always remember us this way!<br><br>From a friend that cares,<br>Emmiasky Ojex<br><br>&nbsp;</p>', 'uploads/15423795302068567remember_us.jpg', '36au8m1elEn53m8538', '14:45:30', '2018-11-16', '15423795306391tibere15ee6lca59m0rmr', 2, 'thumb/15423795302782672remember_us.jpg', 1, 535, NULL);
