(142, 'Letter To Self ', 'Oluwaseun Ejire', 'show', '<p>Dear self,&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Be real _ be true _ be loving to yourself, distance yourself from people who lie to you _ disrespect you _ use you and, put you down.&nbsp;<br>Always do what you like _ it\'s freedom&nbsp;<br>Like what you do _ it\'s happiness&nbsp;<br>Let your tears water the seed of your future happiness,&nbsp;<br>Slow down _ calm down _ don\'t worry _ don\'t hurry, trust the process&nbsp;<br>Once beaten _ keep trying, remember; slow _ steady wins the race, never be anxious about tomorrow, for tomorrow will be anxious itself.&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;loving self &nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ej_oluwaseun</p>', 'uploads/15446075847236675d9a3c8c2fe62c8f-a-nw-p.jpg', '15409061695snaoeu694w89l7304u', '09:39:44', '2018-12-12', '1544607584708tea66r3tel951tric4le', 1, 'thumb/15446075842874261d9a3c8c2fe62c8f-a-nw-p.jpg', 1, 434, NULL);
INSERT INTO `blog` (`id`, `title`, `author`, `visibility`, `body`, `image_1`, `created_by`, `time_created`, `date_created`, `hash_id`, `about`, `thumbnail`, `notification_status`, `rcount`, `category_id`) VALUES
(143, 'Suicide Note (Page One)', 'Abdulhafeez Onitilo', 'show', '<p>If you are reading this, it means it\'s too late to help,&nbsp; I am not going to blame anyone for my actions instead I will tell you my story and let you be the judge but before I do I need you to know some things about me.</p><p><br>My name is <strong>Benson Afolabi Richard</strong>, I am 18 years old, I like to write and listen to music, I am also smart which is the only thing I am proud of. I am not much of talker as I get easily intimidated. I was only able to make three friends, one is late and the remaining two have distance themselves from me lately.</p><p><br>My dad left us when I was four and the next time I saw him was when I lost my twin brother, then I was five. I can\'t really remember much about my dad because even when we had him, I never felt like I had a father, he distanced himself but one thing I can never forget was the way he looks at us. I can\'t really say why but whenever my dad takes a look at my twin and I, I could see it in his eyes that he hates us and the news of my brother\'s death was like a thing of joy to him, I remember I overheard him telling my mum, \"<i>at least one of them doesn\'t have to worry about the truth</i>\", the meaning of this statement became much clearer as I grew older.</p><p><br>After my dad left us, mum became a wrecking ball as she gradually drowns herself in self-pity, alcohol, hard substances and home service sex.&nbsp; To be honest at times I don\'t blame my mum for the way things turned out because when my dad left us he left us with nothing, three months after he left we were evicted from the house we thought my dad had bought and this was the beginning of my misfortune.&nbsp;</p><p><br>We relocated to <strong>Festac</strong> and my mum literally stopped caring about my well-being though not immediately, I mean I have to give her credits, at first she did what she could to make us survive. I stayed at home all the time when we first got to Festac as my twin and my mum will go look for how to make ends means and it was during this period that we lost my twin, he was involved in a hit and run.</p><p>I didn\'t say my first set of words till when my twin brother died and just in case you wondering yes we were identical. It was assumed I was dumb, I couldn\'t speak so I learnt how to write fast and that won\'t have been possible if not for my mum\'s friend aunt <strong>Florence</strong>, she really helped on how to communicate, she even taught me some sign languages.&nbsp;</p><p><br>My love for music came as a result of a portable CD player I found when we were packing to Festac, mum said it belongs to dad, this CD player was my best friend as I had no friends and wasn\'t steady with my speech. So when I feel lonely I just listen to&nbsp;<strong>Bob Marley</strong>\'s CD album over and over again.</p><p>There are times I wish my twin was alive maybe life would have been easier for me, maybe I won\'t have gone through some of the depressing things I went through, maybe I won\'t have done what I eventually did. There are also times I blame my twin for everything that happen to my mum, if only he had not die, my mum probably won\'t have fallen off the wagon but life is cruel, it doesn\'t give you much and it takes everything from&nbsp; you, a lesson I learnt when I was seven&nbsp; years old.</p><p>So there you have it, that\'s everything you need to know about me, oh wait I forgot to add that I didn\'t attend nursery school, I started my education from primary one, aunt Florence was a school teacher, she was the one that helped me with the basic learning while I was also learning how to formulate my words better. Aunt Florence was fond of me for many reasons and one of them was my ability to learn quickly. I am not like every other kid, I don\'t have a best food as I eat what I see, and there are even times I have nothing to eat aside to drink water to fill up my belly.</p><p>So yes there it is, everything about myself I think you need to know, any other thing I recollect I will write down but for now that is all about Benson Afolabi Richard.</p>', 'uploads/15447966164530073IMG_20180226_225636_584.JPG', '1544793563df6a5lb09e3a74ze6hu5', '14:10:16', '2018-12-14', '1544796616s3c0ee6119a4iltdu3ri7c9i', 1, 'thumb/15447966163685328IMG_20180226_225636_584.JPG', 1, 662, NULL),
(144, 'Suicide Note (Page Two)', 'Abdulhafeez Onitilo', 'show', '<p>If you are reading this, it means it\'s too late to help, I am not going to blame anyone for my actions instead I will tell you my story and let you be the judge.&nbsp;</p><p>I was very excited the first day I went to school, I was finally going to mix with my peers, finally&nbsp; going to make friends, the excitement in my face was off the charts, I couldn\'t wait. I attended Festac Primary School and the moment I stepped into the school compound and I saw students on the assembly ground, I wanted to go back home. I was scared, I have never been around many kids but my mum held my hands and told me everything would be fine.</p><p>Everything was indeed fine, I mean I won\'t be the first primary school kid to be stabbed in Festac, at the age of 10, I was already an adult with my reasoning, while my mum was getting drown in being a single mum, the street of Festac raised me. I saw and learnt things a young boy shouldn\'t be learning even in the next generation. My mum, sorry this page is still about me, so I will get back to my mum.</p><p>Remember I said something about being smart, yes I was smart<i>. Na my smartness no make popo catch me when them carry Iwge for Cocaine Avenue, na this same brain I use escape catch fire for Festac College and na this same brain I use do wetin I do</i>.</p><p>My last birthday was the 6th year of me seeing a therapist and mum doesn\'t even have a clue. At age 11 I had my second depression and this was because I couldnt deal with the abuse from aunt Florence anymore, another thing my mum doesn\'t know, the only way I could deal with it was to leave Festac. Two years after I left Festac, <strong>Ehis</strong> was buried, Ehis was that every parent kind of son, he was strong enough not to allow the street life distract him, still he was killed for being Ehis, if Ehis had lasted this long, I am sure he would have found a way to talk me of out this, he always knew what to say to me and that I envy a lot because he had the kind of family I wanted.</p><p>Ehis was my best friend, his death really broke my heart, it made me begin to wonder, what you can do for life to actually be fair to you. Up to this very moment I always wish I could have traded my life for Ehis, I wish my mistake didn\'t affect him, when I heard how Ehis died, I knew it was my&nbsp; doing. I told him a secret I wasn\'t supposed to and just like he promised, he took that secret to his grave, literally speaking.</p><p>I took a big risk when I wanted to leave Festac, the outcome is only known to Ehis and I, and I am also taking the outcome to my grave. My therapist said the only true way for me to honour Ehis is by not giving up the secret he died for, that\'s why I am not going into details of that event. I really miss Ehis, I always carried the picture we took together during one of the first three birthday parties aunt Florence threw for me. As a matter of fact it was my sixth year birthday, I had a decent result in class and my speaking ability had improved though I was still very much shy. Still aunt&nbsp;Florence said my birthday is still worth celebrating, for someone that can\'t recollect any form of birthday celebration, my sixth birthday was one I held dear to my heart and it was also the beginning of me being used as a <i>sexual toy</i> or let me say, I became that kid <i>wey them they use suppress</i> <i>konji.</i></p><p>Yes I used the word them because aunt Florence had a friend, aunty <strong>Ada</strong>, she too took her chances whenever she was around. <i>I know everything about you and aunt&nbsp;Florence, if you don\'t do what she use to tell you to do with me, I will tell your mum</i> these were the exact words she uses to tie my hands. At this point let me tell you a little about my mum\'s situation, three months after we got to Festac she started going out with <strong>Demola</strong>, she thought she was in love, I mean Demola was spending so who could blame her. But it was soon she found out that a Festac guy will do anything to get a lady to bed.&nbsp;</p><p>One month after <i>constant bedtime</i> with my mum, Demola tossed her side. My mum was heartbroken, she was a laughing stock on the street but aunt Florence was able to help her heal. She and my mum became close because she too was once played by Demola, so she understood what my mum was going through. Now as a kid of 6 years how exactly do you tell your mum that her best friend who by the way doesn\'t keep a boyfriend is using her son for sexual satisfaction?</p>', 'uploads/15447968594731197IMG_20180226_225636_584.JPG', '1544793563df6a5lb09e3a74ze6hu5', '14:14:20', '2018-12-14', '154479686039l8ase6icdiu3r48ic39et7', 1, 'thumb/15447968599654172IMG_20180226_225636_584.JPG', 1, 410, NULL),
(145, 'Suicide Note (Page Three)', 'Abdulhafeez Onitilo', 'show', '<p>If you are reading this, it means it\'s too late to help, I am not going to blame anyone for my actions instead I will tell you my story and let you be the judge.&nbsp;</p><p>Still talking about my mum, remember I said she did all she could do but then again life isn\'t just fair. She got a job as a club manager in one of the big hotels in Festac, the pay was good, at least we could have three square meals, I could pay my school fees and house rent wasn\'t an issue, my mum was happy her life was finally getting back together, the only thing that eluded her was love, not that I am trying to insult my mum but she was a sucker for love, few sweet words and she is head over heels for you. After her break up with Demola, aunty Florence introduced her to Daniel, Daniel showed my mum true love but all was just part of a big scam.&nbsp;</p><p>Daniel wasn\'t as rich as Demola, so most of the spending was done by my mum, something aunty Florence was against at some point then, you know what they say about love, it is blind for those who choose not to see, my mum wasn\'t ready to see. Aunty Florence didn\'t know much&nbsp; about Daniel, he was a friend of a friend, Daniel ran into aunty Florence and my mum at the club and after Daniel and aunty Florence did some catch up, he asked to be introduced to my mum and she did and that was how the relationship started.&nbsp;</p><p>There were nights where the club was filled up that aunty Florence and I would at times give my mum a hand and when Daniel came into the picture, he will help too. There was this night the club was very busy, as the ballers of Festac came to ball, my mum needed all the help she could get but that very day I was ill and aunty Florence had to stay with me at the hospital, my mum had to turn to Daniel to help her out which he did. Sales was at it\'s peek, that around 4am when things had ease, my mum and Daniel decided to have a drink in her office to celebrate the sales because that much sales means my mum was going to get a bonus pay. According to what my mum said, it was her idea that they have a drink together but things got really out of hand that my mum got drunk and eventually slept off. She woke the next morning and Daniel was gone.</p><p>She said when she woke up and discovered that Daniel had left the club, the first thing she did was to call him to know where he was but his number wasn\'t going through. She said it was after this she decided to do a proper account of the money they made the previous night, she screamed like a mad woman when she realized that the money which was up to a million plus was gone and the only person that saw where she kept the money was also gone. She said she sat down there crying because it was at this point she realize she didn\'t know where Daniel lives, she kept on calling the number but the number didn\'t go through. She sat down there crying till the owner of the club came, she was arrested, beaten and after three months in prison she was let go when it became obvious that she really didn\'t know anything about how the money went missing, that was the last time she saw Daniel.&nbsp;</p><p>This incident was the wrecking ball incident for my mum because after this, she literally didn\'t care much again, all she wanted to do was to keep drinking, aunty Florence would prevent her at times and at times they will both get drunk and say all sorts of rubbish talk forgetting that I am in the house. It was during this their drunkenness talk I knew that aunty Florence had not had a relationship in three years and she was a pimp, not sure if a woman is called a pimp but I am sure you get what I am trying to say. My mum begged her to find her one rich guy that can take care of her needs or make her one of her runs girl but she turned my mum down, saying she can\'t do that for her. At times I wonder what if she had said yes, what if my mum had gotten that sugar daddy maybe she won\'t have gone down the path she did.</p>', 'uploads/15447970129958569IMG_20180226_225636_584.JPG', '1544793563df6a5lb09e3a74ze6hu5', '14:16:52', '2018-12-14', '1544797012lcdi6re4421uatc9i0e13si2', 1, 'thumb/15447970122445141IMG_20180226_225636_584.JPG', 1, 490, NULL),
(146, 'Suicide Note (Page Four)', 'Abdulhafeez Onitilo', 'show', '<p>If you are reading this, it means it\'s too late to help, I am not going to blame anyone for my actions instead I will tell you my story and let you be the judge.</p><p>At times I wonder what would have happened if aunty Florence had just helped my mum find a man who could take care of her. I wonder what if she had not met Daniel probably my life won\'t have turned this way, if my mum wasn\'t always getting drunk almost every night, I am sure I would have told her that I was abused sexually though back then I didn\'t know what I would have called it but at least I would have been able to tell her what aunty Florence and her friend were doing to me.</p><p>If you are reading this, I want you to picture how much mess it was for a child to literally witness different men sleeping with with his mother almost every night. I know this might sound funny but if there is one thing I can\'t get out of my head, it is the way my mum\'s b00bs bounces up and down when she bends down for one of those men to ride her from behind. After my mum got back from jail, she almost took her life if not for aunty Florence who stopped her that night I might have been a complete orphan by now. There are times I think about that too, maybe I would have been better off if she had just killed herself at least I won\'t have to watch her destroy herself.</p><p>Before I stop talking about my mum, let me just say that she got help, she got better, at least the last time I saw her she was looking healthy. Mummy if you are reading this, it means it\'s too late to help me, I want you to know that I do love you and I don\'t blame you for how my life turned out, I guess I was also messed up in my own way. I also want you to forgive aunty Florence in as much as she was using me as her pleasure object she had some positive impact in my life. Remember the scholarship I won that you said I couldn\'t go because you couldn\'t let your only child out of your sight, she was the one that stayed with me all through the night to make sure I studied hard and of course without her, I am not sure my speech would have been this perfect, so please mum find it in your heart to forgive her.</p><p>The first time aunty Florence made me touch&nbsp; her was the day I went to her house, I had just returned from school and I needed to do some homework, usually she would have been in my house but since I didn\'t meet her I decided to go look for her. She invited me to her room, took a look at my homework and she put me through, then I went to the sitting room to continue with it. After I was done I went back to the room to show her so that he could cross check like she does, I got into the room and I met her almost naked on the bed, I quickly ran out of the room apologizing as I did, she used her towel to cover herself and came to the sitting room. When I saw her I was scared to death as I started to apologize, <i>I am sorry, I didn\'t know, aunty Florence I am sorry</i> I said continuously but she just stood there looking at me smiling. After a while she said \"leave your assignment and follow me to the room, to be honest I started crying because I felt I was in for it and the fact that she didn\'t even say a word after that just made my tears and begging much louder.&nbsp;</p><p>As we got to the room, she sat on the bed and told me to move closer to her and as I did, she told me to stop crying, she said she knew I didn\'t come in on purpose, so I should stop crying. She wiped my tears as I comported myself, she then asked me what part of her body I saw, at first I said I didn\'t see anything but she touched my head saying she wasn\'t going to beat me that I should just tell her the truth. I told her I said I saw a quick flash of her b00bs, she smiled for a while and that left me confused, in my mind I was thinking what was making her smile but I got more confused when she said \"will you like to see it fully?. My throat became dry, words weren\'t coming out from my mouth and for the first time in a long while, I lost my voice. While I was still struggling to gather words out of my mouth she took my hands and placed it on her \'oranges\' and said \"don\'t be shy, you can touch it then she left my hand on it. Like a stature my hands just remained there as I didn\'t even know what to say or how to act, I eventually took my hands off her and said \"I am sorry. She smiled as she ask me what I was sorry for, before I could say anything she took off her towel and said I want you to touch it, I didn\'t know when I urinated on my body.</p>', 'uploads/15448650973905907IMG_20180226_225636_584.JPG', '1544793563df6a5lb09e3a74ze6hu5', '09:11:37', '2018-12-15', '15448650973a4e6i0594u2i2trccies8dl', 1, 'thumb/1544865097274588IMG_20180226_225636_584.JPG', 1, 546, NULL),
(147, 'Suicide Note (Page Five)', 'Abdulhafeez Onitilo', 'show', '<p>From pressing her b00bs, I moved to sucking it and after a while she told me to start touching her privates. I know this will sound silly, there are times I actually enjoyed touching her, I mean I get this sensationally feeling that just makes my body feel unnecessarily good. It was obvious she was enjoying whatever it was I was doing to her, though I couldn\'t understand if it was my own touch that made her scream or it was the way she was dipping her fingers into her privates.&nbsp;</p><p>From the day she first made me touch her, I never did my homework in my house anymore, once I came back from school, I will go to her house with my homework as that was what she said. I know you might be wondering why I didn\'t look for someone else to help me out but that is even a different story all together. Because of my inability to speak fluently, I didn\'t make many friends in Festac aside Ehis and because of my mum\'s history with guys, I hated the guys on my street. So I was stuck with Aunty Florence and like I said, she wasn\'t all that bad as it wasn\'t every time I go to her place that she would ask me to touch her, there are days where she would even beat me if I mess up with my assignment.</p><p>I guess me helping her satisfy whatever urge she was feeling was just about the only bad attitude she has that I know of, aside from that she was very disciplined, if you see the way she talks to my mum, you might think she gave birth to my mum. I remember one night I cried to her house because I was very hungry and my mum had passed out wasted, she feed me and made me sleep at her place, the next morning when we got to our place, she blasted my mum, my mum started to cry that day, my mum later apologized to me.&nbsp;</p><p>Before I forget, let me quickly say that I didn\'t stay long in school, the last time I went to school was a week before my mum got arrested and throughout her stay in prison I didn\'t attend school though aunty Florence told me to go school but I couldn\'t, I couldn\'t even walk on the street during the day as I was ashamed of the way people were looking at me and even the names some of them call me got me crying at times. Aunty Florence wasn\'t really around during that period she said she had some things she had to take care of. Whenever she was around she will come over to our house to take care of me but when she wasn\'t around I was lived on my own and this was how I started getting familiar with Festac street life.&nbsp;</p><p>When I get bored, I go to 5th avenue which is far from my street to play football, I enjoyed playing football. At 5th avenue nobody knew me or my mum, so I didn\'t have to hide my face, though I wasn\'t really vocal when I am with some of the street boys but I get to speak when necessary. I remember meeting this bros in 5th avenue, bros Chima. Bros Chima liked girls a lot, that is another thing about Festac I didn\'t mention, every Festac child grows up doing three things: Music, Womanizing or becomes a chronicle smoker, as for bros Chima, it was the ladies and a bit of smoking. Bros Chima liked me because I was very quiet and intelligent, he became my street brother, I remember when I started going to 5th avenue, I wasn\'t always picked to play football so most times I just watch and go home.&nbsp;</p><p>One day bros Chima who was one of the bros that were placing bet on those playing called me up, he asked if I was new to the street and asked why I was always around if I couldn\'t play football, I told him I wasn\'t from the street and that most times when they get to select players I don\'t get picked. He told me to come on time the next day as he promised me I will get the chance to be picked and just like he promised the next day I came, I played and that was how I started rolling with him, days that I don\'t feel like playing he would invite me to join him and his friends in his house, it was from him and his friends I learnt how to play card and I had my first hard drink with him too.&nbsp;There is this game called strip, this is where whoever loses a game of card will be told to take off a clothing item and I have witnessed some girls strip to their panties alone. Once it gets to that level bros Chima will ask me to go home and come back the next day. Even though I was always shy he was the one that taught me how to approach a girl because most times he will always send me to help him go met a girl.&nbsp;</p>', 'uploads/15448653025880965IMG_20180226_225636_584.JPG', '1544793563df6a5lb09e3a74ze6hu5', '09:15:02', '2018-12-15', '15448653023u236le0r0iasi6d8ti74cce', 1, 'thumb/15448653024780892IMG_20180226_225636_584.JPG', 1, 525, NULL),
(148, 'Suicide Note (Page Six)', 'Abdulhafeez Onitilo', 'show', '<p>Bros Chima was like that big brother I never had. He always looked out for me, he thought me how to be tough in his own possible way. In 5th avenue I was like a prince, I could move around and do whatever I like, the streets of 5th avenue was my safe haven.&nbsp;</p><p>At the same time it was on this street I was first chased by police men. It was on this same street I witness robbers killing someone in cold blood. I can\'t forget that evening, I was cold all through the night. It was some few minutes to seven, I can remember vividly because I had just finish playing ball and was heading to bros Chima\'s flat to wash my body and just stay there for a while. After washing my legs and face, bros Chima gave me money to go buy him beer and Garri (yellow Eba). I had bought it and I had ten Naira change so I decided to branch at a Mallam shop to buy biscuit for myself. It was at this Mallam shop I heard the shooting, I didn\'t know what it was, in my mind I thought it was \'banger\' only for me to see Adamu (the Mallam) closing his kiosk shouting \'danborobber\'. I turned back to face the street and till today what I saw still sends cold shiver down my spine. A man was lying on the floor in his own pool of blood as the thieves were speeding off in their car.&nbsp;</p><p>I didn\'t go back to 5th avenue for like a month, till today I can\'t even remember what happened to the Garri and beer I went to buy nor can I recollect how I got home, all I remember was seeing the blood and waking up the next day at home. Of course I still went back to 5th avenue but bros Chima and I weren\'t that close anymore, can\'t really say this was what happened, I just notice that one day I stopped going to his house and eventually I even stopped going to 5th avenue though I can remember the reason for that. There is this big sandy field in 5th avenue that is where the bros <i>dem dey play</i> football. On this unfortunate day, I decided to&nbsp; go to the field to watch them play ball, no, sorry I actually went to look for bros Chima, I was told that he had gone to play ball so my thought was that he went to the sandy field. On getting there and noticing he wasn\'t there, I decided to stay and watch the other bros playing, little did I know that I was going to get in trouble.&nbsp;</p><p>The field has a fence around it, I was seated on the fence when I notice some activities going on opposite me. They were three bros sitting on a bench at the other end of the fence, my eyes caught them at first but I didn\'t pay attention but after a while when my eyes went towards that direction again I saw one man walk up to them, gave them money and in exchange they gave him a small black nylon. I couldn\'t say what was in the black nylon but my eyes followed the man whom by the way was putting on a nice <i>Agbada.</i></p><p>I saw the man get into his car, a BMW X5 Jeep and as I was taking my eyes back, my eyes came in contact with one of the bros sitting down and he gave me a signal to come over. Wetin small pikin like me know, I went over, he asked how many of my mate did I see on the field and that was when I realized I was the only kid on the field. I tried making up some excuse but he wasn\'t buying it as he kept tapping me on the head. He brought out another small nylon from one of the holes in the fence as someone else walked up to him. I didn\'t look at them as I took my face away but I heard him saying tell <i>chief this one strong pass the last one, na Italian coke be this</i>. I took a quick glance at the nylon wondering what type of coke could be in that small nylon. After the guy left, he asked me why I was looking at the man that left and what did I see, I told him I didn\'t see, I lied that the man looked like my Mum\'s friend that was why I was looking at him. He pulled my ear and said <i>I no won see you for here again, oya disappear</i>.&nbsp;</p><p>I disappeared and I went home, hours later I was playing on my street when I saw one of those bros with three other bros I can\'t recognize, as they sighted me, he shouted \'na the boy be that, that was how I started running as I saw them running towards me. As I was running I was thinking, what in the hell did I do?, they caught up with me and before I could say <i>Jack Robinson</i> they started pounding me saying <i>na you go jabo abi</i>. After beating me for like three minutes, they calmed to ask if I was the one that told the police that <i>Catch Fire</i> was selling drugs at the field. I was very much confused because I didn\'t see them with any drug, I told them no, I didn\'t speak to any police neither did I see them selling any drug. Then one of them slapped me again and said <i>so you won talk say you no see us they sell white coke today?</i>. I was shocked, of course as a Festac boy I have heard of it but when Catch Fire mentioned Italian coke my brain didn\'t think towards that.</p>', 'uploads/15448656295872880IMG_20180226_225636_584.JPG', '1544793563df6a5lb09e3a74ze6hu5', '09:20:30', '2018-12-15', '15448656308u7ta2cr2ld9i99es50ei1ci', 1, 'thumb/15448656291035548IMG_20180226_225636_584.JPG', 1, 624, NULL),
(150, 'BE YOU', 'Ifedapomola Deborah', 'show', '<p>I was still thinking about it, until Sister Linda Ikeji case came up.</p><p>&nbsp; &nbsp;A friend of mine, Dami, he said Ifedapo, I love the way you write, I\'m sure you must be a strong, super woman. In my mind, I laughed and was like only if you know how weak I can be. Sometimes I even act like a child, you\'ve not witnessed me weeping. You don\'t know days when I feel like not praying, not even reading my bible. Even to carry my notes or books to read is problem for me. Someone would see and be like spiritual mama, I\'m telling you I still look up to people and feel like baby christian. Sometimes, when I\'m praying for people, I\'m wishing someone too is praying for me out there too? I\'m responsible for people but I will ask myself is there someone out there looking out for me? I care for people but sometimes, I want to be careful for. I\'m sure same thing happens to several people who God has placed in one position or the other, that people look up them. But in this part of the world we are in, they see these people as demigod, they expect you to be perfect, no sign of weakness and if you do otherwise, then your are hypocrite, pretender, or you are probably seeking for attention. These have definitely caused problems in the lives of several celebrities.&nbsp;<br>&nbsp; &nbsp; One thing I always do before writing is directing that situation to myself, what if you are in that position, what will do? If this was written about you, how will you feel? So when I write, I don\'t always write for people alone, I write for myself also. So atimes when I go back to what I\'ve written, I\'m always amazed and I have benefited from what I wrote myself.<br>&nbsp; &nbsp;So I\'m going to address three situations here. Firstly, because you are in a particular position doesn\'t mean you can\'t make mistakes, as long as we are human, we are prone to it. Situations or people may warrant them to do so. Some might not even know they are doing the wrong thing and some, I won\'t lie to you, they are just seeking attention, they just have evil motives. But one thing I always love is for one to admit that he or she is wrong and learn from that mistake, or else you will make yourself a liar and lose your integrity.&nbsp;<br>&nbsp; &nbsp; &nbsp;Secondly, before you remove the log in someone\'s eye, remove the speck in yours first. Don\'t say it because that\'s what they are saying, don\'t write because that is what you are expected to write. Don\'t say or write what you don\'t practice. Don\'t think if I say, do or write this, they will love you more. People are watching in case you don\'t know, you might think they are not looking and it won\'t be nice if they didn\'t speak well of you.&nbsp;<br>&nbsp; &nbsp; &nbsp; Lastly, people can be so funny at times when used them to measure on how well you are doing, Right from when I was kid, all the uncles and aunts in the neighborhood would say; \"you should go to Art class, you write very well\". Some would say \"I\'m touched\". Another person would walk up to me and say \"I love the way you write, can you write something for me?\" Another one would say, \"let\'s write something together\". Another one will ask you for your advice. Another will even ask you \"when are you writing the next episode?\" You know when they give you more attention. So they expect you to give them more and more, you wouldn\'t want to disappoint them. Somehow, you get used to it and when you couldn\'t keep up, you had to do something forgetting that these same people are the one who will point fingers at you. What am I saying in essence is be yourself and don\'t exaggerate things, don\'t be afraid to say you can\'t keep up. Don\'t let your happiness depends on people or to please them yet don\'t let it be about you alone... you are becoming selfish in nature. Just be you.<br>&nbsp; &nbsp; &nbsp;&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br>Photo: One of the \'lazy me\' picture&nbsp;</p>', 'uploads/15448841386086341IMG_20181209_161032.jpg', '15371875057edl8i07ap4a99f7oo99m', '14:28:58', '2018-12-15', '1544884138bet50r9ali8e6c97317', 1, 'thumb/15448841386150165IMG_20181209_161032.jpg', 1, 623, NULL),
(152, 'Found', 'Akole Banji', 'show', '<p>It\'s a blank...</p><p>From the beginning, I wait patiently to see it come for me.</p><p>Looking looks like not looked enough.</p><p>Prayers feels like it doesn\'t get up enough.&nbsp;</p><p>When would I find it? As I wait patiently.</p><p>Patience can last over ever... doesn\'t always pay off.</p><p>It looks like I didn\'t get it anytime...but I won\'t give it up. I won\'t let go...It must be found.</p><p>I never had it...even when I thought I did...Cruising down with laughter...</p><p>Oh no...it lacks one...It\'s not it. I thought I found it...But I lied.</p><p>I had to assume it\'s inside of it... somewhere...It would come out.</p><p>Let this not be my fall...let me not perish as I seek...Let me not get in trouble as I hope.</p><p>But as the day goes by...If this was mine...It would be mine...</p><p>But I didn\'t find what I came for...Oh...it\'s lost...it\'s shameful...So I stopped looking.</p><p>What\'s this? doesn\'t look like it...But I take possession.&nbsp;</p><p>Possession gives way for a clearer look...and I think it\'s here...this is it.</p><p>The exact that I want...with all I have hoped for...with all I have given up.&nbsp;</p><p>This is hope...a great heritage...a good find. Rest of mind.</p><p>And now I can be glad to find it all.</p><p>God is with us.</p><blockquote><p>Stay focus...it\'s not lost forever...what\'s yours will come for you...God Made It So.</p></blockquote><p>&nbsp;</p><p>&nbsp;</p>', 'uploads/1545413450361811images_(1).jpeg', 'j90819542aBn72i', '17:30:51', '2018-12-21', '15454134517t5e0dcu50a59n8orf3li2', 1, 'thumb/3891209thumb1545414539.jpg', 1, 671, NULL),
(153, 'Lonely Hearts', 'Akole Banji', 'show', '<p>Hey, Lonely Hearts!</p><p>May I call for a meeting?</p><p>Our times are here, when sweet moments fade away.</p><p>When the smiling lip goes nay,&nbsp;</p><p>And our beaming eyes go dim.</p><p>Though it was interesting, fun-filled,</p><p>Until our moment came yapping for our soul.</p><p>Shall I lay to heart the blooming morning, the dazzling nights,&nbsp;</p><p>As petals of love came dripping from the branch of the generous stem.&nbsp;</p><p>Shall I bring to bear the cage cracking moment,</p><p>When laughter makes us grasp for breath.</p><p>Alas, came for us the hurtful of all times...</p><p>Glorious past makes the heart beat faster.</p><p>The smile of the \'yester\' makes the eye misty.&nbsp;</p><p>What have we? What consoleth thee?</p><p>Holding precariously to the promises yet to come.</p><p>A promised appearance of a translucent future.</p><p>Where rain of petals shall pour again...</p><p>And the flood of happiness shall come rolling us away.</p><p>Shall we stop waiting? Else comes a flood of Noah.</p><p>The unexpected may come dragging us instead.</p><p>But we shall wait patiently, that our time may come.</p><p>That the rain of hope may shower again,&nbsp;</p><p>and the time shall bring to light once more,</p><p>the asynchronous beat of tantamount hearts.&nbsp;</p><p>Then we shall say,&nbsp;</p><p>\"God Pays Me\".</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 'uploads/1545502726959908Lonely_heart.jpg', 'j90819542aBn72i', '18:18:46', '2018-12-22', '1545502726r2lat6n448oc16i8le33ley', 1, 'thumb/15455027265718821Lonely_heart.jpg', 1, 901, NULL),
(154, 'Suicide  Note [Page Seven]', 'Abdulhafeez Onitilo', 'show', '<p>There are slaps and there is that slap I received from that bros, <i>mehn my brain reset</i>, I am not sure I have ever receive any beating like that again. I literally lost a tooth and I had to lie to aunt Florence that I injured myself playing football, I couldn\'t bring myself to tell her the truth, how could I?, knowing what awaits me if I do, that was the last time I ever went to 5th avenue.&nbsp;</p><p><br>Okay if you are reading this, let me quickly say this, everything you have been reading is because my therapist believes that writing down what I have gone through will help me move forward in terms of dealing with it. I met my therapist few months after I left Festac and I have to say meeting her has been a blessing so far, she has done a good job making sure I get myself together. I remember when I met her, my life was really messed up, I was sleeping under different bridges, eating from different dumpsite and at times <i>na market I go go steal wetin to chop</i>.&nbsp;</p><p><br><i>Na wetin I wan chop I go steal for market</i> the day I met my therapist, I thought I had successfully stolen bread off this woman\'s kiosk only for me to hear the daughter of the woman shouting <i>ole ole ole\"</i> and before I knew what\'s up market people began to chase me, I am a lazy runner but that doesn\'t stop me from running and like always I was caught. You know what they say about stealing in the market, <i>sharp sharp</i>, tyre was already hanging around my neck and I could feel the taste of petrol in my mouth, the jungle justice was about to be carried out.&nbsp;</p><p><br><i>\'Please please stop it, stop it, make una no kill am\',</i> these were the first sets of words I heard my therapist say. She literally saved my life that day or let me say she has being saving my life since that day. She took me to her house, changed my clothes then she fixed me something to eat. From the way I was eating she could tell I was very much hungry that she didn\'t even ask, she just went to get me more rice, after eating she then asked me what my name was. From the market till the moment I finished eating she didn\'t say a word aside asking if I was okay as we left the market.&nbsp;<br><br>I told her my name is Benson Afolabi Richard, lied to her about where I stay but told her the truth about everything else. I have to say at first I thought this woman was using jazz because I haven\'t been that free with anyone in my life the way I was with her in terms of speaking. Even aunt Florence that thought me how to speak, I only spoke with her when necessary but with her, from the moment she asked for my name, I just opened my mouth like tap water and I started talking.&nbsp;</p><p><br>It took me a while to understand that therapists have way of making you talk, though I have to say that\'s one hell of job, how can you just sit down and listen to people talk and complain all day, I would have been dead if I have to listen to my problem. When I told my therapist what I had gone through and what I am going through, she was fascinated, she couldn\'t believe how I was still able to put it together, she told me that at the point when we met I was going through depression (at first I thought that was like common disease) and also mentioned that based on what I have told her, that this will be the second time, she said she is afraid that if I continue this way I might not be able to make it to my next birthday.&nbsp;<br>&nbsp;</p><p>Well I have tried, I have come a long way since then, soon enough I will be eighteen though the guarantee that I will live to see that day is slim, I have done something very bad and it has to do with my father, the same father I told you abandoned me and my mum. The world is a small place they say and humans are like water we don\'t know which direction we might flow to tomorrow, well my father and I flowed to the same direction two years after I left Festac, funny thing the man didn\'t even recognize me.&nbsp;</p><p><br>Growing up, watching how my mother\'s life fell apart, I have always had this thought in my head about what I will do to my father if I ever get the chance to see him, there he was this very day, walked into the fast food where I work, place an order and he didn\'t even recognize me. As I saw him walk up to me to place his order, I started to remember everything he did to us while growing up and everything my mum had been through since he left and I wanted to do right there was to just ask him <i>why, why did he have to leave us?, why didn\'t he even bother to check on me?, why was he so relieved after the death of my twin?</i>.&nbsp;</p><p><br>I got my answers eventually but it wasn\'t in the way you would have expected.&nbsp;</p>', 'uploads/15459990259673082IMG_20180226_225636_584.JPG', '1544793563df6a5lb09e3a74ze6hu5', '12:10:26', '2018-12-28', '1545999026ed2l1iaci28t9ecr4s22u51i', 1, 'thumb/15459990259066589IMG_20180226_225636_584.JPG', 1, 595, NULL),
(155, 'Suicide Note [Page Eight]', 'Abdulhafeez Onitilo', 'show', '<p>Like I said I have always had this thought of what I was going to do to my father when next I see him but when I eventually saw him, I couldnt believe my eyes, for a moment I was shocked and dumfounded, until I heard that his bass voice saying <i>can I have a bucket of chicken to go please</i>?&nbsp;</p><p>To be honest I didnt know I had that strength to comport myself the way I did, the thought running in my head was to lock his shirt until he apologies for what he did to us but I just gave him his order without saying a word.&nbsp;</p><p><br>Few seconds after he steped out of the eatery I ran after him and by the time I got outside, I saw him drove off but I was able to catch his plate number. I told my therapist what I wanted to do and she said I did the right thing by not causing a scene, she said it shows I have more self-control though I feel it was indecision on my part because in between locking his shirt and making him beg, I also felt like breaking something on is head though what I did in the end was far worst.&nbsp;</p><p><br>Before I took out my frustration and anger on him I saw him twice after that very first day, the third time I saw him, he came into the eatery with his new family, two boys, a girl and his wife. Seeing the kids and his wife looking all happy and full of smiles triggered something in me that I didnt know I had.&nbsp;</p><p><br>The amount of hatred that grew in me that day is one I dont ever wish for again. I literally almost spat in their ice cream if not for one of my coworker who caught me and stopped me. He took me to the kitchen and asked why I wanted to poison a customer. I told him the customer his my father and I told him how he abandon me and my mother and how that has led me to where I am though I didnt tell him everything about myself but I painted my father in the worst possible way I could. &nbsp;&nbsp;</p><p><br>By the time we got back to the eatery they were about to take their leave, I told my coworker to cover for me as I stylishly followed them out and traced them back to their house.&nbsp; If you hear adding fuel to the fire that was what happened next, <i>as I see the large mansion wey him and he family dey live</i>, my heart break, my anger went from 0 to 100%. Once again at that point when I thought of&nbsp; making a scene I could hear my therapist voice in my head telling me I shouldnt&nbsp; because I am better than that, her voice was like that of an angel preventing you from doing that bad thing while my mind was, the devil, shouting BURN DOWN THE HOUSE SON.&nbsp; This was my exact thought as I watched my dad and his new family walk into their house, I was touched and for the first time I left Festac.</p><p><br>I remembered my mum, not that I have forgotten about her, I very much think about her but that was the day I wished I could see her in person and talk to her. For two years I didnt speak to my mum, I needed to be sure if I was ready, so as always I&nbsp; spoke with my therapist about it and she told me how to go about it but let get back to how I killed my father, I will return to the part at which I&nbsp; met my mum after two years. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>After I discovered where my father was living, I will go there every two weeks even though I didnt know why I was going but I still go, when I told my therapist she said maybe I was looking for closure, she suggested that I should gather the courage to talk to him or if I want she could help me reach out to him but I wasnt just ready so I just quit going there.&nbsp; Two days ago I woke up with only one thought and that was to kill my father,not just him but his entire family, lord forgive because I did.&nbsp;</p>', 'uploads/15459994788344014IMG_20180226_225636_584.JPG', '1544793563df6a5lb09e3a74ze6hu5', '12:17:58', '2018-12-28', '1545999478ri7s272c86eu6ci9e2atldi2', 1, 'thumb/15459994787325342IMG_20180226_225636_584.JPG', 1, 428, NULL),
(156, 'Suicide Note [Page Nine]', 'Abdulhafeez Onitilo', 'show', '<p>They say as kids we get to gather lots of information but most stay in our subconscious mind and only pop up when an action or occurrence triggers it and some stay buried forever. In my case this information I gathered while I was little pop up rather too late, I mean I had already carried out the atrocity, which even made it worst for me to deal with.&nbsp;</p><p><br>Killing my father or should I say killing the man that married my mum, sorry I dont even know what to say, I havent being myself since this event, the only thing I want to do is to also kill myself. I know I should have told my therapist about it probably she would have helped me deal with it better but how can I bring her&nbsp; into a crime I committed plus I felt I dont deserve to feel better, what I did was worth it considering the fact that my father was not innocent after all.</p><p><br>Like I said before I had stopped going to my fathers house but one morning I couldnt bear the thought of him being happy while my mum, <i>well you know all about my mum</i>. I wanted him to pay for everything he did and most important I wanted to know why he left the moment my twin brother died and talking about my twin brother, I cant stop seeing him since I killed my father and his family. You all need to know that these few weeks of my life has been the worst, I have literally lost my mind, I have even stopped seeing my therapist, havent seen her since I killed my father and his family.&nbsp;</p><p><br>I got to my father\'s house that very night dressed like a delivery boy, who was there to deliver some chicken. Inside the chicken pack was a gun and rope, I stole the gun from <strong>Lawrence</strong>, Lawrence is a policeman who rents out guns to people for extra cash, before I got my eatery job, I was his apprentice, so I know a great deal about the business. I knocked on the door and as my father opened the door I pulled the gun on him and forced him back inside quietly. His wife and kids were in the sitting room watching TV and as they saw me, the kids ran to their father screaming and I said <i>I will shoot you if you make any noise, oya all of you on the floor</i>.&nbsp;</p><p><br>Before leaving home I had to meet <strong>Monica</strong>, the weed dealer in my area, I told her I needed a weed that will give me the mind to do whatever it is I wanted to do without any sort of pity while doing it. Monica had just one rule, <i>dont ask dont tell</i>, she didnt ask why I wanted it - she just gave me two roll of loud to smoke and instantly as I was smoking I felt the effect kicking in.&nbsp;</p><p><br>I placed the chicken box on the table, brought out the rope and pointed the gun at my dad and told him to tie his wife and kids together. Then I took the remaining rope to tied him down, I told him to look into my eyes if he could remember me but he said \'no\'. I used the gun to hit his head every time he said he couldn\'t remember me till one on his kids said he had seen me at the eatery before. I looked at the kid and I laughed, I took off my shirt and I tied his mouth then said <i>anybody that talks next will die</i>.&nbsp;</p><p><br>I faced my dad again and ask if he knew any <strong>Yetunde Coker</strong> and this time around his answer was positive but what followed wasnt what I was looking for. He called my mum a slot, who wanted him to raise children that werent his and he walked away from the marriage when he couldnt take it anymore.</p><p><br>Apparently he had not told his family about his former life so as he started to explaining I also began to recollect some of the things I had overheard my dad and my mum argue about and the most important of them all which happened to be true was the fact that this man I call my father whom I blame for all the misfortune in my life is actually not my dad. I remembered clearly when my twin brother died the statement he (my supposed dad) made, he said <i>at least one of them wont have to worry about the truth, I hope you finally have the courage to tell them who their real father is, that if you eventually remember, you this slot</i>.&nbsp;</p>', 'uploads/15459996929649692IMG_20180226_225636_584.JPG', '1544793563df6a5lb09e3a74ze6hu5', '12:21:32', '2018-12-28', '154599969232i47icde6e1rlsit02ca04u', 1, 'thumb/15459996927438545IMG_20180226_225636_584.JPG', 1, 412, NULL);
INSERT INTO `blog` (`id`, `title`, `author`, `visibility`, `body`, `image_1`, `created_by`, `time_created`, `date_created`, `hash_id`, `about`, `thumbnail`, `notification_status`, `rcount`, `category_id`) VALUES
(157, 'Suicide Note (Final Chapter)', 'Abdulhafeez Onitilo', 'show', '<p>I remembered the day my dad and mum fought because my dad had called my twin brother a bastard and as I began to remember all these things the more I started to feel guilty. I still blamed him for everything that had gone wrong in my life and I still went ahead to kill him and his family.</p><p>I sat on their couch for few minutes thinking about my next moves, I had finally gotten the answer I have been searching for and it wasnt what I was expecting. It was at that moment I agreed with the phrase <i>some things are rather left unsaid</i>, not every answer is pleasant to the ear and this definitely wasnt pleasant. I thought he was the reason why I have become messed up but I have now found out that my mum, whom I love dearly and I pity so much is the one to be blamed for the way her life and mine turned out and still there is a new question to be asked, <i><strong>who exactly is my father?</strong></i>.</p><p>I couldnt just let them go, they have seen my face and they can always go to the police, I dont want to go to jail, I still want to find my real father, so I did the one thing I came there to do, I went to the kitchen, turn on the gas and came back to the living room, I revealed myself to them, my supposed dad tried to apologize but I wasnt willing to hear anything from him, I told him to keep quite if he doesnt what me to shoot him. As the gas started to choke the children I got up walked to the door then light the match I had taken from the kitchen.&nbsp;</p><p>I hid myself where no one would see me as I watch the house burn while I was also trying to calm myself from the injury I sustain too. My hand hasnt properly healed, I still feel the pain but that would end soon, I have thought about this day very much and I have come to the same conclusion, Benson Afolabi Richard has to die, there is nothing left for me in this life, I burnt the only man I knew as my father alive along with his family, I almost killed my mother whom I have always held in high esteem and my twin brother is now constantly criticizing me for everything I did, so tell me what kind of life I still want to live.&nbsp;</p><p>If you have been reading this from the beginning you already know its too late to help, now that you know my story I would say its okay for you to judge me, I know I made some terrible mistakes, I took so many wrong turns in my life and instead of me to fix up my life I kept looking for who to blame but now I have no one else to blame but myself and that burden is too much for me to bear that\'s why I have decided to take my life so before the poison&nbsp; have taken kicks in let me quickly tender my apologies to the following&nbsp; people that I have.&nbsp;</p><p>I am sorry mum, I apologise for hitting you hard that you had to be hospitalize, I would never forgive myself for that, I just hope one day you will find it in your heart to forgive me. I would never understand why you hid the truth about my real dad from me or why you choose not to tell me the truth about.</p><p><strong>THE END</strong></p>', 'uploads/15459999147960935IMG_20180226_225636_584.JPG', '1544793563df6a5lb09e3a74ze6hu5', '12:25:14', '2018-12-28', '15459999140ec745rt98sd6u9ciil34eia', 1, 'thumb/1545999914799919IMG_20180226_225636_584.JPG', 1, 512, NULL),
(158, 'EKITI: REPLACING HER ILLEGAL YAHOO YAHOO ECONOMY PART ONE', 'O\'TIMILEHIN ALABI', 'show', '<p><br>The economic situation of Ekiti State is deteriorating. The degrading situation and progress of the state is of ratio 1 to 80. It is like trying to quench a blazing fire with irregular drops of water. So disheartening to know, the proportion of economic decadence is enormously gigantic compared to the rate of development in the state. It is clear, the governments have been sailing the ship of the state without any map. The state government workers have lost the proper touch of a good directive from competent leaders. Sadly, the state lay bare just like a desert where nothing is happening. But another bitter truth is that something is happening. What? The position of the state has shifted from the fountain of knowledge to the bedrock of online scammers\'yahoo yahoo\'s domain. Houses and lands are rented and sold to them, goods are bought by them, eateries, clubhouses and hotels are patronised by them, even fuel at refilling stations are bought by them at about the same range as commercial drivers. In essence, &nbsp;the legal economy of the state is abjectly stuck and is sustained illegally by the hijacked dollars of yahoo boys. Kudos that the entire state is not unaware of this fact! So what has been done to this menace? Absolute nothing! Except that the statesmen and elders of the state due to their failed insight to stir the course of the state rightly have lost the confidence of ridding the state off of the appalling reign of yahoo boys. But what are the implications? It means the reign of illegal and embarrassing business Yahoo Yahoo has come to stay. It means that some days, Yahoo Boys would by the economic input in the state contest and they might win. And then, the state is in smooth pepper soup!<br>My question is: how did the state get here in the first place? One can say it a million times that many factors have led the state to this economy end zone. Although the state has spent so many years arguing about which end of the egg is to be broken: the smaller end or the bigger end. Well, that factor has been the problem of Nigeria and not Ekiti alone. Primarily and basically, apart from the fact that the state allocation is meagre, all the tiers of government and the citizens have driven the state to its present economy end zone. They have done this through several factors, viz: headstrong factor, self-indiscipline factor, unneeded project factor, misplacement of priorities factor, lack of insight factor, greed factor, I-know best factor, insincerity factor, consumer-mentality factor and so on. The most painful is that, external people hold the state to high esteem while within, the state knows that those comments of fame are actually laurels of shame.<br>To bail Ekiti out, why dont the statesmen first push aside the insincere propaganda game and blame game they are good at, and just find their way to the drawing board? Why dont the state continue with their different political parties yet have and focus on one goal? A goal of investing in the health sector. The goal is called Project Classic Health. Why health? Because people cannot deny the fact that the economic value of health investment still hold sway today. Every class of humans want good health and they can go to the moon for it. But why Project Classic Health? It is simple, the absence of Project Classic Health made a sitting president in Nigerian to die in office and the presence of Project Classic Health made a sitting president in Nigeria to leave office to London for over 90 days. And when he returned, rumour has it that he has been cloned. What exactly is behind that drama and rumour of the presidents health is the power of a Project Classic Health. Project Classic Health is possible in Ekiti State. In short, it has started privately in Ekiti State at Afe Babalola University. However, that it has started in Ekiti does not mean the state does not need another Project Classic Health to increase the internal revenue, boost the economy of the state, and like, India, Germany UK, become the main hub of medical health solution in Nigeria and Africa at large.<br>It sounds insane, but it is like imagining a situation where all class of the human society who need superb healthcare and can afford it in the world are booking their tickets to Ekiti State. This image is amazing! It is a dream that can be realised. Although the Project Classic Health investment cannot happen in 4years or &nbsp;8 years, this is where the need of one economic goal by different political parties should come in. If it does, then in 16 to 32 years, Project Classic Health will be set in Ekiti. Certainly, 16 to 32 years is quite far, but that might be if we do not believe that time flies. More so, we are not going to grow old, die and leave Ekiti like that. We are going to bear children who will stay. Candidly, there has not been any long-term economic project in Ekiti State that the present thirties and forties can thank their grandfathers for in Ekiti. No wonder Yahoo Yahoo is the order of the day. But with the commencement of Project Classic Health, the present generation can put a smile on the face of the future generation. &nbsp;</p>', 'uploads/15461034333436502images.jpg', '7NEO0I762M15TI661HLI', '17:10:33', '2018-12-29', '1546103433t3k90162iea61eil8c6tir', 1, 'thumb/15461034332109391images.jpg', 1, 652, NULL),
(159, 'THAT MOMENT', 'Emmiasky Ojex', 'hide', '<ul><li>&nbsp;</li></ul>', 'uploads/15463371751883665christmas-2971961_1280.jpg', '36au8m1elEn53m8538', '10:06:15', '2019-01-01', '15463371751t527e4tc211h2ai9atrl', 1, 'thumb/15463371757249591christmas-2971961_1280.jpg', 1, 1, NULL),
(160, 'Gratitude', 'George O\'Nuel', 'show', '<p>DEAR LORD!</p><p>&nbsp;I just want to say Thank you for this life</p><p>&nbsp;For giving me daily breath &amp; keeping me alive</p><p>&nbsp;I humble myself this day as I bow before Your feet&nbsp;</p><p>Thank you for setting me above &amp; not below, six feet</p><p>&nbsp;Thank you for my past, my present &amp; my future</p><p>&nbsp;I\'m really undeserving, me, this ungrateful creature</p><p>&nbsp;Thank you for your Grace, your Love and your Mercy</p><p>&nbsp;You\'ve been ever faithful despite how bad life has been messy</p><p>&nbsp;Thank you for our families and loved ones that surround</p><p>&nbsp;You\'ve been our strong tower. It\'s a privilege to have them around&nbsp;</p><p>Thank you for the daily bread and the food on our table&nbsp;</p><p>Moreso, thank you for the poor, the rich and the disabled</p><p>&nbsp;Thank you for the good times, the bad and the ugly</p><p>&nbsp;For the love in our hearts. Thank you for all and sundry</p><p>&nbsp;Thank you for the pain, the challenges and the hard times&nbsp;</p><p>Thank you for been God in the good and the bad times</p><p>&nbsp;Dearest father and creator forgive me for ever been ungrateful</p><p>&nbsp;Times when I acted sinfully, went lost and played a fool</p><p>&nbsp;Be thou for us,As Thou has been , Now as ever.</p><p>&nbsp;&amp; May Your presence be with Us Now, always and forever.</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; \'the George O\'Nuel</p>', 'uploads/15468461469712604worshipping-god-2101347_1920-e1541999286685.jpg', '1541840791go45e67e1r89306g', '15:06:43', '2019-01-01', '1546355203822c4ewra113oilr2td03s', 1, 'uploads/15468461466910164worshipping-god-2101347_1920-e1541999286685.jpg', 1, 579, NULL),
(161, 'Judge Jury', 'Ayodeji Fakunle', 'show', '<p>Who made you the Judge?</p><p>\"A Boy and his father were driving to get a drink at a wonderful spot newly opened in town and they had an accident immediately, the father died and the boy was rushed to the hospital. The doctor who was to attend to him screamed OH LORD! My son\"&nbsp;</p><p>I asked a group of people &nbsp;if they can explain why the doctor called him son but only 5% got it immediately. So whats &nbsp;the answer? The doctor was his mother. After my findings from the people who did not get the answer correctly majority said it never came to their mind that the doctor would be a woman and i was like... Medicine is a profession not medicine a male profession.</p><p>My point here is that we humans are to quick to judge.&nbsp;We judge events, situations, and most especially people before we get to evaluates or know them respectively.</p><p>We already have the mindset that a young guy who is well to do is a fraudster aka Gee guy, we don\'t even get to know him think otherwise.</p><p>A lady who wears trousers is a slut, and the one that puts on eloquent long gown and skirts is a saint.&nbsp; We write off smokers, drunks,</p><p>fornicators and assume they are going to hell. Well i wants to bring your notice, one of the reason why we preach the gospel is to convert. So who are you converting when you pursue sinners from the church or mosques. News Flash!! Churches are not for saints they are for everyone, those who are saved and those who wants to be saved. Even Jesus brought closer the&nbsp;</p><p>adulterer in the bible when she was being stone to death.</p><p>You judge the guy who have not gotten admission&nbsp; to the higher institution and tag him as an unserious and not going to become something good. Who made you judge jury of the persons future.</p><p>You judge people from appearance, his dark lips already depicts smoker alert!</p><p>You called her slut for interacting and making friends with guys. I didn\'t go to church and you called me a backslider, funny you forgot you lied to to your friend because you don\'t want to share with him what he asked you for.</p><p>This life is so messed up, everyone judging others for committing a bigger sin.&nbsp;</p><p>Note! This has nothing to do with religion, I am just giving a general opinion so Please don\'t judge me.</p>', 'uploads/15483078708278455images_(2).jpeg', 'jy95Ae4d739i4o02', '15:30:39', '2019-01-01', '154635663943er6g57a1tjilu10d7ec', 1, 'uploads/15483078702321637images_(2).jpeg', 1, 906, NULL),
(162, 'THIS MOMENT OF HAPPY NEW YEAR', 'Emmiasky Ojex', 'show', '<p>Hi, it\'s the NEW YEAR.<br>&nbsp;</p><p>We made it here, and we thank God for that.<br>Now, let\'s take sometimes to check out some things, shall we?<br>&nbsp;</p><p><strong>THIS MOMENT</strong></p><p>Although it\'s an obvious fact that we cannot get this moment back in time as; \'Moments, once gone, can never be reiterated\' (except if we\'re dealing with physics and the time-travel theory here), but we relive some joyous periods annually, NEW YEAR DAY<br>CELEBRATIONS is one to be exact, every year.<br>Now let\'s scrutinize some facts, shall we?<br>&nbsp;</p><p><i>YOU HAD THIS MOMENT SOME 365 DAYS AGO</i>:<br>Leaping for joy whilst on the 12 O\'clock hour, the mass you attended at Church/Mosque or various religious institutions or even stayed home after praying for all you wished the year to seem like, but what went wrong?<br>&nbsp;</p><p>Did you really get to that point you wished?<br>&nbsp;</p><p><i>YOU MADE YOUR NEW YEAR RESOLUTIONS AND PLOTTED OUT HOW YOU WANTED LAST YEAR TO SEEM LIKE:</i><br>You had lists of things you wanted to achieve right?<br>&nbsp;</p><ul><li>how much weight you wanted to gain or lose that year,&nbsp;<br></li><li>how much you would plan on spending over the year and a well-planned estimate of how much you,&nbsp;<br></li><li>how much muscle you should\'ve gained to your tiny arms,&nbsp;<br></li><li>how much should have been saved up by the end of the year, but what went wrong and why are you still here,<i> broke</i>?<br></li></ul><p><br><i>YOU TRIED FOLLOWING UP WITH PROPOSED PLANS:</i><br>&nbsp;</p><p>Here\'s the hard part, you did all you (think you) could to stay focused but some three months in, you started wearing out (life), do you remember that day you finally made up in your mind <i>\'WELL, I CANNOT HAVE EVERYTHING I WISH FOR</i>\' and thus went the goals and dreams you\'d planned for?<br>&nbsp;</p><blockquote><p>Moments, once gone, can never be reiterated<br>&nbsp;</p></blockquote><p>Do you?<br>&nbsp;</p><p>Now, you\'re about leaping for joy once more, looking at that long list of things to achieve for the year?<br><br>You might not have even plotted yours yet!<br>Are you planning to make same life-pattern in 2019 as you did in \'18.<br>Will you keep blaming the government, coworkers, neighbors, friends once more for all problems you face diurnally?<br>or will you get up and be determined to make this year COUNT as one of the best in your life?<br>&nbsp;</p><p>You have a choice,<br>STAY MEDIOCRE or MAKE A CHANGE in this YEAR.<br>&nbsp;</p><blockquote><p>Will you keep blaming the government, coworkers, neighbors, friends once more for all problems you face diurnally?<br>or will you get up and be determined to make this year COUNT as one of the best in your life?<br>&nbsp;</p></blockquote><p>We\'ll see sometimes in the future to know whatever CHOICE YOU MADE TODAY.<br>It will be another MOMENT some 365 days to come and you\'ll either be happy you made the right choice or the other way round in some times to come.<br><br>&nbsp;</p><p><i>From a friend that cares.</i><br>&nbsp;</p>', 'uploads/15463571752923686christmas-bauble-15738_1280.jpg', '36au8m1elEn53m8538', '15:39:36', '2019-01-01', '15463571769c81il9r0ahes572t59ti', 1, 'thumb/15463571753225515christmas-bauble-15738_1280.jpg', 1, 802, NULL),
(164, 'LIFE', 'Olajide Genesis', 'show', '<h2>&nbsp;</h2><p>*LIFE*<br>L- living, I- In, F- full, E- emotions.&nbsp;<br>Hmmm Life!!! Life!!! Life!!!&nbsp;<br>&nbsp; &nbsp; Life is a Journey, life\'s a teacher. Its a personal assignment you have to contribute more to than anyone else trying to help. The content of your heart determines your place in life. Learn to take the good with the bad cause. \"tough times don\'t last but tough people do\". So how tough are you? In life many people sight without insight, but no one will truly ever rule over the affairs of life without an insight. To be successful in life, don\'t give or take excuses. You will never change if you keep focusing on results, instead focus on change and you will get results. Learn to read and listen , \"Be slow to speak and quick to hear says the bible\". Don\'t be quick to judge and label stray/isolated situations in your life as failure. Its OK to fail, make mistakes, just don\'t get bedridden by it. Fall down seven(7) times, rise up eight(8). Someone once said, A life spent making mistake is not only honourable but more useful than a life spent doing nothing. The question remains, \"what are you doing? Be productive. &nbsp;If there is no *wind* just *ROW*<i> </i>life itself is a test. You never know how great you can, Never stop believing.persevere, Keep moving, No matter the pace, remember only by perseverance the snail reached the ark. Don\'t be mindful of the fact that many has gone ahead, it doesn\'t mean they are ahead of you. Some actually went much more earlier to spread palm fruit leaves for you to walk on. So don\'t give up until you\'ve made your last attempt and don\'t make your last attempt until you have succeeded. Knowing fully well &nbsp;you\'ve only got one life to live, Are you gonna get knocked out by life, or, you are gonna stand firm, look at her straight in the eyes and say, I know you never plan going easy on me, but who cares, cause am just gonna play smarter, faster and stronger each time, till l get what i want. I have a dream and am gonna do everything I can to make it happen. We all have over 86 thousand &nbsp;seconds a day. Use your Time wisely. What ever dream you have push yourself to make it into reality. If you doubt yourself you never gonna make it. So Keep working, don\'t doubt, keep believing, keep learning, never stop reading, keep up the good work until you become the best version of yourself..</p>', 'uploads/15465273705555940Longman_20141004_184558.jpg', '15464624262a32j59od5e12l7i0', '14:56:10', '2019-01-03', '1546527370t63c1r7l5l70ieaief', 1, 'thumb/15465273708390036Longman_20141004_184558.jpg', 1, 930, NULL),
(166, 'MY COLLEGE STORY', 'Aderonke Adetona', 'show', '<ol><li>It was on a Thursday afternoon I was checking my admission status on jamb portal, a message popped up \"Dear Aderonke Adetona you have been offered provisional admission into Ekiti state university\", I was so excited I screamed!. My family members were so happy, they congratulated me, the thought of being an undergraduate was overwhelming I couldn\'t sleep.<br></li><li>I Dreamt about how life in Eksu would be, how I would be free, wake up when I want to with no one to disturb me......No one told me it was going to be my hell!.</li><li><br>I packed my bag on a weekend, so ready to leave the house I was overly excited I got to school around 2 pm in the afternoon. I was ready the following day with my files in hand, I was ready for the next phase of my life.</li><li><br>&nbsp; I have been standing on a queue for over 3hours, it was my turn to submit the file somebody shouted from the back \"sister is not yet your turn\" I was exasperated I screamed but I have been here since 7 am, people behind me looked at each other and chorused \"welcome to eksu\". That\'s how my journey of living in hell begun, I followed routines daily, wake up by 5 am, leave the hostel by 6am so I can sit at the front, there are times when I leave the hostel by past 6 there wouldn\'t be where to sit, I will stand through a 2hours class, I was fed up but i kept on because I always remember this quote from my mother &nbsp;\"When the going gets tough, the tough get going\". I followed every rule, the same routine till the semester was over then it was time to check my result I had 7As, 2Bs I was happy, I thought maybe Eksu isn\'t that bad after all but it wasn\'t the same story in my second semester I read for this course more than anything I complained, you better thank God someone said, there was mass failure. Welcome to Eksu people muttered.</li><li>Hmm, how I hate the phrase \" Welcome to Eksu\".</li><li>&nbsp;</li><li>By the time I got to 200L, I was already tired of Eksu. It\'s either lecturers don\'t come to class or there was no available lecture theatre. I can\'t continue like this I complained to my just met friend, I can slip into depression if am not careful. I have been there she answered, Why don\'t you get involved in extracurricular activities? I know of an organization called enactus if you are interested. Extracurricular activities? How am I suppose to manage that with chemistry?</li><li><br>&nbsp;My first time of attending a formal meeting, I was lost...So people like this still exist, how do they know so much, I was curious. Pointing at the project manager, I want to be like him, I told my friend...Me too she answered. How about we take advantage of our idleness and commit to some self-development I suggested. We started reading a book called \"change your thinking change your life\". I have learned to take advantage of whatever situation I found myself.<br>&nbsp; &nbsp;If I didn\'t come to Eksu maybe I wouldn\'t have met my friend, Maybe I wouldn\'t have heard about Enactus, Maybe my life wouldn\'t really have been different.</li><li><br>Looking back now I wouldn\'t say life in Eksu is a living hell anymore, I would rather say its a bittersweet experience.</li></ol>', 'uploads/15468710695004451IMG-20190107-WA0017.jpg', '1546847130dk032o2aen3r22e559', '13:49:42', '2019-01-07', '154686898224rm0203a1y785telic', 1, 'uploads/15468710699575713IMG-20190107-WA0017.jpg', 1, 756, NULL),
(167, 'When is the best time to have s3x?', 'Abdulhafeez Onitilo', 'show', '<p>Many people have disagreed on what time of the day is the best time to enjoy sex, some are of the opinion that sex can be enjoyed at any time as much as you are in the mood while others believe that for better sexual pleasure and satisfaction sex should be done at a particular time of the day.</p><p>As for me I would say for better sexual pleasure, it would be safe to combine a little bit of mood and timing when you want to have sexual intercourse, though research has been able to prove that the timing in which you carry out sexual intercourse can also affect or should I say is one of the determinant to sexual satisfaction.</p><p>Like I would normally do, I carried out my own little research on what time of the day would be perfect to have sex that would guarantee you that orgasm you have so much desire and this is what I was able to find out.</p><p>Sex in the afternoon between 12pm - 4pm is good because the energy from the sun as at that time would help increase the energy level in your homos which might also increase your performance but the problem is that you might cum quicker than expected and you would sweat a lot due to the energy you are burning.</p><p>A lot of people prefer this, sex at night. Nothing like having a good sexual intercourse after the whole messy day you have been through, right? The problem with this is the fact that you might not be at your best performance because of all the stress you been through during the day. And if probably you didn\'t stress yourself during the day, the anxiety that you would be getting laid at night might just be what would hinder your performance level and deprive you of the sexual satisfaction you need.</p><p>Midnight sex is fabulous because of the cool weather between the hours of 3am - 5am, this would make your sexual organ want to heat up which is a good mood setter but this would also lead to quick ejaculation. The performance level would begin to increase as the fiction between both organ begin to increase and once the homos as gotten the needed heat it begin to cool off which in most case we don\'t tend to know and this is when we ejaculate or climax quick.</p><p>It is very unusual to find people having sex around this time because they have to wake up early and prepare for work and on days whereby they are not going to work they prefer to use that time to get enough rest. Early morning sex between the hours of 6am - 8am is the best time to have that sexual pleasure you might be craving for because at this time your sexual organ are always ready for any sexual activities. Your testosterone and energy level are always higher during this period which is the best mood setter and if you can be patience and stay sensually focused then would you end up having the best sexual orgasms of your life.</p><p>So people try out some of my experiment to see if Im wrong or right.</p>', 'uploads/15470281302078376Vaginal_sex_page.jpg', '1544793563df6a5lb09e3a74ze6hu5', '10:02:10', '2019-01-09', '1547028130e1lc40he14iw16na99r4t', 1, 'thumb/15470281306902628Vaginal_sex_page.jpg', 1, 572, NULL),
(168, 'ACCEPTING YOU', 'Aderonke Adetona', 'show', '<p>Everyone as a child has been taught to try and be like the other kids, your parents compare you with your mates every day. You wonder what the hell is wrong and why you couldn\'t do things right. You grew up with that notion that you always have to be some certain way, you always have to fit in.<br>&nbsp; &nbsp; All your friends wanna be Doctors, lawyers, and the likes, you never had dreamed of being any of that.</p><p>Your dream was to be a fashion designer with a big shop but because society only recognizes people with the titles, you went to university to study what you didn\'t like. Now you are grown. You are working, You earn six figures a month but you didn\'t find self-fulfillment in what you do, &nbsp;you remembered you had a dream of becoming a fashion designer when you were a kid but you didn\'t pursue it. You imagined how your life would have been if you had chased your dreams...Perhaps &nbsp;you would have been happy, Find fulfillment maybe<br>&nbsp; You loathe yourself daily<br>&nbsp; &nbsp;You have become more withdrawn<br>&nbsp; &nbsp;Everybody noticed; you said it\'s nothing<br>&nbsp; &nbsp; You crawl to bed before 12 pm wake up before anybody</p><p><br>&nbsp; &nbsp; &nbsp;You couldn\'t find your self</p><p>&nbsp; &nbsp; &nbsp;You lost it a long time ago<br>&nbsp;This happens daily in our life whenever we try to fit into the world\'s standards<br>You think that Being fair is the new thing, you bleached all the Melanin off your skin.<br>They said you are Overweight, you starve yourself every day. You look in the mirror and thought within yourself I still haven\'t lost 50 pounds yet... People are going to make a jest of me<br>You saw that skinny looking lady, you said she looked malnourished<br>Who said looking a certain way is a ticket to heaven?<br>&nbsp; Until you learn to stop comparing yourself to anybody, stop trying to fit in, stop taking other people\'s validation as a measure of your self-worth.<br>&nbsp;You will never be you&nbsp;<br>&nbsp; You will not find happiness<br>Happiness is from within, it starts by accepting you as you.</p>', 'uploads/15472031256879428desperate-2293377_1920.jpg', '1546847130dk032o2aen3r22e559', '10:38:46', '2019-01-11', '154720312698gt27i8t3ecnle55p3ci8raac', 1, 'thumb/15472031252943566desperate-2293377_1920.jpg', 1, 557, NULL),
(169, '#Naija_Which_Way', 'George O\'Nuel', 'show', '<p>#Naija_Which_Way</p><p>If I teh you say I never chop since yesterday ,Shea you go believe<br>See, wetin I wan yan you na true talk,I no dey decieve<br>I don taya for Naija, but still ehnn, I LOVE THIS COUNTRY.<br>Naso I see Poverty wae &nbsp;carry Award On top my family Tree<br>For Naija ; we dey Hustle like elephant dey chop like ant<br>Na this same country some fools (wae I no blame) dey scavenge for pant<br>Shea Naija dey forward ni abi &nbsp;e dey retrogress&nbsp;<br>I swear down, #10Years Challenge for Naja, We sti Never progress&nbsp;<br>Our Leaders don build wall of China as full stop for middle of poor and rich<br>The system go sti try bring you down,If you try cross da bridge<br>House of this, National dat,Yen yen yen , Abegg wish work dem dey do sef<br>\"Da thing\" wae happen for Ghana da day na wetn most of dem deserve<br>Helloooo....No be me talk am o!!!!<br>Na from popular demand me ah hear r\'am o!!!<br>Every sitting and meeting wea dem get,na to si down share our money<br>Waliah, this people no try, dem dey do us cunny cunny</p><p>Popsi don go fyn work since morning , ehin no chop before he go<br>Food no dey, light poor, road bad...we no get ego<br>Popsi don come back now, he go empty...he come empty.<br>Chai! Kon see as him shoe chop dust, him cloth don dirty!!!!!<br>Mumsy sef don lose her job for government office&nbsp;<br>Everyday na water for her eyes and her facial surface</p><p>Na only popsi shoe dey enjoy, e don chop for under<br>I dey vex ryai now e be like say make I order for thunder.<br>Naija which way na!?....Abeg which way<br>Shea Na God we go pray to...abi na to go India to the \"witch way</p><p><br>People are dying of depression&nbsp;<br>Poverty; Our greatest infection&nbsp;<br>My mother now has high blood pressure&nbsp;<br>This Nonsense has met my displeasure<br>ASUU is giving me too much leisure&nbsp;<br>Pain is giving Us too much lecture&nbsp;<br>The only Time we\'re loved is before election&nbsp;<br>Internet Fraud are most youth passion<br>Young ones are straying ;No one to caution&nbsp;<br>&nbsp;The change we were promised is Nothing but deception<br>&nbsp;The status Quo is in recession<br>&nbsp;Corruption has become an addiction&nbsp;<br>&nbsp;But we were not like this from the inception&nbsp;<br>&nbsp;Our Hope is fading like into a delusion<br>&nbsp; &nbsp;WE\'RE LOSING THIS PATRIOTIC SENSATION .</p><p>Abeggg..Make una no vex for the transmission of Gramma wae I dey spark<br>My anger don rish em limit I kon dey spark&nbsp;<br>Wait sef!..wetin me sef sabi<br>Dem don call us \"Lazy Nigeria Youth\" now ,abi??<br>But NIGERIANS , I HAIL OH, as in, UNA DEY TRY!!!!<br>Make una just stay strong, make una no cry !<br>Today dark, bur tomorrow go bright&nbsp;<br>Make una Uphold love and Hope, make una No Fight.<br>I suppose yan una plenty..but I gas go now<br>The garri wae I soak-travel don swell rish, make I go chop now<br>Make I run before dem shoot me gun for head<br>Truth bitter.Dem go soon throw me stone, abeg make I bend.</p><p>Maybe Sha we go dey talk later&nbsp;<br>GOD BLESS NIGERIA AND MAKE THIS COUNTRY BETTER</p><p>I AM &nbsp;\"the GEORGE OLUWASANMI EMMANUEL\", a concerned Citizen&nbsp;<br>But from my Heart, I write to you as a depressed \" Sick-tizen\"<br>&nbsp;&nbsp;<br>#GOD_BLESS_NIGERIA&nbsp;<br>#GOD_BLESS_YOU&nbsp;<br>&nbsp; &nbsp;&amp;&nbsp;<br>#GOD_HELP_OUR_LEADERS<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br>&nbsp;\'the George O\'Nuel<br>&nbsp; &nbsp; GraceInkConcept {GIC}<br>&nbsp; &nbsp; &nbsp; &nbsp; 2019</p>', 'uploads/15481407042782554IMG-20190120-WA0026-01.jpeg', '1541840791go45e67e1r89306g', '07:05:04', '2019-01-22', '15481407049aa6wilhrc13ja4cw6ney7h558tiai', 1, 'thumb/15481407045408057IMG-20190120-WA0026-01.jpeg', 1, 258, NULL),
(170, 'THE PLAY OF COINCIDENCES ON OUR DEMOCRACY', 'O\'TIMILEHIN ALABI', 'show', '<p>The issue affecting our democracy over the CJN is very delicate. And if handled trivially without critical considerations, democracy, so long and duly taunted &nbsp;could fight us back fiercely.</p><p>It is so sad that coincidence has come to play on this matter. This now allows it to be possible for some enemy of democracy and legally-insufficient knowledgeable people to hijack the situation, twist it in their favour to poison people\'s mind with a clear attempt to spite the patience of democracy.</p><p>This is bad. I really sympathise about the coincidence that Justice Walter is from the south-south, that the federal election is close by, that the most senior judge after Justice Walter is a northerner, that most Nigerians aren\'t legally exposed, that PMB has been considered a dictator and a tribalist. I really sympathise a lot.</p><p>To me, I feel Justice Walter is the villain. He has made whatever plight against our democracy possible by what he simply calls \"forgetfulness\". He has added salt to the injury of our democracy by failing to do the needful when he was alleged: voluntarily stepping down as CJN, and he is breaking the Carmel\'s back of democracy by staying silent about the whole situation.</p><p>However, as much as I would refer my readers to the Nigerian constitution of section 231, subsection 4 et al, I would like to say expressively that that PMB hasn\'t breached the constitution as much as the way people say he has. However, my blame on PMB is in his failure to consider the powerful coincidences which is capable of destroying our democracy before going on with the suspension of Justice Walter.</p>', 'uploads/15486819363790017images.jpeg', '7NEO0I762M15TI661HLI', '13:25:36', '2019-01-28', '1548681936463c7he31t1rl445aeit', 1, 'thumb/15486819364433834images.jpeg', 1, 555, NULL),
(171, 'Exes (Episode One)', 'Abdulhafeez Onitilo', 'show', '<p>The mistake he made was not asking her about her past, he had this&nbsp;<i>don\'t ask don\'t tell&nbsp;</i>rule and he is also a fan of&nbsp;<i>whatever happened in the past should be in the past,</i>&nbsp;so when he fell in love with her he didn\'t bother asking her about past relationships even though she wanted him to know.</p><p><strong>Nkechi </strong>wanted to tell him about her past relationship but whenever she tries to, he would say <i>as long as the relationship is over then the rest is history</i>&nbsp;&nbsp;and with that she would just keep mute. Truly the relationship was over but she wasn\'t sure if the passion between them was over, back then whenever she hears the voice of her ex, there was this sweet sensation that runs through her spine that makes her quiver and this is something she doesnt feel with <strong>Lekan</strong> unless she was been touched by him. It wasn\'t as if she wasn\'t enjoying the sex between her and Lekan, she did because it was a whole new experience for her but she felt there was something missing, something only her ex had given her, an orgasm that would paralyze her for about thirty seconds.</p><p>Due to the nature of Lekans job, he had to travel a lot and that was something Nkechi was trying had to cope with even though whenever he is around he surely knows how to make it up to her yet she wasn\'t always happy whenever he wasn\'t around. Loneliness and boredom was what actually brought her and her ex together back then when she was schooling in Enugu but this is Lagos,&nbsp;<i>the city that never sleeps</i>, boredom wasn\'t a problem for her as she had exciting places she could go whenever her boyfriend wasn\'t around. She was always scared of been alone because she knows deep down in her heart that she might just head back to the lifestyle she and her ex were leaving, a lifestyle she wasn\'t even sure if she should let go off. She never thought that the love experience she had with her ex was going to be over immediately she left Enugu, she still had great feelings for her ex but once she came across Lekan she started to experience something new, something different from what she had with her ex and just like that she forgot the promise she made to her ex. <i>Don\'t worry as soon as I settle down in Lagos I would come visiting I promise</i> she said to her ex on the day she left Enugu finally.</p><p>Lekan is a typical example of a Lagos&nbsp;<i>sharp guy</i>&nbsp;who grew up on the streets of Surulere, attended the school with the most bragging right Unilag. He works as a contract staff for a telecommunications company and this provides him with the kind of cash he needed to flirt around with girls. He actually met Nkechi at a park in Enugu when he was heading back to Lagos from a job trip, they got to talk and from there they became friends and months later they started dating. Nkechi became Lekan first serious girlfriend since he broke up with his ex, two years ago, after the break up, his relationship was more about flings and&nbsp;<i>fwb</i>&nbsp;till he came across Nkechi. Truly Nkechi is beautiful but what made him attracted to her was beyond her beauty, it was more of a love at first sight thing.</p><p>He was very helpful in helping Nkechi adjust to life in Lagos as he was the one that helped her secure a job and also found an apartment for her, something Nkechi said she would forever appreciate. Being the first guy she came across in Lagos and considering how helpful he had been, Nkechi felt very comfortable around him even before he asked her out. The day he asked her out she wasn\'t expecting it, it was on a weekend, he had just arrived from one of his trips and he asked her over. On getting to his house, he asked her if she could cook something for them to eat and that she did with all pleasure. In the middle of their meal while he was telling her about his trip, there was a sudden pause and after that pause followed this sentences <i>throughout my trip I couldnt stop thinking about you, couldnt stop thinking about how nice it would be to have you as my girlfriend, I mean, of course that if you are willing to</i>. Her reply was short and simple <i>I guess you would have to find out</i>.</p><p>She couldnt deny the fact that she was really enjoying this whole new love experience she had with Lekan. Her relationship with Lekan couldnt be compared with the one she had with her ex for so many reasons, part of it was the fact that she didn\'t have to hide her love for Lekan the way she did with her ex. She could show public affection for him something that would look extremely weird if she had done it with her ex though she and her stayed together while she was schooling but they only made people to believe that they were roomies. The only thing she could say she missed about her ex was the sexual pleasure&nbsp;<i>she&nbsp;</i>made her feel even though having sex with a man is a new experience which she is enjoying but deep down in her mind she knew it didn\'t match the ones she had with her ex.</p>', 'uploads/15487537381583878exes.jpg', '1544793563df6a5lb09e3a74ze6hu5', '09:22:18', '2019-01-29', '1548753738l61ser12i5aee9x9t984c', 1, 'thumb/15487537384266069exes.jpg', 1, 532, NULL),
(172, 'Exes (Episode Two)', 'Abdulhafeez Onitilo', 'show', '<p>Nkechi wasn\'t her first relationship but she was the one she loved the most, that why she was really heartbroken when things ended between them. She had tried to keep in touch with her but whenever she does Nkechi would always say she was busy and as time went on she assumed Nkechi wasn\'t just interested in her anymore so she let her be.</p><p>Her first&nbsp;relationshipwas short and not too interesting, she attended an all girls boarding school which exposed her to the&nbsp;lesbian<i> </i>world but as at then she never saw herself fitting into that world. She had this&nbsp;<i>bff&nbsp;</i>who by the way was already into lesbianism and that was how she was dragged into it. Although she was a lesbian while in secondary school she never had sex, though she had fantasize about it a lot but those fantasy didn\'t come to pass till she met Jenifer right after she left secondary school and it was Jenny (like she normally calls her) that took her virginity. After Jenny she had two other relationships one with a bisexual and the other a&nbsp;lesbian<i> </i>and it was after she broke up with the&nbsp;lesbian&nbsp;that she met Nkechi.</p><p>She had just resumed for her third year in school and it was at the point of registration she first saw Nkechi but they couldnt talk due to the whole stress of getting registered. The next time she saw her, it was at her faculty and this time they were able to talk, <i>wow, is that Take the Risk by Ben Carson</i> she said as she took a seat beside Nkechi. <i>Yes it is</i> Nkechi replied. <i>Wow! I cant believe it, I have been searching for this book, can you possibly lend me?&nbsp;</i><i>Of course thats when you are through with it</i> she added when she noticed the expression Nkechi gave. <i>Well lending you isnt the issue but how do I get to see you when I am done with it</i> Nkechi said. <i>Arent you a member of this faculty</i>? She asked. <i>I am but I don\'t receive my lectures here, I only came here to finish up my registration</i> Nkechi replied. <i>Then I guess I have to take your number so I can call you to know for sure, by the way you said you are here for your registration, may I ask what registration is that</i>? She said. <i>The one for the field trip and one other one like that</i> Nkechi replied. <i>I guess today is your lucky day, I know the guy that is in charge of the registration, I can help you talk to him</i> she said back. <i>I would be very glad, I have been here for three days now and I havent been able to do anything</i> she responded. <i>Alright then, follow me let go see him in his office</i> she said. And that was how she and Nkechi became friends and from friends they became lovers something Nkechi didn\'t believe was going to happen.</p><p>Throughout her first and second year Nkechi was very serious with her studies, her schedule was from her hostel to school to tutorial back to the hostel and on weekends it was between tutorial and church. She didn\'t socialize that much, the only friends she had were those that stayed in the same hostel with her and they didn\'t even talk much but there was something about <strong>Seun </strong>that she likes, she was caring, understanding, lively and fun to be with. Typically when it comes to socialization Nkechi didn\'t know where to turn to and that was why she enjoyed the company of Seun. Whenever she felt bored she would call her to come over and they would gist from morning till night and this was how she got to know that Seun was a lesbian. After so many attempt of getting Nkechi a boyfriend had failed, Seun decided to make a move on her and her gambled paid off. <i>I know you are surprise that I agreed to date you because I told you I am not a lesbian which is true. But ever since I caught my elder sister with my cousin having sex together, I have secretly wished to experience what it felt like, I have read a lot of books and as shameful as it might sound I sometimes masturbates</i>. The first time they had sex Nkechi was blown away as she never knew that sex with a girl could be so pleasurable and breathtaking. <i>Wow if I knew this was how it feels I would have probably had sex a long time ago</i>, Nkechi said right after she reached her first orgasm. <i>If you have never had sex before then who come disvirgin you</i>? Seun asked. <i>Like I said I masturbate a lot and it was during that process I disvirgin myself</i> she replied. <i>Wow that must have been some pretty serious masturbation you did</i> Seun said right before she placed a kiss on her lips as they enjoyed another round of sex.</p><p>It was when Seun moved over to Ibadan that she was able to get over Nkechi, the plan was to stay in Enugu, find a job and an apartment so whenever Nkechi was free she could always come over. Since Nkechi wasn\'t even forthcoming on her promises she decided to head back home and it was then she met her new love, though it wasn\'t the kind of relationship she would have love to have because the girl she met said she would only date her if she agrees that they would once in a while have sex with men. The relationship was more of a&nbsp;<i>when the desirable is not available the available becomes the desirable</i>&nbsp;kind of a thing, perhaps she thought to herself what harm would it do if she decide to have sex with a man. <i>I guess there is always a first time for everything,</i>&nbsp;Seun said when her new love gave her the condition.</p>', 'uploads/15487541156788800exes.jpg', '1544793563df6a5lb09e3a74ze6hu5', '09:28:35', '2019-01-29', '1548754115e0te4ca50733e2srix05l', 1, 'thumb/15487541159139694exes.jpg', 1, 542, NULL);
