(173, 'Exes (Episode Three)', 'Abdulhafeez Onitilo', 'show', '<p>She had this believe that for him to be having phone sex with someone that wasn\'t in the country, nothing would stop him from actually having sex with someone within the country and this was the sole reason why she broke up with him. Lekan wasn\'t expecting her to come around that very day because he had told her that he wasn\'t going to be around but he had also forgotten that she had his spare key which means free entry whenever she feels like and on this faithful day she felt like.</p><p>Actually she came over to pick a material she needed for her project and since Lekan had told her he wasn\'t going to be around she didn\'t bother pressing the doorbell once she got to his door step. Truly Lekan had locked the door and based on the outside look you wouldnt believe someone was home considering how the windows were shut down but little did she know that Lekan was at home. Lekan was really carried away with the phone conversation he was having that he didn\'t hear the sound of the door when it opened, the door to his room was ajar and it was the sound that came from the room that caught her attention.</p><p>At first she thought probably Lekan forgot to switch off the television in his room so she decided to check it out but as she moved closer, things started to seem strange and the first thing that tipped her off was the door that was at ajar. Lekan never leaves his door open even when he is at home, so the fact that he wasn\'t home and the door was slightly opened made her feel suspicious. The sound that was coming from the room became louder as she got closer, it wasn\'t the sound of the television as she thought, it was a familiar sound, a sound she only hears whenever she and Lekan were having sex and that made her heart skip. <i>Oh my God, is that what I think its sound like</i> she said to herself as she finally got close enough to the door to see what was happening. Her expectation was to catch Lekan in the act but that wasn\'t the case, Lekan was on the phone talking to someone and he was moaning and that was when it hit her that he was actually having sex with someone over the phone. This pissed her off for two reasons one; she could remember vividly this one time she asked Lekan if they could do such and he said never, two; he lied to her that he wasn\'t going to be around. After ten minutes of listening to their conversation and watching her beloved moan over the phone as he was masturbating, she busted into the room with all the anger she could gather. Lekan was really caught off guard and off balance as he didn\'t know what to say, he was far beyond short of word as he was clueless concerning what to say and when he finally spoke the only thing he could say was <i>Mercy its not what you think it is</i>.</p><p>Lekan did try to make amend but the method he used didn\'t help the situation. <i>I swear you have to believe me, she is just a friend</i> he said. <i>Oh I see, a friend that you can have phone sex with</i> she replied back. <i>I only did it because I wanted to make her happy, trust me nothing more than that</i>. <i>Really, I caught you butt naked masturbating, I am sure there is more than enough to that</i>. <i>If you really wanted her to be that happy why didn\'t you just go over and have sex with her</i>? She added to her sentence. <i>That never going to happen</i> he replied her immediately. <i>And why is that</i>? She asked. He had already said the answer before he realized how worst he just made the issue. <i>Oh so you mean if she was in the country you would have?</i> <i>Gosh all guys are the same</i> she added to her statement before she walked out on him. <i>That wasn\'t what I meant</i> he said as he tried holding her back to see if he could still savage the situation but from the way she acted he could tell it was too late. <i>Dont you dear touch me you this scumbag, as a matter of fact I don\'t want to ever hear my name from your mouth</i> she said as she forcefully took her hands away from him and walked out of the house.</p><p>She had this interim program she applied for that was going to last for a year and her plan was to move into Lekans house and stay with him for that one year but after the whole phone sex incident, she had to change her plan. The program was supposed to start three months after her graduation but she wasn\'t able to resume on time because she had issue with accommodation, since she had graduated there was no way the school could let her stay in the hostel. She made a friend who offered her to stay in her house for a while probably before she could get her own place but as time went on and she and this her friend became more close, her friend told her she could stay as long as she wanted.</p><p>She and her friend whom by the way also enrolled for the same program with her went out to party and unfortunately for them they were beaten by the rain on their way back. They were drunk and cold, they were also alone and before they could say Jack Robison they were caught up in the moment as they both kissed each other before they laid side by side fingering and sucking each other. The next morning after they were back to their senses, they decided it would be best for them not to talk about what happened the previous night and they should just move on with their lives. </p><p><i>it was just a moment of highness nothing more perhaps you have a boyfriend and I am not a lesbian so just like you said we are not going to talk about this again</i> Mercy said&nbsp;</p>', 'uploads/15487544455728826exes.jpg', '1544793563df6a5lb09e3a74ze6hu5', '09:34:05', '2019-01-29', '1548754445tl69a03secx5i8r749ee1', 1, 'thumb/15487544455783266exes.jpg', 1, 590, NULL),
(174, 'TELL IT TO THE MOUNTAINS', 'Emmiasky Ojex', 'show', '<p>Tell it to the mountains<br>tell it out loud that the world might hear<br>Wax up the steep and rugged hills, journey the valleys and fountains<br>tell them! oh tell them now that they are near</p><p>that there lived the casted stones<br>Let the world hear of their silent voices<br>though may come as echoes<br>Yet, in peasantry they live and make such loud noises</p><p>The worthless pearls have found their worth<br>they sought for noesis and were answered without delay<br>Tell it out loud for<br>the son and daughters of lay men are now of great names</p><p>Tell their success story<br>Tell them its not all irony.</p><p>Emmiasky Ojex</p>', 'uploads/15488550415499094tell_it.jpg', '36au8m1elEn53m8538', '13:30:41', '2019-01-30', '1548855041l63e32i747ta67tecr6ll', 1, 'thumb/15488550416292816tell_it.jpg', 1, 756, NULL),
(175, 'VICTIM and KARMA', 'Aderonke Adetona', 'show', '<p>&nbsp;I have been running through the jungles; I have been dancing with the wolves to get to you Selena Gomez wolves was playing on my phone I sang along in the showers. Today was a weekend which means no lectures I was Bored. Staying in a hostel far to school makes it more difficult to make friends, I picked up my phone and turned off the music, It was time to go on social media and check up on my friends. I was sending a random Hello to everyone I saw online and waiting for anyone to Reply to me. &nbsp;Hi, girl a message popped up on my phone. It was from Tayo aka Mr too know my Coursemate. He is known for asking too many questions in class hence the name Mr To know. Is there an assignment I forgot? I thought to myself. I quickly reply How are you tayo were we given an assignment?</p><p>No, he replied I just wanted to check on you.</p><p>We started chatting about random things; I thought he was being too familiar to believe we just started talking but being bored would make you do anything and reply to anything if it makes you feel better.</p><p>Since then we say hello to each other after lectures.</p><p>He has been my regular chat buddy on WhatsApp that I didn\'t think it through when he asked me to come to pay him a visit at his hostel and tutor him on some courses, after all, It was almost exam period, and I could use a study mate too.</p><p>I quickly put on black trousers, and a top packed my books into a bag and left for his place. When i got there I picked my phone up to tell him I was outside, the odour coming from the hostel was disgusting but since he isn\'t the only one living there I quickly waved it away, Must be from other rooms maybe they have smokers too here I thought. We got to a tiny looking apartment with strange faces staring at me I felt uncomfortable, sensing my displeasure he quickly introduced me to some of his friends and welcomed me to his hostel.</p><p>He offered me a drink, I refused. When I finally settled down to join them in the movie they were watching, his friends got up and made excuses about who they needed to visit and all.</p><p>One, in particular, was giving me this creepy look but Being an innocent and gullible girl that I was; I didn\'t read in between the lines.</p><p>It was silent. We were all alone in the room. &nbsp;I started to get nervous I pulled out my note.</p><p>I begin to blab about courses and how much syllabus we needed to cover before exams.</p><p>He didn\'t respond</p><p>He smiled</p><p>He pulled out his note too; he faked reading.</p><p>It didn\'t take long before He got up to turn on the music louder. Why too serious? We can still catch some fun you know. Life is short</p><p>His hands began to wander; It was starting to get creepy I was getting chills</p><p>I slapped it away immediately; it was uncomfortable I shifted farther. My heart began to race this was looking Like the typical Hollywood movie when the actor wants to force himself on the victim the only difference was; with me, it was happening. He pushed me to the bed and increased the sound of the music. He started to unbuckle is a belt. Why are you so difficult? I am not going to hurt you i promise we would catch some fun and then read later baby relax that was his exact words to me he was whispering. If i didn\'t know better, I would have thought it was a crazy joke. Hahaha. I wish i can laugh right now. I Was already screaming. No one can save you now my subconscious added. I started to beg he wasn\'t listening &nbsp;he was pulling off his cloth</p><p>I was crying</p><p>Is this how it\'s all going to end?</p><p>Touching and kissing every exposed part he could find while i was struggling. I couldnt fight anymore. After all, he was stronger than me</p><p>I gave up</p><p>He was getting his way with me now, and i had thought of a better way to end it all. Suicide. No, i cant do that to them. My family.No they deserve better. I was sobbing silently. &nbsp;&nbsp;</p><p>His phone started to ring he suddenly stopped, I am still not naked just a couple of bruises and ripped cloth. Cursing loudly he picked it up in anger. I couldn\'t hear what the person on the other end was saying, but I know his face was pale all of a sudden. He got ready in a hurry and pushed me out.</p><p>I adjusted my cloth and &nbsp;started to run until my legs gave out</p><p>I cried like someone who has been beaten by a cruel teacher. The passerby watched from afar no one approached me. I walked all the way to my hostel and locked myself up. It all felt like a dream i didn\'t want to wake up. One thing i know was i wasn\'t raped; I could have been. A miracle happened. I don\'t see why it chooses that moment, but it did.</p><p>I didn\'t have the strength to go to school the following day</p><p>My coursemate called because they knew I wouldn\'t miss class for anything unless something happened, but i ignored all of their calls.</p><p>I have been avoiding school for a while now because i didn\'t want to face Tayo. I knew to report him was the best thing to do, but i was scared of all of the questions they would ask me. I didn\'t want to go through that process.</p><p>Tayo has disappeared since that day and hasn\'t been seen by anyone, the day he came to school to write his exams he was looking like a rain-soaked puppy we later heard Tayos family had been in an accident and was called to go home immediately. Must be the reason he went pale in the room that day. Not like i was happy it happened.</p><p>The few people I told pressured me to report him, but i thought karma had served him enough hot dish.</p><p>Not all victims are lucky as i am</p><p>I wish he finds peace soon.</p>', 'uploads/15493675958597454IMG_20190205_123632_451.JPG', '1546847130dk032o2aen3r22e559', '11:53:15', '2019-02-05', '15493675952ic2i7486vi58acl5r4ttme', 1, 'thumb/15493675951400090IMG_20190205_123632_451.JPG', 1, 727, NULL),
(176, 'Exes (Episode Four)', 'Abdulhafeez Onitilo', 'show', '<p>Even though she never spoke about what happened the other night again she still thought about it and how crazy it would be if something like that would happen again. <i>I know it crazy but really I wouldnt mind for it to happen again</i> she thought to herself. After her program, Mercy had to return home but instead of her going to her parents house she went to her sisters house in Ibadan.</p><p>Her elder sister was married but she hasnt been blessed with the gift of the womb though she once had a miscarriage which made her very sad. Due to work and some other stuff she with her husband who by the way works in a very big&nbsp;<i>I.T&nbsp;</i>firm havent had the chance to try again. Mercy elder sister just opened up a boutique store and this was why Mercy went to stay with her so that she could help her out though every weekend whenever her&nbsp;sister&nbsp;didn\'t go to work Mercy would go to Onitsha to visit their parent.</p><p>There was this particular day she was in her sister store, sales were slow and she was feeling very bored and worst of all she was feeling horny. Normally she would have closed the shop and head home but she couldnt because her sister husband was beginning to flirt with her. She and her sister husband had once had sex with each other but that was way before he met her sister. Mercy didn\'t get to know her sister husband till the day they did their introduction and as at then it was too late for her to object to the relationship. Mercy and her sisters husband both decided not to tell her sister that they once had a one night stand but then again, the guy in him wont just let it be, after two months of Mercy stay, he started making moves on her again. This was why she couldnt go home if she wasn\'t horny she would have gone home because she knew how to handle herself but the fact that she is horny made her stay in the store and self-service herself.</p><p>She was in the rest room trying to satisfy her sexual urge when a customer walked into the store, <i>hello is anyone here</i> the customer said. <i>I will be out in a minute</i> she replied as she put on her pant and her jean and rushed out. <i>Good afternoon, how may I help you</i> she said as she came out of the rest room. I&nbsp;<i>am looking for a nice gown, something not too flashy yet sexy</i> the customer said. <i>I think we have something you might like, please follow me</i> she said as she led the way into another section of the store. The customer was busy gazing up the twisted G-string that expose Mercy ass when Mercy turned back and said <i>can you please hold this for me</i> as she tried picking out one or two gowns from where it was hung. She was putting on a low waist jean and for her to get to where those gowns were she had to stretch a little bit since it wasn\'t on her height level and it was in the process of stretching that the customer eyes saw that her pant wasn\'t well worn. As Mercy handed her the gowns, she knew the customer was staring at her but she couldnt figure out why, <i>which&nbsp;of these would you prefer</i> she said to the customer. Taking a look at the dress the customer whose mind wasn\'t on the gown anymore but on what she saw said <i>I am confuse I don\'t know which one to pick but I think I would prefer this black</i> as she pointed to the black gown that Mercy was holding.&nbsp;&nbsp;<i>So how much would it cost it</i>? She asked. <i>15k</i> she replied as she took a look at the price tag that was placed on the gown. Mercy wanted the customer gone as quick as possible so she could go back to what she was doing, immediately the customer agreed to pay the money, she went to package the gown for her without asking any further question. The customer couldnt erase the thought of Mercy expose ass off her mind so she tried to see if she could prolong their discussion by asking her about shoes. <i>What about a shoe to match, can you help with that</i> the c