 possible solution when someone was is in distress. Before she saw the face, Mercy knew the person she was looking at was familiar because of the cloth the person was putting on. From where Mercy was seated she could only see the persons side view which wasn\'t good enough for her but immediately the man that made the prototype of&nbsp;<i>ReadMe</i>&nbsp;stood up and walked to the stage, she saw her but the person she saw didn\'t see her till that person and the man that made the prototype got to the stage.</p>', 'uploads/15494138733379060exes.jpg', '1544793563df6a5lb09e3a74ze6hu5', '00:44:33', '2019-02-06', '1549413873c499el9e9t40a8s2ire1x', 1, 'thumb/15494138739178843exes.jpg', 1, 395, NULL),
(177, 'Exes (Episode five)', 'Abdulhafeez Onitilo', 'show', '<p>Their relationship wasn\'t too serious but it was interesting as they both enjoyed what they were having. It was a new experience for Mercy who had never had a romantic relationship with any girl though there was this one time she got drunk, she and her friend kissed and fingered each other but that doesnt really count because she was under the influence of alcohol. As for Seun who had been a full lesbian all her life, having sex with a guy was also a new experience for her as it was part of the condition Mercy gave if they were going to date</p><p>Mercy was surprise to have seen Seun at the party but she was more surprised when she found out that her sisters husband and Seun uncle were colleagues. <i>I never knew Mr. Biola is your uncle</i> Mercy said when she and Seun finally got the chance to talk. <i>I also didn\'t know that you know my uncle, I guess it is small world after all</i> Seun replied. <i>It is a small world indeed</i> Mercy said as they both continued chatting with each other. After that night they began to see each other, as a matter of fact whenever Mercy was in her aunty store and sales were slow or she was feeling bored, she would speed dial Seun to come keep her company and that was how they got close and finally started dating each other.&nbsp;</p><p>Every six month they would go clubbing, flirt with a guy and finally they would both have sex with the guy. It was Mercy that came up with the idea of going to the club and picking the guy that would have sex with them. What they do is simple, they both go to the club but once they get to the club they separate as couple and this would give guys the chance of flirting with them. Whoever a guy flirts with among them would make sure the guy have a reason to see her the next day and since they both have an idea the kind of guy they are targeting they don\'t have problem with each other choice. A month after one of them would have met a guy from the club that is when they would have sex with the guy but there also a trick to that and this trick was Seuns idea. Let say for that month it was Mercy that brought home the guy they are supposed to have sex with, she would have informed Seun on when to come into the room so she would catch them in the act.&nbsp;</p><p>Now on arriving at the scene Seun would act as a jealous girlfriend who just caught her girlfriend cheating on her, she would lock the door saying she wont allow the guy to leave until he has sex with both of them, uttering these exact words <i>I am not going to allow you get away with this, if you are going to cheat then we would do it together</i>. It would naturally take a very spiritually inclined guy to see both Mercy and Seun naked and would still reject having sex with them, they have all that a man would sexual desire in a girl.</p><p>Nkechi was now really enjoying her relationship with Lekan because not only did Lekan now travel less, whenever he goes on short distance trips he takes her along and that never made her lonely again. There was this particular month that Lekan travelled to for an impromptu job that wasn\'t supposed to last more than two days instead it lasted for a week. A lot of unexpected event occurred to both of them within the space of that one week and it was this event that changed the course of their relationship.&nbsp;&nbsp;Nkechi dilemma started with the phone call she placed to a number she found on her phone while she was just scrolling through her contact, she had thought she had deleted the number because she actually said was going to, she didn\'t want to keep in touch with that person. It was a surprise to her when she saw the number and that brought back some memories she had forgotten and just out of curiosity she decided to call the number, that call changed everything.</p><p><br>As for Lekan his own predicament started when he and some of his friends that were with him on the job trip decided to hit the club and grab one or two beers just to ease the tension of the work. They had been working for three day without any form of relaxation so they all decided to take that night off and relax. Lekan came across this pretty&nbsp;<i>bae,</i>&nbsp;he decided to make a move on her and that move lead to a series of unexpected revelation.</p>', 'uploads/15494143318185937exes.jpg', '1544793563df6a5lb09e3a74ze6hu5', '00:52:11', '2019-02-06', '154941433138e074s8eet9lr9i9a0xc', 1, 'thumb/15494143318570123exes.jpg', 1, 473, NULL),
(178, 'Exes (Episode Six)', 'Abdulhafeez Onitilo', 'show', '<p><i>Excuse me miss, I am David by name and I hope you wouldnt mind if I talk to you for a bit</i> he said as he walked up to the girl. David was his flirting name, whenever he is out drinking and just want to flirt around that is the alias he uses. Yes he was attracted to the girl but if his friends had not pushed him he wouldnt have walked up to her, he would have just continued to admire her quietly. <i>You talking to me is no problem but I am not sure I would be interested in what you have to say</i> the girl said back. If there was one thing Lekan was good at its being able to read people and base on the way the girl was dressed Lekan read her perfectly. <i>A pretty girl like you all in&nbsp;&nbsp;the club by herself, dressed in a very sexy and comfy dress, I would say you are here to have fun and I can definitely give you that, that of course if you allow me too</i> Lekan said. <i>And how do you intend doing that exactly</i> she asked him. <i>First, allow me start by buying you a drink and we can talk further</i> and that was how Lekan was able to get her full attention and they actually had a lot of fun before they left the club.</p><p><i>Hello Nkechi is that you</i>? The person on the other line said as she picked the call. Nkechi didn\'t know what to say but when she found her voice she said this <i>you still sound the same</i>. <i>Were you expecting me to sound different</i>? The person she called asked. <i>I didn\'t mean it like that, I was probably expecting you to be mad at me considering how.........</i>. <i>Why should I be? You made your decision and I have learnt how to leave with it, you have moved on and I am also trying to do the same</i> the person she was talking to said as she cut her short. <i>I am sorry for what I did, I know that wasn\'t the plan and I am sure you wont probably believe me if I tell you</i> Nkechi said. <i>Now that you have called me why don\'t you give it a try at least I would listen even if I wont believe you</i>&nbsp;the receiver said. And that was how Nkechi began to explain everything that happened and why she had to behave the way she did. The way they ended their conversation wasn\'t the way Nkechi had expected it to end, it ended on a more laughing note rather than on an apologetic note.</p><p>Mercy had gone to Onitsha to spend some days with her parent as she was called that her mum wasn\'t feeling too well. So that particular weekend that Seun went to the club Mercy wasn\'t around but Seun was able to fill her in via phone call and chatting. Some few minutes after she had just finish talking with Mercy her phone rang and she was very surprise when she saw the name that appeared on the screen. The name she saw on the screen was the last person she was expecting a call from, that why when the phone first rang she didn\'t want to receive it because she didn\'t even know what to say. On the second ring she decided to pick it up saying <i>at least let me hear what she has to say</i> but she was confused and was forced to talk first when she picked the call and she didn\'t hear a word from the caller for about thirty seconds and that was when she said <i>Hello Nkechi is that you</i>?</p><p>There was this sensational feeling she was having as she spoke with Seun, it been close to two years since they both went their separate ways yet that her voice still had a solid effect on her. As they kept on talking she began to reminisce about all those time that they had together and she didn\'t know when she said <i>I sometimes wish we can still be together</i>. It was this statement that lead to more complicated issue with her present relationship, Seun too couldnt deny the fact that she missed what she and Nkechi had and that she also sometimes wish they were still together. There was a long pause after Nkechi made that statement but Seun broke the pause by saying <i>I wish the same too</i> and it was at this point Seun began to tell her about her current relationship. <i>I cant believe it, you have started having sex with men</i> Nkechi said when she had the terms in which Mercy gave before she could date her. <i>My dear na my story be that ooo and talking about guys self, where this your guy come dey way you get time to call me for midnight so?</i>&nbsp;Seun said. <i>He went for a job in Ibadan although him suppose don come back but him say the work go delay small</i> she replied. <i>Alright babe me won crash, it been very nice hearing your voice, hope we can talk soon</i> Seun said. <i>Definitely we shall talk soon and this time I promise to keep to my promise</i> she replied before they both said their final good bye. Nkechi didnt get to sleep till probably thirty minutes after the phone call as she was still reminiscing about her and Seun and wondering how it would feel if they were still together or if they could still have sex one more time.</p><p>Lekan was suppose to see Seun the next day after the club but due to work he couldnt, he was very stressed that he just went to the hotel he was staying to rest. He called her to inform her that he wont be able to make it for their date and asked her if they could reschedule for the following day and she agreed to. As Lekan was relaxing he was also plotting how he was going to get under Seun pant before he leaves Ibadan. <i>I no won long thing with this bae, just do what I want to do sharp sharp, cant risk Nkechi finding out</i> and it was when he spoke of Nkechi he actually remembered that he promised her he was going to call her back and since yesterday that he said so he hasnt. Immediately he picked up his phone from the side of the bed, he dialled her number. Nkechi was taking a shower when he first called so she wasn\'t able to pick it up at first ring, it was on the third ring that she came out of the shower and she picked up. <i>Hello dear I am sorry for not picking up, I was in the bathroom</i> she said immediately she picked the call. <i>That alright</i> he said before he began asking her how she was and how her day has been.</p><p>He was a bit disappointed that he wasn\'t able to have sex with Seun before leaving Ibadan though it wasn\'t as if he was also hell bent on doing it, just that he felt he had a shot at it and he didn\'t take it. Seun made him a promise before he left and it was that promise that gingered him to go ahead with her&nbsp;<i>parole</i>, he believe it was what he said to her that made her make that promise so he felt he his game plan was working but little did he know that it was actually Seuns game plan that was working and he was the one been played.</p><p>He was supposed to go back to Lagos on Thursday but since he knew that his plan to get Seun to sleep with him wasn\'t going to work he decided to leave on Wednesday and Nkechi wasn\'t expecting that. He got home around past six that evening and what he witnessed wasn\'t what he was expecting.</p>', 'uploads/15494150437821260exes.jpg', '1544793563df6a5lb09e3a74ze6hu5', '01:04:03', '2019-02-06', '15494150434ti7s6c85lxe6404eear2', 1, 'thumb/15494150432651907exes.jpg', 1, 355, NULL),
(179, 'I Believe in the Power of YOU and I ', 'Oluwaseun Ejire', 'show', '<p><br>I believe in the power of LOVE;&nbsp;<br>I believe in the power of CHANGE;&nbsp;<br>I believe in the power of TOGETHERNESS;&nbsp;<br>I believe in the power of ONE;&nbsp;<br>I believe in the power of PEACE;&nbsp;<br>I believe in the power of UNITY;&nbsp;<br>Let\'s practice GOODNESS, KINDNESS, LOVE and RESPECT;&nbsp;<br>Let\'s live in HARMONY with each other;&nbsp;<br>Let\'s be of ONE mind _ UNITED in thought and PURPOSE;&nbsp;<br>Don\'t believe the lies that VOTE don\'t count;&nbsp;<br>If VOTE don\'t count, why do bad politicians share money for VOTE;&nbsp;<br>Together let\'s RECREATE a planet in HARMONY;&nbsp;<br>Vote your CHOICE;&nbsp;<br>Vote your FUTURE;&nbsp;<br>Vote WISELY;&nbsp;<br>Your vote COUNTS;&nbsp;<br>Your VOTE _ your FUTURE</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ej_oluwaseun</p>', 'uploads/15496227204368330FB_IMG_1549032395263.jpg', '15409061695snaoeu694w89l7304u', '10:45:20', '2019-02-08', '1549622720ceilt165i78a0169r4', 1, 'thumb/15496227208318594FB_IMG_1549032395263.jpg', 1, 517, NULL),
(180, 'The New YEAR ', 'Oluwaseun Ejire', 'show', '<p>What a feeling to scale through to the NEW YEAR;&nbsp;<br>A feeling of HAPPINESS to be ALIVE;&nbsp;<br>A feeling of JOY to be HALE and HEALTHY;&nbsp;<br>A feeling of SHOUTING for APPRECIATION;<br>Here comes 2k19;&nbsp;<br>Here comes the new YEAR;<br>Here comes new OPPORTUNITIES;<br>Here comes new DOORS;&nbsp;<br>Here comes new HEALTH;&nbsp;<br>Here comes new FEELS;&nbsp;<br>Here comes new CHANCES;<br>Same DREAMS and a fresh START;&nbsp;<br>I don\'t believe in new year RESOLUTIONS _ I believe in DAILY RESOLUTION;&nbsp;<br>I ain\'t saying what I\'m doing or what I am not doing for 2k19 _ whatever GOD has planned for me _ is the path I\'m TRAVELING; so<br>I EMBRACE 2k19 _ cos it\'s my year of THANKSGIVING to PRAISES.</p>', 'uploads/15496235609197431FB_IMG_1549120178701.jpg', '15409061695snaoeu694w89l7304u', '10:59:20', '2019-02-08', '1549623560e341tih39r3a19etcl61', 1, 'thumb/15496235603349471FB_IMG_1549120178701.jpg', 1, 467, NULL),
(181, 'The Random Act Of kindness ', 'Oluwaseun Ejire', 'show', '<p>INTERNAL DISPLACEMENT is a global crisis with over 40 million IDP\'s; NIGERIA alone has over 5 million DISPLACED INDIVIDUAL;&nbsp;<br>How do we SUBDUE this;&nbsp;<br>How do we ERADICATE it;&nbsp;<br>It start with YOU;&nbsp;<br>In a world where u can be anything_be GENEROUS;<br>In a world where you can be anything _ LOVE;&nbsp;<br>In a world where you can be anything _ be KIND;&nbsp;<br>I believe if we all take just one step, we will change this situation far quicker than we imagine;<br>Working to raise awareness in every STATE, starting now will result in strong protection for our CHILDREN _ our FUTURE;&nbsp;<br>SHARE kindness _ PREACH kindness;&nbsp;<br>SPREAD kindness _ PRACTICE kindness;&nbsp;<br>Together we can do this;&nbsp;<br>Together we can make this a REALITY;&nbsp;<br>Just one RANDOM ACT of KINDNESS .</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ej_oluwaseun</p>', 'uploads/15497104844903974Screenshot_20190123-001351.png', '15409061695snaoeu694w89l7304u', '11:08:04', '2019-02-09', '154971048492tl8trca4e65h69i7e', 1, 'thumb/15497104841684655Screenshot_20190123-001351.png', 1, 666, NULL),
(182, 'GRACE FOUND ME', 'Oluwaseun Ejire', 'hide', '<p>The Grace of God makes me RELEVANT;&nbsp;<br>The Grace of God makes me SHINE;&nbsp;<br>The Grace of God makes me FLOURISH;&nbsp;<br>The Grace of God is my BEAUTY;&nbsp;<br>The Grace of God is my LIGHT;&nbsp;<br>The Grace of God is my HAPPINESS;&nbsp;<br>The Grace of God gives me Good Things I don\'t DESERVE;&nbsp;<br>I enjoy UNLIMITED Grace;<br>I enjoy UNENDING Grace;<br>I enjoy Grace NONSTOP;&nbsp;<br>When they use STRENGTH _ I use Grace;&nbsp;<br>When they use FORCE _ I use Grace;&nbsp;<br>When they use POWER _ I use Grace;&nbsp;<br>The Grace of God made ME;<br>I am the SON of GRACE .............</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ej_oluwaseun</p>', 'uploads/15504462485078934DSC_0841.jpg', '15409061695snaoeu694w89l7304u', '23:30:48', '2019-02-17', '15504462482gl6ccaei96t947ae5r3r7', 1, 'thumb/15504462486520346DSC_0841.jpg', 0, 15, NULL),
(183, 'The JOURNEY  of Self DISCOVERY ', 'Oluwaseun Ejire', 'show', '<p><br>The content of my character is my CHOICE;&nbsp;<br>Day by day _ what I CHOOSE _ what I THINK, and what I DO _ is who I BECOME;&nbsp;<br>When I lose all sense of SELF _ the bonds of a thousand chains will VANISH;&nbsp;<br>Life told me to lose myself completely and return to the ROOT of the ROOT of my SOUL;&nbsp;<br>The root of my CORE BEING _ it\'s the first step to a FRESH beginning;&nbsp;<br>I sighed;&nbsp;<br>Life smiled  and asked;&nbsp;<br>Do you know I\'m a FLUTE; I have many HOLES and EMPTINESS _ but if u work on me carefully _ you\'ll play MAGICAL MELODIES;&nbsp;<br>Confused  I asked;&nbsp;<br>Why are you like this???&nbsp;<br>What do I need to do??? He said;&nbsp;<br>From a place of self APPRECIATION _ you\'ll attract WONDERFUL things;&nbsp;<br>From a centered place of liking YOURSELF _ you\'ll allow all wonderful things to come to you;&nbsp;<br>The SELF relationship is the most important RELATIONSHIP and it\'s the basis of other RELATIONSHIPS;&nbsp;<br>To change your life _ you need to change your PRIORITIES.&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ej_oluwaseun</p>', 'uploads/1551080748159151IMG_20181208_151410.jpg', '15409061695snaoeu694w89l7304u', '07:45:48', '2019-02-25', '1551080748i1c28et82ltr29e6h2a9', 1, 'thumb/15510807488643992IMG_20181208_151410.jpg', 0, 194, NULL),
(184, 'I am not my MISTAKES ', 'Oluwaseun Ejire', 'show', '<p><br>I am not perfect and will never be;&nbsp;<br>I make mistakes cos it\'s meant to happen;&nbsp;<br>I hurt people cos I\'m also human;&nbsp;<br>Too many people today speak after hearing just one side of the story _ judging a situation without being there and knowing the actual facts;&nbsp;<br>It ruins life _ it ruins relationships;&nbsp;<br>What I went through happened;&nbsp;<br>Who I was existed;&nbsp;<br>I needed my past and mistakes to get me where I am;&nbsp;<br>Don\'t underestimate me!! And if u do _ you won\'t be the first _ you won\'t be the last_ but, u\'ll be wrong; &nbsp;<br>I am the catalyst;<br>I am the change;&nbsp;<br>I am not my mistakes...........<br>Let he who is of without sin : cast the stone </p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ej_oluwaseun</p>', 'uploads/15510814058829036IMG_20190117_234003.jpg', '15409061695snaoeu694w89l7304u', '07:56:45', '2019-02-25', '155108140546tai8c919lr32e3i8', 1, 'thumb/15510814058133608IMG_20190117_234003.jpg', 0, 245, NULL),
(185, 'Dear God of Heaven', 'Lewis Wamwanda', 'show', '<p>&nbsp;</p><p>Dear God of heaven,&nbsp;<br>I don\'t know how to pray<br>But a few words from my mouth<br>May show the wants of my heart</p><p>Am not worth to pray<br>But see, God my neighbour has a wife<br>Am not lustfull at all<br>But i pray if given a chance<br>I will treat her better than him</p><p>Dear God of heaven<br>If my answers are given<br>I promise to change my drinking habits<br>From drinking five bottles a week<br>To drinking three bottles a day</p><p>Dear God of heaven,<br>Am not selfish as many say<br>Try and give me wealth<br>And all the beggars in town<br>Will be happily eating crumbs at my doorstep</p><p>Dear God of heaven,<br>Am not an adulterer at all<br>All i pray to you father<br>Give me two or three women today<br>To prove to my loving wife<br>And the neighbours at our home<br>Am still good in bed</p><p>Dear God of heaven<br>When my answers will be answered<br>I promise to go to church<br>During the weddings of saints<br>And parties of the church<br>My generosity will be seen<br>As i supply free booze to saints</p><p>*#lewiswamwanda*</p>', 'uploads/15514208269488134IMG_20190301_065928.jpg', '15512039962781e52s5wil319', '18:07:28', '2019-02-26', '1551204448il2reca273ea8r4d864t3', 1, 'uploads/15514208269765823IMG_20190301_065928.jpg', 1, 331, NULL),
(186, 'It\'s okay to FEEL ', 'Oluwaseun Ejire', 'show', '<p>It\'s okay to CRY&nbsp;<br>It\'s okay to be CONFUSED&nbsp;<br>It\'s okay to be SAD&nbsp;<br>It\'s okay to be DISAPPOINTED&nbsp;<br>It\'s okay to be ANGRY&nbsp;<br>It\'s okay to WORRY&nbsp;<br>It\'s okay to FAIL&nbsp;<br>It\'s okay to FEAR&nbsp;<br>It\'s okay if you don\'t FIT IN&nbsp;<br>It\'s okay if you choose not to BELONG;&nbsp;<br>Life is a balance between what we can control and what we cannot;&nbsp;<br>Life is for the living;&nbsp;<br>Let life be like music; learn to live between effort and surrender;&nbsp;<br>It will all be WORTH IT; it\'s OKAY </p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ej_oluwaseun</p>', 'uploads/15516845642260266IMG_20190304_081030_564.jpg', '15409061695snaoeu694w89l7304u', '07:29:26', '2019-03-04', '15516845665r7a8t5c68el0its3i95', 1, 'thumb/15516845643754551IMG_20190304_081030_564.jpg', 0, 245, NULL),
(187, 'TEAR DROP', 'Lewis Wamwanda', 'show', '<p><br>Tears of the past days<br>Forgotten by time,<br>Assumed by many<br>Fear to remember the past<br>But still she feels the pain</p><p>She went to school, yes<br>She did her primary level, yes<br>She passed, they say, yes<br>But she was a girl, not a child<br>And had to go, and bring cows</p><p>She tried to voice her sound,<br>To scream for help<br>To beg for a chance<br>A chance to schooling<br>A girl, how can anyone hear?</p><p>Now she is twenty<br>And a dozen of offsprings<br>With a drunk man<br>Empty plates on the table<br>Twenty four eyes looking at her<br>But no one dares to speak</p><p>Her memories linger six years back<br>A mere, bright, hardworking girl<br>A bright anticipated future<br>A good and rich husband<br>But all she got now,<br>A tear drop to wipe</p><p>*_Reflections_*<br>*#lewiswamwanda*</p>', 'uploads/15521257415588752mqdefault.jpg', '15512039962781e52s5wil319', '18:57:48', '2019-03-05', '1551812268certe6ltaar8i', 1, 'uploads/15521257418375194mqdefault.jpg', 0, 352, NULL),
(188, 'From My Chains', 'Lewis Wamwanda', 'show', '<p><br>I was a good child to my parents<br>A good example to my friends parents<br>Mark mine words<br>\"I was\"</p><p>Am dying from self denial<br>For am chocking from within<br>And the chains holding me are heavy<br>But my desires hold me away from salvation</p><p>I want to stop it<br>I wish to stop it<br>But i fail&nbsp;<br>Am weak and a coward</p><p>I am a slave of addiction<br>A slave of drugs and drinks<br>From a sip to sips<br>A puff to puffs<br>Slowly leading to my grave</p><p>My will I write<br>To the youths all right<br>My advice to heed<br>Don\'t fall a prey<br>And a drinking one to be</p><p>Am dying from drinking<br>Poison and death<br>Dirt and immoral<br>Yet I can\'t stop<br>Yet I can\'t.</p><p>*lewis wamwanda*</p>', 'uploads/15518576483246374black-man-chains-450w-638952265.jpg', '15512039962781e52s5wil319', '07:34:10', '2019-03-06', '15518576502fearlcomirt', 1, 'thumb/15518576486722916black-man-chains-450w-638952265.jpg', 1, 296, NULL),
(189, 'Give Me A Year', 'Lewis Wamwanda', 'show', '<p>Give me a year, just one.<br>Give me a year to prove mine worth,<br>Give me a year to serve the nation,<br>And fullfill my Promises.</p><p>Give me a year my people,<br>I will build all those bridges,<br>And I promise to Increase your wedges,<br>From fifty a day, to a hundred a week.</p><p>Give me a year my friends,<br>To serve you well,<br>To sack all the corrupt<br>And for a small fee from you<br>To give out free jobs for all</p><p>It\'s only a year, only one,<br>To bring change to you,<br>Free education,tax free nation,<br>Give me a year</p><p>Lewis Wamwanda</p>', 'uploads/15521256907275925Year-of-Change-A2-Poster-KNOCKOUT-Copy_1914081a8bc8f9fe63792c787eb0d38c.jpg', '15512039962781e52s5wil319', '11:37:56', '2019-03-06', '15518722767ivlieta4cger', 1, 'uploads/15521256905537475Year-of-Change-A2-Poster-KNOCKOUT-Copy_1914081a8bc8f9fe63792c787eb0d38c.jpg', 1, 435, NULL),
(190, 'Alone', 'Lewis Wamwanda', 'show', '<p>You won\'t understand either,</p><p>So i seize to talk.</p><p>Call me a coward,</p><p>Or perhaps proud</p><p>But my pain, won\'t understand</p><p>Blooding is oozing</p><p>Pain inflicted in me</p><p>Yet I say I\'m ok</p><p>And pretend to put a smile</p><p>Sometimes we laugh,</p><p>Making jokes \'till late</p><p>Drinking and eating</p><p>But I still feel alone</p><p>I wish to die</p><p>Slow, painlesa death</p><p>Deep down in my sleep</p><p>To wake up and see myself dead</p><p>Not to talk,</p><p>Not to laugh</p><p>Not to cry</p><p>Silence!</p><p>But this are just illusions</p><p>Chains of loneliness holding me</p><p>Tightly breaking my soul</p><p>Forcing my inner to give in</p><p>If only you could understand,</p><p>And feel my pain</p><p>And bare my pains</p><p>Then the world apart</p><p>Will be one whole ball</p><p>They celebrate when the sun rises</p><p>Yet my burden of sadness increases</p><p>My sack of pain becomes heavier</p><p>With lots of condemnations</p><p>Lots of judgement.</p><p>Am alone</p><p>lewis wamwanda</p>', 'uploads/15521255444148553download.jpg', '15512039962781e52s5wil319', '14:24:28', '2019-03-06', '1551882268ieoen2alct5alr', 1, 'uploads/15521255445905056download.jpg', 1, 425, NULL);
