(191, 'Exes (Episode Seven)', 'Abdulhafeez Onitilo', 'show', '<p>Since she was the only one at home and she wasn\'t expecting anybody, she didn\'t see the need of locking the door with keys perhaps it wasn\'t dark yet and she still had the intention of going out to get what to eat. He knocked only once after which he noticed the door wasn\'t locked with key so he went straight in, on getting in, he saw an empty bottle of red wine on the small centre table in his sitting room and with that he knew she had been drinking. That was the first clue that made him suspect something was wrong, she doesnt alone and when she does she has never finished a bottle of red wine before, he started to think what could be wrong as he hurried up the stairs to check up on her.</p><p>He stood by the door watching in amusement waiting for the right time to join the fun but he was surprise when he heard what she said. What he saw at first was his girlfriend who had drank a whole bottle of red wine which made her horny and decides to help herself (that was what he thought the case was), so he decided to stare at her for a while before going in to make love to her not knowing she was on the phone.&nbsp;&nbsp;After watching her self-servicing herself for about five to ten minutes, he was also getting an erection and he felt this was the right time to move in, coincidentally it was at that same exactly time she said this <i>I really miss having sex with you, I mean I enjoy having sex with my guy but na guy him be and you be woman and that cant be compared</i>.</p><p>Slowly and gently Lekan removed his hands from his already hard manhood as he couldnt believe what he just heard. Her sleeping position when Lekan saw her was on her right hand side and the phone was close to her ear that was why Lekan couldnt see it, but as she said those words she turned straight facing the ceiling and holding the phone in a much more visible position that Lekan could see. While Lekan was still standing close to the door in shock over what he heard, she spoke again <i>can you make me cum please, I missed that feeling</i> she said. He had series of questions like <i>is she truly a lesbian? How long has she been doing this? Who the hell was she talking to on the phone</i>? The best he could do was to continue drinking the bottles of beer that he had in his front as he couldnt find the answers to the questions that he was asking. After he was very much convinced that she was having phone sex with another girl he carefully left the house and headed for the bar. He didn\'t go home that night instead he spent the night in a friend house, he tried explaining his situation to his friend maybe the friend could help make sense of it but the respond his friend gave wasn\'t helpful. He decided to go home and act like he didn\'t know what had transpired between his girlfriend and the girl over the phone.</p><p>Nkechi was so happy seen him as he jumped on him and placed a kiss on him saying <i>I have missed you so much</i>. In a very relaxed tone he said <i>I can only imagine</i>. <i>Gosh see the way you sounding, your journey must be very exhausting, go take your shower while I prepare your favourite meal</i> she said to him as she followed him to the bedroom before she headed to the kitchen. After taking his shower before heading back to the sitting room he got a call and the caller told him something that took his mind off the whole scene that he had witnessed when he first came home yesterday, before receiving the call he had decided to head to the sitting room and confront Nkechi concerning what he saw and see what would happen but after receiving the phone call he changed his mind.</p><p>Seun and Mercy had agreed on the time there were going to have sex with the guy Seun met in the club. While Mercy wasn\'t around after Seun had fill her in on how things had been going between them. <i>I told him to come next week, I told him I was having a little get-together and I said I have a surprise for him</i>. So what did he say? Mercy asked. <i>Well he didn\'t say much but trust me I know he is excited, you know guys na dem go won form</i> she replied.&nbsp;&nbsp;Throughout that week Mercy and Seun were planning how exactly they were going to trick Lekan into sleeping with them both at the same time Seun was contemplating on whether to tell Lekan the truth that he wasn\'t going to be having sex with her alone because she had already given him the hint that they were going to have sex when next they see each other. Lekan on the other hand was also battling with his own issuing, he wasn\'t still sure want to do concerning what he saw and heard Nkechi doing, there were times he would sit her down to ask her if she was a lesbian but somewhere along the line he would just ask her a different and sometimes unnecessary question.</p><p>Seun and Nkechi kept on having phone sex without their partners knowing, since Lekan got back from Ibadan Nkechi had only slept in his house once and that was that very day he got back, expect from that day she would go sleep in her own apartment and Lekan never questioned her because he suspected she wanted to be alone so could continue having&nbsp; phone sex with the mysterious girl. Lekan had made up his mind to find out who the girl was before he confronted her but that didn\'t take place till after his trip to Ibadan which also didn\'t go according to plan.</p>', 'uploads/15523426258186082BLIHMB9e_400x400.png', '1544793563df6a5lb09e3a74ze6hu5', '22:17:07', '2019-03-11', '1552342627ear3esxltie4c', 1, 'thumb/1552342625347372BLIHMB9e_400x400.png', 0, 221, NULL),
(192, 'Exes (Episode Eight)', 'Abdulhafeez Onitilo', 'show', '<p>It seems like she had seen a real life ghost the way she reacted when she came into the room and saw who she and her girlfriend were supposed to have sex with, she totally lost it that her girlfriend had to calm her down as she stylishly told her that she was overreacting.</p><p>Lekan was still playing it cool with Nkechi acting like he wasnt suspicious about her being a lesbian, as a matter of fact he became a better boyfriend just that he didn\'t make any advances on her concerning sex and that was where Nkechi gave up herself. Normally whenever Lekan returns from a job trip like that, the next three days was going to be a sex marathon but this wasn\'t like that, she didn\'t make any plan like she was supposed to and the fact that she wasn\'t even sleeping in his house said a lot. If Lekan had not seen her moaning over the phone he would have probably initiated the sex marathon but he still hasnt been able to put his head around the fact that his girlfriend might be bi or possibly a full time lesbian, so sticking his manhood up her ass wasn\'t just feeling right.</p><p><i>I really have a feeling I should tell this guy that he wont be having sex with me alone, something is telling me he would go for it</i> Seun said. <i>Why you go won tell am, is that how we have been doing it or wait, are you having feelings for this guy</i> Mercy replied. <i>Feelings ke, bae I am a lesbian, David just seems like an adventurous kind of guy that all</i> she replied her back.&nbsp;<i>Why am I even bothered, its your turn to come up with a plan on how we are both going to get his manhood inside us, so bae do what you have to do, koko be say he sleeps with us</i>&nbsp;&nbsp;Mercy said as she stood up from the chair she was seated on and left for the toilet that was in the store.</p><p>Nkechi had pleaded with Seun to come to Lagos so they could catch up and obviously have sex, she told Seun that her boyfriend would be away for the weekend but Seun told her she wasn\'t going to be free that weekend <i>I go dey busy for Friday and Saturday, maybe next time sha&nbsp;</i>Seun said to her. Nkechi went on to her ask if she could come on Sunday and she gave it a maybe saying <i>that if you are sure that your boyfriend wont be back by then</i>. Lekan had told Nkechi he was going to Abeokuta for another job trip and after that he was going to spend a little time with his elder sister who also stays in Abeokuta, so Nkechi was so sure that he wasn\'t going to be around for at least a week. Seun had informed Mercy she was going to Lagos on Sunday, she said her uncle was sending her on an errand and she wont be back till Tuesday.</p><p>Lekan got to Ibadan around 6pm and after he had settled in with one of his friends he gave Seun a call letting her know he was in town and if they could see that evening. Seun politely turn him down using this as an excuse <i>don\'t let me trouble you tonight when I am still going to trouble you tomorrow, just make sure you rest and save your energy for tomorrow because I know you going to need it</i>. <i>Hmmm I like it when you talk like that but be warned I don\'t get tired that easy</i> Lekan replied her. She meant every word of it when she said <i>trust me you are going to be more than tired tomorrow</i>, If they were going to rate how good both Seun and Mercy were on bed they would probably get an 8 and 9 over 10.</p><p><i>What the hell is going on here</i>? She asked as she came into the room to see Seun been stripped naked by David. She was dumbfounded when David turned to face her, she forgot her rehearsed speech and all she could say was <i>Oh My God Oh My God.........</i> and that was when Seun got up from the bed to meet her. She tried acting her part maybe Mercy was going to remember her part I&nbsp;<i>can explain baby it is not what it seems like</i> she said as she was giving her eye contact to play along. <i>I am sorry but I think I have to take my leave</i>&nbsp;Lekan said as he got up from the bed and that was when Mercy played along but not in the way Seun was expecting but definitely the way Lekan had thought she would when he turned and saw his ex-girlfriend staring at him. <i>No no no, nobody is going anywhere until you explain to me why you are sleeping with my girlfriend</i> Mercy said but as Seun was trying to stick to her script Mercy let the cat out of the bag as she said <i>do you hate me this much Lekan, breaking my heart wasn\'t enough for you that you have to sleep with my girlfriend now</i>.&nbsp;<i>What!</i>&nbsp;Seun said as she couldnt believe what she was hearing. <i>Yes Seun this is the ex I told you about and his name is not David his name is Lekan</i> Mercy said facing Seun before she faced Lekan who just stood there quiet as he didn\'t know what to say. <i>I am so sorry Mercy I didn\'t know he was the one if not I wouldnt have flirt with him</i> Seun said right before Lekan said <i>that true I didn\'t know she is your girlfriend perhaps the last time I checked you werent a lesbian</i>. <i>Just shut up your mouth you this good for nothing guy, what I decide to do with my life isnt your business anymore</i> Mercy said out of anger as Seun moved closer to her, calmed her down before pulling her aside to talk to her.&nbsp;</p><p>Lekan just stood there trying to understand why he has been out of luck lately, he just found out that his girlfriend is having an affair with a girl and now his supposed side chick is also a lesbian <i>I mean what could be worse than this</i> he thought.</p>', 'uploads/15523429645565386BLIHMB9e_400x400.png', '1544793563df6a5lb09e3a74ze6hu5', '22:22:46', '2019-03-11', '1552342966e9xs9claierte', 1, 'thumb/15523429646796814BLIHMB9e_400x400.png', 0, 124, NULL),
(195, 'WHAT IF I SAID I LOVE YOU?', 'Emmiasky Ojex', 'show', '<p>What if I said I love you?<br>Would your heart skips its stepping stones and you fall into a bottomless hole?<br>What if I told you each time, I see your buoyed up face as early as 1 a.m at morn in my lovely dreams<br>My soul, spirit and body yearns to be always around you and casts a spell against its master neer to leave that scene<br><br>What if I told you that before I sleep off at dusk,<br>Id pick up my mobile device just to take one more glance at the dazzling angel my wallpaper harbors<br>What if?, you got to know that the <i>ten tails of love</i> were all for you<br>What if, all these and more you knew?<br><br>Would you light up my world with the sun in your smile,<br>tell me <i>I love you too</i> and <i>Youre mine</i><br>or would it seem to you, another love confession<br>one of the many love words youve been hearing long before you were eight(a)-teen<br><br>Would you leave me shocked by the regretful poem I wrote to woo you?<br>Im afraid of being broken by another kind and thus, will never tell you!<br><br>Emmiasky Ojex</p>', 'uploads/15525692549803012what_if.jpg', '36au8m1elEn53m8538', '13:14:16', '2019-03-14', '15525692562l5etacriawht', 1, 'thumb/15525692548614591what_if.jpg', 0, 361, NULL),
(196, 'What Love Is To Me', 'Lewis Wamwanda', 'show', '<p>&nbsp;</p><p>The fact that we don\'t talk daily<br>And even rarely meet<br>Or laugh all night long<br>Does not mean I don\'t love</p><p>The fact that we don\'t go out<br>And prefer to cook at home<br>Wash utensils, and do the cleaning<br>Means Love to me</p><p>The fact that we have busy schedules<br>From dawn to dawn, dusk to dusk<br>And pause a second to say hi<br>Or a moment to say goodnight<br>Means love to me</p><p>The fact that you cry when I cry<br>And travel miles to be a comfort<br>And travel miles to give a hug<br>And tears to wipe<br>Means love to me</p><p>The fact that we fight all night<br>And wake up in the morning to smile<br>To laugh and talk happily<br>And not remembering about yesterday<br>Means love to me</p><p>The fact that you choose to miss the bus<br>And choose to push me to town<br>Not because you have no money<br>But because I have no limbs<br>Means love to me</p><p>The fact that you miss all those CATS<br>Just to take me on my frequent check ups<br>And volunteer to push my wheelchair<br>Assuming the preying eyes<br>Means Love to me</p><p>The fact that you take sign language classes<br>And learn to talk to me in signs<br>And patiently willing to learn<br>And your time offering whole<br>Means love to me</p><p>The fact that you dont say you love me<br>And in Actions you speak louder<br>And the signs showing still<br>Leaves me with hopes always<br>For that means love to me.</p><p><strong>Lewis Wamwanda</strong></p>', 'uploads/1552632228156398PhotoGrid_1552602015376.jpg', '15512039962781e52s5wil319', '06:43:50', '2019-03-15', '1552632230tt5aial8whrce', 1, 'thumb/15526322282971980PhotoGrid_1552602015376.jpg', 1, 287, NULL),
(197, 'Mine Was Not Love', 'Lewis Wamwanda', 'show', '<p>&nbsp;</p><p>The fact that we met and talked<br>The phonecalls we made \'till late nights<br>Laughing till dawn catches up<br>Does not mean love to me</p><p>I smile when we meet<br>Yearning for the next visit&nbsp;<br>And the still moments we are together<br>Happily listening to your unending stories<br>But still, It does not mean love</p><p>Those late nights we spend together<br>And the long weekend gateaways<br>To the woods and the oceans<br>And the frequent parties&nbsp;<br>Does not mean that I Love</p><p>Those tears that I wipe<br>When you are low and sad<br>Taking you by my arms<br>And resting in my comforting hugs<br>Still does not mean that I Love</p><p>That special visit to pa and ma<br>And when everyone said you are good<br>And praised you all day long<br>And talked about you being a good wife<br>Does not explain of love to me</p><p>The jumper I made you wear<br>During that chilly walk at the beach<br>And I shivered by from the sea breeze<br>Making my skin cold and numb<br>Still, does not explain about Love</p><p><i>Reflections</i><br><strong> Lewis Wamwanda</strong></p>', 'uploads/15526353816487330IMG-20190315-WA0001.jpg', '15512039962781e52s5wil319', '07:36:23', '2019-03-15', '1552635383etcanliime3r4', 1, 'thumb/15526353819528729IMG-20190315-WA0001.jpg', 1, 338, NULL),
(198, 'A Letter To Heaven', 'Lewis Wamwanda', 'show', '<p><br>The sky has been blue<br>Since ages ago<br>Before myself was born<br>Or even more, concieved</p><p>The sun has been shinning<br>Since the start of time<br>Blessing as with light<br>Not forgeting energy</p><p>But this is too much<br>Our brothers are scorched<br>Burnt by the sun rays<br>Like roasted meat in feasts</p><p>Hunger is tearing them apart<br>Yet no one sees the burden<br>We are helpless perhaps<br>And a letter of help we write</p><p>Let me not write a long one<br>For the message will fade<br>Or perhaps, God,&nbsp;<br>You will get tired reading perhaps</p><p>But, just like in the good holy book&nbsp;<br>During the time of moses<br>And those children of yours<br>Shower manner and quils today</p><p>We are dying of hunger<br>The earth has forsaken us<br>The rains have long deserted us<br>And the sun is mocking us</p><p>See, dear Lord, I haven\'t said much<br>Just asked for a little favor<br>To my brothers and sisters<br>And your reply, I\'ll be waiting</p><p> Lewis Wamwanda</p>', 'uploads/15528579326868102PhotoGrid_1552856744530.jpg', '15512039962781e52s5wil319', '21:25:35', '2019-03-17', '1552857935rt7ic2aale', 1, 'thumb/1552857932880066PhotoGrid_1552856744530.jpg', 1, 833, NULL),
(199, 'WILD THOUGHTS', 'Aderonke Adetona', 'show', '<p>It\'s a wild thought</p><p>It runs deeper and faster</p><p>It keeps coming back</p><p>They make my head spin</p><p>The more I try to be free, the more I feel constrained</p><p>It\'s deep within</p><p>It\'s in my heart</p><p>I keep fighting, but it has a firm grip</p><p>Sometimes I want to let go</p><p>Or maybe &nbsp;I want to fight back</p><p>Why does it have to be this way?</p><p>Why do good things never last?</p><p>Why do you always have to prove yourself?</p><p>Why is it a minute you are happy, the next your world comes crashing down?</p><p>Emotions clouds my thoughts</p><p>Sometimes I feel no connection at all</p><p>No, maybe they are just wild thoughts</p><p>Perhaps no one knows the answer</p><p>Do you know why the sky is blue, and the leaves are green?</p><p>Don\'t tell me is Evolution</p><p>They say the &nbsp;world is a mystery</p><p>Some say it\'s metal physical</p><p>Why are you created here?</p><p>What\'s your purpose?</p><p>Why does no one ask those questions?</p><p>Why do we have to fake smiles when we are not feeling it?</p><p>Why do we have to pretend to be happy when we are not?</p><p>If you had a choice would you still choose to be you?</p><p>It\'s not a cry for help</p><p>I\'m just a girl in thought</p>', 'uploads/15547636237336798IMG_20190408_233212_607.JPG', '1546847130dk032o2aen3r22e559', '22:47:05', '2019-04-08', '1554763625rtlw6adiilc3e', 1, 'thumb/15547636233162758IMG_20190408_233212_607.JPG', 1, 413, NULL),
(200, 'HUSHED VOICE', 'Aderonke Adetona', 'show', '<p>I am speaking loud, yet no one can hear me</p><p>Shouting at the top of my voice but the silence is way too deafening, it swallowed it</p><p>All the voices in my head are screaming for freedom</p><p>I wish I could let them all out</p><p>I wish I could stop giving a fuck</p><p>But bottled feelings turned my worst habit</p><p>I find a companion in silence</p><p>I recoil every time they wanted a reaction</p><p>It\'s better than fighting</p><p>Just like they wanted</p><p>An average thinker</p><p>An average dreamer</p><p>Now I have had Enough</p><p>Either haunt or be haunted</p><p>It\'s between them and me</p><p>It\'s for survival</p><p>Tired of crushed dreams</p><p>Hushed voices</p><p>It\'s about time I let them know</p><p>The fear of being average turned me into a rebel</p><p>I became the opposite of what they wanted</p><p>Just like the actress in their nightmares</p><p>My body screams fire</p><p>Tell them I\'m a voice not to be silenced</p><p>A girl not to be toyed with</p><p>It\'s a battle for freedom</p><p>I will fight tooth &amp; nails till I get it</p><p>No longer a hushed voice</p><p><strong>A Girl in Thought</strong></p>', 'uploads/15550230028116687IMG_20190411_234159_089.JPG', '1546847130dk032o2aen3r22e559', '22:50:05', '2019-04-11', '1555023005resaculdth52hie', 1, 'thumb/15550230029237345IMG_20190411_234159_089.JPG', 0, 344, NULL),
(201, 'BITTER ANGEL', 'Jane Smith', 'show', '<p>I woke up feeling different today. I tried to ascertain why I was feeling weird, and strange. It then hit me like a block, everything dawned on me in an instant.</p><p>&nbsp;Today, I was going to die.</p><p>&nbsp;I tried hard to sniffle in my tears, I have been preparing myself for this day. I have been preparing myself for this day for the past twenty years. I accepted my fate, and in turn, fate has accepted me.</p><p>&nbsp;The house was not lively, it was as if a dark entity was lurking like an evil bird. Even the colors of my room had turn into black. All I could see was the angel of death blowing it\'s cursed trumpet to a beautifully wicked tune.</p><p>&nbsp;The song captivated my soul, my heart, and my body. The trumpet called to my inner being. That moment, I knew that I was going back to where I belonged. To where the likes of me dwelled in for eternity.</p><p>&nbsp;Like a kid that was presented with a cotton candy I followed the sound of the trumpet, my gaze planted firmly on the angel that was dressed in black, the only atom of light in him were his eyes that was shining brightly. His eyes were so white that you could mistake it for the snow. I strode forward to him, never for once breaking eye contact.</p><p>Mourning could be heard in the background, my family was mourning for me. My home was mourning for me. But I couldn\'t do anything, I couldn\'t keep living here, I was going back to where I belonged. To where I was meant to be.</p><p>&nbsp;I blocked away their bitter mourns, without hesitation I embraced the angel of death.</p><p>&nbsp;And it engulfed me in his beautiful darkness.</p><p>JANE SMITH</p>', 'uploads/1555108204353677315551028705736865images.jpeg', '1555101679742etljc8en1ai85r71a7', '21:01:12', '2019-04-12', '1555102872iebtrtrecli8a4t', 1, 'uploads/1555108204668128415551028705736865images.jpeg', 1, 384, NULL),
(202, 'Exes (Episode Nine)', 'Abdulhafeez Onitilo', 'show', '<p>He actually took that false trip to Abeokuta to see his sister to explain what has been happening to him of late.&nbsp;<br>&nbsp;</p><p>He didn\'t disclose what happened in Ibadan to her but he did mention the current crisis he his having with his girlfriend. <i>You see that was your mistake, you should have asked her about her past relationships</i>&nbsp;his sister said after he explained everything to her. <i>Sis you know I don\'t dwell on the past especially when it comes to relationships or have you forgotten what happened the last time I was hell bent on knowing Taye\'s past</i> he replied her. <i>I can still remember that but like I told you then there are better ways to handle things like that, anyway what do you want to do about your girlfriend</i>? She asked. <i>Sis I don\'t know that why I came here, I am just confused.&nbsp;</i><i>Do you love her</i>? His sister asked. <i>Really sis, if I didn\'t I wont be bothered, I for don send her pack in since</i>. <i>Alright I would suggest you give her the chance to explain herself, ask if the lesbian thing is something of the past or if she also doing it on the side</i>. <i>That is the point sis, I am scared of it been a thing on the side</i>. <i>If you truly love her then you need to know her mind because if you don\'t know her mind any decision you make might just be the wrong</i> her&nbsp;<i>sis</i>&nbsp;said.</p><p><i>See you have to believe me I have no idea he was the ex you told me about</i> Seun said again after Lekan had finally gone. <i>I believe you it just that I thought I was completely over him, seen him today just brought back some memories</i> Mercy replied. <i>I am sorry dear, what do you need me to do</i>? Seun asked. <i>Don\'t worry I would have to handle this by myself perhaps you have an errand to run for your uncle if not I would have love to have you around just in case I need someone to talk to</i> she replied. <i>Don\'t worry I would cancel the trip, I can give my uncle an excuse</i>&nbsp;she said. <i>Seun you don\'t have to worry at least na just two days you dey spend, I can manage that</i> Mercy replied. Mercy did a lot of thinking while Seun was in Lagos, seen Lekan again did brought back some memories both good and bad ones, and at the end she saw herself laughing because she just realized that she had a lot of good memories with Lekan.</p><p>Lekan journey to Lagos was a very thoughtful one and the decision he arrived at was very unexpected, he concluded he wasn\'t going to tell her that he knew about her been a lesbian instead he was going to propose to her with the assumption that she would say yes and maybe that would just change her mind about the whole lesbian thing. When he got to Lagos he went to a jewellery store, got her a ring before heading to her house, he didn\'t bother to call her because he wanted to surprise her but on getting there he was the one that was surprise.</p><p>Seun got to Lagos around 4pm and just like Nkechi had said she was waiting for her at the park. She hired a taxi that took them from the park to her house as she was so excited to see her. After settling down in Nkechi house Seun decided to call Mercy to check up on her, <i>how was your journey</i>? Mercy asked. <i>It was fine and you, how you coping</i>? Seun asked. <i>Well I am doing fine, I am home didn\'t go to the store today</i>. <i>Hope all is well</i>? Seun asked in a concern tone. <i>Yes everything is fine, I just wanted to rest that all</i>&nbsp;she replied. <i>Okay please I hope you aint thinking about what happened,</i>it was when Seun said this statement that Nkechi walked into the room. <i>Who was that</i>? She asked after Seun had finished her call. That was my girlfriend she replied. <i>Oh I see, I guess you have to switch off your phone because I wouldnt want any calls to disturb us most especially when we are getting it down</i> Nkechi said. <i>I am sorry but I cant do that, remember I told about out little agreement</i> she replied back. <i>Yes you did and what about it</i>? She said. <i>Well yesterday we were supposed to have sex with this guy that flirted with me only for us to find out that the guy was his ex boyfriend</i>.<i>Oh My God! That weird how did you guys find out</i>? Nkechi asked and that was how Seun told her everything that transpired. <i>Poor girl, how is she doing now?&nbsp;</i>Nkechi asked<i>. Well she said she would be fine but I have told her to call me whenever she needs to talk, at least that the least I can do for her</i> Seun replied. <i>If you had told me this I would have asked you to stay with her, now I am feeling like a terrible person</i> Nkechi said. <i>Come on babe this had nothing to do with you perhaps I offered to stay but she said she would be fine though I feel bad too because she doesnt really know why I am here</i>. <i>Well since you feel bad and I am feeling bad why not we get totally bad</i> Nkechi said with a smile on her face. <i>Are you suggesting what I am thinking</i>? Seun asked. <i>I am only saying there is whiskey in the sitting room and you know how bad we get on whiskey</i> Nkechi said.&nbsp;<i>You know sometimes I wish you had remained that classroom girl</i> Seun said. <i>Well if I had you wouldnt have the opportunity to taste and enjoy this sweet lovely girl</i> she said as she used her hand to touch her breast before she placed a kissed on her as she whispered <i>let go get the drink</i>.</p><p>After they had almost down a whole bottle of whiskey they started to make love to each other not before Nkechi had locked the door and placed the key on the centre table. As she was coming back to meet Seun on the chair she was seated, Seun stood up and met her with a kiss. She returned the kiss as she grabbed her tight, after kissing for about five minutes Nkechi pulled away a little and when she returned to Seun arms she was placing kisses all over her body as she was standing and moaning gentl