(203, 'Exes (Final Episode)', 'Abdulhafeez Onitilo', 'show', '<p>After seen what he had seen he knew she wasn\'t the girl he was going to settle down with, so all those thought he had some few hours ago about proposing to her, hoping she would leave her past in the past went straight out of the window.</p><p>Nkechi was very shocked when she saw him she didn\'t know what to say, she picked up the bedspread and cover her naked body with it. Her biggest bewilderment came when she saw and heard the reacting of Seun towards Lekan and that was how she too lost it. Seun was shock to find out that Lekan is Nkechi boyfriend the same Lekan that is Mercy ex, she turned to Nkechi told her that the guy standing across them is the same guy she was telling her about few hours ago.</p><p>Lekan catching Nkechi in bed with another girl wasn\'t what really shocked him but what did was the fact that the girl his girlfriend was having sex with is the same girl he would have had sex with if what happened in Ibadan didn\'t happen. After the initial shock statement of&nbsp;<i>what in God name is this</i>&nbsp;all three of them were quiet as they kept on staring at each other since words were finding it hard to come out. Finally Seun was the one who broke the silence as she asked Nkechi if the person standing in front of them was truly her boyfriend and with Nkechi answer been positive Seun decided to spill the beans concerning what went down in Ibadan and that was how Lekan was exposed. Lekan too spilled the beans on how he came home the other time only to find her having phone sex with a girl and that was the reason he gave for his actions at Ibadan. Once again Seun was the one on the apology end as she apologise to Nkechi for flirting with her boyfriend saying she wouldnt have if she had known better. Lekan didn\'t give Nkechi the chance to speak or probably explain herself because after he had revealed what he saw the other day he came home, he left her house without saying any word although Nkechi tried getting his attention saying they should sort things out before leaving but it was obvious that Lekan had already sorted things out in his mind as he left the house without looking back.</p><p>Mercy had thought about her life and the direction she had wanted it to go and she knew it wouldnt be the same direction Seun was thinking and with that her thought became more of how to break up with her than how hurt she would be when she does. Seun returned back from Lagos on Tuesday just like she had said she would just that she was early and that was why Mercy was surprise to see her at the store.&nbsp;&nbsp;After exchanging pleasantries, Seun sounding so happy to be back and all that, Mercy had a very long conversation with Seun and the conversation ended up with Seun smiling out of the store which was not expected at all.</p><p>Seun took the break up from Mercy very well because she knew that things between Nkechi and Lekan were not going to work out and what perfect time was it for her to win her love back if not now. She thanked Mercy for giving her the chance of at least dating her even though she wasn\'t a lesbian and also wished her all the best in life before she finally left the store. They remained friends, kept in touch via phone calls and through chatting but they never saw each other again after that day Seun left the store. After a month that Seun came back from Lagos she took another trip to Lagos but this time she was going to see her girlfriend, winning Nkechi back was easier than she thought and just like they had planned it once they started living together just that it was Seun that move into Nkechi house and not the other way round.</p><p>As for Lekan and Mercy it was a case of&nbsp;<i>the devil you know is better than the angel you don\'t know</i>, Lekan realised the mistake he did with Mercy and decided to try his luck to see if this time they could work things out. Mercy too had secretly wished that Lekan would come back because after seen him that day with Seun she hasnt been able to stop thinking about the good times they had together and how far they would have gone with their relationship if she hadnt reacted the way she did the day she caught him having phone sex. To her when Lekan came back begging she saw it as her wish been granted and she didn\'t waste any time to say yes again but this time was really different because Lekan had learn his lesson and was more serious with her and to prove it he proposed to her just two months after they got back together and like they say the rest <i>na history</i>.</p><p>&nbsp;</p>', 'uploads/15555522372950953BLIHMB9e_400x400.png', '1544793563df6a5lb09e3a74ze6hu5', '01:50:39', '2019-04-18', '1555552239r0i0e00c1tla', 1, 'thumb/15555522373228055BLIHMB9e_400x400.png', 0, 172, NULL),
(204, 'LETTER TO A STRANGER', 'Aderonke Adetona', 'show', '<p>I know this letter is ridiculous or maybe am not suppose to write this, but i think you should know just in case we meet again and you couldn\'t recognize me.</p><p>It\'s was 8 pm, I remember it like i do my face in the mirror, I was running down the highway trying to catch up with a bus but being the klutz that I was, I tripped on my toes and bumped into you, your chest was like a rock, So solid. &nbsp;I didn\'t even know you were human until i looked up and I found the most beautiful pair of eyes staring back at me for a moment or maybe more than, we were lost in each other\'s eyes. How can someone be so handsome? I thought</p><p>Your face screams perfection, and for those split seconds your hands held me. &nbsp;My world was in a standstill. I didn\'t want you to let go.</p><p>Just our eyes, speaking for us saying all of the things we couldn\'t know if we were sane.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Like how I want you to kiss me like it\'s just you and I in the world...</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Hug me till I couldn\'t breathe...</p><p>But time was not on our side.</p><p>We were running late</p><p>You pushed me away sooner than I like to admit. If i had a choice, I would hold on forever</p><p>What was wrong?</p><p>I know you felt it too</p><p>Just how two strangers world fit perfectly.</p><p>I adjusted my shirt and pretended nothing happened</p><p>If only you could read minds and hear my thoughts out loud</p><p>But &nbsp;I couldn\'t be angry at you</p><p>Maybe it was too much to handle</p><p>And you couldn\'t face it</p><p>I know none of us believed in love at first sight till that day</p><p>Perhaps that\'s why you reacted the way you did</p><p>But we know better now right?</p><p>We have experienced it first hand</p><p>I know you are thinking of me right now</p><p>At least that\'s what I like to believe</p><p>The feeling is so real to be only fantasy</p><p>So hold on dear</p><p>Just a little while</p><p>Till our path cross again</p><p>And I promise this time I will be yours Forever</p>', 'uploads/15555838725748072IMG_20190418_113039_334.JPG', '1546847130dk032o2aen3r22e559', '10:37:55', '2019-04-18', '155558387500t1rlci0e0a', 1, 'thumb/15555838723424416IMG_20190418_113039_334.JPG', 0, 296, NULL),
(205, 'WHEN WILL MY GRIEF TURN YESTERDAY?', 'Emmiasky Ojex', 'show', '<figure class=\"media\"><oembed url=\"https://www.youtube.com/watch?v=alQIjV2oajk\"></oembed></figure><p>I picked up the mirror today,<br>I see myself<br>Not human, rather an elf<br>How I wish I could have life replay!</p><p>Maybe Id have changed a lot of things<br>Like when I gave faith Judas kiss<br>And he departed from me to be nailed on the cross<br>And when I told you, youre no longer needed<br>-I can survive alone in this dorm</p><p>When will the pain I feel turn numb?<br>These cuts the razors mouth gives do nothing but burn<br>I lost me, when you were gone!<br>The news of you leaving dropped in my ear like an ef bomb!</p><p>Hope, please come back home!<br>I need you to be my own<br>Living life without you is such disarray<br>I forget when you were here but now youre gone, I remember my pain!</p><p>I need your stretching flagellum to remind me that tomorrow will come<br>That today is just for now,<br>And soon, will be gone!</p><p>-<a href=\"https://www.facebook.com/Emmiasky/?__tn__=K-R&amp;eid=ARD8j182Swt3DltBBfbmk2hg3pElhVFA4hJDY6Cg81FEmkCWZnvkpKGExZ1jZjxt1ctmEpDIapQ8ayOO&amp;fref=mentions&amp;__xts__%5B0%5D=68.ARCSc4tYq9i9gJxvFNlXB1G6w3wlYs2fr5cT0g7oxos-kGol1EfkaqGHsH1KCbyaZw406lhJWiOU5ZL_NGow190sxyrnFldD_z8Tk54GtcaRsDKUEIqJrpca8l2jOkOARJmJUKmQx2F5dKEBbDfR8mN96KXzRn8mrqSjdPpIyM73u8yk4fpsaZ9sOHMPEZRUJA550aV2Lo4xIlc\">Emmiasky Ojex</a></p>', 'uploads/15555921066732377prayer_2454429_1280.jpg', '36au8m1elEn53m8538', '12:55:09', '2019-04-18', '1555592109lr0c00teia10', 1, 'thumb/15555921067156525prayer_2454429_1280.jpg', 0, 458, NULL),
(206, 'Connecting the dots', 'Ayodeji Fakunle', 'show', '<p>A lot of times we give credit to communities, mentors, friends on how far we have come but we always forget to give credit to ourselves for humbleness, time, energy, &nbsp;selfless service commitment,&nbsp;<br>dedication and every decision you made that got you where you are etc.</p><p>You definitely contributed &nbsp;to &nbsp;large extent to whom have become. You have to be grateful to the people that helped you achieved whatever you have been able to achieve, they also have to be grateful to that you turn out well, they will always have &nbsp;claim to how you have turn out well but you have a larger claim to your self.</p><p>Connecting the dots have made me realize that every little steps counts just like cooking without lighting the gas you can\'t boil water and with out boiling water you will end up eating raw food.</p><p>When you connect the dots you do that backwards, you never connect the dots forward, Its all about the decisions you have made. For example when we were in school we stayed all night to read and even sometimes moved outside the curriculum to learn more about a particular course then in recent event we ace all courses, this couldn\'t have happened without the hard work you employed &nbsp;before the exams.</p><p>You cant connect the dots looking forward; you can only connect them looking backwards. So you have to trust that the dots will somehow connect in your future. You have to trust in something  your gut, destiny, life, karma, whatever. This approach has never let me down, and it has made all the difference in my life\"<br>~&nbsp;Steve Jobs</p><p>Connecting the dots is what most of us don\'t think about, Religiously some of us believe if you give to the poor, God will bless you more and when that happened you always remember the time you gave to the poor.</p><p>Do not ever forget people who stood beside you, even without them you will still become who you are or even better or maybe lesser. But people who committed their time and energy to ensure you reach your full potential are the real deal, you need to also invest in them whatever you can.</p><p><br>Always remember to connect the dots, every decision, step, time, energy counts.</p><p>Cheers!!</p>', 'uploads/15559482541014052images__59_.jpeg', 'jy95Ae4d739i4o02', '15:50:57', '2019-04-22', '155594825710r0a0le0cti', 1, 'thumb/15559482544978085images__59_.jpeg', 1, 335, NULL),
(207, 'Good Old days', 'Aderonke Adetona', 'show', '<p>Can we go back to the days?</p><p>Days When smiling for us &nbsp;come from within</p><p>When dancing in the rain naked was no sin</p><p>Days when all we ever wanted was food and a playmate</p><p>Days when our only worries were dresses that didn\'t fit barbie and goals we fail to score</p><p>Days when mama cradles us to sleep and mama\'s bed night song was a sleeping therapy</p><p>Days when daddys attention is all we needed</p><p>Days when the rise of a sunset amazes us</p><p>Days when a family dinner was something to look forward to</p><p>Days when we truly wished each other happiness without jealousy</p><p>Days when we were still our brother\'s keeper</p><p>Days when our dreams were still real</p>', 'uploads/15560370591741775IMG_20190423_172111_644.JPG', '1546847130dk032o2aen3r22e559', '16:31:02', '2019-04-23', '15560370620e1rlac000it', 1, 'thumb/15560370591254503IMG_20190423_172111_644.JPG', 0, 300, NULL),
