(209, 'Shades of Failure', 'Aderonke Adetona', 'show', '<p>Get in here girl!</p><p>That was my friend\'s first opening speech when she called me. What now? I murmured. I drag my feet to the lecture theatre, Kicking each stone as I pass them. I don\'t like Afternoon Lectures. What would it cost them to Reschedule this class? The stupid department, I was ranting to myself. The place was so noisy; there were about 200 students in the class. Some were gisting and shouting while Others had a sober look on them. &nbsp;Immediately I sat down; the lecturer came in. He started introducing a topic to us. I wasn\'t listening. Why did you call me in that manner I faced my friend, it\'s not like the course is that serious to start with, I whisper yelled. Our result is out! That grabbed my attention. I thought It was going to take months for that to happen since that has been the usual practice of the school. Which of them?</p><p>Chm and bio. She replied.</p><p>Have you checked? How was it? I bombarded her with a lot of Questions. I would tell you after class; she wasn\'t about to allow me to distract her from listening to the lecturer now. I hate suspense! You know I hate it!. Why won\'t you tell me now? Its not like I carried it or something? I looked from her to the lecturer; the man was trying to say something I didn\'t hear. Something about us reducing the noise or he leaves. I didn\'t care. She didn\'t reply to me until I heard a faint Yes. I wanted to tell her to stop joking until I saw the look on her face. Damn, she was serious. Wow, I said. I didn\'t know what to say; Another friend answered Wow? To a 3 unit course? It\'s that what you are supposed to say! Am I supposed to be crying? Is that how am suppose to feel? I replied. At that point, I don\'t even know how to react.</p><p>Wish you could hear a thousand thoughts going on in my head. I pretended nothing happened and started paying attention to the lecturer once again, but my train of thought was somewhere else This is all a sick joke They are kidding. You all should laugh and tell me it\'s a prank and tell me to relax and stop being too serious. &nbsp;I swear I Read for that course. Heaven knows I did. At the end of the lecture. I need to take a look myself, I told them. Catch Ya later. I left them to see for myself. It\'s a mistake, how am I going to do this, there is nowhere to add it if I need to retake the course, God. Why now?. It\'s at the back of the HOD\'s door if it\'s your result you all are looking for.</p><p>Matric no 01 let me check, please...Its an F. It all dawned on me. They werent kidding. Holy cow! I did carry the course. What now? What next? I was thinking out loud; I can\'t sit for this course in finals. What if I didn\'t pass it again? Would that mean I would spill? No way! Heavens Forbid. Not on my mummy\'s not enough salary. I was battling with it in my head watching people who were rolling on the floor, crying. At that point I was feeling numb, I didn\'t know whether to cry or laugh. Or maybe I should do both.</p><p>I can\'t even bring myself to do any. I am emotionless as fuck. Permit me to use the word, but thats how I feel in reality. It\'s okay I tell myself, You are a strong woman I affirmed, but my thoughts weren\'t agreeing. That course is hard, Dont go for it. Dont say I didn\'t warn you those words keep ringing in my head. They were everything that was said to me before coming to school. Who am I going to tell now? They won\'t listen. They are all going to say to me I told you so. I left the place for my hostel. The only place I can get comfortable in my bed. I would sleep and move on. It won\'t matter if I don\'t think about it at least that\'s what I told myself, but it wasn\'t as easy as I thought. It was until I got to my hostel to write about my day every emotion come flooding. I was crying. I did. I needed it for my sanity. I wiped my tears away until there isn\'t a single drop left. Its not the end of the world girl! Nothing is! And nothing deserves your tears now. Show the world what you got! That was my new mantra. I resolved that very moment, no matter how bad my situation gets. Nothing ever deserves my tears. I remember those words in motivation speech. If you didn\'t fail at any point in your life, you have not grown as a person; you have just been adding numbers to your years. Fail forward! When life throws you a curve ball ask if that\'s the only thing it got? The reason I felt that way that day wasn\'t because carryover was a life sentence; it was because society has brainwashed our thinking to accept failure as a death sentence. Get an excellent grade that\'s the only way you can have a better life than your parents, that\'s the only way you can be a good daughter. In a bid to be somebody, we took failure as a No No., Nobody is ready to fail. Nobody wants to, but the bitter truth is. If we don\'t fail at some point in life, we would never have the experience of how to do better, how to move on in bad situations. I am not saying it\'s ok to fail courses just because we all have to fail at some point. The point I am trying to drive home is how to accept failure. A lot of people are committing suicides because of different things. It\'s a controversial topic I know, and I would not want to dive into it too. The reality is, 50% of reasons why people are committing suicide or slipping into depression nowadays is because they haven\'t accepted failure as part of life and Until we are ready to take that fact Failure would be Something we all dread</p>', 'uploads/15578644354226099IMG_20190514_WA0012.jpg', '1546847130dk032o2aen3r22e559', '20:07:17', '2019-05-14', '1557864437lri0t00e10ac', 1, 'thumb/15578644351107656IMG_20190514_WA0012.jpg', 0, 276, NULL),
(210, 'WHEN WILL MY GRIEF TURN TOMORROW (The video)', 'Emmiasky Ojex', 'hide', '<p>Here is the video for the poem WHEN WILL MY GRIEF TURN TOMORROW</p><p>&lt;iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/alQIjV2oajk\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen&gt;&lt;/iframe&gt;</p>', 'uploads/15580835785010678grief.jpg', '36au8m1elEn53m8538', '08:59:39', '2019-05-17', '1558083579100lr0ecait0', 1, 'thumb/1558083578733495grief.jpg', 0, NULL, NULL),
(211, 'Jazz Night', 'Erochukwu Shedrach Ugwu', 'hide', '<p>(somewhere in time)</p><p>In the luxury of flocculent tones,<br>Lake of fine faces drowning<br>In light-eyed city.<br>Undulating syncopation,</p><p>Falling blues, gratifying this concouse.<br>Sir and ma\'am, with pointed nose.<br>Oga and madam, with charcoal face.<br>Alas, another birth of a brawny bond betwixt the</p><p>Keys of a broken keyboard.<br>&nbsp;</p>', 'uploads/1558306928696348ALONE_1622890274481123_1111052303684599808_n__1_.jpg', '15582991866hcs8due3uahkwc76iehecar21t10ro1rl', '23:02:10', '2019-05-19', '1558306930leri0000at1c', 1, 'thumb/15583069287926541ALONE_1622890274481123_1111052303684599808_n__1_.jpg', 1, 117, NULL),
(212, 'Suicide note [Don\'t die,Live]', 'Ariyo Ahmad', 'show', '<p>&nbsp;</p><p>Listen and read through my encephalon the definition of depression and choose maybe suicide &nbsp;is an option.</p><p><br>What is depression ?</p><p>Depression! Depression!! Depression!!!</p><p>That stupid stinking foe that runs helter skelter in the succulent vein of human.<br>Which slow down the rate of the heartbeat from the flow of blood to the brain and control the organ of thought from seeing the goods in stock for future.</p><p><br>That which pumps sadness as the red blood cell and also regurgitate past mistakes as white blood corpuscles to clothe the skin by adding to the cut spot of sadness.</p><p>That which control the five senses of organs of &nbsp;man and jail him against performing its daily functions.</p><p><br>I\'m not bias in what my encephalon gathers together to portray its reality.<br>it makes the eye see a beautiful picture portraying death and makes the iris to draw close the beauty of death and makes the eye lashes blink to it\'s wondrous dangerous gift.</p><p>It make the nose smell the delicious delicacy deep down in the second world and makes the mouth to be fed with smell of suicide.</p><p>It makes the ears listen sonorously to the sound that is beautifully &nbsp;blown by the trumpet of death and awaken the spirit to be ready to dance to the lyrics of depression by committing suicide.</p><p>It makes the skin to stop releasing the toxic in the body and disallow fragrance flowing freely in the atmosphere to sink deep into the belly of the skin.</p><p>It makes ones tongue &nbsp;taste the sweet aroma of the melody of death.</p><p>To walk on the land seems matching on depression and it tend to lead to suicide.<br>Inhaling and exhaling the air planted in the atmosphere is taking drip of depression, the rain that pour down showers one the water of depression, the sun is the mother of depression, it nurses drainage of blood and sucking of bone making it perforated.</p><p>Depression turns friend to a scary ghost that eye can not see, his words becomes &nbsp;electrocuted and charges ones brain to committing suicide.</p><p>Depression ravels the word of God into a &nbsp;dying pills, if one takes it, it makes one get close to slip of suicide.<br>Stop calling to death with the stick of suicide, rather burn the &nbsp; stick and cast it into oblivion.<br>I am not telling you suicide is not option but remember suicide is not a friend one can enter business with, you will loose in this world and loose in the hereafter.</p><p>&nbsp;</p><p><br>By : Ariyo Ahmad</p>', 'uploads/15583458512378606IMG_20190519_WA0022.jpg', '1558268234eci26a5l52i2yo1ra7t0r2', '09:50:53', '2019-05-20', '1558345853e0i1rc0al00t', 1, 'thumb/15583458512293263IMG_20190519_WA0022.jpg', 1, 334, NULL),
(213, 'And At The Fullness Of Time.', 'Omotayo Mayowa', 'show', '<p>And At The Fullness Of Time....</p><p>You ain\'t married yet, your mates are making babies, relax; till the Fullness of Time.</p><p>Your mates are in school, studying, you\'re still sitting in daddy\'s parlor all day; wait, let the Fullness of Time reach.</p><p>You are still in the labour market, friends are working already; it\'s yet the Fullness of Time.</p><p>You\'ll be thirty tomorrow, yet no suitor seem to be approaching; untill it is the Fullness of Time.</p><p>It\'s your seventh wedding anniversary, issues are yet to come; unless when it is the Fullness of Time.</p><p>Everything seems to be stagnant; it isn\'t the Fullness of Time yet.<br>.&nbsp;<br>When everything suddenly becomes tedious; it\'s about to be the Fullness of Time.</p><p>When opportunities longed for becomes adversities; the Fullness of Time will be soon.<br>.&nbsp;<br>When would it be? The Fullness Of Time, when shall it be?&nbsp;<br>.&nbsp;<br>Its nigh, nearer than expected, it will soon arrive, the new dawn gonna be here soon.&nbsp;<br>.&nbsp;<br>Just know that if it isn\'t the Fullness of Time, (the time assigned for it to happen), nothing is gonna show forth.&nbsp;<br>.&nbsp;<br>Relax, &nbsp;strife further, don\'t look back, just keep the focus and follow the map. Don\'t try taking another route not in the map. Be steady in your path to success. You will see The New Dawn, the Fullness of Time lying ahead of you. Then all hope is restored, appointments longed for, working out, and the success longed for achieved.&nbsp;<br>.&nbsp;<br>That\'s The Fullness Of Time.</p><p>&nbsp;</p>', 'uploads/1558376413880113d3d8b574_a52e_40d0_9983_cad106ef899b_1.745d8e1c2faaee25f70cf4ba47603d59.jpeg.jpg', '1558358063i1orm5t755oel5a8a76yoc7t', '18:20:15', '2019-05-20', '15583764150a10ecrt0li0', 1, 'thumb/15583764136275790d3d8b574_a52e_40d0_9983_cad106ef899b_1.745d8e1c2faaee25f70cf4ba47603d59.jpeg.jpg', 1, 322, NULL),
(214, 'Berger To Ajah (Episode One)', 'Abdulhafeez Onitilo', 'show', '<p><strong>Bimbo</strong> is a 25 years old single girl who scouts with her friend <strong>Felicia</strong> in Berger. She has been in the labour market hunting for jobs but so no luck and she has also been on social media searching for love but no luck too.<br><br>She is an introvert, if she is not going out for a job interview or probably forced by Felicia to step out, she enjoys staying at home pressing her phone. Her IPhone 7 is her life, she doesnt put it down at all even when she is going into the toilet, this makes she and Felicia go at each other at times, with the phone in the toilet, she can spend an hour in there.&nbsp;<br><br>She is not the quick tempered girl but when she gets upset, its like you are unleashing a monster, she gets very mad, screaming at the top of her voice just to drive home a point and she doesnt forgive easily. When she gets very comfortable with you, she is someone you will get to enjoy her company and she is generous.&nbsp;<br><br>With the correct make up, Bimbo isn\'t that bad but on a natural face she is just another 3/10 girl but her body structure is that of an hour glass, in fact its more than that, she is fully loaded both front and back, like<strong> Dbanj</strong> will say, she is endowed, so that compliment her not-too-pretty face.&nbsp;&nbsp;<br><br>It was her hips that got Felicia\'s attention, Felicia is one blunt girl, she says it as she sees it and the first time she saw Bimbo in her NYSC CDS, she didnt waste time walking up to her saying <i>hey whats up, this your hips ehn, na die there ooo, wish mine was like that</i>. Bimbo felt uncomfortable that she wanted to enter her skin, of course a lot of guys have always admired her physique and some even go as far has given her nasty comment like; <i>the juice for this your boobee go sweet gan, shey you go allow me ride this your hips way be like horse own</i> but because it was all from guys she will just ignore them but hearing a girl complimenting her the way Felicia did, she just felt very uncomfortable.&nbsp;<br><br>Felicia could see it in her eyes which prompted her to laugh making the whole situation more embarrassing for Bimbo, who just walked away but not too far as Felicia caught up with her and said <i>didnt mean to laugh at you but seeing how shy my compliment made you look, I couldnt help, you too set make you dey&nbsp; shy, if na me be you ehn, all the guys for this CDS for don die</i> a bit of smile appeared on her face as Felicia was saying this. <i>by the way my name is Felicia and dont mind me I like to talk</i>. and that was how their friendship started. After services she followed Felicia to Lagos.&nbsp;</p>', 'uploads/15585864966409772Berger.jpg', '1544793563df6a5lb09e3a74ze6hu5', '04:41:38', '2019-05-23', '155858649800iar0te1l0c', 1, 'thumb/15585864965658790Berger.jpg', 0, 208, NULL),
(215, 'Berger To Ajah (Episode Two)', 'Abdulhafeez Onitilo', 'show', '<p><strong>Uche</strong> is a 33years old self employed single guy, he is a Digital Strategist &nbsp;and deals with cryptocurrency hence he spent most of his time on his laptop which is his office, aside from this, Uche is also a social media freak especially twitter though you can blame that on the nature of his work.&nbsp;</p><p>When he is not working, he is seeing a movie on his laptop, he doesnt have a television but he has a home theater sound system, his room is conducive enough for a single guy as the only thing missing is the television which he use to have before but had to sell because of the last girl he dated.&nbsp;</p><p>Uche once had a 9-5 job which had a really good pay, as a matter of fact half of what he owns now was bought using the salary he got then. During his NYSC days, Uche served with one of the biggest media firm, where he worked as the personal assistant to the boss, after his service, he was able to make the position permanent due to the good relationship he had with his boss. His major job then was handling the social media handles of the boss and at times he also attends to his mail, of course he does other jobs for the boss like running errands in and outside the office but handling social media was his major task.&nbsp;</p><p>Uche was never the social media kind of guy aside from Facebook, he wasnt really into any other social media as a matter of fact he didnt open Twitter and Instagram till after his NYSC and that was even because he boss forced him to but fast-forward two years after that Uche wasnt just in love with social media, he became a Twitter addict, always on twitter, retweeting and liking tweets became his thing. And when he started putting out his own tweet and it was getting a lot of attention, he just fell in love with the app totally.</p><p>Aside work Uche has a social life too, he has two best friends, one he met on Twitter, <strong>Tunde, </strong>and his best friend from university days who recently moved to Lagos, <strong>Benson</strong>. Tunde is the one who actually taught Uche how to be a Digital Strategist, that was one thing that sealed their friendship finally though it has to be said that&nbsp;<i>na woman parol</i> first bring them together. Benson on the other hand, works 9-5 with a financial firm which doesnt give him that much free time compared to Uche and Tunde, he only links up with them mostly during the weekends compare to Uche and Tunde, who link up anytime they feel like, it\'s just to tweet at each other.</p>', 'uploads/15585866773642673Berger.jpg', '1544793563df6a5lb09e3a74ze6hu5', '04:44:39', '2019-05-23', '15585866790c00atei01lr', 1, 'thumb/15585866775598269Berger.jpg', 0, 152, NULL),
(216, 'Berger To Ajah (Episode Three)', 'Abdulhafeez Onitilo', 'show', '<p><strong>Bimbo</strong> is lying down on the couch watching TV when <strong>Felicia</strong> walks in, they greeted each other before Felicia left for the room. Few minutes later she walks back into the sitting room with a bowl of Garri and as she takes her seat, it dawn on her that Bimbo is watching TV without pressing her phone. So she went ahead to tease her by picking up Bimbos phone from the table</p><p><strong>Felicia:</strong> Whats wrong with your phone?&nbsp;</p><p>Bimbo turns her attention to the table to check the phone then nice Felicia is holding it</p><p><strong>Bimbo</strong>: Nothing ooo, my sub has finish jare</p><p><strong>Felicia</strong>: No wonder, see as you humble in front of TV</p><p><strong>Bimbo</strong>: Na you sabi</p><p>They both laughed as Bimbo focused on the program she is watching. Few minutes later Felicia was going through her own phone and she kept laughing out loud. Bimbo was forced to ask what was making her laugh. She passed the phone to her, she saw the content and couldnt help but to laugh.</p><p><strong>Bimbo</strong>: People on this app are not serious at all</p><p><strong>Felicia</strong>: Im telling you, see as they turn simple question to nonsense</p><p><strong>Bimbo:</strong> Im glad I dont really understand the app self, <i>me way dey like to ask mumu question, dey will have finish my life</i></p><p>Felicia laughs at her as she has this surprise look on her face</p><p><strong>Bimbo:</strong> What?</p><p><strong>Felicia:</strong> Did you just say you dont understand Twitter?</p><p><strong>Bimbo</strong>: I mean I can tweet and retweet but this trend thing <i>way dem dey do na him I no understand at all&nbsp;</i></p><p><strong>Felicia</strong>: Well to be fair enough, not everything you post will trend, <i>some handle dey, na dem dey make gist trend, like this one now, just dm your gist and dem go post am anonymously</i></p><p><strong>Bimbo:</strong> Then how do you now follow the trend, <i>you know say twitter feed dey plenty</i></p><p><strong>Felicia</strong>: Just follow the hastag.</p><p><strong>Bimbo</strong>: What if I tell you I never knew what that hastag was for?</p><p>Felicia laughs at her again&nbsp;</p><p><strong>Felicia</strong>: How can you say you dont..wait first, <i>wetin you dey use your data do when you dey online?</i></p><p><strong>Bimbo</strong>: <i>Ode, na only twitter be the app wey dey abi,</i> for your information, I enjoy Facebook</p><p><strong>Felicia:</strong> No wonder</p><p><strong>Bimbo</strong>: <i>Abeg let me hear word, like you are not on Facebook, abi no be there you dey post all your slay queen pictures?</i></p><p><strong>Felicia</strong>: See yourself, all those pictures are from my Instagram, my Instagram is connected to my Facebook, so I dont need to login to Facebook before I post</p><p>Nepa interrupts the power, Bimbo picks her phone and said <i>who I fit call to do sub for me?</i>. As she was leaving the sitting room,&nbsp;Felicia laughs at her saying&nbsp; <i>call those your Facebook messenger boys na</i></p>', 'uploads/15585870546620143Berger.jpg', '1544793563df6a5lb09e3a74ze6hu5', '04:50:55', '2019-05-23', '1558587055ca0it0010lre', 1, 'thumb/15585870541034278Berger.jpg', 0, 157, NULL),
(217, 'HE CAME, HE SAW BUT WAS CONQUERED.', 'Ariyo Ahmad', 'show', '<p>The day he eavesdropped &nbsp;into my privy.<br>Was the day he salutes the squirrel.<br>I knelt &nbsp;down with cries to his kingdom,<br>And begged him with all my wisdom.</p><p><br>But I think he is determined to swim my ocean.<br>It was in the dark deem part of the night.<br>I had no option but to pave way for his permission.<br>He fell into my ocean without fright.</p><p><br>I could smell the thick odour of beer from his mouth.<br>Why not on his face lies smiles of &nbsp;no mercy<br>I stealthily gaze to the glass from the rear,<br>And stood to begging and pray to be lucky.</p><p><br>Then he roared like an hungry hyena.(shuuut up!)<br>Ready to paunch on me like his prey.<br>At this hour I remembered how I was taught to pray.<br>I kept mute and close my eyes to my brain.</p><p><br>He try to off his skin to show me his vein.<br>And pushed me to his death bed.<br>He forced my my my cloth and tore it plain.<br>I &nbsp;started shivering and wish I was dead.</p><p>I looked into my past of holding this gift.<br>But deep down in him, he is ready to drink me to stupor.<br>I shouted on the top of my voice if I could see an helper.<br>But no one seems to hear the cry of an helpless girl.<br>He slapped my face and hold my breathe.</p><p><br>He forced himself into me so deep.<br>He paint me with his blue and black rod.<br>My ties became wet with bloody erosion.<br>I felt broken into pieces of air, I can\'t hold myself.</p><p>He made my pot of soup splash on the surface of my thigh.&nbsp;<br>And also broke down the pot into pieces.<br>He enjoyed me for evil pleasure.<br>And cast in my brain a heavy tremor.</p><p>&nbsp;</p><p>It down sadness in my eyes, and I rush to the glass.<br>And smashed it on his head with courage.<br>I used the broken part to peel his rod to the vein, and sent him to heaven.<br>It was a painful remembrance, he hew deep in my brain.<br>I cried profusely for my treasure is gone into ocean of &nbsp;no return</p><p>&nbsp;</p><p><br>@Gent_Soul<br>@Ariyo Ahmad<br>May 23, 2019.</p>', 'uploads/15586304748973293rape_scene_1024x683.jpg', '1558268234eci26a5l52i2yo1ra7t0r2', '16:54:36', '2019-05-23', '1558630476r1l00t0ieca0', 1, 'thumb/15586304746459430rape_scene_1024x683.jpg', 0, 250, NULL),
(218, 'The Sower and Son', 'Omotayo Mayowa', 'show', '<p>The Sower and Son&nbsp;<br>Dad, why do you have to throw away a lot of the millet seeds on the soil of the farm? , asked the son in their way home from the farm.&nbsp;<br>Uhmn, he sighed, nice question he continued , that is because, you have to let go of some seeds in to the soil to produce another larger amount of the millet grains, the ones you let go are those that will multiply into larger amount of grains.  he explained. &nbsp;<br>.&nbsp;<br>In life, you have to let go of some stuffs if you really want to gain more. Your hands have to be open for some to go, on the process, a lot come into the hands. Closing your hands and not letting anything go out is as same as not letting anything come in. &nbsp;<br>When you are not ready to let go, do not expect anything to come in. &nbsp;<br><br>&nbsp;</p>', 'uploads/15587894299230956Parable_of_Sower.jpg', '1558358063i1orm5t755oel5a8a76yoc7t', '13:03:51', '2019-05-25', '155878943101000clertia', 1, 'thumb/15587894298251667Parable_of_Sower.jpg', 1, 162, NULL),
(219, 'I Found A Solace', 'Lewis Wamwanda', 'show', '<p><br>I remember days ago, those doomed days<br>When depression was a reflection of my soul<br>And my eyes were painted black<br>And my face of winkled skin<br>And I sit down and smile,</p><p>I found solace somewhere<br>And I\'m not selfish either, not at all<br>To share this mutual understanding<br>And the discovery of self happiness<br>That won\'t begotten anywhere<br>But from the solace within</p><p>My happiness comes from self acceptance<br>Of no denial of the bitter black past<br>But the embracement of my old self<br>And learning from the bitter thorns<br>Of life, of love, of pain, of torture<br>And re-writing of the better me</p><p>I found a solace within me<br>And accepted that at times I\'m wrong<br>Not worth it at all, and pain will be part of me<br>I found my solace<br>To dust off the dust in my eyes<br>And sweep the webs of fear and sorrow</p><p>The secret of happiness<br>Told by my inner self, my solace<br>To accept my mistakes, my pains<br>To forgive, to move on, and love<br>\"Depression is an illness\", He said<br>\"And you are the only doctor,<br>Choose Between happiness and sorrow\"</p><p>Lewis Wamwanda</p>', 'uploads/15591986879181964Screenshot_20190530_094130.png', '15512039962781e52s5wil319', '06:44:49', '2019-05-30', '155919868900etiacr001l', 1, 'thumb/15591986878144151Screenshot_20190530_094130.png', 0, 147, NULL),
(220, 'There\'s a \'Way\' In \'No Way\'', 'Omotayo Mayowa', 'show', '<p>There is a \' Way\' In \'No Way\'!<br>.<br>There\'s always a way where there seems to be no way... Its just that you\'ve not discovered the way.<br>If you did not discover the \'way\' in \'no way\', it gonna seem there\'s no way.<br>.<br>No way is gonna appear on its own, you\'ve gat to crave the way out, out of the desserts, out of the thick bushes, out of the red sea.<br>.<br>See, roads don\'t appear just like that, constant treading on a path makes the way.<br>.<br>The splashed waters doesn\'t wait for way to appear, it make a path, nd the waters flow along.<br>.<br>There\'s surely a way where the sign-post reads \'No Way\', don\'t go back, stick to it, it might be temporarily not available.<br>.<br>The fact there is \'no way\', doesn\'t mean there is \'no way\', there are many routes that leads to the market square.<br>.<br>When life closes it\'s door at you, don\'t go away, find the key to the door.<br>.<br>There\'s always a Way.<br>.&nbsp;<br>N.O means Next Option.&nbsp;<br>.<br> KING_MARVEY</p>', 'uploads/15592288805670521D648_1_400_0004_600.jpg', '1558358063i1orm5t755oel5a8a76yoc7t', '15:08:03', '2019-05-30', '1559228883c0at00r0ile1', 1, 'thumb/15592288809634098D648_1_400_0004_600.jpg', 1, 166, NULL),
(221, '#savethesociety DEPRESSION; the Silent killer ', 'Oluwaseun Ejire', 'show', '<p>&nbsp;</p><p>Depression I know is to be UNHAPPY for a little while;&nbsp;<br>Depression I know is to be ANXIOUS for a little while;&nbsp;<br>Depression I know is a MEDICAL CONDITION that prevents one from living a NORMAL life;&nbsp;<br>A MENTAL DISORDER that prevents one from responding to life;&nbsp;<br>Been MOODY _ SAD _ CONFUSED _ not knowing what to do is what I know depression to be;&nbsp;<br>So painful DEPRESSION I see today is SUICIDE and SUICIDE alone; &nbsp;<br>WHY see suicide as your only option???<br>WHY indulge yourself to a criminal act???<br>WHY put yourself _ family\\friends in agony???<br>WHY take your precious soul for been depressed???<br>SUICIDE doesn\'t end DEPRESSION, it only passes on to someone who loves you;&nbsp;<br>Remember LIFE is a GIFT _ you need a BREATHING SOUL to ENJOY it _ You need a BREATHING SOUL to EXPLORE it _ You need a BREATHING SOUL to TOUR it;&nbsp;<br>You don\'t know what depression is and you need help to TREAT or MANAGE it _ talk to SOMEONE, If there\'s none _ listen to MUSIC of ur choice, and if there isn\'t _ take a NAP, &nbsp;if it doesn\'t _ IMPOSSIBLE, surely one of it will ease the PAIN, BAD times don\'t last remember;<br>Be STILL;<br>HANG on;<br>Hold TIGHT, and remember&nbsp;<br>GOD LOVES YOU......... &nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ej_oluwaseun</p>', 'uploads/15595539554580513IMG_20190517_150928.jpg', '15409061695snaoeu694w89l7304u', '09:25:58', '2019-06-03', '1559553958ia0001l0trec', 1, 'thumb/15595539556526993IMG_20190517_150928.jpg', 0, 131, NULL),
(222, 'Hello', 'Lnk Lnk', 'hide', 'Write your article herebanjell', 'uploads/1559655684206545tmp_cam_575997645902069774.jpg', '155965487651lk1lnec619r624t7ai', '13:41:26', '2019-06-04', '155965568600alrt01i0ec', 1, 'thumb/15596556843090214tmp_cam_575997645902069774.jpg', 0, NULL, NULL),
(223, 'That virtue', 'Victor ASIKA', 'hide', '<p><br>By Victor. A</p><p>A virtue that bring bliss<br>an inevitable peace,<br>to all who embrace its---<br>coolness like pro-active<br>Mannish</p><p>A virtue which is needed<br>to achieve that wishful height<br>At first it\'s hard to uphold,<br>but once emerged with---<br>your soul, just as the spirit<br>Never will it depart.</p><p>All needs this virtue called humility<br>A wonderful and blissful quality<br>all need, never to fumble<br>For that, we need to be humble<br>So that all wishful,<br>can be honorable</p><p>Humility is a quality<br>never is it a quantity.<br>We are born in egocentric world<br>Where all mouth claims to be humble<br>but wish not to be humble<br>still, never want to fumble</p><p>All never want to fumble<br>So all need to be humble&nbsp;<br>For that called humility,<br>pays with no penalty&nbsp;<br>And it comes with plenty of prosperity</p><p>For one not to embrace humiliation<br>One needs to join the administration,<br>called Humility</p><p>#Vicas<br>#all_right_reserved</p>', 'uploads/15599239601821818BeautyPlus_20190607163947_save.jpg', '1558307185556i83ot9l2vcertci327ar', '15:25:59', '2019-06-07', '15599211590i10rac0et0l', 1, 'uploads/15599239602941268BeautyPlus_20190607163947_save.jpg', 0, NULL, NULL),
(224, 'THAT VIRTUE', 'Victor ASIKA', 'show', '<p>By Victor. A</p><p>A virtue that bring bliss<br>an inevitable peace,<br>to all who embrace its---<br>coolness like pro-active<br>Mannish</p><p>A virtue which is needed<br>to achieve that wishful height<br>At first it\'s hard to uphold,<br>but once emerged with---<br>your soul, just as the spirit<br>Never will it depart.</p><p>All needs this virtue called humility<br>A wonderful and blissful quality<br>all need, never to fumble<br>For that, we need to be humble<br>So that all wishful,<br>can be honorable</p><p>Humility is a quality<br>never is it a quantity.<br>We are born in egocentric world<br>Where all mouth claims to be humble<br>but wish not to be humble<br>still, never want to fumble</p><p>All never want to fumble<br>So all need to be humble&nbsp;<br>For that called humility,<br>pays with no penalty&nbsp;<br>And it comes with plenty of prosperity</p><p>For one not to embrace humiliation<br>One needs to join the administration,<br>called Humility</p><p>&nbsp;</p><p>Vicas</p>', 'uploads/15599222965624683BeautyPlus_20190607163947_save.jpg', '1558307185556i83ot9l2vcertci327ar', '15:44:58', '2019-06-07', '1559922298r1cia0te00l0', 1, 'thumb/15599222967434754BeautyPlus_20190607163947_save.jpg', 1, 83, NULL),
(225, 'Evil tongue', 'Ntokozo Mokoena', 'show', '\"Negative talks negative results\",\r\nI heard a preacher, on the radio, say it loudly\r\nA question of motive, I don\'t say it proudly\r\nWasn\'t this message meant for adults?\r\nShivering and shaking I stood still\r\nAn evil tongue I ought to kill\r\nThis mission involves me and you\r\nRead this with care and love under the tree,\r\nMake your heart pure with evening dew\r\nFor if you wish evil it may come back as three', 'uploads/15600596924766154TextOnPhoto_280.png', '155922950454lro6n9528oociak58ztte7', '05:54:55', '2019-06-09', '15600596951t000e0rcail', 1, 'thumb/15600596928981136TextOnPhoto_280.png', 1, 130, NULL),
(226, 'Is it me', 'Ntokozo Mokoena', 'show', 'Is it me who\'s wrong,\r\nOr is this daze far too long?\r\nDo I have a wild imagination, is it really true?\r\nI recall not such a thing, your face smeared with glue,\r\nOn the wall, your portrait upright,\r\nThe sun out upon you with golden light.\r\nIs it me, is it me blame,\r\nOr this ruthless game.\r\nLay tight in peace,\r\nYour memories will not cease,\r\nLike you did when you left me,\r\nBut whom am I, maybe it was meant to be.', 'uploads/15600618981140748TextOnPhoto_401.png', '155922950454lro6n9528oociak58ztte7', '06:31:40', '2019-06-09', '15600619000r01ce0lait0', 1, 'thumb/15600618982470629TextOnPhoto_401.png', 1, 69, NULL),
(227, 'IN MAY RACE', 'Victor ASIKA', 'show', '<p><br>IN MAY RACE<br>By Victor. A</p><p>Wonderful is the may,<br>for it made me know this female<br>So beautiful she is, lovely and awesome<br>The real version of forever young</p><p>A singer with angelic voice,<br>a voice that can raise the dead<br>Your tears can be wiped by her voice<br>A voice that can make your day</p><p>At the mention of her name,<br>there were stampede<br>Many in high speed,<br>just to see her face</p><p>Her beauty can make--<br>you loose your cool<br>Still, it can make<br>your tension to become cool</p><p>Her beauty can make one become a coffe drinker&nbsp;<br>For you will loose sleep thinking of her</p><p>Thanks to may race&nbsp;<br>For it showed me an Angel on earth<br>Thanks for soft words that brakes bone<br>For it is a pull from death</p><p>Her kind nature rise pleasure<br>For it\'s an antidote for blood pressure<br>She is beautiful beyond measure<br>For she is the best from mother nature</p><p>I\'m not a drunkard&nbsp;<br>but my foot can\'t stand<br>For she shines like a candle,<br>in dark mantle battle</p><p>Lovely, kind and simple<br>Brilliant, intelligent and smart<br>She is a good example----<br>of mean in moderate</p><p>Her beauty is so lucid<br>That even the blind can see it<br>And the dumb can testify it</p><p>That eyes of yours<br>that can quench a burning fire<br>That lips of hers<br>that can make one go gaga</p><p>Lucifer is jealous of your beauty<br>Your enemies are jealous of your beauty<br>Now God has made them guilty<br>of their duty, never to see your prosperity</p><p>Mother nature really endowed you with all<br>But robbed you of stature&nbsp;<br>Her printumness can make one look down on her ideal<br>Filled with sense of humor&nbsp;<br>What a sweet rob of stature<br>Which made her more beautiful<br>and young forever</p><p>Dear Miss Jen<br>Your beautiful with or without caution<br>For you are beautiful in all ramification&nbsp;</p><p>Vicas</p>', 'uploads/15601058595312670BeautyPlus_20190606122258_save.jpg', '1558307185556i83ot9l2vcertci327ar', '18:44:21', '2019-06-09', '1560105861lera00cti001', 1, 'thumb/15601058597098984BeautyPlus_20190606122258_save.jpg', 0, 92, NULL),
(228, 'I KNOW I KNOW ', 'Oluwaseun Ejire', 'show', '<p><br>I know to always do my BEST _ for whatever I plant now I will HARVEST later;&nbsp;<br>I know that my past can\'t DETERMINE who I AM, rather it IDENTIFIES who I WAS;&nbsp;<br>I know for every CHALLENGE that comes my way is an OPPORTUNITY for me to do something REMARKABLE;&nbsp;<br>I know that even if I CRY _ I will SMILE;&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;if i\'m SAD _ I will LAUGH;&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;even if I BREAK _ I will HEAL;&nbsp;<br>I know being NEGATIVE only makes a journey DIFFICULT _ I may be BROKEN but I don\'t have to SIT on it;&nbsp;<br>I know it gets HARDER before it gets EASIER, but it will get BETTER if I make it through the HARD stuff first;&nbsp;<br>I know to keep PUSHING forward with my eyes on CHRIST _ for my FAITH rest not in what I am but in what CHRIST is;&nbsp;<br>For all of this that I know;&nbsp;<br>For the little that I know;&nbsp;<br>I will never FORGET ....&nbsp;<br><br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ej_oluwaseun</p>', 'uploads/1560166141712420IMG_20190413_212402.jpg', '15409061695snaoeu694w89l7304u', '11:29:03', '2019-06-10', '15601661430l00t0rcia1e', 1, 'thumb/15601661412307774IMG_20190413_212402.jpg', 0, 104, NULL),
(229, 'SAY SOMETHING', 'Dicksom Tindi', 'show', 'Say something, \r\nHold my hand, beat my chest or cry. \r\nPull my eyes out, drain me of ny blood but please dont let me leave. \r\nsay something. \r\nTell me am foolish for walking away, \r\nTell me Iam not good enough but its okay,  \r\nTell me we can make it work, day by day, \r\nJust say something. \r\nTell me you can\'t live without me, \r\nTell me am your knight and shining armor, \r\nTell me Iam your soul mate, \r\nTell me you are Rose and iam your Jack, \r\nThat iam your sidhart. \r\nSay something. \r\nI\'ve loved you too little I know it, \r\nGiven you less than you deserve, \r\nFreedom to associate with friends I did prohibit, \r\nI don\'t want to walk out of that door but If you dont stop me I  will. \r\nSay something. \r\nProve my pride wrong and my ego selfish, \r\nRender them hopeless and \r\nReplace them with love. \r\nSay something. \r\nClose the door and throw away the keys, \r\nAs you unpack my clothes and tear into shreds my suitcase. \r\nWipe my tears and tell me how much you love me. \r\nAm giving up on you, won\'t you Atleast  say something?? \r\n#CHHOTE_THEE_POET', 'uploads/15602006991402492IMG_20190402_WA0007.jpg', '15601997426k731dic7s7r7t8meo1iacl1', '21:05:00', '2019-06-10', '156020070000lir0act01e', 1, 'thumb/15602006995579241IMG_20190402_WA0007.jpg', 1, 82, NULL),
(232, 'I Know', 'Enos Klay', 'show', '<p>I KNOW:<br>By: Enos Klay.</p><p>I know its hard, I know its mad.<br>I know its mean, I know it\'s meaningless<br>I Know its pain, I know its painful<br>I know its end, I know its ending<br>I know its a cloud, I know its silver lining<br>I know its hopeless, I know its hopeful<br>I know its Goliath, I know its David<br>I know, you know, its blood purchased.</p>', 'uploads/1560315239332005IMG_20171028_WA0021.jpg', '1560314189i05olesar4t79cn48240e', '04:54:00', '2019-06-12', '156031524000e0ac01tlir', 1, 'thumb/15603152395074285IMG_20171028_WA0021.jpg', 1, 106, NULL),
(233, 'LOST', 'Enos Klay', 'show', '<p>I took off knowing and &nbsp;sure of my final destination</p><p>The road seemed clear and straight</p><p>Motivational speakers said it was easy.</p><p>Courage I gathered, vision was clear.</p><p>Now I\'m lost, I\'m in oblivion.</p><p>I can\'t seem to find my way forward or backwards.</p><p>Lost lost lost, I am lost.</p><p>Around me is chaos, lost soul, I am lost.</p><p>Come find me someone please, I am lost.</p><p>I am in the wilderness, all I hear are echoes from my troubled life.</p><p>Memories from long ago echo on, did I take the wrong turn.</p><p>Lost I am lost, which way do I take from here. I am lost.</p>', 'uploads/15604264622120949download.jpg', '1560314189i05olesar4t79cn48240e', '11:47:43', '2019-06-13', '15604264630latrc100ie0', 1, 'thumb/15604264625972676download.jpg', 1, 127, NULL),
(234, 'Berger To Ajah (Episode Four)', 'Abdulhafeez Onitilo', 'show', '<p><strong>Bimbo</strong> is now a pro when it comes to using Twitter, aside from tweeting, theres nothing she doesnt do on the app.. The first thing <strong>Felicia</strong>&nbsp;taught her about Twitter is that your profile has to be lit, from your avatar, your bio and of course your followers.</p><p>And the first thing she did was to go snap some studio pictures, selecting the sexiest using it as her avatar, like Felicia said, a handle with sexy avatar attracts more followers, Yes! You guess right, her avatar display some of her goodies. Next thing she did was to change her handle, she went from @bimbo2015 to @that_bimbochick and <i>the one way shock Felicia herself</i> was what she wrote as her bio. Felicia couldnt understand how she went from <i>If you follow me I follow back, I promise</i> to <i>If I dont pop up on your TL, you dont have TL, #shootyourshot, #ifyoumissyoumiss</i>, when she was asked why she used the <i>#shootyourshot,</i> she said <i>no be through DM <strong>Banky</strong> marry <strong>Adesua?.</strong></i></p><p>In as much as she was aware of the <i>Yoruba Demons</i> on Twitter, she believed she could find a decent guy on twitter, <i>at least she dey see pictures, she dey read gist of people way meet for Twitter</i>&nbsp; &nbsp;and are living happily ever after, so who says she cant also have it. She wasnt being too forward on replying guys in her DM, if a guy sends her a DM she doesnt reply immediately, she\'ll check out the guys handle, then follow the guy\'s tweet and retweets, if she sees what she likes, she go reply, if not, you will be in that <i>too much DMs, might take long but I will reply all #shootyourshot, #ifyoumissyoumiss</i> zone that she tweets every day.<br>There was a day Felicia noticed her tweet and she used it to tease</p><p><strong>Felicia</strong>: Is it you that didnt even have up to 100 followers two month ago that is now saying too much DMs, when you become overnight celebrity</p><p><strong>Bimbo</strong>: Overnight celebrity ko, under morning star ni</p><p><strong>Felicia</strong>: Abi, even me that has more followers, I never get too much DMs</p><p><strong>Bimbo</strong>: <i>Bae all na scope</i>, <i>some guys dey way dey DM me</i> and I dont want to reply them, at the same time I dont want to be seen as being too proud or something, so I tweet that every day, giving them hope that one day I will reply them.</p><p><strong>Felicia</strong>: But dont you think that might backfire?</p><p><strong>Bimbo</strong>: How?</p><p><strong>Felicia</strong>: I mean, say am a guy now, if I see you tweet that every day, I might feel discourage to DM you at all</p><p><strong>Bimbo</strong>: Then that guy doesnt deserve to have me, I like guys who have courage and are bold</p><p>Actually she gets an average of 5 DMs a month and replies 3 and ignore 2 though as time went on,&nbsp;she just replies the guy she feels she might like the most amongst the 5 guys that will send her a DM. Her timeline got more actions, due to the fact that there is nothing she doesnt retweet, some people now mention her in some of their post because they know she will retweet it.</p>', 'uploads/15607185218957177Berger.jpg', '1544793563df6a5lb09e3a74ze6hu5', '20:55:54', '2019-06-16', '1560718554t1l0caei000r', 1, 'thumb/15607185214198063Berger.jpg', 0, 148, NULL),
(235, 'Berger To Ajah (Episode Six)', 'Abdulhafeez Onitilo', 'show', '<p>What came out of her bag sale wasnt what she was expecting, as promised, she was done with the bags within the two weeks time frame but the guy wasnt available for delivery till a week after.</p><p>After collecting the guys number they kept on talking on WhatsApp, at least she felt giving him update on the bag wont make him forget or change his mind about buying. Some days before she was going to deliver the bag, the guy chatted her up but this time their conversation had nothing to do with the bag, the guy was trying to shoot his shot with her. The delivery was supposed to take place on a weekday but the guy convince her to make it on a weekend so they can both get to see each other and talk more, this was after she first agreed to deliver the bags&nbsp; herself.</p><p>Bimbo was very skeptical about meeting the guy, so she told <strong>Felicia</strong> to follow her. They met up at a mall in Ikeja, they did some chitchat before she brought out the bag to show him, he collected the bag from her, asked for her account number and transferred her balance into her account. After the business transaction was done, they started to get familiar with one another, just talking about random stuff but the guy wasnt really feeling the vibes because Felicia was there. He kind of made this known when he first saw the girl and they were greeting each other, after Bimbo had said, .<i>and this is my friend Felicia</i>, he smiled a little as he replied <i>I see, you brought your friend along</i> but none of the girls read meaning into it, they didnt understand what he meant by that.</p><p>After thirty minutes of random talk and the guy still playing it cool that he was okay with Felicia being there with them, things begin to get weird. It all started when Felicia said ..<i>na wa ooo so you wont buy us something to drink</i>, he acted like a gentleman got up and got them something to drink though Bimbo kept on saying <i>dont mind her jare, we are okay</i>. After buying them something to eat and drink, he waited few more minutes after random talks had gone on, he then asked Felicia to excuse them, .<i>I will like to talk to Bimbo alone</i>, he said. Felicia left the table but took the snack and drink that the guy bought, she took both snacks and her own drink leaving Bimbos drink. As she was doing this, the guy was looking at her with so much disgust on his face, Bimbo could tell he wasnt too happy with the way Felicia had behave so she tried to apologies on her behalf but then things just got escalated from there.</p><p>The reply she got when she said <i>dont mind my friend jare, she can be naughty at times</i>, wasnt what she was expecting. The guy went on for about 3 minutes or there about complaining about how wrong what Felicia did was, he even blamed Bimbo at some point. He said <i>what sort of naughtiness is that?, thats not being naughty thats being disrespectful. See how she is disgracing herself in public, well I dont blame her, it\'s you that I blame, when you know this was going to be a date why did you bring your friend along?, how can you even be friends with such a person self</i>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', 'uploads/15607190003869871Berger.jpg', '1544793563df6a5lb09e3a74ze6hu5', '21:05:07', '2019-06-16', '1560719107010tli0a0rce', 1, 'thumb/15607190007452979Berger.jpg', 1, 126, NULL);
