(257, 'Distraction or Opportunity?', 'Akole Banji', 'show', '<p>When we hear the word \'distraction\', what comes to our mind can be one of <i>Unreasonable Engagements</i>, <i>Negative Activities</i>, <i>Unproductive things. </i>&nbsp;Have you for once thought about the fact that it could come to you as a thing that seem positive, such thing like an o<i>pportunity</i>.&nbsp;<br>It is not sufficient to plan, but to pursue through focus and persevere towards achieving a desirable result. Most times, we start some things and while we are at it, it looks like it won\'t work. Yes, everything has a phase and one has to be focus enough to pass the test of perseverance to make &nbsp;that thing which seems impossible come to light. But while we pursue our well drafted goals, more things that looks like an opportunity may surface. It is important at this state to be able to discern if this is a distraction or an opportunity.&nbsp;<br>Take for instance, a young man once attempted to pursue a life long dream, to learn a &nbsp;skill that would cost him time and money, but the after-mart would be profitable. But while he was at the stage of starting to train, a job offer came, that would require all his time. This Job offer might be a distraction to this young man, depending on the after-mart of the skill he was going to learn, but at that moment, the job came looking like an opportunity to make money. To be able to figure out which one it is in between Opportunity or Distraction, one have to consider certain things:</p><p>1. We all need to ask questions of long time and short term effects of everything that comes to us.&nbsp;<br>2. We all have to look at futuristic tendencies of everything that comes to us.&nbsp;</p><p>3. We all have to ask about why we want to do anything or why we have to take an opportunity.</p><p>4. We all have to ask about what an opportunity would cost us and how it affects everything we have running at the moment.</p><p>After these important checks, we should be able to decide if the offer is really an opportunity or a distraction.<br>It is therefore important to bear in mind that distraction doesn\'t always come as a negative thing,. They also sometimes come as an opportunity which has made many dream lost just because wrong things were pursued. Even as we do what we thing is best, let\'s always proceed on all things with caution.&nbsp;<br>IRE O (Have a good time);</p>', 'uploads/1562752763948244look_distraction.jpg', 'j90819542aBn72i', '09:59:25', '2019-07-10', '1562752765a0te10cirl00', 1, 'thumb/15627527632763840look_distraction.jpg', 1, 489, NULL),
(258, 'HUSTLE', 'Omotayo Mayowa', 'show', '<p>HUSTLE<br>.<br>The scorching sun peirce through my skin<br>Like to hustle is a sin&nbsp;<br>But contrary to hustle is a sin<br>But I\'ve gat to endure what my eyes have seen.</p><p>Walking with slipper in the hot soil<br>Is equivalent to walking on foot sole<br>But I have to push further<br>\'Cause I\'ve gat to be the topper.</p><p>Sweating underneath<br>But my feathers covereth<br>No retreat no surrender&nbsp;<br>I\'ve gat to reach the peak.</p><p>Through fire, I pass<br>But like the burning bush, i burnt not&nbsp;<br>\'Cause the feather of a hustler; covers<br>But I\'ve gat to hustle.</p><p>Like a gold passes through fire<br>So i pass through<br>And as a gold shines afterwards<br>So will I.</p><p>Someday, tears and sweat will disappear&nbsp;<br>And like a shinning gold, i will appear&nbsp;<br>And it\'ll be clearer&nbsp;<br>That indeed amma SUCCESSFUL HUSTLER.</p><p>Dedicated to all Hustlers around the globe.&nbsp;<br>Please, don\'t relent, the winning in nigh.&nbsp;<br>KING MARVEY&nbsp;<br>MAYOR DE WRITER, 2019</p>', 'uploads/1562756010444083023824979_1165585516906892_2640595779625943040_n.jpg', '1558358063i1orm5t755oel5a8a76yoc7t', '10:53:32', '2019-07-10', '15627560120li010aetr0c', 1, 'thumb/1562756010991811923824979_1165585516906892_2640595779625943040_n.jpg', 1, 423, NULL),
(259, 'Rebecca', 'Lewis Wamwanda', 'show', '<p>REBECCA<br>Rebecca, oh Rebecca, Rebecca<br>When you pass by my home,Rebecca<br>On your way to the river, Rebecca<br>Please try to whistle,Rebecca<br>Or sometimes call my name.</p><p>When you see me standing by the road<br>Do not shy away, Rebecca<br>My heart yearns to speak,speak to Rebecca<br>And even when the sun sets, Rebecca<br>I always stand by the road, watching you pass by</p><p>Rebecca, My eyes watch you sway hips<br>My mouth gapes, as you take each step<br>Mama, Rebecca, should I remind you<br>Rebecca, that it is love, not illusions?<br>I\'m growing older, and, Rebecca,&nbsp;<br>I want you as a wife, you Rebecca</p><p>Rebecca, I am not a coward, they say<br>I fought the War of the Whites,<br>Rebecca, as the song of the poets goes<br>With a spear on hand, Rebecca,&nbsp;<br>I, myself, chopped the white man\'s head<br>Of these tales, I am not bragging, Rebecca</p><p>Rebecca, when you pass by my home<br>Please knock and say hello<br>Rebecca, my hands are tired of fighting<br>My hands yearn to touch the soft skin<br>Rebecca, not anyone\'s, Your skin Rebecca</p><p>Rebecca, pass by home tomorrow<br>Colour my walls with your beauty<br>Light my hut with your smile, Rebecca<br>Come Rebecca, See, I am strong and handsome<br>Hardworking and brave<br>Rebecca, a suitable husband for a suitable wife</p><p>Rebecca, oh Rebecca, Rebecca<br>The moon of the village,&nbsp;<br>Rebecca, the one with stars in the eyes<br>Who will marry you Rebecca?<br>Tell me, if you don\'t stop by my home<br>And say hello, Rebecca, oh Rebecca.</p><p>Lewis Wamwanda</p>', 'uploads/15631704188273399Screenshot_20190714_165017.png', '15512039962781e52s5wil319', '06:00:20', '2019-07-15', '15631704200recli0at100', 1, 'thumb/15631704189215670Screenshot_20190714_165017.png', 0, 640, NULL),
(260, 'THE HATE YOU GIVE', 'Victor ASIKA', 'show', '<p>THE HATE YOU GIVE<br>By Victor. A</p><p>The hate you give,<br>is the division we have.<br>The love you give,<br>is the unity we embrace.</p><p>That your &nbsp;brother hates you,<br>for he thinks you hate him.<br>That your sister loves you,<br>for she thinks you do the same</p><p>The hate you give---</p><p>&nbsp;is the pain we have&nbsp;<br>And the pain you have,<br>is the hate we give.</p><p>Have you ever been across the sea?<br>Haven\'t you been across the ocean?<br>You most have seen how lovely and brotherly---<br>that your homily enemy is.</p><p>The Muslims hates thee son\'s of Isaac,<br>for they think thee son\'s of Isaac,<br>hate thou son\'s of Ishmael</p><p>The Christendom---<br>goes against the Ishmealite,<br>for they view thee as terrorist.<br>Why on earth do thou thinketh---<br>thee brother, a terrorist?</p><p>Across the border,<br>You showed me brotherly love.<br>Back home,<br>you become my fucking freaky enemy.<br>Our home, the love killer,<br>For it has killed the love in you.</p><p>The one in power is your enemy,<br>that is the hate you give.</p><p>Your pleasure, now your pain,<br>that is the hate you give</p><p>Your brother, your enemy.<br>That is the hate you give</p><p>Your sister, now detest you.<br>That is the hate you give.</p><p>Children against parents,<br>patents against children.<br>That is the hate you preached.</p><p>Across that seven rivers,<br>you showered me with that infant love.<br>Back home, I become your bad side.<br>Why are we being a fucking hypocrites, unknowingly?</p><p>The pain we face today,<br>is the hate we gave yesterday.<br>And the joy of tomorrow,<br>is the love we spread today.</p><p>#Vicas<br>11:38<br>7/7/2019</p>', 'uploads/15633111189208017FB_IMG_15526642484247893.jpg', '1558307185556i83ot9l2vcertci327ar', '21:05:20', '2019-07-16', '156331112000rctie0al10', 1, 'thumb/1563311118830071FB_IMG_15526642484247893.jpg', 1, 311, NULL),
(261, 'BIOSCOPE', 'Victor ASIKA', 'show', '<p>&nbsp;</p><p>Bioscope</p><p>Have you ever been to a bioscope,<br>where children catch fun.<br>Where you don\'t need a microscope,<br>for all scene will be seen.</p><p>Have you ever seen a Bioscope?<br>showing brightness of a moving image.<br>Happiness in the children--<br>growing taller than the tallest mountain.</p><p>Have you ever been to Bioscope?<br>a theatre in South-Africa.<br>where moving images are shown,<br>on a projected screen.</p><p>Have you ever saved money--<br>to see the projector,<br>projecting a moving image?<br>Which calms tension and time.</p><p>Have you ever been to Bioscope?<br>where you don\'t need microscope--<br>That even the microscopic actor,<br>is viewed with the help of the &nbsp;projector.</p><p>Have you been to that place?<br>where children forget lunch,<br>Just to feel pleasure.</p><p>By Victor. A<br></p>', 'uploads/15634839861953333BeautyPlus_20190718220230_save.jpg', '1558307185556i83ot9l2vcertci327ar', '21:06:29', '2019-07-18', '1563483989ai01000trecl', 1, 'thumb/15634839862024237BeautyPlus_20190718220230_save.jpg', 1, 416, NULL),
(262, 'I DEFINE PRODUCTIVITY', 'Oluwaseun Ejire', 'show', '<p>I\'m so EFFICIENT _ I make good use of my ENERGY everyday;&nbsp;<br>I\'m so FERTILE _ I put to act CERTAINTY everyday;&nbsp;<br>I\'m so CREATIVE _ I create new PROBLEMS for me everyday;&nbsp;<br>I am aiming high to PRODUCTIVITY;&nbsp;<br>I am aiming high to POSITIVITY;&nbsp;<br>I am aiming high to SUCCESS;&nbsp;<br>Tho I know success isn\'t something that just HAPPENS;&nbsp;<br>It\'s a process where PREPARATION and SUCCESS itself meet;&nbsp;<br>It\'s LEARNED _ PRACTICED and then SHARED;&nbsp;<br>Don\'t underrate me _ I know more than I say _ think more than I speak _ notice more than you realize;&nbsp;<br>The PAST is my LESSON _ that I KNOW;&nbsp;<br>The PRESENT is my GIFT _ that I am THANKFUL for;&nbsp;<br>The FUTURE is my MOTIVATION _ that I will RE-SET _ RE-ADJUST _RE-START _ RE-FOCUS as many times I need to;&nbsp;<br>I can do THIS _ I can do THAT _ YES, I CAN and only me can do it BETTER&nbsp;<br>To be PRODUCTIVE POSITIVELY _ I DEFINE it......</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ej_oluwaseun</p>', 'uploads/15641271594059831IMG_20190117_234020.jpg', '15409061695snaoeu694w89l7304u', '07:46:01', '2019-07-26', '15641271611c0ra00t0eil', 1, 'thumb/15641271594311871IMG_20190117_234020.jpg', 0, 333, NULL),
(263, 'MY MOTHER', 'Styles Goodluck', 'show', '<p>MY MOTHER</p><p>A beautiful mother&nbsp;<br>With a blond hair<br>Her eyes beautiful like diamonds<br>Her skin so smooth<br>If not careful, you\'ll slip<br>Out of her and kiss the floor</p><p>Age is not a barrier<br>To hinder her love<br>Or destroy her beautiful body.<br>Many amazing kids<br>She profusely bore,<br>Many things they evolved to.<br>Thanks to her wonderful checkpoints.</p><p>Thousands of buildings,<br>She owns for her lovely kids.<br>Buildings of love and not hate<br>A skyscrapper<br>Filled with achieved dreams<br>And not aborted ones.</p><p>A mother!<br>With multiple hearts in one heart.<br>Her heart &nbsp; &nbsp; &nbsp; &nbsp; is bigger<br>&nbsp; &nbsp; &nbsp; &nbsp;Than the entire earth.</p><p><br>Copyrightstylesgoodluck</p>', 'uploads/156465546079788986b30e78c02de84c9a685dff4d8bfccb6.jpg', '1564652750l8rtelsta5y932c5e25si61', '10:31:02', '2019-08-01', '156465546200c1er0tlai0', 1, 'thumb/156465546075226776b30e78c02de84c9a685dff4d8bfccb6.jpg', 1, 205, NULL),
(264, 'Money', 'Omotayo Mayowa', 'show', '<p>#<strong> MONEY</strong><br>.<br>I was so obsessed with the want of riches. The percentage of the want was very high. I can\'t continue to live like a church rat, a church rat is even far better, better than I do.<br>I can\'t wait to be like Chinedu, live large like Kayode, have lot of cars like Quadri, go to clubs and spend money like Kelvin. I\'m even older than Segun, see, he has everything he want. Abdul is a mate of my junior brother, yet, he still gives me \'five K\' to manage with all the money he has.&nbsp;<br>\"What do I do about this now? \'Cause right now, there\'s no way of survival without food. What do I even eat now?,&nbsp; \'cause am as broke as a lizard in the desserts, I might serve as dinner to a lucky python. Mtchw... Money... Food...\" I was lost to thought, and don\'t even know when Saliu arrived, he\'s here to drag with me again, drag the little thing I\'ll get to to my stomach with me. He\'s of no difference with me, I\'m better off him,\'cause he still beg from me: who has nothing, talk less of food to eat.<br>My only hope is Iya Alamala, if I can use my funnyman to talk convince her to give me just one wrap of Amala, that will be manageable for tonight.<br>\'Ogbeni! What have you been thinking!? \' Saliu half shouted at me, and I jolted out of my thoughts.&nbsp;<br>\'I\'ve been standing here for the past five years\', he exaggerated,<br>\'Any available food for me to bite?\', he inquired further, yawning like a hungry lion ready to devour. I casted an angry look at him, which gave him the signal of no to his query, and he strolled out.&nbsp; I picked my half-condemned \'baby Nokia\' phone, it\'s almost 4pm, and yet, no food for the worms. I could feel and hear the grumbles from my stomach, as the worms struggle for survival, they\'ve tried, since last night. I rolled back to a sleeping posture on my bed, and wandered back to my thoughts.<br>\"I think I need to visit Rasheed, I need quick solution... No, I\'ll meet Chinedu, (he used to be my best friend in the college before I dropped out, because of money), he\'ll have a better way to help,&nbsp; not to ask for money though, but to ask for solution. Hope I\'m not taking the wrong step?\" I was still wandering about my wonder land, when I drifted to sleep. Can\'t believe I slept on an empty stomach...&nbsp;<br>\'Alaye, longest time, how have you been na\' I greeted Chinedu on sitting on his sofa in his large sitting room.&nbsp;<br>\"Na television be this?\" I wondered as i stared at the very big flat screen television hanged on the wad as I shook my head amazingly.&nbsp;<br>\'So how far, na you I come see o\', I said as I turned back to Chinedu, who was handing me a glass of wine which I collected and dropped on the glassy table,&nbsp;<br>\'Uhmn uhmn?\' he inquired, it seems he has no interest in what I want to say, he thinks I want to beg for money again, but no, I want to have money like him, it\'s better I let the cat out of the bag, \'cause I can\'t die like this,<br>\'Chinedu, I want get money!\' I bursted out like a cow filled to the brim waiting to burst. He spitted the wine he had sipped back to the glass, \"is it what I said that made him choke or what?\" I wondered,<br>\'You say wetin? You wan get money?\' he inquired irritatingly,&nbsp;<br>\'Yes na,&nbsp; abi na bad thing?\' I retorted,<br>\'No na, but how e take concern me?\' he asked annoyingly as he rolled his eyes, \"Imagine, na me Chinedu they talk to like this, because of money wey I no get, person wey me dey help solve Maths and Physics questions for school, well, na conditions make crayfish bend, no p\", I cried in my thoughts as I glanced through my memories with Chinedu back in the college, all our wishes, our plans and how we planned to do everything together, well, a sick hen that still lives has hope of swallowing even if its a grain of maize. Any how he talks to me is isn\'t my concern, I just needed the help and get away. Let me just hit the nail on the head,&nbsp;<br>\'Wetin concern you be say, I need your help, I want make you show me the way, abeg\', I said&nbsp; begged, he roared with laughter for a while,&nbsp;<br>\'You are so funny, you haven\'t changed up till now\', he said, is he thinking that I\'m here to joke,<br>\'Alaye, am damn serious o\', I said with all seriousness, he calmed down seeing my degree of seriousness,&nbsp;<br>\'So, go and find work now!\' he spat out, the words hit me like a trailer whose brakes has failed, thank God I didn\'t die as a result,&nbsp;<br>\'But, Chinedu, you know me now, I no finish school, with which certificate I go take find work, abi you go give me your own?\' I pitifully let out,&nbsp;<br>\'You deh mad? Why I go give you my own? I no even know where e deh sef, because no be him I take get money, he let out angrily, \'so wetin you want make I do now?\' he asked further as he dropped his glass of wine, seems he\'s ready,&nbsp;<br>\'Chinedu, you suppose understand, how you take get your money, put me for that same way, am ready to do anything, anything at all\', I said with determination, a determination without determination. But am I sure I mean what I said? Am I truly ready to do anything?&nbsp;<br>\'Okay I go carry you go somewhere...\'&nbsp;<br>We were in a room, painted or I should rather say clothed with white, black and red arrays, I could see a calabash, an idol, a horn and many other fetish stuffs, there was Baba who was sitting on wooden stool, only tying a white wrapper on his waist, a black hair band in his head, oh! he actually had dreadlocks, they were gray, he\'s actually an old man, he used to whitish substance to make tattoos on his left breast, and a circle on his right eye and some other parts of his body. I need no one to tell me we are in for it. He understands what I wanted. He introduced himself as a regular customer to the Baba, the Baba nodded in affirmation to his explanation of recognition, he introduced me too and the Baba motioned him to stop as he wanted to proceed in the exposition of my reason of coming.&nbsp;<br>\"But was this actually what I wanted, was this how I wanted to become rich, but there seem to be no way other than this\" , I was lost in thoughts, I wasn\'t even concentrating. Chinedu slapped my head back to reality, he dragged and submitted my right palm to the Baba, he collected and held it in his hand, his eyes were to my palm, like the eyes of a lady glued to the Zee world movie series, perhaps he\'s looking at something spectacular, he\'s looking at my destiny, I knew it won\'t be more than that, as I have seen in Nollywood. All of a sudden he shouted, I knew he must, he have seen something, I thought he would shout \'Abomination!\' afterwards, (that\'s how they do it in Nollywood), but he didn\'t, he said some incantations into my palm for a long time and then closed it, then pushed it forward, letting it rest on my forehead. Afterwards, he gave me a calabash filled with a kinda liquor which I can\'t fathom what it was, I irritatingly sipped from it, it was sour, I could feel its impact all over my body and even down to my spine and bone marrow. He let out a soft laugh after I handed his calabash to him,&nbsp;<br>\'Your destiny is great\', he let out after a while, \'but due to poverty, you\'ve eaten your destiny with food and passed it out as an ordure\' he lamented,&nbsp;<br>\'Chai, Chinedu, ayaff die\', I cried out, \'but wait o, what is or...ordu....ordure?\' I asked no one in particular, not sure of&nbsp; what I was asking,&nbsp;<br>\'It means shit, faeces\', the Baba answered,&nbsp;<br>\"Ha! The Baba is even blowing grammar, on top of my matter,\" I thought as I cried,&nbsp;<br>\'But there is solution\', the Baba said, I immediately wiped my tears and concentrated,&nbsp;<br>\'We\'ll need to make a sacrifice to appease the gods to release your destiny back, then do the ritual of riches properly\', I listened with rapt attention,&nbsp;<br>\'I\'ll do the sacrifice my self, so don\'t bother\', he added,&nbsp;<br>\'Thank God\', I commented,&nbsp;<br>\'And the ritual, you\'ll get some materials which are a bit difficult to get...\', \'which are?\' I inquiringly interrupted,&nbsp;<br>\'Kai! chill now!\', Chinedu cautioned. The Baba just smiled as he opened and deeped his right hand into a calabash arrayed with white cowries and with an inscription \'AJE\', he brought out a white paper and handed it to me,&nbsp;<br>\'Go get the materials listed there\', he said referring to the paper. I was happy we were getting close to the solution. I was about to open the paper, but the Baba made a signal to me not to, I gently kept the paper in my pocket, he motioned me to listen to him,&nbsp;<br>\'At this stage, no backing out!\' he let out,&nbsp;<br>\"When am not in the military\" I thought, I was terrified, I know am in for it, but there seem to be no way apart from this one I\'ve tread, and now no going back,<br>\'Go get the things quickly, the deadline is only two days, I\'ve warned you, no backing out, you\'ve made a covenant with the \'Ifa\' , and you will have all you want if you you do what is required of you, failure to do so, the repercussions will&nbsp; be unbearable\', he said on a final note. No one need to tell me that if I didn\'t bring the requests in two days, I\'m in hot soup. I signal a lets go to Chinedu, but he waved me to wait for him outside, it took him a while to come out, as I was already tired of waiting.&nbsp;<br>On our way back, I brought out the list, Gosh! I was terrified, \'Stop!\' I screamed at Chinedu, he immediately stepped on the brake pad,&nbsp;<br>\'Where does he expect me to get all this things?\' I lamented bitterly, Chinedu collected the list from me, he glanced through and look at me in awe,&nbsp;<br>\'So, what is it that you can\'t get here?, the six months old virgin chicken, or the kidney of two anopheles mosquitoes, or which of them, shebi na you want get money, you better get sense and do fast, I\'ve done my part,\' he queried angrily,&nbsp;<br>\'Don\'t you see the last requirement?\' I asked rhetorically, he glanced and made a grin,&nbsp;<br>\'Oh, that\'s easy we\'ll go to a hospital...&nbsp;<br>\'Ogbeni, look sharp, put am inside the bag make we cut out... I go leave you run o... the nurse deh com... make we deh go jhor\' Chinedu was just ranting. I finished packing and ready to leave, Chinedu held the door knob, and pulled, to our utter dismay, a nurse was standing at the door, probably waiting for us to come out, we made to move but we were attacked by three security men, before we could say jack, the doctors appeared from no where as if they\'ve been hiding around. This is a bad luck!&nbsp;<br>\'How do you reach here?\' one if the doctors threw at us,&nbsp;<br>\'And what\'s in the bag you\'re holding?\' another one threw, I opened my mouth, but no word came out,&nbsp;<br>\'Answer now before I smash your head!\' a security man shouted as he charged towards me,<br>\'Search the bag\', the doctor who seemed to be the senior ordered. And one security man moved close to me, I held tight unto the bag, though I was visibly shaking, he made to collect the bag, but I dragged it back, I looked at Chinedu and he gave me a go ahead signal, as he was ready to move, all attention was on me, so he had a chance to sneak, on sneaking out of the scene, he charged forward, I threw the bag at him and he caught it, all attention shifted to Chinedu as they begin to chase him, I escaped without wasting a second, unluckily, I was grabbed by my collar by God-knows-who, but fortunately, I successfully pulled off the shirt for him without looking back. I always knew I had a talent called \'running\' I discovered it that day, if I were to compete with Hussain Bolt at that moment, no doubt I will defeat him, I ran to the extent that I could feel my heels on my occiput. Thank God I escaped, but I can\'t find my accomplice, I explored all the nook and cranny of my refuge, but I can\'t find my confederate. I stealthily find my way back to Baba\'s places, but Chinedu isn\'t there, I lost my baby Nokia phone on the process of my escape and I can\'t contact anybody, he ought to have reported back to Baba\'s place if he had successfully escaped, because we have less than five hours to complete the rituals, it\'s obvious Chinedu has been caught.&nbsp;<br>\'Abomination!\' Baba shouted as I narrated the ordeal to him, I know there is problem, \'There\'s problem\' he spatt,&nbsp;<br>\'If the one day old baby\'s head and heart are not produced before the dead line, yours shall be used to in place&nbsp; baby\'s, because no one promise the \'Irunmoles\' and go free without fulfillment\' Baba said, I was terrified, I was already urinating on my body,&nbsp;<br>\'Enough!, You cannot urinate in front of Irunmole!\' Baba exclaimed, I had to hold on to my urine and store them back to my bladder, \'so, Baba... wha...t is...is the...the solu..lu...tion now,\'? I asked shuttering,&nbsp;<br>\'The solution is what I\'ve told you, you will replace the baby\', I began to weep uncontrollably, I beckon on the gods of my ancestral fathers, but all of them seem to be deaf at the moment, even Sango wasn\'t answering me.&nbsp;<br>Time was rolling by, but no hope of deliverance, not even from Ogun. My tears has blurred my vision but my cerebrum cerebellum can process what I\'m seeing at that moment, I saw Baba brought out a pot, a pot boiling fiercely on it\'s own, without fire, I could hear the sound, it\'s boiling point perhaps could not be measured by a thermometer, the heat generated from this pot filled the room, as I was sweating profusely, but surprisingly, Baba held the pot with his bare hands, he dropped it at the center of the room, on the white-clothed floor, he said somethings that my cerebrum cerebellum processed to be tongues I haven\'t heard before, for like thirty minutes, he was still blasting and moving round in a circulatory motion like being powered by a centripetal force (I\'m shocked, my brain could still remember some terms in physics at that moment). Suddenly, I can\'t even move a finger talk less of my whole body, I stopped crying, I can\'t even see clearly again, I\'m not my normal self, but I\'m still who I am: the broke ass nigga looking for wealth, no changes.&nbsp;<br>He suddenly stopped, he motioned me to come forward, and like an automated machine, I moved closer, and like a computer system affected by virus, without given any instructions, I kneeled facing inside the pot, i was sweating an ocean as a result of the heat from the un-fired boiling pot. Like a lamb, lamb meant for sacrifice, lead to the slaughter, to be killed, killed without its consent, that\'s what I am.<br>Baba lifted his cutlass, glittering like a just refined silver, ready to cut asunder, I could see the reflection of the action from the boiling pot (but my brain processed it to be a film), the cutlass was going down bit by bit, down to my neck:&nbsp; that was<br>as&nbsp; long as that of a starved giraffe, the cutlass was six micrometers away from my neck, (but my brain brought the output to be two meters), just then the door blasted open, some people in a cloth of color which it took five minutes to be processed by my brain; black, holding some instruments looking like sticks, know as rifle came in with somebody who has stains of red or pink, or maybe green (can\'t actually be processed at that moment) on his cloth,&nbsp;<br>\'That\'s him, my accomplice\' he said pointing to someone I think is standing behind me, the people in black started exchanging words with another man, who looked like a masquerade holing a machete, and there were demonstrations of powers like I used to see in Nollywood. I turned around and sat down to watch d beautiful scene. All of a sudden I could see Chinedu (Finally i regained my senses), he has stains of blood all over him, it dawned on me he has been caught, he lost the baby, oh!, How can he be so careless, and he know it\'s thats the solution, I remembered those in blacks to be Nigerian police officers, I sighted a police officer saying some incantations into his gun, before I could say jack, Baba was lying dead on the floor as a result of a bullet released from the police officers\' rifle, I could feel death ruminating round my head, I need to find an escape route, I need to survive, the police officers were still ruminating round about the room, without thinking twice, I sneaked, it\'s not easy but I tried, and I succeed, in reaching outside, I took to my heels, not long, I began to hear the siren, I\'ve got no strength remain in me to run, but I just knew am running. I was still running, but not running like I was running, I was now seeing thing in five dimensions, black and white and colorless. I was still running, and I ran into a tree with my hands opened for a hug, (actually my brain processed it to be a lady), and boom!...</p><p>I repelled upward from my bed like a repellent force between like charges in an electric field, feeling weak, hungry and tired.<br>It was just a dream!&nbsp;<br>What a dream, thank God it\'s just a dream, I could feel the sweat, urine and tears, it came out real. \'Chai! Which kind dream be this?\', I asked myself rhetorically loud .&nbsp;<br>\'Ha! Thank God, it was just a dream\'&nbsp;<br>\'I\'m no longer interested in&nbsp; becoming rich again, let me remain like this, as far as there is life, there\'s still hope, it\'s better like this, than losing my life because of wealth...\' I was still in my thoughts and cleaning up when someone knocked on my door,<br>\'Who is that o?\' I asked irritatingly,&nbsp;<br>\'Boda Mayowa, its me o, Iya Alamala, you go buy Amala today?\', she asked,&nbsp;<br>\'Yes o, give me four wraps\', I replied as I stood up to meet her outside with a wide grin on my face, its dark already, thank God food has come, incase you don\'t know, I like food,&nbsp;<br>\'But I don\'t have money on me now o, later if you are coming back, stop by, and I\'ll give you your money, plus yesterday own, three wraps, making it two fifty\', I said convincingly with joy in my heart,&nbsp;<br>\'Yes no problem, thank you\' she said as she handed my Amala to me. \'She\'s still telling me thank you, on my debts\', I thought as I walked back to my room.&nbsp;<br>After i finished my clean up, I devoured the four wraps with a constant speed of forty kilometers per hour, without retarding.&nbsp;<br>Thank God, I didn\'t do money ritual, and I won\'t.&nbsp;<br>\'Ha! Egbon Mayor, thank God it was just a dream o\' Joseph, the boy who had been listening to me commented,&nbsp;<br>\'Yeah, thank God\' I replied,&nbsp;<br>\'Had it&nbsp; been it was real, you for don kpeme..\'&nbsp;<br>\'Na u go kpeme\' I replied as I hit him playfully, and we laughed out, we paused for a while, looked at each other and rolled into another round of unending laughter.&nbsp;<br>.&nbsp;<br>THE END</p><p>#<strong> Morals:</strong><br>No matter the situation, no matter how poor, as far as you can still feed yourself, wear good cloths, pay rent, Blood money is not an option.&nbsp;<br>To hustle is good, but not the type of the hustle&nbsp; I did in my dreams.&nbsp;<br>This story led to a fore hand write up of mine titled \"Fullness Of Time\", if it isn\'t your time, nothing will happen.... Untill the Fullness of Time.&nbsp;<br>You just have to be patient, if all this sorts don\'t happen, what do you tell your children and others as history in future.&nbsp;<br>NOTE: Devil gives nothing for free.&nbsp;<br>.&nbsp;<br>KING MARVEY&nbsp;<br>MAYOR DE WRITER, 2019.</p>', 'uploads/15646559361524333PhotoGrid_1563833208560.jpg', '1558358063i1orm5t755oel5a8a76yoc7t', '10:38:58', '2019-08-01', '1564655938ir0ac0e010tl', 1, 'thumb/15646559361352745PhotoGrid_1563833208560.jpg', 1, 544, NULL),
(265, 'A PUPPY IN MY LIFE', 'Styles Goodluck', 'show', '<p>A PUPPY IN MY LIFE</p><p>The first time I saw You,<br>The ceiling, I clinged onto<br>Thinking you\'d chew my bones<br>Like biscuit.</p><p>Anytime you were around me,<br>My heart beat rose,<br>My brain malfunctioned<br>My body started reacting by itself<br>All thanks to fear of being chewed by you.</p><p>As time drove by,<br>We became connected.<br>My body became a tree<br>Where you could climb freely<br>And lick my branches.</p><p>A very strong bond,<br>We shared together.<br>We were like a couple<br>But we were not a couple.</p><p>Forever we would remain&nbsp;<br>Till and after the appearance<br>Of our bride.<br>For you\'re family to me.</p><p>Styles Goodluck&nbsp;<br>Copyrightstylesgoodluck</p>', 'uploads/15646564262551438658934f9f8031462f30538feaa09f066.jpg', '1564652750l8rtelsta5y932c5e25si61', '10:47:08', '2019-08-01', '1564656428i0tcael00r01', 1, 'thumb/1564656426892676658934f9f8031462f30538feaa09f066.jpg', 1, 237, NULL),
(266, 'CORRUPT LEADERS', 'Styles Goodluck', 'show', '<p>CORRUPT LEADERS</p><p>Thousands drown<br>In the village of tears.<br>Millions pass on<br>In the hunt for flesh.<br>Yet they yowl<br>for the deaths&nbsp;<br>like movies&nbsp;<br>In their sight.</p><p>Like ping pong,<br>They toss the lives of men<br>Back and forth&nbsp;<br>On the table of life<br>Brainwashing men<br>To fight illusions(hope, solution.)</p><p>Instead of wielding power,<br>It flows into their body<br>Like HIV&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Which evolves to AIDS<br>It takes over<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;their minds.<br>Their minds&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; are with them<br>But &nbsp;not &nbsp; &nbsp; &nbsp;controlled &nbsp; &nbsp; &nbsp; by \'em.</p><p>Copyrightstylesgoodluck</p>', 'uploads/15646567858314914FB_IMG_15643016210342902.jpg', '1564652750l8rtelsta5y932c5e25si61', '10:53:07', '2019-08-01', '156465678700ci0r0tela1', 1, 'thumb/15646567856126754FB_IMG_15643016210342902.jpg', 1, 536, NULL),
(267, 'UNINVITED GUESTS', 'Styles Goodluck', 'show', '<p><br>UNINVITED GUESTS</p><p>Those nocturnal friends<br>Who love visiting<br>Without an invitation<br>And throw us a surprise party.</p><p>As a Dj,<br>They are in charge of music.<br>They instruct when to sing along<br>To the music and when to stop.</p><p>As a bodyguard,&nbsp;<br>They choose who is allowed<br>To move round the party.</p><p>Once the party is over,&nbsp;<br>They become gods.<br>Who ever wants to leave the party<br>Has to follow the party rules.</p><p>It is now considered a thought,&nbsp;<br>What if one&nbsp;<br>Doesn\'t have the party equipment?&nbsp;<br>Will the nocturnal party conductors<br>Become selfish and answer<br>To the call of erection?</p><p>Styles Good Luck<br>Copyrightstylesgoodluck</p>', 'uploads/1564754448983574420190802_145730.jpg', '1564652750l8rtelsta5y932c5e25si61', '14:00:50', '2019-08-02', '15647544500rlai0e001ct', 1, 'thumb/1564754448845335520190802_145730.jpg', 0, 264, NULL);
