(67, 'The Code Center', 'uploads/7922720j_bMUWvv_400x400.jpg', '1592897314_3378207', '04:30:26', '2020-06-22', '1592843426a45d9959hretn947b0', 'thumb/6704231thumb1620959602.jpg', 0, NULL, '<p>We are a revolutionary Coding School on a mission to demystify Computer Science education, making it a dream career for everyone</p><p><strong>Knowledge Factory</strong></p><p>TheCodeCenter is a <strong>knowlegde factory</strong> where we take in people as raw materials and turn them into sought-after technology talents by the end of there program with us.</p><p><strong>Build Lifelong Relationship</strong></p><p>Our learning atmosphere is characterized by strong inter-personal relationships among everyone - more like home away from home.</p><p><strong>Learn Under Veteran Instructors/Practitioners</strong></p><p>Our Instructors are <strong>veteran practitioners</strong> in their field / naturally talented teachers</p><p><strong>An Eye For The Future</strong></p><p>At the heart of our operations is an obligation to help our participants build a successful career in their chosen course of study with us.</p>', 'thecodecenterng', 'thecodecenterng', 'thecodecenterng', 'thecodecenterng', 'https://thecodecenter.org', '+23407039069923', 'hide', '', '', 'Nigeria [NG]', 'Lagos', 'Ikeja', 30983, 2671, 160, NULL, 'Training Center', 'thecodecenter', 1, NULL, NULL, NULL, 'a:0:{}'),
(68, 'Millzsammyz Hub', 'uploads/53776040001_8211650676_20210919_202655_0000_removebg_preview_png', '1594939965_5360663', '09:32:46', '2020-07-18', '1595064766arlz9sb2lym2m313z77inam3d5', 'thumb/5715985thumb1633475206.png', 0, NULL, '<p>Millzsammyz Hub, is a media house that offers specific services pertaining to live sound, audio post production, sound design, sound recording, social media management and live feeds for events (live-tweet/live-streams).&nbsp;</p><p>At Millzsammyz Hub, we cater to your musical needs whilst also providing quality sounds for your films and events; and rebrand your events with hands you can trust by using various tools and strategies to bring out the best you deserve.</p><p>Millzsammyz Hub; a better service for your events and social media platforms.</p>', 'Millzsammyz Creatives', 'lydiaomorodion', 'Lydia Omorodion', 'millzsammyzhub', '', '+2347062785957', 'hide', '3.3792057', '6.5243793', 'Nigeria [NG]', 'Lagos', 'Lagos', 30985, 2671, 160, NULL, 'Social Media Manager,Digital Marketer,Sound Engineering', 'Millzsammyz', NULL, NULL, NULL, 'Audio post production, Live tweets, Live streaming,Sound recording, sound design ', 'a:4:{i:65541652197895;a:2:{s:5:\"image\";s:38:\"uploads/165219789594367brand_image.jpg\";s:5:\"thumb\";s:32:\"thumb/8473954thumb1652197895.jpg\";}i:11441652197930;a:2:{s:5:\"image\";s:38:\"uploads/165219793076880brand_image.jpg\";s:5:\"thumb\";s:32:\"thumb/4826449thumb1652197930.jpg\";}i:87631652197989;a:2:{s:5:\"image\";s:38:\"uploads/165219798979028brand_image.jpg\";s:5:\"thumb\";s:32:\"thumb/5272781thumb1652197989.jpg\";}i:67931652198032;a:2:{s:5:\"image\";s:38:\"uploads/165219803291325brand_image.jpg\";s:5:\"thumb\";s:32:\"thumb/5727815thumb1652198032.jpg\";}}'),
(70, 'Fovty Enterprise', 'uploads/3527841download.png', '15984329758t2i3ft4re9loy259v9ac', '09:25:21', '2020-08-31', '1598865921avdon8t4y5r44789b20f', 'thumb/8178045thumb1620959602.png', 0, NULL, '<p>Fovty Enterprise is an online business facilitator</p>', NULL, NULL, NULL, NULL, NULL, NULL, 'hide', '151.17906', '-33.85895', 'Australia [AU]', 'Balmain', 'Balmain', 6559, 248, 13, NULL, 'Facilitator', 'fovty', NULL, NULL, NULL, NULL, 'a:0:{}'),
(71, 'Spur Nation Media ', 'uploads/187556SpurNation_Medi_Logos_Upd-03.jpg', '1599234365sni7p8i5te6c1819rtau3na8rlo', '03:57:16', '2020-09-04', '1599235036rrb409n70361sap6du1', 'thumb/9179340thumb1620959602.jpg', 0, NULL, '<p>Spur Nation Media is a growing media brand that comprises of two individual brands; Spur Nation Magazine and Spur Nation PR and Communication.&nbsp;</p><p>SLOGAN- Made For More</p><p><strong>SPUR NATION PR AND COMMUNICATIONS</strong></p><p><strong>SERVICES</strong></p><p><strong>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; COMMUNICATIONS STRATEGY</strong></p><p>A strong communications strategy is an essential tool to help you organize effective and proactive PR, marketing and digital activity. We can help you to outline a purposeful plan linked to your communications goals and objectives.</p><p><strong>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; PUBLIC RELATIONS</strong></p><p>Our approach to PR is rooted in your business aims and objectives, enabling us to help you deliver the right messages in clear and interesting ways. Media management, communication, recruitment, audits, events, awards lobbying, social, PR strategy &amp; reputation handling are just some elements of our offer.</p><p><strong>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; COPY WRITING &amp; EDITING</strong></p><p>Strong products and services deserve equally high quality writing. Our team will help you hit the mark with crisp and concise words that make people want to know more. We can write or edit your material or build your in-house capacity through plain language and a tone of voice training.</p><p><strong>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; MEDIA RELATIONS</strong></p><p>Running a business or providing a service puts you right in the public eye, so you need to develop and maintain a positive profile in the relevant local, national and trade media. We use our strong relationships with journalists, editors and bloggers to make sure you get fair and accurate coverage.</p><p><strong>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; SOCIAL MEDIA</strong></p><p>Social media generates sales, build your brand online and should be at the forefront of Customer Service Excellence. We can help you to create a strategy, pick your platforms and manage your content and profile in ways that suits your customers (and you) best.</p><p><strong>ABOUT Spur Nation Magazine (BRIEF)</strong></p><p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>Spur Nation Magazine is a youth inspired magazine that encourages Nigerian youths to talk about themselves and share their story with the rest of the world. Not just that!! We envisage a future where mistakes are not repeated. We have 3 published editions with people cut across different social class share their personal story. With close to two years of experience up our sleeves with team members and advisory board guided by our core values which are consistency, integrity and passion.</p><p>We are up for the following</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To share personal stories</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; PR services</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Interview features</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Advert placement</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Event coverage</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Event feature</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Exclusive interviews.</p><p>&nbsp;</p><p><strong>GUIDING AIMS</strong></p><p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To be a world class magazine known for planting seeds of excellence in youths worldwide</p><p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To ensure that every youths have a voice that will be heard.</p><p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To ensure that mistakes are not repeated</p><p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To motivate youths all around the world to be the best that they can be and share their story.</p>', 'Spur Nation Media', 'spurnationmedia', NULL, 'Spur Nation Media', NULL, '+2348110175593', 'hide', '5.237108699999999', '7.6124263', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, NULL, 'Social Media Manager,Digital Marketer', 'SpurNationMedia', NULL, NULL, NULL, NULL, 'a:0:{}'),
