(161, 'Project 1 Million Self-Reliant Youths In Nigeria', 'uploads/8385548img_20211029_wa0001_jpg', '1636320559_1321947', '09:59:57', '2021-11-07', '1636322397267j02ap0eo21ct9rbd0rn', 'uploads/8385548img_20211029_wa0001_jpg', 0, NULL, '<p>Project 1 Million Self-Reliant Youths In Nigeria is an initiative under YOUTH FREE SKILLS ACQUISITION AND EMPOWERMENT PROGRAMME of LIFEAID AFRIQU SOCIAL FOUNDATION (L\'Afriqu).</p><p>LifeAid Afriqu Social Foundation is a non-governmental, non-political organization established to create a healthier and happier Africa, through Welfare Services and Social Integration; which include, but not limited to: Direct Feed, Cultural Re-Awakening, Skills Acquisition, Growing of Small Businesses, Self-Reliance and Self-Esteem for the human person.</p><p>Since Youths are the most useful population, we have strategic plans for Youth Skill Acquisition &amp; Empowerment, and Youth Sustainable Agriculture among others. The plan is to contribute to the wellbeing of the youths as they grow to become the leaders of tomorrow; and to as well assist them in the personal development &nbsp;towards meaningful contribution to communal development.</p><p>#sdgs&nbsp;<br>#nopoverty&nbsp;<br>#zerohunger&nbsp;<br>#decentworkandeconomicgrowth&nbsp;<br>#sustainablecities</p>', NULL, NULL, NULL, 'lifeaidafrique', 'https://lfeaidafrique.org', '+2348034614213', 'hide', '3.9470396', '7.3775355', 'Nigeria [NG]', 'Oyo', 'Ibadan', 31064, 2677, 160, NULL, 'Social Organization', 'lifeaidafrique', NULL, NULL, NULL, '', NULL),
