(166, 'Spensblog.com', 'uploads/8289820_k7gdp5_jpg', '1650582440_6179056', '11:17:42', '2022-04-21', '16505830627bo52gml6ds0p4r6o9seba-cn6n', 'uploads/8289820_k7gdp5_jpg', 0, NULL, '<p>Spensblog.com</p>', '', 'Spensblog1', '', 'Spensblog.comm', '', '', 'hide', '', '', 'Nigeria [NG]', 'Lagos', 'Lagos', 30985, 2671, 160, NULL, 'Entertainment', 'spensblog_com', NULL, NULL, NULL, 'Blog and promotion', NULL),
(167, 'Shinaayomi Media', 'uploads/18406849b3dad58_ff5f_4aa7_8468_0e73a9b0e78e_jpeg', '1650739657_1487649', '07:46:31', '2022-04-23', '165074319128nobs97am3a5h8yd56ri7nai', 'uploads/18406849b3dad58_ff5f_4aa7_8468_0e73a9b0e78e_jpeg', 0, NULL, '<p>A creative Wedding Photographer .</p><p>My vision is to create images that capture the essence of my couple: their love, laughter, joy, style and outfit.</p><p>My desire is to produce authentic, emotive imagery that encapsulate those relationships between the couple and their loved ones.</p><p>My photography is inspired by timeless imagery that reflect the true personalities and experiences of each couples wedding that can be enjoyed for years to come. As such, we specialize in natural light photography. I view my photography as a celebration of life. I strive to shoot the feeling of each particular wedding day so that my photographs will still hold their power decades later.</p><p>In the end, I imagine that moment in the distant future when my clients are paging through their wedding album with their grandchildren and reliving that same love, laughter, and joy with them.</p><p>I like to think that my experience and personality adds a level of calm to the wedding day. My calm, fun, and easygoing demeanor sets me apart from other photographers.</p><p>I believe my ability to genuinely connect and to get couples to relax in front of the camera allows me to capture real moments and candid images.</p>', '', 'awopejushina', '', 'shinaayomi_official', '', '+23407032988640', 'hide', '', '', 'Nigeria [NG]', 'Lagos', 'Ikeja', 30983, 2671, 160, NULL, 'Photography', 'shinaayomi', NULL, NULL, NULL, 'Cinematography ,Event planning ', 'a:2:{i:57991650743238;a:2:{s:5:\"image\";s:38:\"uploads/165074323841930brand_image.jpg\";s:5:\"thumb\";s:32:\"thumb/1501563thumb1650743238.jpg\";}i:74641650743280;a:2:{s:5:\"image\";s:38:\"uploads/165074327912555brand_image.jpg\";s:5:\"thumb\";s:32:\"thumb/9082680thumb1650743279.jpg\";}}'),
